  {id: 3, name: "Duhr Bed", number: nil, price: nil, description: "Come home to comfort with this soft cushioned headboard. Clean lines frame the sides and the low footboard creates a well-focused headboard. Rounded T-style cushions create a relaxing backrest for sitting up in bed. Watch your favorite shows or nestle up with a heart-warming book as the smooth linen upholstery soothes your senses. Finished in a cool gray, this bed offers a relaxed atmosphere that relieves unnecessary stresses.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7551-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-19 04:39:12"},
  {id: 4, name: "Canopus Bed", number: nil, price: nil, description: "Add some refined flair to your room with the aged appearance of this chic bedroom set! The weathered wood creates a warm ambiance with its faded and distressed vibe while the simple moulded details enhance the visual appeal of the design. With simple contrasting bar pulls adorning the various drawers, this bedroom collection is available in two styles to help you make the most of your bedroom space!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7423gy-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:47:36"},
  {id: 6, name: "Haldus Bed", number: nil, price: nil, description: "Get lost in this undeniably industrial bedroom set. The bedroom set offers intrigue with distressed accents and a hand brushed black powder coating. Pointed lines detail the head and footboard, contrasting the rounded frame with edgy accents. The nightstand completes this set with a distinguished wire framed door, natural wood top and flared tapered feet. Available in Red or White, this bedroom set delivers a uniquely bold, industrial look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7502wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:47:52"},
  {id: 7, name: "Fromberg Bed", number: nil, price: nil, description: "The bold look of this collection boasts an elegantly traditional design. A tall camelback headboard with button tufted fabric-like upholstery is in the perfect contrast to the sleigh style footboard. Matching case goods feature genuine marble tops, felt-lined top drawers and full extension metal glides. Set atop bun feet, you'll love the intricate carved wood detailing.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7670cpn-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:48:09"},
  {id: 8, name: "Bailey Bed", number: nil, price: nil, description: "Give your bedroom a rustic feel with the plank-style trimmings of this bedroom set! Prominent plank details adorn the headboard and case goods of this set, providing an appealing timber-like appearance that instantly warms your bedroom. Complete with a convenient combination of storage and style, this bedroom set rests atop sturdy wood block legs for ample support.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7510-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:48:42"},
  {id: 9, name: "Algol Bed", number: nil, price: nil, description: "A bold statement piece to boost the appeal of any bedroom, this platform bed is a surefire hit to create a contemporary sleeping environment. The oversized wingback headboard features eyecatching button tufting and comes dual-lined with nailhead trim. The linen-like upholstery comes tightly wrapped around the platform structure, ensuring a clean yet cozy visual. Choose from Gray, Blue, Navy or Red to showcase your personal taste!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7677nv-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:49:18"},
  {id: 10, name: "Canopus Bed", number: nil, price: nil, description: "Add some refined flair to your room with the aged appearance of this chic bedroom set! The weathered wood creates a warm ambiance with its faded and distressed vibe while the simple moulded details enhance the visual appeal of the design. With simple contrasting bar pulls adorning the various drawers, this bedroom collection is available in two styles to help you make the most of your bedroom space!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7423-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:50:06"},
  {id: 12, name: "Asterion Bed", number: nil, price: nil, description: "Lavish yourself with this bedroom collection designed for those looking for a glamorous upgrade of your most private and personal space in your home. A style uniquely designed to match the upscale luxury of an elegant home, this contemporary set comes complete with a padded fabric headboard and footboard for the utmost elegance in design and comfort. The button tufted feature highlights the solid wood frame and the warm gray tone goes well with the walnut finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7156-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:53:02"},
  {id: 2, name: "Carmela Bed", number: nil, price: nil, description: "Simple yet chic, this minimalistic wood set brings plenty of style and sophistication to any bedroom. The smooth panel headboard stands tall above the low footboard, offering plenty of opportunities to admire the detailed wood grain decorating it. Metal accents accentuate the wood corners, their contrasting gold finish helping to making this set a stylish and visually appealing duo for your bedroom space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7054-1-z.jpg", created_at: "2018-01-16 05:02:03", updated_at: "2018-01-25 20:53:04"},
  {id: 14, name: "Bryony Bed", number: nil, price: nil, description: "Cover your room with clean lines and simplistic designs that define this contemporary set. The plank designed bedroom set promotes soothing flow with linear lines that seem to travel from piece to piece. The high back headboard focuses the set and the low profile headboard contrasts with a clean design. Case goods rest on sleek legs and provide a steady foundation for its spacious storage drawers. Finished in a dark grey, this bedroom set adds cooler tones to complement the fluid designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7511-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:54:18"},
  {id: 15, name: "Cierra Bed", number: nil, price: nil, description: "With each detail carefully crafted, the outcome is this beautifully designed bed! Shiny nailhead trim perfectly lines the wingback panel headboard, which also features deep button tufting for added depth and design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7679gy-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:54:24"},
  {id: 16, name: "Brachium Bed", number: nil, price: nil, description: "Get the most out of your bedroom with this contemporary style bedroom set. The button tufted leatherette headboard offers unlimited comfort so you can lean into it in any angle. The LED light trim on the headboard adds a tasteful sense of convenience for your nightly reading materials and the decorative mirror accents adds a touch of contemporary style. The ornate bun feet compliment these stylish features and the French dovetail construction of the felt-lined top drawers blend traditional elements well. Available in 2 finishes.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7977bk-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:54:29"},
