  {id: 17, name: "Hesperos Bed", number: nil, price: nil, description: "Embolden your room with traditional designs and modern details that define this set. Decorated finials and carved floral accents beautifully frame the head and footboard. Lightened wood accents detail the set, creating soft contrast against these two beautiful finishes. Case goods are polished in elegance. Crafted with sculpted legs, this bedroom set truly sets itself apart with lavish designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7798ch-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:54:33"},
