  {id: 19, name: "Hyadum Bed", number: nil, price: nil, description: "Geometrically inspired, this bed is embellished by soft angles and tufted accents to create one sophisticated aesthetic. Set apart by its soft faux nubuck fabric and dense foam cushions, the bed will leave you relaxed like never before. Beige upholstery brightens, adding warm tones to create a cozy ambiance.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7154-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:56:23"},
  {id: 20, name: "Haldus Bed", number: nil, price: nil, description: "Get lost in this undeniably industrial bedroom set. The bedroom set offers intrigue with distressed accents and a hand brushed black powder coating. Pointed lines detail the head and footboard, contrasting the rounded frame with edgy accents. The nightstand completes this set with a distinguished wire framed door, natural wood top and flared tapered feet. Available in Red or White, this bedroom set delivers a uniquely bold, industrial look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7502iv-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:59:05"},
  {id: 21, name: "Canopus Bed", number: nil, price: nil, description: "Add some refined flair to your room with the aged appearance of this chic bedroom set! The weathered wood creates a warm ambiance with its faded and distressed vibe while the simple moulded details enhance the visual appeal of the design. With simple contrasting bar pulls adorning the various drawers, this bedroom collection is available in two styles to help you make the most of your bedroom space!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7422gy-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:59:10"},
  {id: 22, name: "Clover Bed", number: nil, price: nil, description: "Add this to your bedroom set to give your space a fresh, new classy upgrade. The decorative mirror accents and crocodile-like front panels bring a unique combination of details that come in a silver rose finish. Give your home the upgrade it needs and get the most out of your bedroom space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7971-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:59:15"},
  {id: 23, name: "Armus Bed", number: nil, price: nil, description: "Take advantage of this conveniently functional bedroom set that offers a contemporary blend of modern and traditional styles. Lean into the padded fabric headboard, which has been designed to maximize comfort. The nightstand comes equipped with a USB outlet, perfect for charging your smartphones and tablets, and the felt-lined top drawers give ample storage space for all your clutter. This transitional style bedroom set offers comfort and utility while giving your home a newly refined look that you won't be able to resist.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7719-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:59:20"},
  {id: 24, name: "Bailey Bed", number: nil, price: nil, description: "Give your bedroom a rustic feel with the plank-style trimmings of this bedroom set! Prominent plank details adorn the headboard and case goods of this set, providing an appealing timber-like appearance that instantly warms your bedroom. Complete with a convenient combination of storage and style, this bedroom set rests atop sturdy wood block legs for ample support.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7510dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:00:19"},
  {id: 25, name: "Cierra Bed", number: nil, price: nil, description: "With each detail carefully crafted, the outcome is this beautifully designed bed! Shiny nailhead trim perfectly lines the wingback panel headboard, which also features deep button tufting for added depth and design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7679bk-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:01:08"},
  {id: 27, name: "Canopus Bed", number: nil, price: nil, description: "Add some refined flair to your room with the aged appearance of this chic bedroom set! The weathered wood creates a warm ambiance with its faded and distressed vibe while the simple moulded details enhance the visual appeal of the design. With simple contrasting bar pulls adorning the various drawers, this bedroom collection is available in two styles to help you make the most of your bedroom space!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7422-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:51:34"},
  {id: 28, name: "Golva Bed", number: nil, price: nil, description: "Lavish design crafted with a tall, padded headboard with intricate tufting. Nailheads trim the edges of the leatherette headboard, while case goods feature drawers with mirror front panels. Available in either black or silver finish, this set is perfect to vitalize any contemporary style bedroom d", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7295wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:51:49"},
  {id: 29, name: "Capella Bed", number: nil, price: nil, description: "Brushed in a gleaming gold finish, this bedroom set offers sophisticated elegance. Brushed gold glows as it adds polished accents throughout the set. The tufted headboard focuses with flowing curves and tufted accents that add instant focus. Case goods feature antique style pulls along with uniquely detail corners. Finished with intricate carved designs, the bedroom set will leave your room with a glamorous ambiance.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7442-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:52:06"},
  {id: 30, name: "Bryony Bed", number: nil, price: nil, description: "Cover your room with clean lines and simplistic designs that define this contemporary set. The plank designed bedroom set promotes soothing flow with linear lines that seem to travel from piece to piece. The high back headboard focuses the set and the low profile headboard contrasts with a clean design. Case goods rest on sleek legs and provide a steady foundation for its spacious storage drawers. Finished in a dark grey, this bedroom set adds cooler tones to complement the fluid designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7511dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:52:36"},
  {id: 31, name: "Cayla Bed", number: nil, price: nil, description: "Kick back and relax in this contemporary style bed designed to maximize your comfort in the ultimate fashion! Lean back and feel the full support of the padded flannelette fabric and button tufted wingback headboard. The nailhead trim adds a touch of sophistication for a modernized look, upheld by wooden framework. Available in 3 colors, pick one that suits your style and add this charming piece to your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7779iv-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:53:01"},
  {id: 32, name: "Asterion Bed", number: nil, price: nil, description: "Lavish yourself with this bedroom collection designed for those looking for a glamorous upgrade of your most private and personal space in your home. A style uniquely designed to match the upscale luxury of an elegant home, this contemporary set comes complete with a padded fabric headboard and footboard for the utmost elegance in design and comfort. The button tufted feature highlights the solid wood frame and the warm gray tone goes well with the walnut finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7156-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:54:41"},
  {id: 33, name: "Carlynn Bed", number: nil, price: nil, description: "Need more storage space? Upgrade your bedroom set with this multifunctional bookcase headboard that comes with multiple shelving and drawer space to take care of all your storage needs. With 2 additional drawer spaces in the footboard, the beautifully designed bedroom set takes convenience to the next level in style. You'll surely appreciate the decorative raised drawer fronts and square silver-tone knobs that adds a sense of modern elegance to create a delicate balance between function and appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7555-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:55:11"},
  {id: 34, name: "Avior Bed", number: nil, price: nil, description: "Brighten your bedroom with the glamor and glitz of this elegant bedroom set! Stylish button tufts decorate the padded leatherette headboard, bringing extra definition to each piece while accentuating the thick wood frame. Beautiful mirrored accent panels enhance the visual appeal of the casegood design while the turned bun feet provide sturdy support that adds a sophisticated touch to this set's chic contemporary elements.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7170wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:55:17"},
  {id: 35, name: "Cursa Bed", number: nil, price: nil, description: "Take a page from your cherished childhood fairytales and update your bedroom with a dreamy bedroom set! The entrancing curves of the bedroom are paired with similar case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7664-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:55:24"},
  {id: 36, name: "Ariella Bed", number: nil, price: nil, description: "Rustic meets minimalism with a design that perfectly balances simplicity and style. With a padded fabric headboard and a footboard showcasing drawer space, you will have plenty of storage space for all your storing needs. Available in a gray finish, this set blends yesterday's minimalist approach with today's up and coming rustic-inspired look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7862dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:55:58"},
