  {id: 38, name: "Carly Bed", number: nil, price: nil, description: "Upgrade your bedroom with some contemporary elements! The warm gray tones of the platform bed will set the mood for relaxation so that, after a hard day", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7160-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:56:45"},
  {id: 49, name: "Christie Bed", number: nil, price: nil, description: "Sophisticated and elegantly crafted, this sleek chest melds a hint of traditional appeal with a simple and clean design. Antique-like handles and a hidden case good drawer add style and convenience to the set, ensuring it finds a place in your transitional home!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7550-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:03:12"},
  {id: 257, name: "Belgrade I Bed", number: nil, price: nil, description: "Create a timeless and classic feel to your home with this bedroom set with natural wood finish. The camelback-shaped headboard can either be wooden or with padded ivory fabric. Matching rustic hardware completes this fabulous set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7613.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 00:56:51"},
  {id: 39, name: "Ayana Bed", number: nil, price: nil, description: "Framed by smooth contoured accents, this bedroom set delivers unprecedented style with smooth silver-tone pulls and soft angles. The high back bed is distinguished by panel stitched design as soft upholstery and dense foam cushions add billowing pockets of comfort to the wood frame. Case goods match perfectly, showcasing clean contoured lines along the drawers and sleek angled legs. Finished in an Antique Grey for a soft weathered texture.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7554-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:57:10"},
  {id: 40, name: "Ariston Bed", number: nil, price: nil, description: "Resting atop elegant bun feet, this glamorous bedroom set brings a touch of stylish appeal that instantly brightens any space! Sophisticated button tufts adorn the leatherette upholstery of the headboard, which brings more attention to its thick and chic frame. Mirrored accent panels bring extra glitz to the design and make this a stunning set to admire!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7171bk-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:57:24"},
  {id: 41, name: "Arcturus Bed", number: nil, price: nil, description: "Step into a luxuriously traditional atmosphere with this stunning bedroom set. Intricate carving details the entire set, embellishing every aspect with elegant floral designs and soft curves. Warming notes create a cozy atmosphere with brown cherry finishes that distinguish this set. Genuine marble adds subtle accents and stylish detail to the dresser and nigh tstand. Finished with antique handles, this traditional set inspires with timeless details that will never go out of style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7859-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:57:49"},
  {id: 42, name: "Asterope Bed", number: nil, price: nil, description: "The clean lines and natural wood tones create a refined aesthetic with this plank inspired bedroom set. Minimalistic designs feature sleek easy-grasp pulls that lie flush for a polished finish. One bed option provides unique storage with drawers that hide seamlessly within the footboard. Casegoods spaciously store essentials and the rectangular mirror completes the set for a distinguished rustic style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7861dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:57:59"},
  {id: 44, name: "Castor Bed", number: nil, price: nil, description: "This bedroom set offers a touch of rustic flair with a contemporary twist to redefine your personal space. Perfect for amping up the elegance of any bedroom, the exquisite features of the solid wood and wood veneer framework is available in 3 different finishes that can easily accommodate any particular style. The platform bed comes with two drawers in the footboard for maximum storage space while the felt-lined top drawers and English dovetail construction provides a traditional touch to blend with any setting.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7590bk-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:58:28"},
  {id: 45, name: "Ariston Bed", number: nil, price: nil, description: "Resting atop elegant bun feet, this glamorous bedroom set brings a touch of stylish appeal that instantly brightens any space! Sophisticated button tufts adorn the leatherette upholstery of the headboard, which brings more attention to its thick and chic frame. Mirrored accent panels bring extra glitz to the design and make this a stunning set to admire!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7171sv-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:58:36"},
  {id: 47, name: "Sugar Bed", number: nil, price: nil, description: "Create a glamorous escape with smooth camelback curves. The tufted detail creates sophisticated accents that add instant focus to any room. Nailhead trim outlines the contours and accentuates the high headboard brilliantly. Rest easy on the cushioned back and brighten rooms with the soft finishes that beautifully complement these beds.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7884pk-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:59:11"},
  {id: 46, name: "Hasselt Bed", number: nil, price: nil, description: "The unique multi-colored wood finish easily highlights this bedroom set's transitional flair in a warm and inviting exhibition of style! The thick finish traces the outside of the pieces helping accentuate the various wood finishes to guarantee a chic visual. Each of the triple-bar legs brings an industrial element to the design, adding even more style while at the same time providing sturdy support for these bedroom pieces.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7592ex-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:58:50"},
  {id: 48, name: "Cervantes Bed", number: nil, price: nil, description: "Embolden your room with carved details that fall gracefully on this brown cherry bedroom set. Smooth floral carvings detail each piece to deliver a truly refined aesthetic. The low footboard highlights the well-stated headboard as opposing arches create sophisticated contrast. Case goods are distinguished by antique style pulls and rolled feet, adding refined detail. Welcome the soft silhouettes and gracefully sculpted accents that create this timeless set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7730-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:59:21"},
  {id: 51, name: "Atria Bed", number: nil, price: nil, description: "Bring a modern and up-to-date vibe to your bedroom setting with the sophisticated design of this contemporary bed. The sleek flannelette upholstery adds a soft cushion to the tall headboard and footboard, which feature a uniquely tiered silhouette to enhance the visual appeal. Sophisticated vertical tufts line the length of the upholstery to create a ridged look sure to match any aesthetic.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7687bg-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:09:29"},
  {id: 53, name: "Eugenia Bed", number: nil, price: nil, description: "Sophisticated and elegantly crafted, this sleek bedroom set melds a hint of traditional appeal with a simple and clean design. The sleigh bed provides a chic silhouette with its curving frame and minimalistic leg appearance while the case goods enhance the room with their gently moulded details. Antique-like handles and a hidden nightstand drawer add style and convenience to the set, ensuring it finds a place in your transitional home!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7598ch-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:12:47"},
  {id: 546, name: "Lawrence Dining Table", number: nil, price: nil, description: "This bold rectangular design offers both spacious seating and table space ideal for any dining space. This piece is easily expandable to accommodate any size gathering or function.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3130t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-25 21:11:40"},
  {id: 54, name: "Berenice Bed", number: nil, price: nil, description: "Transform your bedroom with this transitional style bedroom set. The platform bed showcases a comfy padded headboard while each case good features felt-lined top drawers. Built with solid wood and wood veneers, the simple design of this bedroom set brings a contemporary blend of traditional and modern appeal, giving your home a new updated look in a subtle fashion.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7580gy-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:14:05"},
  {id: 55, name: "Blythe Bed", number: nil, price: nil, description: "Experience true glamour with this silver finished bedroom set. Leatherette covers the high back headboard, adding smooth biscuit tufted accents for charming detail. Case goods provide plenty of storage while diamond encrusted handles add chic shine. Felt-lined top drawers accommodate delicate items while English dovetails ensure lasting strength. Fascinate with this pristine bedroom set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7869-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:14:25"},
  {id: 56, name: "Hesperos Bed", number: nil, price: nil, description: "Embolden your room with traditional designs and modern details that define this set. Decorated finials and carved floral accents beautifully frame the head and footboard. Lightened wood accents detail the set, creating soft contrast against these two beautiful finishes. Case goods are polished in elegance. Crafted with sculpted legs, this bedroom set truly sets itself apart with lavish designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7798wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:14:57"},
  {id: 57, name: "Carmela Bed", number: nil, price: nil, description: "Simple yet chic, this minimalistic wood set brings plenty of style and sophistication to any bedroom. The smooth panel headboard stands tall above the low footboard, offering plenty of opportunities to admire the detailed wood grain decorating it. Metal accents accentuate the wood corners, their contrasting gold finish helping to making this set a stylish and visually appealing duo for your bedroom space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7054-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:15:55"},
  {id: 58, name: "Duhr Bed", number: nil, price: nil, description: "Come home to comfort with this soft cushioned headboard. Clean lines frame the sides and the low footboard creates a well-focused headboard. Rounded T-style cushions create a relaxing backrest for sitting up in bed. Watch your favorite shows or nestle up with a heart-warming book as the smooth linen upholstery soothes your senses. Finished in a cool gray, this bed offers a relaxed atmosphere that relieves unnecessary stresses.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7551-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:17:01"},
  {id: 59, name: "Cece Bed", number: nil, price: nil, description: "Ensure your bedroom has a unique and stylish centerpiece with this contemporary bed. The high headboard and footboard are composed of metal spindles arranged in a sophisticated geometric design, creating a visually appealing look that is also airy and open. Featuring a powder-coated metal frame, this bed provides the distinct look that your bedroom has been missing!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7759wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:17:20"},
  {id: 60, name: "Canopus Bed", number: nil, price: nil, description: "Add some refined flair to your room with the aged appearance of this chic bedroom set! The weathered wood creates a warm ambiance with its faded and distressed vibe while the simple moulded details enhance the visual appeal of the design. With simple contrasting bar pulls adorning the various drawers, this bedroom collection is available in two styles to help you make the most of your bedroom space!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7423gy-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:17:31"},
  {id: 61, name: "Clover Bed", number: nil, price: nil, description: "Add this to your bedroom set to give your space a fresh, new classy upgrade. The decorative mirror accents and crocodile-like front panels bring a unique combination of details that come in a silver rose finish. Give your home the upgrade it needs and get the most out of your bedroom space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7971-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:18:18"},
  {id: 62, name: "Cierra Bed", number: nil, price: nil, description: "With each detail carefully crafted, the outcome is this beautifully designed bed! Shiny nailhead trim perfectly lines the wingback panel headboard, which also features deep button tufting for added depth and design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7679bk-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:19:58"},
  {id: 64, name: "Bailey Bed", number: nil, price: nil, description: "Give your bedroom a rustic feel with the plank-style trimmings of this bedroom set! Prominent plank details adorn the headboard and case goods of this set, providing an appealing timber-like appearance that instantly warms your bedroom. Complete with a convenient combination of storage and style, this bedroom set rests atop sturdy wood block legs for ample support.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7510dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:21:31"},
  {id: 65, name: "Hassaleh Bed", number: nil, price: nil, description: "Simplistic lines and chic colors come together to create this splendidly striped bed. Crafted with a low profile footboard, this bed delivers focus to refresh and revitalize your bedroom. The headboard is cushioned with foam for a comforting back rest while soft upholstery pairs perfectly for a smooth touch finish. Sleek and stylish, this striped bed will transform your room with its sophisticated linear lines.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7172-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:24:07"},
  {id: 547, name: "Foster II Counter Ht. Table", number: nil, price: nil, description: "Make your dining room unique with this pedestal table decorated with nail head trim. Matching slated chairs accompany this table.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3437pt.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-25 21:22:28"},
  {id: 66, name: "Canopus Bed", number: nil, price: nil, description: "Add some refined flair to your room with the aged appearance of this chic bedroom set! The weathered wood creates a warm ambiance with its faded and distressed vibe while the simple moulded details enhance the visual appeal of the design. With simple contrasting bar pulls adorning the various drawers, this bedroom collection is available in two styles to help you make the most of your bedroom space!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7422-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:24:21"},
  {id: 67, name: "Golva Bed", number: nil, price: nil, description: "Lavish design crafted with a tall, padded headboard with intricate tufting. Nailheads trim the edges of the leatherette headboard, while case goods feature drawers with mirror front panels. Available in either black or silver finish, this set is perfect to vitalize any contemporary style bedroom d", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7295wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:24:56"},
  {id: 68, name: "Cayla Bed", number: nil, price: nil, description: "Kick back and relax in this contemporary style bed designed to maximize your comfort in the ultimate fashion! Lean back and feel the full support of the padded flannelette fabric and button tufted wingback headboard. The nailhead trim adds a touch of sophistication for a modernized look, upheld by wooden framework. Available in 3 colors, pick one that suits your style and add this charming piece to your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7779iv-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:26:06"},
  {id: 69, name: "Capella Bed", number: nil, price: nil, description: "Brushed in a gleaming gold finish, this bedroom set offers sophisticated elegance. Brushed gold glows as it adds polished accents throughout the set. The tufted headboard focuses with flowing curves and tufted accents that add instant focus. Case goods feature antique style pulls along with uniquely detail corners. Finished with intricate carved designs, the bedroom set will leave your room with a glamorous ambiance.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7442-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:26:11"},
  {id: 70, name: "Bryony Bed", number: nil, price: nil, description: "Cover your room with clean lines and simplistic designs that define this contemporary set. The plank designed bedroom set promotes soothing flow with linear lines that seem to travel from piece to piece. The high back headboard focuses the set and the low profile headboard contrasts with a clean design. Case goods rest on sleek legs and provide a steady foundation for its spacious storage drawers. Finished in a dark grey, this bedroom set adds cooler tones to complement the fluid designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7511dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:26:35"},
  {id: 71, name: "Adhara Bed", number: nil, price: nil, description: "Take the best of traditional and modern designs to meet your personal style needs! With a padded fabric frame, this bed features button tufted details to offer a classic touch alongside its unique appeal. Streamlined details of the nailhead trim and the corner cut-outs will refine the look of your home to create an upgrade you can truly appreciate.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7685-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:08:57"},
  {id: 72, name: "Carlynn Bed", number: nil, price: nil, description: "Need more storage space? Upgrade your bedroom set with this multifunctional bookcase headboard that comes with multiple shelving and drawer space to take care of all your storage needs. With 2 additional drawer spaces in the footboard, the beautifully designed bedroom set takes convenience to the next level in style. You'll surely appreciate the decorative raised drawer fronts and square silver-tone knobs that adds a sense of modern elegance to create a delicate balance between function and appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7555-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:10:46"},
  {id: 73, name: "Avior Bed", number: nil, price: nil, description: "Brighten your bedroom with the glamor and glitz of this elegant bedroom set! Stylish button tufts decorate the padded leatherette headboard, bringing extra definition to each piece while accentuating the thick wood frame. Beautiful mirrored accent panels enhance the visual appeal of the casegood design while the turned bun feet provide sturdy support that adds a sophisticated touch to this set's chic contemporary elements.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7170wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:11:06"},
