  {id: 75, name: "Cursa Bed", number: nil, price: nil, description: "Take a page from your cherished childhood fairytales and update your bedroom with a dreamy bedroom set! The entrancing curves of the bedroom are paired with similar case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7664-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:13:57"},
  {id: 77, name: "Cierra Bed", number: nil, price: nil, description: "With each detail carefully crafted, the outcome is this beautifully designed bed! Shiny nailhead trim perfectly lines the wingback panel headboard, which also features deep button tufting for added depth and design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7679gy-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:14:10"},
  {id: 78, name: "Persephone Bed", number: nil, price: nil, description: "Stylish enough for a queen and elegant enough for everyone else, this bedroom set offers a majestic flair that cannot be rivaled! The curvaceous, high headboard showcases a thick ornate trim that accents the fabric upholstery and its decorative button tufts. Each of the case goods feature fluted details along their sides, drawing the eye up to the moulded top and down to the elegant bun feet. With traditional elements to liven up any home, this bedroom set will transform your home into a luxurious palace.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7661dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:16:26"},
  {id: 601, name: "NORTHVALE I 7 Pc. Dining Table Set", number: nil, price: nil, description: "Add appeal to your dining room with this rectangular table finished in espresso. Matching six chairs have padded leatherette seats that look stylish as they are comfortable.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_709.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-27 01:16:20"},
  {id: 79, name: "Avior Bed", number: nil, price: nil, description: "Brighten your bedroom with the glamor and glitz of this elegant bedroom set! Stylish button tufts decorate the padded leatherette headboard, bringing extra definition to each piece while accentuating the thick wood frame. Beautiful mirrored accent panels enhance the visual appeal of the casegood design while the turned bun feet provide sturdy support that adds a sophisticated touch to this set's chic contemporary elements.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7170bk-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:16:32"},
  {id: 80, name: "Bianca Bed", number: nil, price: nil, description: "This transitional style bedroom set takes the best of all interior designs by blending the classics with rugged rustic flair. Each piece is scaled to balance the rural details with a minimalistic approach that exemplifies down to earth sophistication. The solid wood pieces are topped with wood veneer, giving each piece a smooth and refined exterior. Felt-lined top drawers and sliding cabinet doors give the storage pieces extra appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7734-3-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:16:38"},
  {id: 81, name: "Ariella Bed", number: nil, price: nil, description: "Rustic meets minimalism with a design that perfectly balances simplicity and style. With a padded fabric headboard and a footboard showcasing drawer space, you will have plenty of storage space for all your storing needs. Available in a gray finish, this set blends yesterday's minimalist approach with today's up and coming rustic-inspired look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7862-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:17:14"},
  {id: 82, name: "Cayla Bed", number: nil, price: nil, description: "Kick back and relax in this contemporary style bed designed to maximize your comfort in the ultimate fashion! Lean back and feel the full support of the padded flannelette fabric and button tufted wingback headboard. The nailhead trim adds a touch of sophistication for a modernized look, upheld by wooden framework. Available in 3 colors, pick one that suits your style and add this charming piece to your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7779gy-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:18:27"},
  {id: 83, name: "Azha Bed", number: nil, price: nil, description: "Lavishly update with this stunning bedroom set. The high back bed creates a glamorous focal point with its rounded finials, smooth arches and tufted details. Case goods shine as mirrored accents glimmer against the silver finished set. Sculpted accents embellish with floral patterning, completing the set with rich stylings.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7194-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:18:36"},
  {id: 84, name: "Avior Bed", number: nil, price: nil, description: "Brighten your bedroom with the glamor and glitz of this elegant bedroom set! Stylish button tufts decorate the padded leatherette headboard, bringing extra definition to each piece while accentuating the thick wood frame. Beautiful mirrored accent panels enhance the visual appeal of the casegood design while the turned bun feet provide sturdy support that adds a sophisticated touch to this set's chic contemporary elements.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7170sv-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:18:45"},
  {id: 85, name: "Clotilde Bed", number: nil, price: nil, description: "The perfect addition for those looking for style and comfort immersed in functionality, take a look at this transitional style bedroom set that combines all three for your maximum satisfaction. The padded fabric headboard offers comfort in any position while the 2 drawers in the footboard maximize on your storage needs. With elegant details featuring a raised drawer front and square silver-tone knobs, you can surely appreciate the contemporary mix of traditional decor.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7553-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:19:43"},
  {id: 160, name: "Ennis Bed", number: nil, price: nil, description: "Set the scene for a cozy night's sleep in this warm and inviting platform bed. The headboard top is ever so slightly curved for a modern touch, while detailed stitching runs up and down along the headboard. Padded and upholstered in linen-like fabric, this bed makes for an attractive piece and a relaxing oasis.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7678gy.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:28:45"},
  {id: 86, name: "Tychus Bed", number: nil, price: nil, description: "An eclectic design with tons of character, this dark oak bedroom collection makes a statement like no other! Rustic, wood grain details, and a padded fabric headboard provide a warmth to a space that will make even the coldest winters feel cozy. Contrasting gold finished handles, legs and corner braces add a beautifully chic touch to complete this platform bed and its spacious matching case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7559f.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:19:48"},
  {id: 95, name: "Cressida Bed", number: nil, price: nil, description: "Simple yet charming, this adorable platform bed suits all dcor styles and will surely become a versatile piece to be cherished for years to come. The timeless, button-tufted headboard adds a touch of visual interest while maintaining the clean, classic look with its leatherette upholstery.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7725bg.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:00:21"},
  {id: 96, name: "Lennart II Bed", number: nil, price: nil, description: "For a quick modern update to your home, this collection will add that trendy mid-century appeal. Featuring a sleek white finish and a leatherette headboard, this panel bed is complete in a platform style with an included mattress ready slat kit. Coordinating case goods boast slim flared legs and recessed handle drawer pulls. A choice of oval or rectangular wall mountable mirror completes this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7387wh.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:00:29"},
  {id: 97, name: "Marianne Bed", number: nil, price: nil, description: "Every master bedroom deserves to have a statement piece and this chic, platform bed is just that! Bringing modern appeal to a feminine design, the plush linen upholstered headboard is lined with a fun, nailhead trim pattern consisting of angling zig-zag lines.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7433bg.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:00:44"},
  {id: 98, name: "Louis Philippe III Bed", number: nil, price: nil, description: "Style your master bedroom however you like with this classic collection, featuring a sleigh bed design with matching multi-storage case goods, all with an identical color finish. The nightstand, chest and dresser allow you to store clothes, bedding and any other items. Bring a unique taste to your bedroom while creating a relaxing and stylish environment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7866gy.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:00:55"},
  {id: 99, name: "Ferrero Bed", number: nil, price: nil, description: "Highlight the best of your bedrooms style with this sets subtle elements. From the gently curved headboard of the bed to the tapering legs supporting each piece, the transitional appeal subtly brings out the key features of your bedroom with its crisp and clean lines. Let the brown cherry finish enhance the warm and inviting feeling of your bedroom as it contrasts with the round knobs adorning each case good.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7483.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:01:27"},
  {id: 100, name: "Gillian Bed", number: nil, price: nil, description: "Make a dramatic statement in your bedroom with this striking, contemporary style bed that showcases a beautifully paneled headboard. The plush, linen upholstered frame is lined with a sleek chrome frame for a brilliant contrast that will make jaws drop!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7262gy.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:01:39"},
  {id: 87, name: "Ganymede Bed", number: nil, price: nil, description: "When you think of country farmhouse this lovely bedroom collection comes to mind. The soothing gray finish has a rustic, weathered look that goes beautifully with the vertical panel detailing. Flat panel drawers compliment the simple design and provide an outstanding amount of storage space. With its gorgeous wooden panel headboard, this charming design will create an undeniably cozy atmosphere.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7855.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:19:53"},
  {id: 88, name: "Cressida Bed", number: nil, price: nil, description: "Fall asleep dreaming of stars with this beautiful LED headboard bed frame. Unique LED lights accentuate the button tufting and create the feeling of being outside, watching the bright twinkling lights. Upholstered in a soft padded fabric, this bed provides comfort and creates a cozy atmosphere for any room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7421bk.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:20:47"},
