  {id: 93, name: "Lennart II Bed", number: nil, price: nil, description: "For a quick modern update to your home, this collection will add that trendy mid-century appeal. Featuring a sleek black finish and a leatherette headboard, this panel bed is complete in a platform style with an included mattress ready slat kit. Coordinating case goods boast slim flared legs and recessed handle drawer pulls. A choice of oval or rectangular wall mountable mirror completes this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7387bk.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:21:49"},
  {id: 102, name: "Bryant II Bed", number: nil, price: nil, description: "Drift into a peaceful sleep surrounded by the glamour of this contemporary style bedroom collection. Lined with leatherette upholstery, the button tufted headboard flares back for a dramatic effect. Crocodile texturing along the case good tops and drawer panel fronts add visual detailing that can only be topped by the mirrored top drawers and crystal-like acrylic knobs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7289.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:01:57"},
  {id: 103, name: "Rebecca Bed", number: nil, price: nil, description: "Elegant wingback designs come paired with intricate nailhead trim in the form of this stylish bed. The camelback structure incorporates chic and glamorous elements that will amplify the beauty of any room. Entirely upholstered in soft brown fabric, the bed also showcases a padded headboard that doubles as a comfortable backrest to lean against. So curl up with a good book before bed and drift off into your dreams!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7516.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:02:13"},
