  {id: 105, name: "Daphne Bed", number: nil, price: nil, description: "In addition to stunning carved details and felt-lined top drawers, this transitional style bedroom collection comes with built-in headboard shelves and convenient touch lights. An extra drawer hides within the nightstand and dresser while the chest offers extra functionality with its lift-top jewelry storage, complete with mirror. Sleek silver tone handles sparkle against the weathered gray finish for a beautifully contemporary design that will beautify any bedroom.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7556.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:02:38"},
