  {id: 602, name: "Edinburg II Square Counter Ht. Table", number: nil, price: nil, description: "Finished in dark oak, this counter height dining table has natural wood grain. Dark brown padded leatherette seats on the chair and bench complement the antiquated look of the table. Available in regular height as well.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3688pt.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-27 19:55:46"},
  {id: 134, name: "Safire Bed", number: nil, price: nil, description: "The perfect bedroom set to declutter and organize while maintaining style. This brown cherry finished bed set showcases unique geometric woodwork for a modern charm. Two footboard drawers and paired case goods provide ample storage space to reorganize and tidy up your bedroom. Silver trim accents and matching silver drawer pulls add a faint glamorous touch to brighten up your room!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7616.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:56:32"},
  {id: 135, name: "Emmaline Bed", number: nil, price: nil, description: "Subtle details add up, as proven by this gorgeous warm chestnut finished bedroom collection. Laser-cut designs along each drawer panel and the wooden headboard option bring in an effortless, romantic appeal. The warm chestnut finish is sure to emphasize the wood craftsmanship while traditional moulding provides added sophistication and class. Choose between a linen-upholstered or wooden headboard to complete your bedroom set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7831f.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:56:41"},
  {id: 136, name: "Minerva Bed", number: nil, price: nil, description: "Create a cozy bedroom retreat with this transitional style collection that boasts a harvest brown finish. Decorative ring carvings are complemented with lavish molded trim details and bracket style feet for a design that exudes elegance. The matching case goods feature felt-lined top drawers, lovely hardware and ample storage so keeping a relaxed, clutter-free space becomes second nature.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7839.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:56:53"},
  {id: 139, name: "Mirabelle Bed", number: nil, price: nil, description: "With each detail carefully crafted, the outcome is this beautifully designed bed! Shiny nailhead trim perfectly lines the wingback panel headboard, which also features deep button tufting for added depth and design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7679iv.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:57:22"},
  {id: 140, name: "Salamanca Bed", number: nil, price: nil, description: "Out with the old and in with the new, this champagne finished set is unlike any other! With 3mm mirrored panel accents, this set is an elegant choice for a glamorous setting. Each piece is adorned with geometric style wooden trim that emphasizes the champagne backdrop. Matching case goods are adorned with crystal-like acrylic drawer pull handles, felt-lined top drawers and full extension metal glides.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7673.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:58:38"},
  {id: 138, name: "Hutchinson Bed", number: nil, price: nil, description: "Set the scene for serene relaxation with this beautiful set and its gorgeous rustic natural tone finish. Diamond tufting can be found all along the fabric upholstered wingback style headboard while the wood grain emphasizes the natural finish. The simple design speaks volumes with its elegant centerpiece and supporting case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7577.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:58:43"},
  {id: 137, name: "Frontera Bed", number: nil, price: nil, description: "Beautifully geometric and reflective, this bedroom collection is perfect for updating your sleeping environment! Mirrored glass accents adorn the headboard panel and beautifully accent the case good's top drawers. Metal ring pulls delicately hang while ball bearing metal glides allow for smooth opening and closing of the drawers.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7586.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:58:45"},
  {id: 142, name: "Orianna Bed", number: nil, price: nil, description: "Bring elegance into your bedroom with this magnificent tufted bed. Dual nailhead trim lines the expansive headboard while button tufting adds depth and dimension. The pullout footboard can double as extra storage space and is easily accessed with the help of caster wheels.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7674.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:22:35"},
  {id: 143, name: "Edinburgh Bed", number: nil, price: nil, description: "A traditional design with a modern twist, this bedroom collection can be paired with either of the two platform bed options. A tall camelback headboard is upholstered in padded faux leather, complete with deep tufted detailing. Paired case goods feature intricate wood carvings and are fitted with full extensions metal glides, felt-lined top drawers and antique look drawer pull handles. Two footboard options available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7672.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:22:40"},
  {id: 144, name: "Noella Bed", number: nil, price: nil, description: "Add bold and beautiful coloring to your bedroom in the form of these gorgeous bed options! Equipped with slat kits, this padded fabric bed is available in three eye-catching colors, each of which enhance the scrolled sleigh structure and deep button tufting. The delicate curved design is accented with crystal-like acrylic buttons and trailed by shined nailhead trim.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7128nv.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:23:55"},
  {id: 145, name: "Flandreau Bed", number: nil, price: nil, description: "Add a traditional spin to your bedroom with this stunning collection! With all the qualities of classic designs, this bedroom set will be a hit with its bold accents and smooth brown cherry finish. Perfectly placed nailhead trim along the leatherette panels create a visual complement to the swirling antique gold metal detailing. Intricate carvings along the framework add to the timeless appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7588.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:24:02"},
  {id: 146, name: "Ennis Bed", number: nil, price: nil, description: "Set the scene for a cozy night's sleep in this warm and inviting platform bed. The headboard top is ever so slightly curved for a modern touch, while detailed stitching runs up and down along the headboard. Padded and upholstered in linen-like fabric, this bed makes for an attractive piece and a relaxing oasis.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7678gy.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:24:08"},
  {id: 147, name: "Argusville Bed", number: nil, price: nil, description: "Style your bedroom with dark hues and exquisite trims. Detailed knobs glisten elegantly against the warm espresso finish and provide added enhancements to the stylized drawer fronts. The expansive bed showcases a sloped headboard with matching moulding trim for either two bed options: sleigh or storage platform.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7381.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:25:46"},
  {id: 977, name: "ISABELLA III Twin/Twin Bunk Bed", number: nil, price: nil, description: "Accented with a heart design, this young girl's bunk bed has a twin trundle and attached ladder for an easy climb to the top bunk.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_158.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-27 01:24:32"},
