  {id: 149, name: "Litchville Bed", number: nil, price: nil, description: "With smooth carved panels, this sleigh bedroom set will add a chic upgrade to your bedroom dcor. A dark bold finish sets off the stylish design of the contrasting metal drawer pull handles. Felt-lined top drawers provide safe haven for more delicate possessions, hidden behind the bold paneling designs of each drawer front.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7383.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:26:03"},
