  {id: 166, name: "Erglow I Bed", number: nil, price: nil, description: "Ideal for night owl reading enthusiasts, this flannelette upholstered bed is a must-have with its touch LED lighting trim. Scared of the dark? Just press the built-in touch button along the side and the light strip will brighten your room immediately.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7695nv.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:06:06"},
  {id: 165, name: "Barney Bed", number: nil, price: nil, description: "Three comfortable sizes, one timeless design. These platform beds each feature smooth and inviting flannelette upholstery. Curved corners, button accents and angled legs work together to add a touch of nonchalance to the setting.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7272pk.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:05:56"},
  {id: 168, name: "Lennart Bed", number: nil, price: nil, description: "For a quick modern update to your home, this collection will add that trendy mid-century appeal. Featuring a Gray finish, this padded fabric panel bed is complete in a platform style with an included mattress ready slat kit. Coordinating case goods boast slim flared legs and recessed handle drawer pulls. A choice of oval or rectangular wall mountable mirror completes this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7386gy.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:06:30"},
