  {id: 174, name: "Zaragoza Bed", number: nil, price: nil, description: "Let this bedroom set reflect the same up-to-date sense of style you possess! The sleek lines bring out the best features of the wood craftsmanship, which comes finished in beautiful natural tone. Mirror panels decorated with interlocking circle accents add a modern, unique extra dimension to your headboard as well as the matching case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7585.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:07:17"},
  {id: 176, name: "Karissa Bed", number: nil, price: nil, description: "For a touch of elegance, pair your bedroom with this floral embroidered platform bed. The linen-like upholstery is wrapped tightly around the wooden framework, and sits atop espresso finished block legs for added height. The camelback headboard adds a sense of ease with its soft curves and adds a chic element to the beige coloring.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7698.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:07:36"},
  {id: 170, name: "Baddock Bed", number: nil, price: nil, description: "With a soft antique oak finish, this stunning bed set is finely crafted with smooth carved wood detailing. Pair the tall panel headboard with the matching standard footboard or opt for additional storage space with the double-drawer footboard alternative. Simple bar handles enhance the neutral tones of this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7692.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:08:27"},
  {id: 606, name: "WRANGLER II 5Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Mission-inspired back and padded seats in leatherette are the hallmarks of this rather unassuming set. The dark espresso finish will contrast well with a light walls in a primarily transitional home", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1106.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-27 20:07:56"},
  {id: 175, name: "Hankinson Bed", number: nil, price: nil, description: "With a look all its own, this set demands attention. The rustic natural tone finish enhances the slatted, wingback style headboard and emphasizes each drawer panel. Easily store added belongings within the footboard storage drawers to save floor and closet space. Matching case goods are each equipped with ball bearing metal glides and felt-lined top drawers.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7576dr.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:08:30"},
  {id: 177, name: "Fromberg Bed", number: nil, price: nil, description: "The bold look of this collection boasts an elegantly traditional design. A tall camelback headboard with button tufted leatherette upholstery is in the perfect contrast to the sleigh style footboard. Matching case goods feature genuine marble tops, felt-lined top drawers and full extension metal glides. Set atop bun feet, you", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7670.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:08:32"},
  {id: 184, name: "Janine Bed", number: nil, price: nil, description: "The biscuit-style, padded leatherette headboard is the standout feature of this transitional bedroom suite finished in espresso. Matching case goods have generous storage and are accented with silver hardware.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7868.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:20:40"},
  {id: 179, name: "Noella Bed", number: nil, price: nil, description: "Add bold and beautiful coloring to your bedroom in the form of these gorgeous bed options! Equipped with slat kits, this padded fabric bed is available in three eye-catching colors, each of which enhance the scrolled sleigh structure and deep button tufting. The delicate curved design is accented with crystal-like acrylic buttons and trailed by shined nailhead trim.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7128pr.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:08:42"},
  {id: 180, name: "Edinburgh Bed", number: nil, price: nil, description: "A traditional design with a modern twist, this bedroom collection can be paired with either of the two platform bed options. A tall camelback headboard is upholstered in padded faux leather, complete with deep tufted detailing. Paired case goods feature intricate wood carvings and are fitted with full extensions metal glides, felt-lined top drawers and antique look drawer pull handles. Two footboard options available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7671.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:08:49"},
  {id: 181, name: "Snyder Bed", number: nil, price: nil, description: "Gorgeous lines and sleek bases give this bedroom furniture a distinctive contemporary edge. With a panel headboard with a low profile footboard, this transitional style bed adds modern comfort and structure to any bedroom settings.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7792ex.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:20:13"},
  {id: 182, name: "Riana Bed", number: nil, price: nil, description: "If you're drawn to works of art or unique fixtures, this one-of-a-kind platform bed is fit for your home. The antique coloring brushed along the ornamental accents creates an unusual atmosphere that accentuates the full metal construction. Entirely finished in powder coated black, this bed is appropriate for any bedroom setting.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7733.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:20:24"},
  {id: 183, name: "Bairro Bed", number: nil, price: nil, description: "After the decision has been made to update your bedroom, choose to try something totally new. This platform bed showcases a unique design with its chunky wood block legs and extended panel headboard. With matching case goods equipped with easy pull metal glides, this set provides ample storage along with exclusive style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7250.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:20:31"},
  {id: 188, name: "Barney Bed", number: nil, price: nil, description: "Five versatile colors, three comfortable sizes, one timeless design. These platform beds each feature smooth and inviting flannelette upholstery that allows the striking color options to make a statement. Curved corners, button accents and angled legs work together to add a touch of mid-century modern to the setting.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7272nv.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:29:50"},
  {id: 189, name: "Janeiro Bed", number: nil, price: nil, description: "Visually appealing with urban undertones, this wooden collection is perfect for open spaces such as lofts. A low-profile head and base design with natural wood grain patterns create a comfortable appeal. The case goods include wooden block-like pulls that are sure to coordinate well with diverse interior designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7628.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:30:12"},
  {id: 190, name: "Johara Bed", number: nil, price: nil, description: "You may not have been born royalty but, with this gorgeous bedroom set, you'll be falling asleep in the lap of luxury every night! Boasting beautifully carved wooden details, the upholstered bed showcases a flared structure, complete with eye-catching button tufted accents. Matching case goods complement the fanciful bed with coordinating decorative accents and antique-inspired hardware drawer pulls.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7090.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:30:32"},
