  {id: 192, name: "Alver Bed", number: nil, price: nil, description: "Express yourself with this classy and flashy bedroom set sporting ridge-textured front panels and complementary silver-finished reflective borders. Simple, straight lines paired with a sleek black finish will be sure to transform any mundane room into an exciting environment with just enough flair.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7886.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:31:41"},
  {id: 978, name: "University Twin XL Trundlew/3 Drawers", number: nil, price: nil, description: "Twin XL trundle and built-in roomy drawers add extra space and comfort to any bedroom.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk458q-ctr-exp.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-27 01:31:33"},
  {id: 193, name: "Enid Bed", number: nil, price: nil, description: "Update your bedroom with elegant styles portrayed by this beautiful bed set. A slight curved panel enhances the padded faux leather headboard while accented with diamond tufted detailing. It's the perfect collection for adding sophistication to your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7430.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:31:47"},
  {id: 194, name: "Chanelle Bed", number: nil, price: nil, description: "Upscale your bedroom with this tall and sophisticated platform bed. Gorgeous button tufting enhances the light fabric upholstery while nailhead trim and espresso finished wood paneling draws attention to the wrapped structure. The beautiful two-toned design makes it easy to pair with the case goods of your choice.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7210.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:31:55"},
  {id: 195, name: "Briella Bed", number: nil, price: nil, description: "This platform style bed features a padded fabric headboard adorned with beautiful button-tufted accents and top panel mirror inserts. The low profile footboard, as well as the drawer fronts, feature sandblasted panels. Coordinating case goods complete with top panel mirror inserts are equipped with easy pull metal glides and gorgeous crystal-like drawer pull handles.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7101.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:32:10"},
  {id: 197, name: "Barney Bed", number: nil, price: nil, description: "Five versatile colors, three comfortable sizes, one timeless design. These platform beds each feature smooth and inviting flannelette upholstery that allows the striking color options to make a statement. Curved corners, button accents and angled legs work together to add a touch of mid-century modern to the setting.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7272bg.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:33:16"},
  {id: 185, name: "Jania Bed", number: nil, price: nil, description: "Add an enchanting atmosphere to any bedroom with this stylized metal bed. The lifted structure showcases a matching headboard and footboard with arched tubing and ornate scroll detailing. Metal construction ensures this bed stays durable and steady while smooth powder coating preserves the classic color.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7709bk.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:20:44"},
  {id: 186, name: "Coimbra Bed", number: nil, price: nil, description: "This transitional collection will be the perfect addition to any home looking to revamp their interior decor. The low profile bed features a plank style headboard to enhance the wooden construction while all items feature a flat sturdy base with darker toned paneling, creating a unifying visual.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7623.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:20:59"},
  {id: 199, name: "Noemi Bed", number: nil, price: nil, description: "Boldly fashioned with a completely upholstered exterior, this sleigh bed provides a comforting twist to traditional designs. The gorgeous curvatures are emphasized by nailhead trim detailing along the sides and entrancing button tufting along the inner areas. The corduroy fabric is beautifully styled with a Mocha color to add both warmth and lightheartedness to any bedroom.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7127.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:33:39"},
  {id: 200, name: "Clementine Bed", number: nil, price: nil, description: "Furnish your bedroom with this stylish bedroom collection for a contemporary look. Taking glam styles into consideration, these pieces are clean-cut and awe-inspiring. This set features a smooth white finish with attached chrome legs that resonate with the style of modern decor. To amp up the appeal, the button tufted leatherette headboard offers LED light paneling along the frame to create a stylish setting.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7201.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:33:46"},
  {id: 201, name: "Zelina Bed", number: nil, price: nil, description: "For the modern enthusiast, this curvaceous platform bed is a unique addition to any bedroom. Completely upholstered in smooth leatherette, the stylized structure utilizes the two-tone black and white to enhance the flow and appearance of movement. As the headboard gracefully rises, the frame itself easily keeps any mattress in place.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7125.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:34:36"},
  {id: 202, name: "Bellanova Bed", number: nil, price: nil, description: "Specifically designed to accentuate a glamorous feel, this bedroom collection brings a combination of class and contemporary style to your bedroom. Crocodile embossed veneer and silver lining panels stand out throughout every piece while the button tufted headboard adds a charming effect. The headboard has built-in LED lights to illuminate the mood.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7979bk.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:34:45"},
  {id: 203, name: "Cecilia Bed", number: nil, price: nil, description: "Charming and delightful, this beautiful bed upholds a soft femininity. Slender metal posts support the delicately arched camelback design and feature floral embellishments for added appeal. This stylish bed is the perfect piece to add that special finishing touch to your bedroom.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7731.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:35:09"},
  {id: 204, name: "Louis Philippe Iii Bed", number: nil, price: nil, description: "Style your master bedroom however you like with this classic collection, featuring a sleigh bed design with matching multi-storage case goods, all with an identical black finish. The nightstand, chest and dresser allow you to store clothes, bedding and any other items. Bring a unique taste to your bedroom while creating a relaxing and stylish environment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7866bk_1.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:35:18"},
  {id: 205, name: "Elkton Bed", number: nil, price: nil, description: "Add some depth and dimension to your bedroom area with this nature-themed collection. A cabin-like inspiration is evident throughout these bedroom pieces with its natural wood grain finish. The case goods allow for storage of bedroom items paired with the matching headboard that features built-in shelves, continuing the theme of convenience and style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7072.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:35:23"},
