  {id: 242, name: "Rabia Bed", number: nil, price: nil, description: "This contemporary style platform bed showcases a classic look at an unbeatable value. The bed body features a sturdy wooden construction, tightly upholstered in rich leatherette with decorative stitching accents. The profile sits low to the floor, eliminating the need for a boxspring. Includes 26-piece slat kit that provides mattress support. Available in black and white leatherette fabric.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7708bk.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:35:45"},
