  {id: 268, name: "Rabia Bed", number: nil, price: nil, description: "This contemporary style platform bed showcases a classic look at an unbeatable value. The bed body features a sturdy wooden construction, tightly upholstered in rich leatherette with decorative stitching accents. The profile sits low to the floor, eliminating the need for a boxspring. Includes 26-piece slat kit that provides mattress support. Available in black and white leatherette fabric.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7708bk.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:33:54"},
  {id: 269, name: "Mandura Bed", number: nil, price: nil, description: "Intricate accents give this English style bedroom set a unique personality. The bed", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7260.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:33:58"},
  {id: 270, name: "Eola Bed", number: nil, price: nil, description: "Outfit your master bedroom with this bold and elegant suite. Louver design headboard and footboard give this bed an understated yet confident look. The matching case goods have full extension drawers with the top ones lined with felt. Unique square brass pulls add to this collection with walnut finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7981.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:34:01"},
  {id: 271, name: "Robles Bed", number: nil, price: nil, description: "This modern bedroom suite feature a European style slat kit bed with a two-tone black and white design. A solid black leatherette centerpiece with a white border adorns the headboard and footboard, while the matching case goods feature recessed pull handles and the same two-tone scheme.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7293.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:34:04"},
  {id: 272, name: "Darius Bed", number: nil, price: nil, description: "What sets this bedroom group apart is its novel louver design. The headboard and footboard feature contrasting straight lines and sweeping arches that offer a timeless transitional look. Case goods come with full extension drawers and feltlined top drawers, all in beautiful antique walnut finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7366.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:34:07"},
  {id: 273, name: "Maynard Bed", number: nil, price: nil, description: "Contemporary in style, this sleigh bed functions as the centerpiece of this stylish set. Fully upholstered in either black or white padded leatherette, the bed features an English style headboard. Along with case goods finished in espresso or white, this set will bring both comfort and style to any sleeping space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7947ex.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:34:13"},
  {id: 274, name: "Monte Vista II Bed", number: nil, price: nil, description: "If luxury is what you are looking for, look no further. This bedroom set couples the extravagance of canopy bed posts with the elegance of buttontufted, padded leatherette headboard and footboard. Choose between ivory or dark brown to complement the brown cherry finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7296la-c.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:03:53"},
  {id: 275, name: "Fontes Bed", number: nil, price: nil, description: "Sleek contemporary design is the hallmark of this bedroom set. Button tuftings provide a perfect focus on the wingback headboard. Made of padded linen-like fabric, the bed is available in either gray or ivory.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7050gy.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:04:08"},
  {id: 276, name: "Golva Bed", number: nil, price: nil, description: "Luxury and contemporary collides in this spectacular bedroom set. The padded leatherette headboard is in pewter and the matching case goods feature gold-tinted mirror front panels that give the illusion of depth. The result is a much roomier and more welcoming space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7295.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:04:13"},
  {id: 277, name: "Delphie Bed", number: nil, price: nil, description: "Smooth, flowing lines define this elegant bed. A wingback headboard curves gently into the edges, dipping into a low profile before sweeping back up and connecting with the footboard. This gives the bed a unique wavy look when viewed from the side. Available with matching case goods in white or black.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7999wh.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:04:27"},
  {id: 278, name: "Gerico II Bed", number: nil, price: nil, description: "Sleek and modern, this bedroom set offers a package of features that you will want in your bedroom. It has bookcase headboard with lights for bedtime reading and two extra drawers in the footboad for more storage. As a platform bed, it is mattress-ready and available in either brown cherry or espresso finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7291ch.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:04:32"},
  {id: 279, name: "Hendrik Bed", number: nil, price: nil, description: "Make a bold and loud statement in your bedroom! This rather simple-looking bed is equipped with two bluetooth speakers on both sides of the headboard. Wirelessly connect your MP3 player and blast your favorite songs! The bed is mattress-ready and comes in either espresso or camel color.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7057_1.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:04:46"},
