  {id: 289, name: "Hendrik Bed", number: nil, price: nil, description: "Make a bold and loud statement in your bedroom! This rather simple-looking bed is equipped with two bluetooth speakers on both sides of the headboard. Wirelessly connect your MP3 player and blast your favorite songs! The bed is mattress-ready and comes in either espresso or camel color.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7057_1.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:43:55"},
  {id: 290, name: "Dillan Bed", number: nil, price: nil, description: "With the choice of gray or ivory, this padded fabric platform bed will fit into any contemporary home. Music capabilities are also onboard, with two speakers on both side of the headboard that can be controlled wirelessly through a bluetooth device.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7060gy.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:44:41"},
  {id: 291, name: "Sycamore Bed", number: nil, price: nil, description: "Feel the country vibe in this bedroom set! Coarse wood grain gives the bed a pleasant texture that is nice to the touch, while the metal accents on the headboard and mirror adds to its rustic beauty. Finished in antique dark oak.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7983.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:45:01"},
  {id: 292, name: "Rutger Bed", number: nil, price: nil, description: "The stark contrast between black and white in this unique bedroom set provides a proper backdrop to the modern feel the set aims to invoke. Straight, sharp lines dominate the headboard and footboard, as well as the front panels of the drawers. Case goods lack any latch or knob, but instead has recessed pulls that act as handles.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7292.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:45:07"},
  {id: 293, name: "Alcazar Bed", number: nil, price: nil, description: "From the padded headboard to the tops of the case goods, unique slate inserts give this bedroom set its own character. Slates feature beautiful natural colors that perfectly complement the brown cherry finish. The night stand has a unique three-drawer look that when opened, reveals a felt-lined top drawer and a larger bottom drawer.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7985.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:45:12"},
  {id: 294, name: "Marisko Bed", number: nil, price: nil, description: "Fully upholstered in taupe fabric, this elegant bed features a camelback shaped padded headboard with nailhead trim. Button-tufting create a visually plush facet for the semi-wingback headboard. The contrasting case goods showcasing a unique tiered design are finished in es presso.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7161.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:45:34"},
  {id: 295, name: "Monte Vista I Bed", number: nil, price: nil, description: "Elegance is the first thing that comes to mind upon seeing this set. Floral accents adorn the oval headboard and footboard with a padded, button-tufted centerpiece. Opt for a striking contrast with ivory leatherette, or choose the matching dark brown leatherette for a more harmonious feel. Finished in brown cherry.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7296la.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:45:39"},
  {id: 296, name: "Villa Park Bed", number: nil, price: nil, description: "A sleek modern vibe fused with the relaxing warmth of the leatherette headboard will create a casual yet sophisticated look. There is generous storage in all the matching case goods, which are accented with brushed nickel knobs. A twin size bed is also available with its own set of kids' case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7007.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:45:47"},
  {id: 281, name: "Eola Bed", number: nil, price: nil, description: "Outfit your master bedroom with this bold and elegant suite. Louver design headboard and footboard give this bed an understated yet confident look. The matching case goods have full extension drawers with the top ones lined with felt. Unique square brass pulls add to this collection with walnut finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7981.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:05:07"},
  {id: 282, name: "Leeroy Bed", number: nil, price: nil, description: "Create a simple yet inviting atmosphere in your bedroom with this contemporary bedroom set. The platform bed is fully upholstered fabric and available in two colors: gray or ivory. A padded, button-tufted headboard adds elegance and warmth to this beautiful set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7200lb.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:05:13"},
  {id: 297, name: "Yorkville Bed", number: nil, price: nil, description: "Designed with a contemporary lifestyle in mind, this set features the convenience of sleek and functional extra storage in both the bookcase headboard and footboard. The smooth espresso finish of the solid woods and veneer adds to the updated design and will be the centerpiece of your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7059.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:03"},
  {id: 299, name: "Esperia Bed", number: nil, price: nil, description: "Transitional styling with simple elegant lines that will create a warm and inviting feeling to your bedroom. Little extras like a felt-lined top drawers, slat kit and the smooth silky dark walnut finish make this bedroom suite a stylish addition to your most personal space at home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7503.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:10"},
  {id: 300, name: "Corry Bed", number: nil, price: nil, description: "Finished in dark walnut, this classic bedroom set has a graceful sleigh bed. The matching night stand, dresser and chest are accented with antique brass hardware.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7923ex.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:14"},
  {id: 301, name: "Tuscan II Bed", number: nil, price: nil, description: "Complement your room with the gentle curves of this classic bedroom set. Beautiful blunt arrow feet and sleek round finials adorn the bed. The romantic setting is further enhanced by the glossy dark pine finish, decorative headboard and the unique tri-fold mirror.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7571.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:17"},
  {id: 302, name: "Crest View Bed", number: nil, price: nil, description: "The contemporary lines of this bedroom set are accented with solid wood framing around the padded leatherette headboard. The matching chest, dresser and night stand have silver hand pulls.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7599.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:21"},
  {id: 303, name: "Bristol Bed", number: nil, price: nil, description: "The dynamic crown padded headboard in espresso leatherette is the standout feature of this transitional bedroom suite. Matching night stand, dresser and chest have generous storage and are accented with silver hardware.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7686.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:30"},
  {id: 314, name: "Mercer Bed", number: nil, price: nil, description: "Finished in brown cherry, this padded fabric headboard is accented with metal nail heads for a unique look. Matching dresser, chest and night stand have a sleek modern design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7333.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:05:57"},
  {id: 304, name: "Carlsbad Bed", number: nil, price: nil, description: "Sweeping curves and traditional styling of this bedroom suite are accented with classic silver toned hardware. The bed, which comes in either a low profile or a four-post design, is finished in dark cherry for a regal look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7310l.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:33"},
  {id: 305, name: "Milano Bed", number: nil, price: nil, description: "Modern sleek design is the hallmark of the Milano group. Available in five sizes, extras include a slat kit and French dovetail drawers. The deep espresso finish is highlighted with brushed nickel pulls and the updated bombe style case goods complement this modern look. Crafted with solid woods and wood veneer.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7805.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:47:07"},
  {id: 306, name: "Laguna Hills Bed", number: nil, price: nil, description: "The great style and appeal of leatherette is accented with a nailhead trim. The sleek black finish adds elegance to any bedroom, while the modern style platform bed has an extra bonus of added storage in the footboard. Case goods have unique chrome handles.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7652l.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:47:31"},
  {id: 307, name: "Penbroke Bed", number: nil, price: nil, description: "Elegant carvings in a deepbrown cherry finish are hallmarks to this exquisite formal bedroom suite. The sleigh bed has a carved headboard and footboard. Each matching case goods contain antique brass hardware as well as elegant carved accents.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7270.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:05:17"},
  {id: 308, name: "Louis Philippe III Bed", number: nil, price: nil, description: "Finished in deep espresso or warm cherry, this classic bedroom set has a graceful sleigh bed. The matching night stand, dresser and chest all have bracket feet and are accented with antique brass hardware.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7816ex.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:05:23"},
  {id: 309, name: "Brooklyn Bed", number: nil, price: nil, description: "The simple design, clean lines and the beautiful espresso finish allows the Brooklyn set to blend easily with other styles in your home. Brushed nickel knobs accent the modern curves of the chest, dresser and night stand. The bookcase headboard and media chest provide the extra storage that we all love.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7053.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:05:30"},
  {id: 310, name: "Concord Bed", number: nil, price: nil, description: "Finished in rich dark espresso, this ultra-sleek contemporary style bedroom suite is a unique addition to any home. Enjoy the style and comfort of the button tufted leatherette headboard and padded platform bed. The matching case goods provide plenty of storage and complete the look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7011.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:05:35"},
