  {id: 354, name: "Schoten Counter Ht. Table", number: nil, price: nil, description: "Liven your dining room with the uniquely crafted counter-height table set. The square table features curved and flared corner construction while the celestite mineral top pairs with the antique dark oak finish to enhance the deep blue hues. Warming ivory linen-like fabric accentuates the button tufted chairs while dense foam cushions and leg rests provide undisputed comfort to keep you happily relaxed. Differentiate your dining room with the exclusive mineral top and rustic tones of this transitional style counter-height dining set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3450pt-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:35:38"},
  {id: 567, name: "Emmons I Dining Table", number: nil, price: nil, description: "A contemporary dining piece, this table features a rectangular tabletop with an 18-inch expandable leaf. The side chairs complement perfectly, with their padded leatherette seats and backs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3910t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 23:42:54"},
  {id: 355, name: "Mariam Dining Table", number: nil, price: nil, description: "Immerse your dining room with the simplicity and grace of this multi-tone dining set. Soft grey upholstery wraps the smooth rounded chairs and tapered legs peak with a sleek black finish. Dine comfortably with the spacious wire-brushed top that warms with its oak finish. Bold post legs embolden in black as the dark finish runs elegantly along the table apron. Distinctively contrasted and impeccably paired, this dining set will create a timeless dining room that never loses style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3375t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:35:47"},
  {id: 356, name: "Kristie 5Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Simple yet striking, this counter height set features a unique table that will have guests impressed at first sight. The warm brown cherry finish enhances the solid wood construction while the light fabric cushions provide a fun contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3314pt-5pk-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:36:03"},
  {id: 358, name: "Lilah Stainless Folding Table", number: nil, price: nil, description: "Perfect for an intimate two-person meal, this cozy setup is a sleek and stylish choice for your home! Featuring an X-base with slatted seats that fold, this modest design features bold aesthetics that delivers a sturdy base to support the square tabletop. Take a seat on one of the slatted seats with a special someone to make every evening meal a memorable event!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3506t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:36:28"},
  {id: 360, name: "Gloria 6 Pc. Dining Table Set", number: nil, price: nil, description: "Diverge from tradition and create a calming tone with this gray finished dining set. Ladderback chairs are airy and breathable with smooth cushioned leatherette that complements for a soothing touch. The bench provides a unique seating experience, offering comfortable seating for multiple guests. Tapered legs add stylish detail to the table and the overhanging top maximizes space to accommodate a room full of guests. Create lasting impressions with the sophisticated finish and airy ambiance that this dining set ensures.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3331gy-t-6pk-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:37:01"},
  {id: 361, name: "Alena Dining Table", number: nil, price: nil, description: "Shine and polish your dining room for pure glamour. Tempered glass and mirrored panels create a sophisticated elegance while the silver finish molds the details together for a luxurious dining set. Light up your prized collectibles in the glass-encased curio while the bar table provides a convenient space to concoct the perfect cocktail and store all your barware. Rest upon tufted leatherette chairs and sink into soothing comfort with its dense foam cushions. The expansive table completes the set, offering spacious room for six and carved tapered legs that steadily support the design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3452t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:37:29"},
  {id: 362, name: "Grace Dining Table", number: nil, price: nil, description: "Spark conversation with this glistening chrome brushed dining set. The tempered glass table appears slick as liquid as it rests steadily atop the flared supports. Chairs add a sophisticated touch with smooth ribbed design and sleek leatherette. Relax in deep pockets of comfort while foam cushions provide lasting support. Sharp and stylish, create an inspired dining experience with the intricate angles and gleaming chrome accents that define this set. Chairs are available in two color options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3170t-3380bk-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:38:07"},
  {id: 363, name: "Kathryn Round Dining Table", number: nil, price: nil, description: "Create a sleek and appealing dining space by adding one of the many variations of this collection to your space! Elegantly turned legs or a wide pedestal add unique dimension to the design and infuse the table with traditional flair. Complete with linen-like upholstered seats for extra comfort, this chic collection will make your family wait eagerly for the next family meal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3872wh-rt-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:38:15"},
  {id: 364, name: "Liliana 5 Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Captivate with this bold two-tone counter-height dining set. Clean cut-out accents define the ladderback chairs and contoured seats ensure lasting comfort. Walnut finish adds sleek detail to the table, contrasting the white finished base and highlighting its flowing apron and sturdy legs. Matching pieces complement each other in perfectly unity, creating a polished dining room with intricate contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3107pt-5pk-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:38:31"},
  {id: 365, name: "Dulce Dining Table", number: nil, price: nil, description: "Recreate the feeling of the great outdoors with this industrial inspired dining set. Live edge accents create a natural woodsy feel with sophisticated texture that catches light along sides of the table and bench. Ladder back chairs are rich and rustic, offering uncompromised comfort with angled back rests while the wooden bench provides versatile seating with its smooth wooden seat and distinguished chain-link detail. With bold U-shaped supports and mimicking chain-links, the dining table completes with spacious room for six and a balanced walnut finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3604t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:38:49"},
  {id: 366, name: "Miriam Dining Table", number: nil, price: nil, description: "Simplify your dining room with clean lines and sheer sophistication. White finishes brighten and polish this dining set, creating a chic upscale ambiance. Clear tempered glass stuns as it rests atop the table and easily expands to seat a house full of guests. Smooth leatherette flows down the soft cushioned chairs and pointed legs are brushed with silver powder coating. Spruce up your dining room for a minimalistic aesthetic that delivers a powerful statement.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3383wh-t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:38:56"},
