  {id: 368, name: "Julia Round Dining Table", number: nil, price: nil, description: "#N/A", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3014rt-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:39:10"},
  {id: 632, name: "Brent Dining Table", number: nil, price: nil, description: "Simplistic design carefully accented with just the touch of modern flare. Crafted with a sleek eye-catching table base and designed in two height sizes. Available in two table top styles.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3984w-t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 00:09:54"},
  {id: 369, name: "Chandler 5 Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Distinguish your dining room with this dark toned dining set. Dark oak finishes feature rustic tones that add rich character to the clean designs. The rounded table offers plenty of space for food and drinks while solid legs taper for sound support. Comforting leatherette tightly wraps the cushioned chairs and slat backs provide a breathable back rest. Welcome this dining set for sophistication and unparalleled refinment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3173pt-5pk-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:39:25"},
  {id: 603, name: "DESCANSO Dining Table", number: nil, price: nil, description: "A unique table with cross-leg base gives this dining group its own personality. The same design is reflected on the chair backs, which also feature turned finials. Matching hutch and buffet with multiple shelves accomodate the needs of any wine enthusiast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_523.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 23:36:30"},
  {id: 379, name: "Gloria 5Pc .Counter Ht. Table Set", number: nil, price: nil, description: "Dine with this gorgeously gray counter-height dining set. The table is well-stated with an airy open bottom and sleek square top that overhangs for expansive table space. Relax on comfortably cushioned seats and soothe your senses with the smooth leatherette. Arched ladder backs and sleek leg rests provide additional support, ensuring uninterrupted comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3331gy-pt-5pk-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:55:26"},
  {id: 380, name: "Fran Dining Table", number: nil, price: nil, description: "Tall, dark and handsome has a new meaning thanks to this daring two-tone dining set. Warm wood veneer is balanced as sand black coloring add sleek finishes to the metal framework. The pipe-inspired design adds edgy industrial tones while hand-painted  copper delivers a rustic touch. Rest easy on the curved back chairs and kick your legs up for additional comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3373rt-1.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:55:33"},
  {id: 381, name: "Lela Dining Table", number: nil, price: nil, description: "This industrial-inspired dining set is a great addition to any restoration-decorated space. The metal legs and chair frames contrast beautifully with the wooden table top and seat. Tapering legs sturdily uphold the entire piece while adding a touch of modern eccentricity.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3529gy-t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:55:39"},
  {id: 370, name: "Kirstin Dining Table", number: nil, price: nil, description: "This striking industrial styled dining table brings some real character to your home decor. Immediately the eyes are drawn to the large metal supports styled after shaped steel beams. The antique oak finish meshes effortlessly with legs to make a beautiful lifted table where you can host all the big meals.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3573t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 23:36:35"},
  {id: 371, name: "Juniper Round Dining Table", number: nil, price: nil, description: "Keep your dining space sleek and simple with this stylish and attractive round table dining set! Between the smooth round table design and angular legs, this transitional table provides a sophisticated visual while also offering a convenient place to store items on the lower shelf. Lean back and relax against the ladderback chairs, enjoying the comfy feeling of the padded fabric seat as you and your family get ready for a meal together.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3162rt-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 23:36:40"},
  {id: 372, name: "Jenessa Counter Ht. Table", number: nil, price: nil, description: "Texturize your dining room with this louver inspired dining set. Clear glass shows subtle textures as it accentuates the spacious dining table. Ribbed chairs come upholstered in smooth leatherette and soft cushions will keep you comfortably relaxed. Finished in espresso, the set delivers deep dark tones to focus your dining room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3820pt-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 23:36:49"},
  {id: 373, name: "Roeselare Dining Table", number: nil, price: nil, description: "Dine in luxury while the rustic style and wire-brushed gray finish take you on a journey to the countryside. This dining set is crafted with luxurious turned legs and an expandable table that pleasantly seats guests for a roomy dining space. The bench and framed nailhead chairs keep you comfortably seated with soft linen upholstery and deep cushioned foam. Have dining essentials conveniently on hand with roomy cabinets, easy slide out drawers and a top felt-lined compartment that the spacious server delivers. Simplify your dining room with the rustic style versatile design of the wire-brushed gray dining set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3455t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 23:36:55"},
  {id: 374, name: "Fafnir 5 Pc. Dining Table Set", number: nil, price: nil, description: "Be bold and daring with this dining set. Slat chairs are distinguished by an airy back design that welcomes natural light. Cushioned seats are upholstered in a warming fabric, creating soft contrast that emboldens the finish. Solid legs create clean lines and the spacious top provides plenty of room for everyone. Redefine with the two-tone dining set that delivers clean lines and sharp contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3607ex-t-5pk-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 23:37:49"},
  {id: 375, name: "Siobhan II Dining Table", number: nil, price: nil, description: "Create a sleek and appealing dining space by adding one of the many variations of this collection to your space! Elegantly turned legs or a wide pedestal add unique dimension to the design and infuse the table with traditional flair. Complete with linen-like upholstered seats for extra comfort, this chic collection will make your family wait eagerly for the next family meal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3872t-3874a-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:37:53"},
  {id: 376, name: "Helene Dining Table", number: nil, price: nil, description: "Chic meets sleek with this daring pipe inspired dining set. The clear tempered glass rests beautifully while silver powder coating adds shine to the industrious base. Two-toned chairs create a uniform look with matching legs and round leg rests. Warm veneer seats pair with the rounded backs, providing comfort for hours on end. With industrious accents and glamorous shine, this dining set provides the ultimate balance of edgy and luxurious.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3378rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:38:47"},
