  {id: 386, name: "Alpena Round Dining Table", number: nil, price: nil, description: "Shine up your silverware, bring out the glassware and get ready for the dinner party of the century with this glorious, traditional style dining table. The ornate pedestal base provides the perfect structure for the crisscross patterned table top that, with its wide circular space, can fit all the friends and family you can imagine. Paired with upholstered chairs featuring espresso leatherette, rope-like trim and elegant carved legs, this table showcases your exquisite taste with a bold and impressive presence! Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3350rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:57:29"},
  {id: 387, name: "Kirstin Counter Ht. Table", number: nil, price: nil, description: "With room for the entire family to sit down and enjoy a meal, this spacious table and chairs set perfectly combines rustic and contemporary elements into a chic dining set! The fabric chairs come with nailhead trim for extra visual appeal to complement the square table's minimalistic appearance. A distressed finish adds the finishing touch to this sophisticated design, providing an inviting ambiance for your dining space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3573pt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:57:37"},
  {id: 388, name: "Schoten Dining Table", number: nil, price: nil, description: "This celestite mineral table top becomes the focal point as it brinsg the beauty and intricacy of natural elements to your dining set. The flared corner construction delivers soft curves while the mineral top brings sophisticated hues of blue to compliment the antique mango finish. Brightening ivory linen fabric pulls attention to the button tufted chairs while dense foam cushions provide undisputed comfort to keep you happily relaxed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3450t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:57:44"},
  {id: 389, name: "Kristie 5Pc. Dining Table Set", number: nil, price: nil, description: "Distinguish your dining room with this dark toned dining set. Dark oak finishes feature rustic tones that add rich character to the clean designs. The rounded table offers plenty of space for food and drinks while solid legs taper for sound support. Comforting leatherette tightly wraps the cushioned chairs and slat backs provide a breathable back rest. Welcome this dining set for sophistication and unparalleled refinment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3314pt-5pk-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:58:31"},
  {id: 390, name: "Lucie Dining Table", number: nil, price: nil, description: "Shine and polish your dining room for pure glamour. Tempered glass and mirrored panels create a sophisticated elegance while the silver finish molds the details together for a luxurious dining curio cabinet. Light up your prized collectibles in the glass-encased curio.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3788t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:58:37"},
  {id: 391, name: "Izzy Dining Table", number: nil, price: nil, description: "Rediscover sophistication with this simplistically sleek dining set. Glass pieces cover the dining table and welcome light for a clean, brightened aesthetic. Chrome brushed accents shine along the tempered glass top and completes the base for a polished look. Sleek leatherette chairs are comfortably cushioned while peg style legs add character and flare. Gather round and welcome new memories with this dashing dining set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3384rt-wh-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:58:48"},
  {id: 392, name: "Nembus Dining Table", number: nil, price: nil, description: "With a clean contemporary look and sophisticated silhouette, this dining collection brings with it the chic presence your home deserves! The long tabletop provides plenty of room to accommodate multiple people while the elegant turned legs add a sophisticated element that provides plenty of support. The accompanying chairs features button tufting along the backrest while the reverse side boasts a stylish nailhead trim, bringing a classy look to both the front and back of each seat that will make your guests admire your modish tastes!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3161t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:58:53"},
  {id: 393, name: "Banbury 7Pc. Dining Table Set", number: nil, price: nil, description: "Nothing blends distinctive style with convenient comfort quite like this industrial table set. Combining sturdy metal with light wood tones, this table showcases sleek rounded corners supported by unique triple-bar legs. The weathered seats of the chairs complement the design and add contrast to the dark metal frame. Ideal for family meals, this table set showcases casual comfort and reliable support to last for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3279t-60-7pk-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:59:45"},
  {id: 394, name: "Echo Dining Table", number: nil, price: nil, description: "Dine in style with this fabulous Antique Gold finished dining set. Antique mirrors accent the set, adding soft reflections that glimmer in natural light. Cushioned chairs are elegantly detailed with nailhead trim and single tufted accents. Dazzle with the geometrically designed mirror and easily organize dinnerware with the dining server. Intricate and opulent, this dining set provides comfortable seating with an expandable leaf that ensures plenty of space for everyone.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3980t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:59:50"},
  {id: 396, name: "Kathryn Round Dining Table", number: nil, price: nil, description: "Create a sleek and appealing dining space by adding one of the many variations of this collection to your space! Elegantly turned legs or a wide pedestal add unique dimension to the design and infuse the table with traditional flair. Complete with linen-like upholstered seats for extra comfort, this chic collection will make your family wait eagerly for the next family meal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3872dg-rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:39:22"},
  {id: 397, name: "Fafnir 5 Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Be bold and daring with this counter-height dining set. Slat chairs are distinguished by an airy back design that welcomes natural light. Cushioned seats are upholstered in a warming fabric, creating soft contrast that emboldens the finish. Solid legs create clean lines and the spacious top provides plenty of room for everyone. Redefine with the two-tone dining set that delivers clean lines and sharp contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3607pt-5pk-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:39:32"},
  {id: 398, name: "Marybeth Dining Table", number: nil, price: nil, description: "Characterize your dining room with this rustic industrial dining set. Bolt accents add bold detail to the ladder back chairs and vibrant upholstery creates warming accents. The wooden bench flares with angled legs and its sleek wooden seats offer soothing comfort. Tied together with a spacious wooden table, the set blends beautifully in your home. The airy table base welcome natural light and splayed legs create visual intrigue that leaves your dining room with a tempting allure.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3572t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:39:37"},
  {id: 399, name: "Reidar Round Dining Table", number: nil, price: nil, description: "Combine sophisticated elegance with contemporary elements to create the perfect dining room setting! The sleek curving legs arc toward the floor before meeting in an X-shape beneath the table for extra sturdiness. Each of the accompanying chairs features faux leather upholstery with stylish diamond tufting across the backrest and seat, adding visual appeal to the padded comfort of the dining set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3651rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:39:45"},
  {id: 400, name: "Siobhan II Dining Table", number: nil, price: nil, description: "Create a sleek and appealing dining space by adding one of the many variations of this collection to your space! Elegantly turned legs or a wide pedestal add unique dimension to the design and infuse the table with traditional flair. Complete with linen-like upholstered seats for extra comfort, this chic collection will make your family wait eagerly for the next family meal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3872wh-t-3874wh-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:39:51"},
  {id: 401, name: "Fafnir 7 Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Be bold and daring with this counter-height dining set. Slat chairs are distinguished by an airy back design that welcomes natural light. Cushioned seats are upholstered in a warming fabric, creating soft contrast that emboldens the finish. Solid legs create clean lines and the spacious top provides plenty of room for everyone. Redefine with the two-tone dining set that delivers clean lines and sharp contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3607ex-pt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:40:02"},
  {id: 402, name: "Leann Dining Table", number: nil, price: nil, description: "Dark metal and warm wood tones redefine industrial design with this exquisite dining set. The roomy wood table is rounded along the sides and contrasts the edgy metal base with its live edge design. Ladder back chairs keep you comfortably entertained while bold legs highlight its sleek wooden seat. Share a seat on the spacious wooden bench that adds to the industrious flare with archaic metal legs. Indulge and redefine with the rich tones and dark accents that this dining set delivers.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3601t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:40:07"},
  {id: 403, name: "Kochab Oval Dining Table", number: nil, price: nil, description: "Flared legs and perfect simplicity define this mid-century modern dining set. Lean back on rounded back chairs and enjoy a hearty meal with comfort. Soothing grey fabric delivers a soft touch to the chairs and angled backs ensure proper support. Splayed legs add character to the dining table, providing focus and light tones to warm your dining room. Available in round or oval dining table sets to fit your particular style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3876ot-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:40:15"},
  {id: 404, name: "Kaitlin Dining Table", number: nil, price: nil, description: "Stunning nailhead accents bring extra appeal to this transitional dining set, creating the perfect setting for a warm and inviting meal. The spacious tabletop ensures there ample space to lay out place settings while the lower shelf offers room for display and storage. The linen upholstery of the chairs offers added comfort to the design to provide extra enjoyment to the experience. With its long curved legs and detailed wood grain, this table works in tandem with the chairs to easily fit for your transitional dining space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3323t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:40:19"},
  {id: 405, name: "Kaitlin Round Counter Ht. Table", number: nil, price: nil, description: "Stylish nailhead accents bring extra appeal to the table and chairs of this counter height set, helping to create the perfect setting for a warm and inviting meal. The round tabletop ensures there is ample space to lay out any place settings while the lower shelf offers extra space for display and storage. The linen upholstery of the chairs offers even more comfort to the design and overall experience. With its long curved legs and detailed wood grain, this round table works in tandem with the chairs to easily fit for your transitional dining space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3323rpt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:40:27"},
  {id: 416, name: "Lela Counter Ht. Table", number: nil, price: nil, description: "Immerse your dining room with the simplicity and grace of this multi-tone dining set. Soft grey upholstery wraps the smooth rounded chairs and tapered legs peak with a sleek black finish. Dine comfortably with the spacious wire-brushed top that warms with its oak finish. Bold post legs embolden in black as the dark finish runs elegantly along the table apron. Distinctively contrasted and impeccably paired, this dining set will create a timeless dining room that never loses style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3529gy-pt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:41:16"},
  {id: 410, name: "Kathryn Round Dining Table", number: nil, price: nil, description: "Create a sleek and appealing dining space by adding one of the many variations of this collection to your space! Elegantly turned legs or a wide pedestal add unique dimension to the design and infuse the table with traditional flair. Complete with linen-like upholstered seats for extra comfort, this chic collection will make your family wait eagerly for the next family meal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3872rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:39:51"},
  {id: 411, name: "Jadyn Dining Table", number: nil, price: nil, description: "Understated yet powerful, this unique dining collection is a beautiful addition to the home looking for a set that makes guests do a double take. The weathered gray finish adds emphasis to the solid wood construction while flattened slat panels draw the eye towards the cushioned seats and angled table base.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3545t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:39:56"},
  {id: 412, name: "Chandler 5 Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Distinguish your dining room with this dark toned dining set. Dark oak finishes feature rustic tones that add rich character to the clean designs. The rounded table offers plenty of space for food and drinks while solid legs taper for sound support. Comforting leatherette tightly wraps the cushioned chairs and slat backs provide a breathable back rest. Welcome this dining set for sophistication and unparalleled refinment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3173pt-5pk-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:40:07"},
  {id: 413, name: "Jenessa Dining Table", number: nil, price: nil, description: "Texturize your dining room with this louver inspired dining set. Clear glass shows subtle textures as it accentuates the spacious dining table. Ribbed chairs come upholstered in smooth leatherette and soft cushions will keep you comfortably relaxed. Finished in espresso, the set delivers deep dark tones to focus your dining room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3820t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:40:14"},
  {id: 414, name: "Mandy Dining Table", number: nil, price: nil, description: "Rustic style and polished metal sheens create this sumptuous dining set. Antique finishes display rich tones and a weathered aesthetic that defines shabby chic, enhancing the natural wood table that brings woody elements to your dining room while U-shaped supports contrast with clean, lustrous accents. Panel cushioned chairs are upholstered in soft linen-like fabric and keep you pleasantly supported for extended dinners. Keep wine handy in the dining server and conveniently store dinnerware in its spacious storage compartments.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3451gy-t-2-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:41:01"},
