  {id: 432, name: "Banbury 3 Pc. Dining Table Set", number: nil, price: nil, description: "Nothing blends distinctive style with convenient comfort quite like this industrial table set. Combining sturdy metal with light wood tones, this table showcases sleek rounded corners supported by unique triple-bar legs. The weathered seats of the chairs complement the design and add contrast to the dark metal frame. Ideal for family meals, this table set showcases casual comfort and reliable support to last for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3279t-29-3pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:40:48"},
  {id: 406, name: "Mandy Dining Table", number: nil, price: nil, description: "Rustic style and polished metal sheens create this sumptuous dining set. Antique finishes display rich tones and a weathered aesthetic that defines shabby chic, enhancing the natural wood table that brings woody elements to your dining room while U-shaped supports contrast with clean, lustrous accents. Panel cushioned chairs are upholstered in soft linen-like fabric and keep you pleasantly supported for extended dinners. Keep wine handy in the dining server and conveniently store dinnerware in its spacious storage compartments.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3451a-t-2-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:40:57"},
  {id: 407, name: "Maegan I Round Dining Table", number: nil, price: nil, description: "Modernize your dining room with this design-forward dining\r\nset. The round dining table is intricately stained, displaying\r\nrich and dark tones for a sophisticated finish. Bold legs\r\nframe the spacious open shelf and the sleek lazy susan\r\nadds a unique spin to your dining table. Parsons style\r\nchairs pair in perfect sync, adding sleek detail with smooth\r\nleatherette and comfy foam cushions. Update with this\r\nexceptionally functional dining set for a seamless dining\r\nexperience.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3152rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:41:05"},
  {id: 408, name: "Nerissa Dining Table", number: nil, price: nil, description: "Enjoy breakfast, lunch and dinner in style and comfort with this stylish dining set! The sophisticated shape of the pedestal pairs perfectly with linen-upholstered chairs and a comfy bench to create a luxurious atmosphere. Scrolled backrests decorated with button tufts help emanate a regal and feminine style that complements the beautiful antique black color for a chic finishing touch.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3840t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:41:11"},
  {id: 418, name: "Kirstin Dining Table", number: nil, price: nil, description: "This striking industrial styled dining table brings some real character to your home decor. Immediately the eyes are drawn to the large metal supports styled after shaped steel beams. The antique oak finish meshes effortlessly with legs to make a beautiful lifted table where you can host all the big meals.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3573t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:41:32"},
  {id: 419, name: "Roeselare Dining Table", number: nil, price: nil, description: "Dine in luxury while the rustic style and wire-brushed gray finish take you on a journey to the countryside. This dining set is crafted with luxurious turned legs and an expandable table that pleasantly seats guests for a roomy dining space. The bench and framed nailhead chairs keep you comfortably seated with soft linen upholstery and deep cushioned foam. Have dining essentials conveniently on hand with roomy cabinets, easy slide out drawers and a top felt-lined compartment that the spacious server delivers. Simplify your dining room with the rustic style versatile design of the wire-brushed gray dining set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3455t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:41:39"},
  {id: 420, name: "Jenessa Counter Ht. Table", number: nil, price: nil, description: "Texturize your dining room with this louver inspired dining set. Clear glass shows subtle textures as it accentuates the spacious dining table. Ribbed chairs come upholstered in smooth leatherette and soft cushions will keep you comfortably relaxed. Finished in espresso, the set delivers deep dark tones to focus your dining room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3820pt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:41:47"},
  {id: 421, name: "Luminar II Counter Ht. Table", number: nil, price: nil, description: "Contemporary inspired with radiant lighting to perfectly show off the fine points of this table. This is accented with plush key-hole chairs and an illuminated table base.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3559gy-pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:41:57"},
  {id: 422, name: "Luminar I Dining Table", number: nil, price: nil, description: "Combine ambience with appetite in this extraordinary dining set. LED lights are embedded underneath the frosted tempered glass insert of the table and the matching server. With three levels of brightness, there will always be a perfect mood for the perfect moment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3559gy-t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:42:04"},
  {id: 423, name: "Sarina Dining Table", number: nil, price: nil, description: "Draw attention to the contemporary elements of your dining space with this lustrous dining set. Between the turned legs providing support and the mirror accents bordering the table edge, this set is designed to shine and enhance the modern vibe of your home all at the same time. The matching server provides extra storage to ensure every dish and utensil can have a home in your dining room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3229t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:42:10"},
  {id: 424, name: "Dodson II Counter Ht. Table", number: nil, price: nil, description: "Perfect for an elegant space, this counter height dining set offers a perfect blend of beauty and refinement to enhance your eating experience. The square table top is composed of bright faux marble to help brighten the room while the lengthy black legs feature fluted detailing to add visual interest. Coordinating chairs showcase nailhead trim to add emphasis to the stylish design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3466pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:42:24"},
  {id: 426, name: "Penelope Round Table", number: nil, price: nil, description: "Beautify your dining room with chic country appeal. A beautiful tribute to feminine designs, the faux marble table top elegantly glistens with the paired white wooden framework. The chairs and table embody country charms with simple wood frames and bright white finish. Contoured seats provide a comfortable seating experience and curved legs on the table perfectly fit its country vibes.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3546rt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:42:35"},
  {id: 427, name: "Joinville II Counter Ht. Table", number: nil, price: nil, description: "Create a cozy, casual place to enjoy delicious meals with this contemporary style dining set. Gather around the spacious table top and enjoy the added bonus of an expansive 18-inch butterfly leaf. Experience the comfort of the panel back chairs that each feature lovely light grey fabric upholstery and foam padding. With a rich dark walnut finish, this collection combines the warmth of rustic hues with the modern simplicity of clean, linear lines for a dynamic design fit for all.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3985pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:42:45"},
  {id: 428, name: "Livada II Dining Table", number: nil, price: nil, description: "Create a hip lounge effect with this sleek modern counter height dining set. The tufted leatherette chairs feature plush foam padding for hours of unbelievable comfort. Beverages sit atop the tempered glass, which is supported by a mod, angular base showcasing a shiny chrome finish. As a final thought, the chairs offer matching chrome legs with an eye-catching L-shaped design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3170rpt-wh.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:42:52"},
  {id: 429, name: "Thomaston I Dining Table", number: nil, price: nil, description: "Add a simple modern touch to your dining room with the sleek and sophisticated beauty of this set. The crisp and clean lines help keep the focus on the brushed black finish covering the thick tabletop and sturdy wood block legs. Padded fabric upholstery on the matching chairs adds a beautiful contrast to the set while the slatted backrests offer plenty of comfort and support. Also available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3543t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:43:00"},
  {id: 431, name: "Johannesburg Counter Ht. Table", number: nil, price: nil, description: "Refine your dining room with luxurious style and class, this formal collection is perfect for the traditional home. The square dining table is adorned with floral wood carvings to enhance the faux marble top while matching dining chairs come upholstered in flannelette for comfortable seating. A classic design with sophisticated designs and intricate details, this dining set will surely elevate your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3873pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:43:16"},
  {id: 433, name: "Abelone Rectangular Table", number: nil, price: nil, description: "Mid-century inspired details take this dining collection from ordinary to extraordinary! Flared angular legs and visible wood grain give a retro twist that will ensure your collection stands out from the rest. Tufting adorns the gray fabric chairs while the rich walnut finish pairs beautifully with both table and chairs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3354gy-t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:43:24"},
  {id: 434, name: "Svana Dining Table", number: nil, price: nil, description: "Add a bold statement to your home with this unique modern dining set. Flared two-tone legs create a unique pedestal base while providing sturdy support for the tempered glass table top. Padded leatherette chairs with striking structures complement the one-of-a-kind contemporary designs. Chrome accents add a clean and stylish touch, this dining set commands attention and will beautifully accessorize any dining space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3382t-bk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:07:34"},
  {id: 435, name: "Dodson I Dining Table", number: nil, price: nil, description: "Make your dining room a stylish force to be reckoned with when you add this contemporary set. The lengthy table is composed of a stylish faux marble top and features subtle fluted details along the legs to offer an even more majestic impression. A nailhead trim traces the edges of the light fabric chairs and dining bench, guiding eyes down to the contrasting leg finish. Also available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3466t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:07:39"},
  {id: 436, name: "Onway Dining Table", number: nil, price: nil, description: "Create a warm rustic charm with natural wood tones, this dining set features country styles mixed with chic modern designs. A tempered glass table top rests upon oak finished wood legs to create an elegant, homey charm while chairs are upholstered in a soft beige fabric that perfectly complements its neutral tones.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3461t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:07:45"},
  {id: 437, name: "Yasmin Round Table", number: nil, price: nil, description: "Step out of the boring, old and ordinary with this cool and modern dining set. Crisscrossing chrome legs pair with the tempered glass table top to fit into the upscale home. Paired padded leatherette chairs offer optimal comfort so sit back and enjoy a delicious meal with close family or friends.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3381t-bk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:07:50"},
  {id: 438, name: "Fezziwig Round Table", number: nil, price: nil, description: "Add a pop of color to your home with this fun, mid-century style dining set. The round wood table and its supporting legs have a natural tone finish that exemplifies retro design. For a striking contrast, the varying fabric chairs add tons of life and personality to a space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3877t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:07:55"},
  {id: 439, name: "Paulina Dining Table", number: nil, price: nil, description: "A traditional design with hints of medieval flair, this beautiful dining set features rich hues and ornate details that are perfect for fine dining. The bold wood table showcases rustic bolt accents and metal supports to create the perfect spot for the ultimate feast. Sit comfortably upon the brown leatherette seats that come paired with stunning metal scrollwork and classic nailhead trim. This collection is finished in rustic walnut for a cozy atmosphere full of warmth and charm.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3465t-6pc.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:07:59"},
  {id: 440, name: "Aero Round Table", number: nil, price: nil, description: "Let your furniture be as much a piece of art as your other dcor with this eye-catching dining set. The round tempered glass table top allows the base to be the real star with its chrome center ball and angled, propeller-inspired legs. The black powder coated legs mimic the black microfiber seats for a minimalist design with modern flair. Metal satin plated chairs showcase a round, cut-out back to complete the unique and stunning look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3169t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:08:04"},
  {id: 441, name: "Colette 78\" Dining Table", number: nil, price: nil, description: "Bring the countryside into your dining space with this rustic masterpiece. The table top features a slab of concrete-like insert on a beautiful, split-wood textured top with natural cracks. Underneath the table are metal accents giving it a bit of industrial flair. Finished in beautiful rustic oak.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3562t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:08:11"},
  {id: 442, name: "Griselda Dining Table", number: nil, price: nil, description: "Bring the focus of your dining room to this spacious collection as underplayed stylish elements and refined silhouettes provide a cozy appeal. The spacious table top comes with plank style detailing to add visual interest while the turned legs offer a hint of flair. When paired with the matching bench, chairs and server, the entire set becomes the perfect showcase of transitional style for your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3136t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:08:16"},
  {id: 443, name: "Gloria 6 PC. Dining Table Set", number: nil, price: nil, description: "Casual yet elegant, this six-piece dining set embodies a simplistic design while finished in deep, rich colors. A unique dining bench creates an informal and homey appeal but pairs beautifully with the four chairs as all seats come upholstered and padded in leatherette for a comfortable dining experience. Its minimalistic structure and timeless design is a perfect fit for any home. Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3331t-6pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:08:26"},
  {id: 445, name: "Phyllis Dining Table", number: nil, price: nil, description: "Perfect your homes contemporary image with chic dining room furniture! With its long and sophisticated beveled and tempered glass table top, youll have no issues seating all of your guests down for a home-cooked meal. Each leg comes together to form a sturdy U-shaped support beneath the glass top, maximizing leg room for everyones comfort. Settle back in the padded faux leather chairs and enjoy a lovely meal among friends.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3462t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:09:23"},
  {id: 605, name: "REYES II Square Counter Ht. Table", number: nil, price: nil, description: "Chairs with a mission style back with a slight curve give this set a transitional look. Padded leatherette seats deliver comfort, while the simple lines of the table add to the old-fashioned look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_998.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:09:47"},
  {id: 446, name: "Diocles Dining Table", number: nil, price: nil, description: "A glamorous design that will amaze guests of all ages, this dining collection is a superb addition to any formal dining room. The antique mirror inserts along the table top, lengthy bench and paired server adds a beautiful and elegant touch to the already charming silver finish. Padded flannelette chairs add comfort to the chic design with their tufted backs and soft coloring.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3020t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:09:52"},
  {id: 447, name: "Gloria II 5 PC. Counter Ht. Table Set", number: nil, price: nil, description: "Casual yet elegant, this six-piece dining set embodies a simplistic design while finished in deep, rich colors. A unique dining bench creates an informal and homey appeal but pairs beautifully with the four chairs as all seats come upholstered and padded in leatherette for a comfortable dining experience. Its minimalistic structure and timeless design is a perfect fit for any home. Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3331pt-5pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:10:05"},
  {id: 448, name: "Anton I Dining Table", number: nil, price: nil, description: "Make your dining room the hub of the home with this beautiful contemporary style dining set finished in rustic gray. The flat panel backs feature a curved design for maximum comfort as padded light gray fabric cushions provide additional relaxation and style. A center beam connects the bottom of the table base for a charming detail and subtle support. Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3986t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:10:09"},
  {id: 449, name: "Stevensville Dining Table", number: nil, price: nil, description: "Gather the family around this lovely traditional style dining set and enjoy the moments that follow. The brown cherry finish gives a warm, welcoming glow that is enhanced by carved, hexagonal cut-outs along the chair backs. An 18-inch leaf insert expands this table to the perfect length, comfortably seating a multitude of friends and family. To complete this lavish design, beige fabric upholstered chairs provide undeniable comfort and high style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3875t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:10:15"},
  {id: 451, name: "Joinville I Dining Table", number: nil, price: nil, description: "A simply designed dining set with contemporary flair, this collection glorifies clean lines and classic colors. A light grey fabric upholstered seat contrasts beautifully against the warm dark walnut finish for a chic look. An 18-inch expandable leaf offers extra table top space for large dinner parties or fun family gatherings. Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3985t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:10:35"},
  {id: 452, name: "Johannesburg I Dining Table", number: nil, price: nil, description: "Refine your dining room with luxurious style and class, this formal collection is perfect for the traditional home. The rectangular dining table is adorned with floral wood carvings to enhance the faux marble top while matching dining chairs come upholstered in flannelette for comfortable seating. A classic design with sophisticated designs and intricate details, this dining set will surely elevate your home. Also available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3873t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:10:44"},
  {id: 453, name: "Thomaston Counter Ht. Table", number: nil, price: nil, description: "When its time to modernize your dining space, this counter height set is ready to oer its sleek style and sophisticated beauty. Featuring crisp and clean lines and a brushed black finish, this thick table top is sturdily supported by the wood block legs beneath. A set of coordinating chairs add to the elegant style with their slatted backrests and contrasting fabric upholstery. Give your dining room the facelift it deserves with this chic and simple update!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3543pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:10:56"},
  {id: 454, name: "Glenham 5 PC. Dining Table Set", number: nil, price: nil, description: "You can never go wrong with a dark and simple dining set in your home. Clean and linear lines create a minimalistic rectangular dining table while emphasized with brushed black finishes. Chairs with padded fabric seats provide the best comfort while an X-shaped backrest design adds flair and dimension. This dining set fits into any home for a simple and clean look!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3175t-5pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:11:21"},
  {id: 455, name: "Abelone Round Table", number: nil, price: nil, description: "Mid-century inspired details take this dining collection from ordinary to extraordinary! Flared angular legs and visible wood grain give a retro twist that will ensure your collection stands out from the rest. Tufting adorns the gray fabric chairs while the sleek gray finish pairs beautifully with the matching round dining table.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3354gy-rt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:11:27"},
  {id: 458, name: "Banbury 5 PC. Dining Table Set", number: nil, price: nil, description: "Nothing blends distinctive style with convenient comfort quite like this industrial table set. Combining sturdy metal with light wood tones, this table showcases sleek rounded corners supported by unique triple-bar legs. The weathered seats of the chairs complement the design and add contrast to the dark metal frame. Ideal for family meals, this table set showcases casual comfort and reliable support to last for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3279t-43-5pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:43:58"},
  {id: 459, name: "Nerissa Round Table", number: nil, price: nil, description: "Enjoy breakfast, lunch and dinner in style. This round pedestal table comes paired with ivory linen dining chairs to create a luxurious atmosphere. Button tufting and a scrolled backrest emanate a regal and feminine style that pairs beautifully with the antique black finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3840rt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:04"},
  {id: 460, name: "Miriam Dining Table", number: nil, price: nil, description: "Whether youre having an intimate dinner party or a large family get-together, make sure to dine in style with this gorgeous modern dining set. The tempered glass table top features a unique self-storing leaf for added surface space while supported on sleek powder coated silver legs. Chairs are padded and upholstered in leatherette and feature a contoured backrest for relaxed comfort. A perfect and stylish modern set is a must have to update your chic dining room!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3383t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:10"},
  {id: 461, name: "Xanthe Dining Table", number: nil, price: nil, description: "Enjoy a nice family meal around this chic, transitional style dining set with comfortable fabric chairs and a matching bench. The charming X-back chairs give off a farmhouse vibe that is beyond cozy. Ivory colored fabric provides a beautiful contrast against the dark brushed black finish for a classic design with immeasurable charm.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3172t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:17"},
  {id: 462, name: "Osburn Dining Table", number: nil, price: nil, description: "Handsome wooden framework pairs with light neutral fabric for a charismatic and rustic appeal. This dining collection features chic country designs that will beautifully embellish your home. A brown cherry finish paired with neutral colors, nailhead trim and a tempered glass table top creates an elegant yet homey ambience. This set is a fresh new take on a warm farmhouse design and adds a touch of modern appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3464t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:22"},
  {id: 463, name: "Livada I Dining Table", number: nil, price: nil, description: "Get in touch with your modern side, this strikingly sleek dining set is perfect for those upscale get-togethers. Gather round the tempered glass table top and admire the unique base inspired by pyramids and mod designs. Similarly designed, the paired chairs feature matching chrome legs and ridged leatherette upholstery for unbelievable texture and personality!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3170rt-bk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:27"},
  {id: 464, name: "Sania I 84\" Dining Table", number: nil, price: nil, description: "Rustic charm meets upscale design in the form of this stunning collection. The rustic wood grain and antique black finish take you to a charming farmhouse somewhere in the countryside, achieving an inviting, homey atmosphere that will have family and friends coming back for more. Elegant ivory linen-like chairs add sophisticated appeal with their wingback sides, button tufting and nailhead trim.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3324bk-t-84-bench.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:35"},
  {id: 465, name: "Griselda Round Table", number: nil, price: nil, description: "Bring the focus of your dining room to this spacious collection as underplayed stylish elements and refined silhouettes provide a cozy appeal. The spacious round table top comes with plank style detailing to add visual interest while the pedestal made up of four turned legs offer a hint of flair. When paired with the matching bench, chairs and server, the entire set becomes the perfect showcase of transitional style for your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3136rt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:40"},
  {id: 466, name: "Kera Dining Table", number: nil, price: nil, description: "Replace your old dining set with a refreshing, modern set. Satin plated metal legs meet at the rectangular base to provide a strong and sturdy support for the tempered glass table top. Paired dining chairs are cushioned and upholstered with black microfiber for a comfortable dining experience. With its sleek futuristic design, this collection is a clear winner for any modern enthusiast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3725t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:45"},
  {id: 467, name: "Gianna 77\" Dining Table", number: nil, price: nil, description: "Dine in rustic elegance with this gorgeous antique-inspired collection. The weathered finish of the entire set draws attention to the sturdy solid wood framework while providing the necessary support for a worry-free dinner setting. Curved table legs create a unique visual and come reinforced with a center floor beam. The paired chairs and bench feature an earthy toned fabric that enhances the wood elements. Matching server accented with steel casters and wire-panel cabinets.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3829t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:53"},
  {id: 468, name: "Meagan I Dining Table", number: nil, price: nil, description: "Parson style chairs and a plank style table top blend to create a contemporary design with rustic appeal. The open bottom shelf provides an interesting visual while providing useful storage space. The flared chairs are upholstered in sleek leatherette upholstery to combine trending style with modern comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3152t-bench.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:44:59"},
  {id: 456, name: "Arcadia Dining Table", number: nil, price: nil, description: "Beautiful wood inlay details and a dramatic double pedestal base create a grand statement with elegance galore. The ivory fabric upholstery provides a stunning contrast against the rustic natural tone finish for a look that is as cozy as it is chic. Intricate leg designs play beautifully off the delicately cut backs for a look that will inspire and amaze.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3150t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:11:31"},
  {id: 470, name: "Belinda II Counter Ht. Table", number: nil, price: nil, description: "Delight in the rich espresso finish and sleek linear lines of this contemporary counter height dining collection. Smooth leatherette upholstery wraps tightly around the compact chairs and showcases the minimalist design tastefully. The bold table top and base are complemented beautifully by the whimsical, V-shaped pedestal, achieving an artful balance of beauty and function.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3357pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:45:28"},
  {id: 471, name: "Montreal I Round Dining Table", number: nil, price: nil, description: "Place this perfectly round dining table in the center of your dining space and get the conversations started. The dark oak finish and molded trim are perfect for hosting a more elegant dinner party, whereas the curved edges and flared, panel-style legs bring in a contemporary feel for casual family meals. Matching chairs feature padded tan fabric seat and paneled back with unique angular forms.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3711rt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:45:39"},
  {id: 473, name: "Eindride Dining Table", number: nil, price: nil, description: "Make your family meals great again by adding this mid-century design to sweeten the experience! Slim, tapered wood legs support the plankstyle table top, off ering both a chic appearance and quality support. The matching side chairs feature padded fabric upholstery to provide an extra incentive to gather around for a great family dinner.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3371t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:45:50"},
  {id: 474, name: "Lidgerwood Dining Table", number: nil, price: nil, description: "Sit down to a nice family meal around this rustic dining collection and feel the southern charm flow through your home. The natural tone finish brings out the rustic wood grain details and U-shaped legs provide sturdy balance to emanate that country charm. Bright ivory cushions add a softness to the overall visual while distressed texturing emphasizes the wood craftsmanship.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3358t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:45:55"},
  {id: 475, name: "Macapa Dining Table", number: nil, price: nil, description: "Celebrate the most festive occasions with this large and spacious dining table. The rectangular top measures 94 inches across allowing up to eight of your guests to be seated. Underneath is a beautiful display of intricate carving on the trestle base. The ivory chairs have upholstered seats and backs for extra comfort, while the matching cabinet offers more than just storage for unused china and silver; it also holds wine bottles for your very own special cocktail party.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3441t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:46:00"},
  {id: 476, name: "Anapolis Dining Table", number: nil, price: nil, description: "A classic dark walnut finish coupled with elegant turned legs makes this set a must-have for any transitional home in need of a dining room update. If you are looking to hold bigger parties with more guests, this solid pine wooden table offers two large top sizes (94 and 78), each of which has bold, thick legs to match. Chairs with padded ivory fabric seats and nailhead trim top off this exquisite set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3440t-94.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:46:08"},
  {id: 477, name: "Foskey Counter Ht. Table", number: nil, price: nil, description: "Transform unique into functional with this fire-hydrant themed counter height table. Featuring a tall pedestal, this fun table is constructed out of durable metal and features a spacious round table top. Rest your feet on the attached footrest while your guests marvel at your distinct and absolutely delightful style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3367pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:46:19"},
