  {id: 513, name: "Ingrid II Counter Ht. Table", number: nil, price: nil, description: "With a neutral design, this transitional dining table is perfect for most if not all dining spaces. Fabric upholstered chairs pair well with the table and create a comfortable seating experience for all sizes. Whether entertaining guests or having a meal with your family, this set warms up any dining decor.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3134pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:49:49"},
  {id: 514, name: "Zelda Dining Table", number: nil, price: nil, description: "Gather your family around this stunning set to indulge in fine and fabulous dining. The smooth sleek lines of this rectangular table top offer a cozy and inviting feel while the beautiful wood finish adds a timeless touch. Paired with gorgeous fabric upholstered chairs, this dining set will make friends and family appreciate a fine dining experience.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3329t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:49:55"},
