  {id: 517, name: "Hurdsfield Dining Table", number: nil, price: nil, description: "Bring some classy inspiration into your dining room with this warm toned table featuring stylish turned legs. Matching side chairs beautifully wrapped with linen-like upholstery makes this the perfect addition to any dining area.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3133t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:50:24"},
  {id: 518, name: "Isadora Dining Table", number: nil, price: nil, description: "Create a warm and inviting environment in your dining area with this dark toned sturdy dining set, perfect for family gatherings or any type of get-together. Matching chairs with comfortable upholstered seats add to the overall great look of the well thought-out design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3191t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:50:30"},
  {id: 519, name: "Orla Dining Table", number: nil, price: nil, description: "Graceful and dignified, this one-of-a-kind table will make any meal feel like a fanciful feast. Featuring a unique chrome base, this stunning fixture sits atop a contrasting black flat base as it holds up a beveled edge glass table top. Complete this piece with the coordinating round cut-out metal back chairs, which feature black foam filled seat cushions.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3726t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:50:35"},
  {id: 520, name: "Medieve Round Table", number: nil, price: nil, description: "The dining room is a very important place in your home. It is where the family gathers and great conversations happen. It deserves something grand like this elegant round dining table, with intricate apron details and lion claw feet. Chairs feature fabric padded seats with beautiful patterning and cabriole legs. Matching hutch and buffet completes this gorgeous set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3557ch-rt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:50:48"},
  {id: 521, name: "Joleen 3 PC. Counter Ht. Table Set", number: nil, price: nil, description: "For the space-conscious couple, this three-piece counter height dining set is the perfect fit. The metal framework provides long-lasting stability you can count on while the faux marble tabletop and faux leather seats balance effortlessly with the black finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3131pt-3pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:51:00"},
  {id: 522, name: "Ava Dining Table", number: nil, price: nil, description: "Utilize this cozy collection to bring your family together every evening. The wood construction and detailing creates a warm and inviting atmosphere while the structure provides plenty of room for all your loved ones, especially when you add in the expandable leaf. Coordinating slat back chairs with fabric upholstered seats complete the look of this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3287t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:51:06"},
