  {id: 526, name: "Manhattan Rectangular Table", number: nil, price: nil, description: "For larger dining areas, this 72\" beveled glass top rectangular table has a unique pedestal base and can easily accommodate up to six seats comfortably. Finished in gray and also available in round table top.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3710gy-t_2.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:51:37"},
  {id: 527, name: "Sabrina Counter Ht. Table", number: nil, price: nil, description: "The cottage style combined with the beautiful two-toned finish on this table adds a cozy look to any dining space. With a wide array of functional features such as the wine holder and multi-open storage shelves, this dining table can be paired with the matching wooden chairs to give any outdated dining space a light makeover.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3199bc-pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:51:45"},
  {id: 528, name: "Alana Rectangular Table", number: nil, price: nil, description: "If fine dining without formalities is appealing to you, then this dining collection is perfect. The cross-legged base readily supports the smooth plank-inspired tabletop while the coordinating chairs feature slat back designs to enhance the black finish. Fit for a 3-course dinner or family game night, this dining set is everything you need for quality family time.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3668t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:52:11"},
  {id: 545, name: "Danette 5 PC. Dining Table Set", number: nil, price: nil, description: "For smaller dining areas, this compact dining set with matching leatherette upholstered chairs bring a simplistic style paired with functional qualities. This five-piece dining set will look great placed in the center of any room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3190t-5pk.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:12:11"},
