  {id: 529, name: "Crosby II Round Counter Ht. Table", number: nil, price: nil, description: "Update your dining room in a style that is casual yet uniquely refined. This industrial style counter height table will be a fun addition to your home. The round wooden table top and slim metal frame with curved post accents combine beautifully with a cross frame bottom for additional support.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3827rpt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:12:27"},
  {id: 530, name: "Dwight III Dining Table", number: nil, price: nil, description: "Convenient and space-saving, this dining table is absolutely perfect for your home. With features such as tall and sleek wooden legs that stylishly support the molding trim table top, this beautifully finished set is a wonderful addition to any modern and understated dining space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3988gy-t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:02"},
  {id: 531, name: "Zora Counter Ht. Table", number: nil, price: nil, description: "Modern design and sleek style come together to create this amazing pub table. Featuring a rounded edge triangular glass table top, the table is complete with its shiny chrome base and curved cross design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3992pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:09"},
  {id: 532, name: "Jazlyn II Bar Table", number: nil, price: nil, description: "Rustic elements come paired with space-saving design. This bar set showcases matching rustic oak finished wooden panels along the tabletop and the matching chair backs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3686bt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:15"},
  {id: 533, name: "Jazlyn I Dining Table", number: nil, price: nil, description: "Simple yet detailed, this industrial inspired set adds a rustic charm to any dining setting. Matching rustic oak finishes along the wide table top and paneled chair backs provide a warm contrast against the metal legs and ivory linen-like seat cushions. Metal framework for both the table top and chairs ensure a sturdy set for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3686t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:20"},
  {id: 534, name: "Giselle Dining Table", number: nil, price: nil, description: "Leave a great impression on guests with this simple yet bold dining table that looks great with the accompanying hatch-back wood dining chairs. The dining table comes in a rich espresso color and is built from reliable wood while the dining chairs comes in four fun color options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3528t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:25"},
  {id: 535, name: "Sania Bar Table", number: nil, price: nil, description: "Designed with convenience and style in mind, this rustic dining collection is a gorgeous addition to any environment. The paired coloring between natural toned wood and ivory linen-like upholstery creates a bright and inviting atmosphere for a space-conscious studio or loft. The plank style surface offers ample room while adding emphasis to the solid wood construction. Available with chair or bench options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3324bt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:30"},
  {id: 536, name: "Dickey Dining Table", number: nil, price: nil, description: "Add natural vibes to your dining area with this wood constructed dining table featuring realistic indentions and bold support legs. The chairs mimic the wood features and come paired with upholstered linen-like seats. Great for any homeowner trying to add a bit of flair to their dining area.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3132t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:40"},
  {id: 537, name: "Dwight I 48\" Round Table", number: nil, price: nil, description: "Add country charm to your dining decor with this dining table, featuring a round tabletop with moulded trim and tapered legs. The side chairs showcase slatted backs. Finished in medium oak and available in two sizes: 42\" or 48\" table top.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3988rt-w_2.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:13:54"},
  {id: 539, name: "Amina Dining Table", number: nil, price: nil, description: "This dining collection will be the focal point of any home with its eye-catching silver finish and elegant structure. Double glass inserts draw attention to the Moroccan-inspired inset patterns while a convenient 18-inch leaf offers the option of hosting a large or intimate dinner. This dining set is the perfect statement addition to any dining area.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3219t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:14:08"},
  {id: 540, name: "Dwight III 42\" Round Table", number: nil, price: nil, description: "This dining table features a roomy table top resting upon block legs, with a solid wood construction for long-lasting quality and style. The chairs showcase slatted backs and padded leatherette seats. Choose between a 42\" or 48\" table top.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3988gy-rt.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:14:15"},
  {id: 541, name: "Yvetti Round Table", number: nil, price: nil, description: "For a casual and chic addition to your home, this table is just what you're looking for. The round glass table top offers a unique frosted look with its fiber backing while the shiny chrome base completes this collection with a stylish finish. Three chair color options are available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3991t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:15:07"},
  {id: 542, name: "Elana Dining Table", number: nil, price: nil, description: "Classic elements are at the forefront with this brown cherry finished collection. The intricately designed chair backs match beautifully with the meticulously carved table, while the padded fabric seat cushions offer both comfort and style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3212t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:15:12"},
  {id: 543, name: "Yvetti Round Counter Ht. Table", number: nil, price: nil, description: "Excited to show off your modern taste? Invite your friends over to wine and dine in chic style. Crafted with a slim structured chrome base, this round frosted glass table top is designed with perfect taste. The tall height of this piece is a fun switch-up from standard height tables. Matching chairs available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3991pt.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:15:20"},
  {id: 544, name: "Eris I Dining Table", number: nil, price: nil, description: "This picturesque dining collection offers a wonderful alternative to traditional designs while maintaining a refined appearance. The neutral coloring adds a chic appeal and can be easily paired with any light decor. Easily host a classy dinner with the wide, expandable surface and multi-functional storage server.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3213t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:15:25"},
  {id: 574, name: "Marshall Dining Table", number: nil, price: nil, description: "Metal legs combined wth the solid wood top's rustic oak finish create a beautiful piece that will surely sit well in any dining space. The matching chairs are upholstered in ivory fabric with button tufting.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3564t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 23:43:38"},
  {id: 548, name: "Rockham I Dining Table", number: nil, price: nil, description: "One of a kind style for the ultra modern home. This dining set provides ample space for intimate dinner gatherings without compromising modern style. The crocodile leatherette offers a touch of contemporary feel while the faux marble top stands out against the black finished legs. Also available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3278t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:15:31"},
  {id: 549, name: "Caithe Dining Table", number: nil, price: nil, description: "There's a sense of allure when metal, wood, and stone are combined, as seen in this beautiful dining set. The table top is made of wood and stone, while the distinctive legs are made up of three metal bars. Distinct natural cracks on the wood give this set a textured look. Matching chairs have padded fabric backs and seats.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3563t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:15:36"},
  {id: 550, name: "Bonneville II Counter Ht. Table", number: nil, price: nil, description: "Beautifully sleek, this set is great for any contemporary home. Ample seating room for four with the wide table top, the table features sturdy, bold paneling to double as legs while creating a shelving panel and hiding the rack below the table top. Parson style chairs angle eccentrically to emphasize the complete padded leatherette upholstery and contrast stitching.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3824pt.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:15:47"},
  {id: 551, name: "Hillsview II Dining Table Set", number: nil, price: nil, description: ".", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3916pt-5pk.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:16:06"},
  {id: 552, name: "Harwinton Dining Table", number: nil, price: nil, description: "For the traditional home looking for a way to create an air of luxury, this beautiful dining set is a great choice. The backs of the chairs have intricate interlocking loops and the front legs have reeding details. The matching buffet has drawers and shelves for dinnerware storage.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3527t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:16:10"},
  {id: 553, name: "Dover Dining Table", number: nil, price: nil, description: "This gorgeous dining table features a rich cherry wood finish table top and molded trim, resting upon sturdy black tapered legs. The side chairs showcase contoured wood seats and slatted backs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3326wc-t_1.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:16:14"},
  {id: 554, name: "Melston I Dining Table", number: nil, price: nil, description: "Beauty comes in all different types. This eccentric set features stone table top inserts upheld by natural tone finished legs. Easily seating six, this dining table is a surefire conversation starter, especially when paired with the unique fabric upholstered side chairs. Also available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3531t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:16:19"},
