  {id: 613, name: "ATENNA II Oval Counter Ht. Table", number: nil, price: nil, description: "A round, tempered glass top and a distinct cross-oval base give this table a very contemporary look. Leatherette Parson chairs with the same dark walnut finish completes the set, which is also available in a regular height variant.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_962.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 18:05:04"},
  {id: 614, name: "ATENNA I Round Dining Table", number: nil, price: nil, description: "A tempered glass top and a distinct base finished in dark walnut give this table a very contemporary look. Espresso leatherette Parson chairs complete this unique set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_836.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 18:05:13"},
