  {id: 617, name: "Lana Counter Ht. Table", number: nil, price: nil, description: "Rustic meets edgy with this stylish counter-height dining set. The table is boldly brilliant with smooth rounded corners, sleek tapered legs and functional side shelving. Keep dining essentials handy or curate your favorite d", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3153pt-2.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 18:06:07"},
  {id: 618, name: "Izidora Counter Ht. Table", number: nil, price: nil, description: "Warm and welcoming dark tones define this two-toned dining set. The rustic oak pairs perfectly with the espresso finish, accentuating the lighter tones brilliantly. Rounded corners smooth out the table and tapered legs ensure long-term stability. Chairs are crafted with breathable vertical slats, comfortable contoured seats and perfectly placed leg rests for a relaxing dining experience. Create lasting memories with the dining set that ensures plenty of space for delectable dinners and late night drinks with friends.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3164pt-2_1.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 18:06:19"},
