  {id: 757, name: "Lodia I Round Dining Table", number: nil, price: nil, description: "Pair your dining room with this simple yet eye-catching dining chair design. These padded leatherette chairs create an air of modern elegance with the help of sleek chrome legs. Available in black or white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3825wh-rt.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:09:50"},
  {id: 758, name: "KEUKENHOF Round Dining Table", number: nil, price: nil, description: "Perfect for a card game or small dining area, this round table has an uniquely designed base and four comfortable chairs finished in rich dark walnut with dark brown leatherette seats.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_850.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:09:58"},
  {id: 759, name: "MARION II Square Counter Ht. Table", number: nil, price: nil, description: "Six comfortable leatherette Parson chairs complement the ivory marble square table top of this dynamic dining set. The counter height table is constructed of solid woods and is finished in modern espresso. Also available with round table top.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1088.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:10:09"},
  {id: 760, name: "Sorrel I 42\" Round Dining Table", number: nil, price: nil, description: "Whether the side chairs are upholstered in dark brown leatherette or ivory fabric, the understated look of this dining set will bring sophistication to any home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3555rt.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:10:19"},
  {id: 761, name: "Dover II Counter Ht. Table", number: nil, price: nil, description: "This inviting pub table features a square table top with 16-inch expandable leaf and moulded trim, resting upon sturdy black tapered legs. The side chairs showcase contoured seats and slatted backs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3326wc-pt.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:10:28"},
  {id: 762, name: "TOWNSEND I Dining Table", number: nil, price: nil, description: "This beautiful transitional dining table is accented with unique mosaic detail built into the table top. Finished in brown cherry, the table is accompanied by espresso padded leatherette chairs and bench. Counterheight is also available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_625.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:10:39"},
  {id: 763, name: "NAPA VALLEY Formal Dining Table", number: nil, price: nil, description: "Celebrate your most festive occasions with this elegant formal dining table with expandable table and decorative veneer inlay top and carved double pedestals. The chairs have upholstered seats and backs for extra comfort. The matching buffet and hutch has etched glass doors and multiple shelves and drawers to store china and silver.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3005t-2.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:10:48"},
  {id: 764, name: "LISBON III Square Counter Ht. Table", number: nil, price: nil, description: "For smaller kitchens or dining rooms this square marble top counter height table seats eight comfortably. A round table top option is also available and seats four. Mix with the button tufted or key-hole style padded leatherette chair.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1082.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:10:59"},
  {id: 765, name: "Levna Dining Table", number: nil, price: nil, description: "A sleek dining table for six with a high gloss lacquer coating for a sleek vibe. Matching Parson style chairs are padded in durable leatherette. Chairs and table are available in black or white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3822bk-t.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:11:07"},
  {id: 766, name: "MONTECITO Dining Table", number: nil, price: nil, description: "Add variety and color to your dining room theme. The 54 pedestal glass top table can be paired with either modern ivory fl ax fiber chairs, or microfiber upholstered chairs in a variety of colors: Apple Martini, Cognac, Ivory, or Mocha.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_826.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:11:14"},
  {id: 767, name: "SALIDA II Square Counter Ht. Table", number: nil, price: nil, description: "Acacia wood top gives this dining set a timeless look. The two-toned counter height table has a unique inlaid wood table top, while the matching chairs also have acacia backs with padded leatherette seats. Also available in regular height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1044.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:11:28"},
