  {id: 835, name: "Mullan Bed", number: nil, price: nil, description: "A charming transitional style bedroom set led by a stylish low footboard bed with gracefully curving head and foot boards and attractive bracket feet. The case goods offer a perfect complement.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7943wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:55:32"},
  {id: 769, name: "GRAND VIEW I Dining Table", number: nil, price: nil, description: "Perfect for the contemporary dining area, this rectangular glass top table rests on a wooden base. The matching chairs are fully upholstered in a soft dark gray fabric. The table and chair legs are finished in espresso.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_834.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:11:44"},
  {id: 770, name: "Foster I Dining Table", number: nil, price: nil, description: "Make your dining room unique with this pedestal table decorated with nail head trim. Matching slated chairs accompany this table.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3437t.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:11:50"},
