  {id: 756, name: "WEST CREEK I 5 Pc. Dining Table Set", number: nil, price: nil, description: "This small square dining set comes with four Mission style chairs with padded leatherette seats. Finished in espresso.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_896.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:19:01"},
  {id: 775, name: "Dani Bed", number: nil, price: nil, description: "With its unique color selection and contemporary elements, this stylish trundle brings with it everything your child needs in a bedroom.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7159wh-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:36:54"},
  {id: 774, name: "LISBON I Rectangular Dining Table", number: nil, price: nil, description: "For a smaller kitchen or dining room, this rectangular or oval edge table with a genuine marble table top seats six comfortably. Two side chair styles are available, both in espresso: button tufted chairs or keyhole style padded leatherette chairs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_752.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:36:45"},
  {id: 776, name: "Diane Bed", number: nil, price: nil, description: "With its unique color selection and contemporary elements, this stylish bedroom set brings with it everything your child needs in a bedroom. The curving headboard on this stylish bed features sleek plank details and sophisticated finials that are mirrored on its footboard, providing a cohesive look with plenty of visual appeal. Each of the matching case goods provides spacious drawers for storage that are reinforced with a sturdy dovetail construction, enhancing the ability of this set to meet the needs of your child throughout the years.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7158gy-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:36:59"},
  {id: 778, name: "Claudia Bed", number: nil, price: nil, description: "Elegant carvings and distinguished antique handles are glamorously paired with a Silver Gray finish to create this stunningly luxurious bedroom set. Round wood accents focus the high back headboard as smooth curves glide down the sides to frame the bed. Decorative nailhead trim adds luxurious detail the case goods, accentuating the silver tone handles and spacious drawers. The round mirror adds a finishing touch, providing a spacious view to keep you looking as stylish as this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7199l-1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:38:00"},
  {id: 777, name: "CarinaTwin Bed", number: nil, price: nil, description: "Perfect for the on-the-go youth, this daybed is elegantly designed to maximize comfort while adding the much needed utility that's great for naps, a good night's rest, or some lounging about with friends for a movie or sleepover. The padded linen-like fabric designed with nailhead trim and button tufting is the perfect combination of traditional qualities with a modern twist. A popular design for the trendy youth, this platform daybed is the perfect blend of classy elegance with a modern touch.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7197-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:39:26"},
  {id: 780, name: "Orbiter Bed", number: nil, price: nil, description: "Blast away in this space shuttle-inspired youth bed and experience the beauty of the universe. Your child will gaze at stars and roam the galaxies while sitting aboard this uniquely designed desk.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7209sv-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:40:19"},
  {id: 779, name: "Debra Twin Bed", number: nil, price: nil, description: "Dream of starry skies and shooting stars with this teepee-inspired tent bed! Peek through the rounded windows and play for hours on end as you imagine yourself in the great outdoors. The slightly raised bed creates a little look-out and the peaking wood supports are reminiscent of a life-like teepee. Create fun-filled memories and explore your adventurous side with this inspired tent bed. Available in two finishes.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7204pk-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:40:06"},
  {id: 782, name: "Caren Bed", number: nil, price: nil, description: "Surprise your kids with an elegant upgrade of this classic contemporary set. With a simple yet refined set of details, let your child be the envy of her school mates! Goes perfectly with any type of style, they will be thrilled to see there very own bedroom set designed with classic elements that bring simple features to life. Not to flashy, and just a hint of old fashion classics, this is the perfect bedroom set to add to any growing household.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7902gy-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:40:51"},
  {id: 781, name: "Carus Bed", number: nil, price: nil, description: "Sized to fit, this casual and contemporary bedroom set is perfect for a child's room.  The platform bed features a paneled headboard and has options for a twin trundle or roomy drawers underneath. The matching case goods are accented with wooden knobs and finished in gray, oak or cherry.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7904gy-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:40:37"},
  {id: 783, name: "Pearland Bed", number: nil, price: nil, description: "Mirrored accent panels bring extra glitz to the design and make this a stunning piece to admire!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7844wh-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:43:23"},
  {id: 785, name: "Diane Bed", number: nil, price: nil, description: "With its unique color selection and contemporary elements, this stylish trundle brings with it everything your child needs in a bedroom.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7158bl-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:43:45"},
  {id: 820, name: "Power Racer Twin Bed", number: nil, price: nil, description: "Heres a bed that your kids can see themselves in! This race car twin bed has a leatherette headboard and features large replica tires. The bed frame, which is mattress ready, is made of metal and comes in three colors: black, pink or white. Its a piece your kid will surely love!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7285pk.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:50:31"},
  {id: 786, name: "Claudia Bed", number: nil, price: nil, description: "Elegant carvings and distinguished antique handles are glamorously paired with a Silver Gray finish to create this stunningly luxurious bedroom set. Round wood accents focus the high back headboard as smooth curves glide down the sides to frame the bed. Decorative nailhead trim adds luxurious detail the case goods, accentuating the silver tone handles and spacious drawers. The round mirror adds a finishing touch, providing a spacious view to keep you looking as stylish as this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7199-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:44:04"},
  {id: 788, name: "Deana Bed", number: nil, price: nil, description: "When you take shabby chic and blend it with today's contemporary elements, you'll find yourself with this bedroom set for your growing kids. As the enter there adolescent years, they'll need there own space to really define themselves. This modernistic style blended with country style elements offers a platform bed with a camel back headboard that brings a sense of nostalgia. With felt-lined top drawers for added storage space, the solid wood and wood veneers come in a blue and white finish, a subtle touch of dainty undertones.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7851t-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:44:32"},
  {id: 790, name: "Coco Bed", number: nil, price: nil, description: "Enchanted by Pink and White finishes, this bedroom set features smooth beaded designs and bright splashes of color to brighten your room. The bed is embellished by smooth rounded frames and patterned accents for intriguing detail. Case goods provide spacious storage with airy open back shelves and the two-tone bench provides a comfy cushioned rest to help with your morning routine. Bring charm and a brightening touch to your room with this youth-inspired bedroom set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7740-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:48:39"},
  {id: 789, name: "Debra Twin Bed", number: nil, price: nil, description: "Dream of starry skies and shooting stars with this teepee-inspired tent bed! Peek through the rounded windows and play for hours on end as you imagine yourself in the great outdoors. The slightly raised bed creates a little look-out and the peaking wood supports are reminiscent of a life-like teepee. Create fun-filled memories and explore your adventurous side with this inspired tent bed. Available in two finishes.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7204wh-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:44:41"},
  {id: 791, name: "Cara Bed", number: nil, price: nil, description: "Update your bedroom with the clean straight lines of this kids set. Finished in a rich gray, cherry or oak, the matching case goods are accented with wooden knobs. The platform bed comes in twin or full size and an under-bed option of a twin trundle or drawers set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7903gy-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:48:49"},
  {id: 792, name: "Prismo Bed", number: nil, price: nil, description: "Vivid color styles perfectly complimented with detailed craftsmanship wood details. This bed is available in two sizes, an array of colors and will easily compliment any child's or yourth's bedroom space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7941ch-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:49:01"},
  {id: 793, name: "Ariston Bed", number: nil, price: nil, description: "Resting atop elegant bun feet, this glamorous bedroom set brings a touch of stylish appeal that instantly brightens any space! Sophisticated button tufts adorn the leatherette upholstery of the headboard, which brings more attention to its thick and chic frame. Mirrored accent panels bring extra glitz to the design and make this a stunning set to admire!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7171rg-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:49:11"},
  {id: 797, name: "Orbiter Bed", number: nil, price: nil, description: "Blast away in this space shuttle-inspired youth bed and experience the beauty of the universe. Your child will gaze at stars and roam the galaxies while sitting aboard this uniquely designed bed. Paired with an authentic front deck and curved back headboard, this bed offers a clean visual while finished in a bright white frame. Life-like decals and wing style shelves ensure your child will be set to face any journey.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7209.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:13:33"},
  {id: 794, name: "Voyager Captain Bed", number: nil, price: nil, description: "Anchors aweigh! This lovely twin bed is inspired by the captains and sailors of the sea. Practical with its included trundle, two drawers, and front storage, it is not only about fun but also about function. A combination of white, oak, and navy blue finish tops this exciting bed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7768f_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:49:26"},
  {id: 795, name: "Cobin Full Size House Bed", number: nil, price: nil, description: "Watch your child have a blast as they hang up their outfits for the next day, and have the time of their life with this house-inspired youth bed. The realistic roof and cut-out window creates a fun sleeping environment that theyll adore for years to come!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7133_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:12:14"},
  {id: 796, name: "Omestad Twin Size House Bed", number: nil, price: nil, description: "Take playtime to a whole new level with this house-inspired bed and its lovely white finish. Light blue trim accentuates the plank style panels, large windows and roof top to provide an authentic experience that kids will have an absolute blast with. Angled ladder on the side offers access to the twin size bed, while up to two optional matching chests may be accommodated beneath the loft design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7135.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:13:08"},
  {id: 799, name: "Olivia Bed", number: nil, price: nil, description: "Fit for your little king or queen, this traditional style youth bed collection features intricate details and ample storage. The tufted leatherette headboard features a camelback design with moulded trim details to create a stylishly regal look that is sure to impress. With matching casegoods that offer multiple roomy drawers and beautiful bun feet, there is no denying the practicality and beauty of this collection.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7155ex.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:14:01"},
  {id: 798, name: "Pearland Bookcase", number: nil, price: nil, description: "Display toys or organize bedtime stories with bookcase-inspired bedroom set. Variously sized shelves and drawers help make any child's room organized.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7844bc.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:13:47"},
  {id: 800, name: "Cammi Bed", number: nil, price: nil, description: "Bring out the toys and bring on the clothes with the ample storage space of this contemporary style youth bedroom collection. With a crisp white finish and colorful circular designs, this set is sure to catch the attention of any child that walks in.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7853bl-t.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:14:28"},
  {id: 803, name: "Pearland Bed", number: nil, price: nil, description: "Display toys or organize bedtime stories with bookcase-inspired bedroom set. Variously sized shelves and drawers organize your little ones favorite playthings while doubling as handy storage compartments. The add-on side bookcases are perfect for the avid reader with their USB plugs that double as convenient charging stations. Dont forget about the built-in headboard light that acts as a nightlight to scare nightmares away! This bed set is the perfect multifunctional and charming piece to declutter and organize your childs room!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7844.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:15:33"},
  {id: 802, name: "Farem Twin Size House Bed", number: nil, price: nil, description: "See creativity flourish as kids play in this house-inspired bed with white exterior and gray trim. As they climb the attached ladder and look out the windows they will see the fun features of the plank-style sides and roof-like top. The matching drawers provide practical storage for clothes, toys, and more so as they have a fun game of house everything is close at hand.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7137.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:15:07"},
