  {id: 805, name: "Cammi Bed", number: nil, price: nil, description: "Bring out the toys and bring on the clothes with the ample storage space of this contemporary style youth bedroom collection. With a crisp white finish and colorful circular designs, this set is sure to catch the attention of any child that walks in.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7853pk-t.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:26:14"},
  {id: 806, name: "Bobbi Bed", number: nil, price: nil, description: "Simple yet fun, this contemporary style youth bed collection will grow with your child. The bright white finish is paired with a colorful trim and matching round knobs for an adorably charming look kids dream of having. With multiple drawers and open shelving, the matching case goods will provide all the storage your little one will need and more!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7852pk-t.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:26:23"},
  {id: 807, name: "Meredith Bed", number: nil, price: nil, description: "Whisk your little princess off to bed so she can dream of castles in the sky and wonderful adventures! Gentle curves along the headboard and footboard are enhanced by the lovely turned feet on every piece of this collection. Elegant carved floral accents along the headboard and footboard are mirrored on the matching case goods for a beautiful, cohesive look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7193.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:26:30"},
  {id: 808, name: "Meredith Bed", number: nil, price: nil, description: "Subtle and sweet, this two-tone bedroom set boasts perfectly carved wave-like panel details that perfectly contrasts the round drawer pull handles. Set atop lifted cut-out feet, coordinating case goods offer plenty of storage space. Hidden LED lights can be found below the night stand, which can easily double as a bedside night light for little ones.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7191.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:26:38"},
  {id: 809, name: "Royal Racer Bed", number: nil, price: nil, description: "Put your little one in the driver's seat to help them speed off to sweet dreams! Whether they're racing towards dreams in the car or stretching out in the loft bunk, you'll be able to prioritize floor space for safe fun every day. A metal mesh guardrail around the top bunk provides secure protection, ensuring no accidents get in the way of your child's fun. Paired storage pieces hold a multitude of items that will help keep the playroom or bedroom organized.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7190.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:27:20"},
  {id: 810, name: "Henrietta Bed", number: nil, price: nil, description: "Whisk your little princess off to bed so she can dream of castles in the sky and wonderful adventures! Gentle curves along the headboard and footboard are enhanced by the lovely turned feet on every piece of this collection. Elegant carved floral accents along the headboard and footboard are mirrored on the matching case goods for a beautiful, cohesive look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7192.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:27:35"},
  {id: 811, name: "Kimmel Bed", number: nil, price: nil, description: "These stylized two-tone pieces are the perfect collection for the outdoorsy adolescent. The bright white is beautifully contrasted by two color choices, which accentuate the tabletops and fence-inspired headboard. The platform bed provides a fun alternative to traditional sleeping environments while the case goods add that extra pop with storage functionality.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7626bl.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:27:45"},
  {id: 812, name: "Enchant Bed", number: nil, price: nil, description: "You're going to love watching your little ones recreate the magical story of an enchanted princess transformation or create a whole new story of their own! This beautiful coach design bed is filled with fun surprises! With its intricate, scrollwork pattern and its gorgeous color, our beautiful bed is more than worthy of a curtain call.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7705cpn.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:27:56"},
  {id: 813, name: "Winn Park Bed", number: nil, price: nil, description: "Form, function, and convenience are the hallmarks of this contemporary bedroom group. The padded leatherette headboard and platform create an urban feel, while the ultra-modern clean lines of the matching chest, dresser, and night stand accentuate the look of the set. A twin size bed is also available with its own set of kids' case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7008_4.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:29:21"},
  {id: 821, name: "Lianne Bed", number: nil, price: nil, description: "Boasting a platform design perfect for creating under-bed storage, this padded faux leather bed features precious crystal-like button tufted accents complimented by metallic mesh trim borders. Equipped with a mattress-ready slat kit and available in two colors, this bed will make a sweet addition to your child's room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7217wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:50:47"},
