  {id: 824, name: "Rainbow Bed", number: nil, price: nil, description: "This high headboard style is part of the Rainbow Metal Bed Collection. There are two bed sizes and seven color options featuring full metal construction with non-recycled heavy gauge tubing. An optional trundle for extra sleeping space is also available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7712bk.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:51:37"},
  {id: 827, name: "Mullan Bed", number: nil, price: nil, description: "A charming transitional style bedroom set led by a stylish sleigh bed with gracefully curving head and foot boards and attractive bracket feet. The case goods offer a perfect complement.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7944wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:54:04"},
  {id: 825, name: "Field Tripper Twin Bed", number: nil, price: nil, description: "This metal twin size bed is perfect for a kids bedroom, but it also works great in a guest room (or any shared space) for those fun sleepovers! Featuring a durable metal construction, it feels just like a real school bus so your kid can sleep safe and sound.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7797.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:51:49"},
