  {id: 828, name: "Medina Bed", number: nil, price: nil, description: "With a timeless, traditional style, our panel bed is a great option that can work in any room of your home. The bed features a sculpted camel-shaped headboard that will add youthfulness to the room. Its sturdy, made-to-last construction means it", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7942wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:54:22"},
