  {id: 829, name: "Freedom Racer Twin Bed", number: nil, price: nil, description: "Can anything be more patriotic than this awesome race car bed? The flag is displayed on its leatherette headboard, while the built-in shelf can hold books and toys. With full metal construction and white, this twin size bed is perfect for young kids everywhere!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7765-side_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:54:36"},
  {id: 814, name: "Power Racer Twin Bed", number: nil, price: nil, description: "Heres a bed that your kids can see themselves in! This race car twin bed has a leatherette headboard and features large replica tires. The bed frame, which is mattress ready, is made of metal and comes in three colors: black, pink or white. Its a piece your kid will surely love!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7285pk.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:29:27"},
