  {id: 817, name: "Kimmel Bed", number: nil, price: nil, description: "These stylized two-tone pieces are the perfect collection for the outdoorsy adolescent. The bright white is beautifully contrasted by two color choices, which accentuate the tabletops and fence-inspired headboard. The platform bed provides a fun alternative to traditional sleeping environments while the case goods add that extra pop with storage functionality.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7626pk.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:29:55"},
  {id: 818, name: "Lizbeth Bed", number: nil, price: nil, description: "Add some excitement to your little one's room with this light-up bedroom collection. A touch-activated LED strip lines the panel headboard, accentuating the straight and simple lines. The white fi nish adorns the complete collection and masks the sturdy wood collection to ensure a clean and bright environment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7840.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:30:07"},
  {id: 831, name: "Retro Express Bed", number: nil, price: nil, description: "Finished in either red or blue with yellow and black accents, this adorable train bed will bring both fun and comfort to any child's bedroom. Built with a sturdy metal construction and padded leatherette headboard, this adds to the charm of this mattress-ready twin bed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7106bl_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:54:56"},
  {id: 832, name: "Rainbow Bed", number: nil, price: nil, description: "This low headboard style is part of the Rainbow Metal Bed Collection. There are two bed sizes and seven color options featuring full metal construction with non-recycled heavy gauge tubing. An optional trundle for extra sleeping space is also available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7713sv.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:55:08"},
  {id: 833, name: "Turbo Racer Bed", number: nil, price: nil, description: "Fulfill your childs need for speed with this fun race car bed. This bed has a sturdy metal construction with leatherette headboard and replica car wheels for added realism. Mattress ready, all this bed needs now is a driver!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7107rd.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:55:13"},
  {id: 836, name: "Monroe Bed", number: nil, price: nil, description: "The comfortable design paired with a simple single-toned finish creates an eye-catching bed. This platform bed features a high hung headboard decorated with button tufting and nailhead trim, sparing no expense when it comes to style, but also keeping convenience in mind.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7016pk.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:55:55"},
  {id: 839, name: "Juilliard Bed", number: nil, price: nil, description: "This striking bed will definitely appeal to those that share a love for pink! Fully upholstered in padded leatherette,the bed features glamorous crystal-like acrylic button tufting. Whats more is that on either sides of the headboard are bluetooth speakers, which will surely come in handy when its time to listen and enjoy a wonderful melody.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7056pk.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:56:37"},
  {id: 837, name: "Enchant Twin Bed", number: nil, price: nil, description: "Youre going to love watching your little ones recreate the magical story of an enchanted princess transformation or create a whole new story of their own! This beautiful coach design bed is filled with fun surprises! With its intricate, scroll work pattern and its gorgeous color, our beautiful bed is more than worthy of a curtain call.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7705-bed.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:56:05"},
  {id: 838, name: "Francesca Twin H/B Case Goods", number: nil, price: nil, description: "A camel-back design with vertical grooves gives charm to this set. The low-post bed shares the same design as the mirror, and like the bed, the rest of the case goods are also finished in cream. The suggested metal bed frame works perfectly with the bed in supporting the mattress.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7911_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:56:16"},
  {id: 840, name: "Colin Bed", number: nil, price: nil, description: "This great-looking bedroom set is perfect for a young child. The beds simple design and the matching case goods straight lines add to the beauty of the set. The dresser has a unique sliding door, while matching trundles and drawers are also available. Cherry and white finish are two options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7909ch.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:56:42"},
  {id: 842, name: "Hendrik Bed", number: nil, price: nil, description: "Make a bold and loud statement in your bedroom! This rather simple-looking bed is equipped with two bluetooth speakers on both sides of the headboard. Wirelessly connect your MP3 player and blast your favorite songs! The bed is mattress-ready and comes in either espresso or camel color.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7057_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:57:20"},
  {id: 841, name: "Trekker Twin Bed", number: nil, price: nil, description: "Fuel any childs imagination with this rover design twin bed. Sturdy metal construction and padded leatherette headboard off er both safety and comfort, while the front hood serves as a table for homework and play. Finished in gun metal, this bed is made for explorers of the future!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7766.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:56:53"},
  {id: 843, name: "Prado I Bed", number: nil, price: nil, description: "Simple and stylish design defines this youth bed. Metal skeletal frames form the headboard and footboard, adorned with bolt accents. The centerpiece of the headboard is a textured dark blue panel, which is also found on the matching night stand.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7167.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:30:27"},
  {id: 844, name: "Bella II Bed", number: nil, price: nil, description: "Perfect for sleep-overs, this Mission style platform bed comes in a twin size trundle plus three roomy drawers providing extra storage. Solid wood and veneer is finished in a dark walnut.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7035_2.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:30:43"},
  {id: 845, name: "Alexandra Bed", number: nil, price: nil, description: "Make every little girls dreams come true with this fairy tale style bedroom set. The beautiful sleigh bed features a twin trundle bed and a delicately decorated motif. Matching chest, dresser and night stand features French dovetail drawers in pearl white finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7226.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:30:48"},
  {id: 846, name: "Hervey Bed", number: nil, price: nil, description: "This full size captain", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7583ch.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:30:54"},
  {id: 854, name: "Victoria Bed", number: nil, price: nil, description: "A room fit for a princess! The four poster canopy bed is delicately decorated with a carved motif design and finished in pearl white. The matching dresser is enhanced with a vanity jewelry box and matching mirror. The hutch style desk, chair, chest and night stand round out the perfect bedroom set for a princess.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7519.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:19:56"},
  {id: 856, name: "Louis Philippe Jr. Bed", number: nil, price: nil, description: "The beautiful curves of the sleigh bed will make any bedroom look special. Finished in a classic dark cherry, this set is packed with extras including felt-lined hidden drawers and a twin trundle. Quiet understated elegance makes this bedroom set a classic.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7828ctr.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:21:27"},
  {id: 855, name: "CHARLOTTE Trundle", number: nil, price: nil, description: "This classic style optional trundle is finished in a rich cherry.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_335.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:20:45"},
  {id: 858, name: "Metro Bed", number: nil, price: nil, description: "An architectural X-brace design creates an sophisticated atomosphere around the Metro bedroom set. A padded leatherette headboard is a soft contrast to the gun metal gray finish and silver metallic drawer faces. Matching dresser, mirror, media chest and night stand combine functionality and style into one.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7166.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:22:07"},
  {id: 857, name: "MONTANA Captain Twin Bed", number: nil, price: nil, description: "The rich cherry finish of this Mission style platform bed creates a dynamic look for any bedroom. Recessed handles in the three drawers under the trundle make it easy to store things away. A dresser, chest and night stand complete the look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7031.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:21:38"},
  {id: 859, name: "Roxana Bed", number: nil, price: nil, description: "Beautiful, soft curved lines give this set a very elegant look. The curvy sides of the case goods echo the same feel as the camel-back headboard on the bed, which has twin and full size options. Both the bed and case goods are finished in white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7940.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:22:23"},
  {id: 861, name: "Largo Bed", number: nil, price: nil, description: "This contemporary bed is finished in unique metal tones. The matching night stand offer great style and durability. Choose between silver and dark gray finish or silver and black.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7163bk.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:23:39"},
  {id: 860, name: "Victoria Twin Canopy", number: nil, price: nil, description: "A room fit for a princess! The four poster canopy bed is delicately decorated with a carved motif design and finished in pearl white. The matching dresser is enhanced with a vanity jewelry box and matching mirror. The hutch style desk, chair, chest and night stand round out the perfect bedroom set for a princess.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7519cp_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:22:54"},
  {id: 862, name: "Caballero Bed", number: nil, price: nil, description: "This full size captains bed has built in drawers with room storage and a full length bookcase to store treasures.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7032-524.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:23:54"},
  {id: 863, name: "Racer Bed", number: nil, price: nil, description: "The need for speed is in every child! This race car twin bed is available in two colors, red and yellow or silver and black, with the main bed frame painted in matte black. It is made of sturdy metal and houses a shelf on top of the headboard. Mattress ready, this twin bed is perfect for any little race car driver!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7104ry.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:23:58"},
  {id: 849, name: "Pine Brook Bed", number: nil, price: nil, description: "With a slat kit included and paneled headboard, this casual bedroom set will fit best in a child's room. Options include matching case goods, including a hutch and desk, all accented with wooden knobs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7908wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:31:18"},
  {id: 847, name: "Rover Twin Bed", number: nil, price: nil, description: "Perfect for any boy who loves cars, this twin bed has all the accessories boys love: fat tires, roll bar and metal front grill. The hood of the car may be used as a table, while the top of the headboard doubles as a shelf. Painted in matte black with orange and silver accents, this rover bed is designed for the adventurous!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7105.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:31:04"},
  {id: 848, name: "Power Racer Twin Bed", number: nil, price: nil, description: "Heres a bed that your kids can see themselves in! This race car twin bed has a leatherette headboard and features large replica tires. The bed frame, which is mattress ready, is made of metal and comes in three colors: black, pink or white. Its a piece your kid will surely love!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7285wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:31:09"},
  {id: 850, name: "Cara Bed", number: nil, price: nil, description: "Update your bedroom with the clean straight lines of this functional bedroom set. All finished in a rich cherry or oak, the matching case goods are accented with wooden knobs. The platform bed is available in twin or full size and an under-bed option of a twin trundle or a set of three drawers.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7903oak.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:31:39"},
  {id: 852, name: "Villa Park Bed", number: nil, price: nil, description: "A sleek modern vibe fused with the relaxing warmth of the leatherette headboard will create a casual yet sophisticated look. There is generous storage in all the matching case goods, which are accented with brushed nickel knobs. A twin size bed is also available with its own set of kids' case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7007.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:32:21"},
  {id: 851, name: "Adriana Picket Fence Bed", number: nil, price: nil, description: "This little girl's bedroom set will please any princess with its curvy headboard and matching nightstand, dresser, mirror and chest. The set comes in white finish, and both the bed and case goods share the same turned legs and blunt arrow feet. The bed comes a beautiful picket fence design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7617y_1_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:31:53"},
