  {id: 868, name: "Freedom Racer Twin Bed", number: nil, price: nil, description: "Can anything be more patriotic than this awesome race car bed? The American flag is displayed on its leatherette headboard, while the built-in shelf can hold books and toys. With full metal construction and white, this twin size bed is perfect for young boys everywhere!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7765-side.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 01:01:06"},
