  {id: 996, name: "Catalina Bunk Bed", number: nil, price: nil, description: "For the more classic home, this twin over twin bunk bed has a fixed ladder for safety bold turned leg design and in an oak or cherry finish. Optional drawers or twin trundle available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk606ex.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:35:01"},
