  {id: 878, name: "AnnemarieBunk Bed", number: nil, price: nil, description: "Ensure your children have plenty of space to enjoy their room by making their bed a multi-purpose fixture! In addition to a twin-size loft bed with protective guardrails and a lower full-size bed underneath, this piece also offers multiple shelves for storage or display. Three wide shelves provide additional room for a personal touch while also doubling as an attached ladder to make accessing the top level even easier. Choose from three beautiful color options to begin the room transformation!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk965wh-l-f-1-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:03:52"},
  {id: 877, name: "Therese Bunk Bed", number: nil, price: nil, description: "An innovative design with kid's love of fun in mind, this contemporary style bunk bed features drawing boards that will let creativity thrive and imagination soar. With fence style guard rails and a handy attached ladder, your child can safely sleep, play, climb and more in absolute confidence.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk628f-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 01:03:44"},
  {id: 864, name: "Bella Bed", number: nil, price: nil, description: "This contemporary style trundle bed features a picket fence style headboard and footboard with extra storage with three drawers underneath the trundle. The matching dresser, mirror, chest and night stand are finished in bright white and have unique recessed handles.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7035w.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:24:07"},
  {id: 976, name: "Chesapeake Bunk Bed", number: nil, price: nil, description: "Simple and classic, this twin over twin bunk bed has curved footboard and headboards, angled ladder to access the top bunk and is finished in a smooth black or bright white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk616w_1.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:03:59"},
  {id: 865, name: "Rover Twin Bed", number: nil, price: nil, description: "Perfect for any boy who loves cars, this twin bed has all the accessories boys love: fat tires, roll bar and metal front grill. The hood of the car may be used as a table, while the top of the headboard doubles as a shelf. Painted in matte black with orange and silver accents, this rover bed is designed for the adventurous!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7105.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:24:19"},
  {id: 866, name: "Power Racer Twin Bed", number: nil, price: nil, description: "Heres a bed that your kids can see themselves in! This race car twin bed has a leatherette headboard and features large replica tires. The bed frame, which is mattress ready, is made of metal and comes in three colors: black, pink or white. Its a piece your kid will surely love!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7285wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:24:26"},
