  {id: 999, name: "Chesapeake Bunk Bed", number: nil, price: nil, description: "Simple and classic, this twin over twin bunk bed has curved footboard and headboards, angled ladder to access the top bunk and is finished in a smooth black or bright white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk616w_1.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:35:17"},
  {id: 1001, name: "Perla Sofa", number: nil, price: nil, description: "This bold design flaunts its contemporary flair, offering luxurious leather gel upholstery that complements the stainless steel trim and chrome legs. The contrasting details of this beautifully designed piece offers luxurious quality immersed in modern appeal that will liven up your living room for years to come. Available in 2 colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6424bk-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:43:26"},
  {id: 1002, name: "Monika Sofa", number: nil, price: nil, description: "Contemporary and chic, this sophisticated sofa set features a leather gel upholstery and stainless steel trim. The modern approach offers a contrasting stainless steel trim against the majestically dark leather gel to offer a unique touch of eclectic details. Impress your guests with this modern day sofa set and lounge out with class and style. Available in 2 colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6423gy-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:43:32"},
  {id: 1003, name: "Mirielle Sofa", number: nil, price: nil, description: "If youre looking for class and elegance but want to lounge in unrivaled comfort, take advantage of this contemporary sofa set. Sporting a plush headrest and pillow top armrests, this set will encourage you to relax in no time. Make your living space comfortable and inviting with a touch of sophistication and quality as you melt against the luxurious top grain leather match upholstery!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6502sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:43:37"},
  {id: 1004, name: "Nena Sofa", number: nil, price: nil, description: "Warm and inviting, this understated sofa set is a beautiful addition to any traditional living space. Fringe accents run along the paired accent pillows while fitted back and seat cushions feature comforting high density foam filling. Intricate wood trim decorates the base while running up along rolled arms to add elegant appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6438sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:44:26"},
  {id: 1005, name: "Badalona I Sofa", number: nil, price: nil, description: "Cozy up in your family room with this transitional chair designed to maximize your relaxing potential! Each of the rolled arms add a stylish appearance that offers a convenient place to prop your elbows or your head when stretching out for a quick cat nap. With T-cushion seating covered in linen-like fabric, this chair will brighten up your living space and create a warm and cozy atmosphere for your living room!, perfect for any family household.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6376bg-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:44:30"},
  {id: 1006, name: "Amadeo Sofa", number: nil, price: nil, description: "Beauty and strength in one, this collection offers a gorgeous seating choice for any parlor. Pecan brown upholstery comes accented with beige coloring to place emphasis on the warm brown tones. Solid wood framework ensures stability and durability while high density foam cushions provide comfortable padding. Loose back pillows featuring fringe trim and mesmerizing patterns add that extra bit of detail to raise this loveseat and sofa set to the next level.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6403sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:44:34"},
  {id: 1007, name: "Elwick Sofa", number: nil, price: nil, description: "Relinquish your old sofa and find comfort in the arms of this dark gray sofa set. The soft fabric is backed by dense foam cushion to deliver a distinguished level of luxury. Scrolled arms are elegantly detailed by nailhead trim as it wraps the soft curves and base with metallic accents. Nestle up with a good book on the accent chair or simply lounge out on the spacious sofa. However you define relaxation, the sofa set will satisfy all your comfort needs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6884sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:44:37"},
  {id: 1008, name: "Reanna Sofa", number: nil, price: nil, description: "Distinguished curves and tufted accents create a fluid, flowing aesthetic with this sofa and loveseat set. Every angle is covered in plush foam cushions and its breathable leatherette upholstery keeps you cool and comfortable. Coil springs take this design a step further, adding plenty of support to keep you relaxed and well-supported. Chrome legs add finishing detail as they gently curve in contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6414rd-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:46:37"},
  {id: 1010, name: "Reanna Sofa", number: nil, price: nil, description: "Distinguished curves and tufted accents create a fluid, flowing aesthetic with this sofa and loveseat set. Every angle is covered in plush foam cushions and its breathable leatherette upholstery keeps you cool and comfortable. Coil springs take this design a step further, adding plenty of support to keep you relaxed and well-supported. Chrome legs add finishing detail as they gently curve in contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6414wh-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:46:45"},
  {id: 1011, name: "Ceuta Sofa", number: nil, price: nil, description: "Create a cozy home ambiance with the warming brown sofa set. The soft chenille fabric and dense foam filled cushions provide all the comfort you need for a relaxing experience. Vibrant accent pillows provide additional support with plush filling and detailed patterning to accent. Cozy up and dive into a new level of comfort with the charming sofa set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6522sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:46:49"},
  {id: 1012, name: "Benigno Sofa", number: nil, price: nil, description: "Surround yourself in elegance as you relax against the various upholsteries of this gorgeous sofa collection. Available in four colors, this sophisticated set will be a sure topic of conversation when guests come over. Nailhead trim decorates the leatherette panels while linen-like upholstery wraps the flared exterior. Reversible seat cushions and back pillows allow you to customize your home area to perfection.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6411-sf-1.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:46:53"},
  {id: 1013, name: "Sherri Sofa", number: nil, price: nil, description: "With a sleekly designed base and angled back, this sofa set provides a stylish update for your living room! Sophisticated breathable leatherette upholstery adds a durable yet comfy touch to the prominently stitched detailing between the tufts. Front metal legs taper to a sturdy point while the upholstered frame elegantly curves down to support the piece in back. With the comfortable lumbar pillows included with each piece, this set is just what your weary back needs at the end of a long day!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6413gy-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:46:56"},
  {id: 1014, name: "Nichola Sofa", number: nil, price: nil, description: "Upgrade your living space with the elegance and class of this contemporary sofa set! These chic leatherette pieces come with sleek chrome and an intricate and contrasting stitched pattern to enhance the visual appeal of this modern-inspired sofa set. Bring home this splash of elegance to fill your home with luxurious appeal, guaranteeing you will not miss out on the cozy comfort your guests will appreciate!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6008bl-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:47:00"},
  {id: 1015, name: "Reanna Sofa", number: nil, price: nil, description: "Distinguished curves and tufted accents create a fluid, flowing aesthetic with this sofa and loveseat set. Every angle is covered in plush foam cushions and its breathable leatherette upholstery keeps you cool and comfortable. Coil springs take this design a step further, adding plenty of support to keep you relaxed and well-supported. Chrome legs add finishing detail as they gently curve in contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6414bk-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:47:03"},
  {id: 1016, name: "Benigno Sofa", number: nil, price: nil, description: "Surround yourself in elegance as you relax against the various upholsteries of this gorgeous sofa collection. Available in four colors, this sophisticated set will be a sure topic of conversation when guests come over. Nailhead trim decorates the leatherette panels while linen-like upholstery wraps the flared exterior. Reversible seat cushions and back pillows allow you to customize your home area to perfection.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6414-sf-1.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:47:08"},
  {id: 1017, name: "Ceuta Love Seat", number: nil, price: nil, description: "Create a cozy home ambiance with the warming brown sofa set. The soft chenille fabric and dense foam filled cushions provide all the comfort you need for a relaxing experience. Vibrant accent pillows provide additional support with plush filling and detailed patterning to accent. Cozy up and dive into a new level of comfort with the charming sofa set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6522-lv-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:47:37"},
  {id: 1018, name: "Sherri Sofa", number: nil, price: nil, description: "With a sleekly designed base and angled back, this sofa set provides a stylish update for your living room! Sophisticated breathable leatherette upholstery adds a durable yet comfy touch to the prominently stitched detailing between the tufts. Front metal legs taper to a sturdy point while the upholstered frame elegantly curves down to support the piece in back. With the comfortable lumbar pillows included with each piece, this set is just what your weary back needs at the end of a long day!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6413wh-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:38"},
  {id: 1019, name: "Nichola Sofa", number: nil, price: nil, description: "Upgrade your living space with the elegance and class of this contemporary sofa set! These chic leatherette pieces come with sleek chrome and an intricate and contrasting stitched pattern to enhance the visual appeal of this modern-inspired sofa set. Bring home this splash of elegance to fill your home with luxurious appeal, guaranteeing you will not miss out on the cozy comfort your guests will appreciate!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6008bk-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:42"},
  {id: 1020, name: "Nanette Sofa", number: nil, price: nil, description: "Modernize your living room space with this contemporary chair! Designed to maximize comfort with a style that you'll admire, the sleek and smooth leather gel gives each piece a polished and refined look. The edge is outlined with stainless steel that elegantly silhouettes each piece for a modern appeal. With classic elements tempered by a minimalist design, this sofa set brings a luxurious update to your home that you won't want to miss!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6425gy-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:46"},
  {id: 1022, name: "Perla Sofa", number: nil, price: nil, description: "This bold design flaunts its contemporary flair, offering luxurious leather gel upholstery that complements the stainless steel trim and chrome legs. The contrasting details of this beautifully designed piece offers luxurious quality immersed in modern appeal that will liven up your living room for years to come. Available in 2 colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6424bk-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:53"},
  {id: 1037, name: "Pollux Sofa", number: nil, price: nil, description: "Add pops of neutral coloring to your most-visited room! This two-tone sofa collection features shades of brown that work well with any home dcor. Paired with a built-in storage console, this reclining set is a must-have for the avid homebody.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6864-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:59"},
  {id: 1024, name: "Mirielle Sofa", number: nil, price: nil, description: "If youre looking for class and elegance but want to lounge in unrivaled comfort, take advantage of this contemporary sofa set. Sporting a plush headrest and pillow top armrests, this set will encourage you to relax in no time. Make your living space comfortable and inviting with a touch of sophistication and quality as you melt against the luxurious top grain leather match upholstery!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6502sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:03"},
  {id: 1025, name: "Nena Sofa", number: nil, price: nil, description: "Warm and inviting, this understated sofa set is a beautiful addition to any traditional living space. Fringe accents run along the paired accent pillows while fitted back and seat cushions feature comforting high density foam filling. Intricate wood trim decorates the base while running up along rolled arms to add elegant appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6438sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:08"},
  {id: 1026, name: "Badalona I Sofa", number: nil, price: nil, description: "Cozy up in your family room with this transitional chair designed to maximize your relaxing potential! Each of the rolled arms add a stylish appearance that offers a convenient place to prop your elbows or your head when stretching out for a quick cat nap. With T-cushion seating covered in linen-like fabric, this chair will brighten up your living space and create a warm and cozy atmosphere for your living room!, perfect for any family household.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6376bg-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:12"},
  {id: 1027, name: "Amadeo Sofa", number: nil, price: nil, description: "Beauty and strength in one, this collection offers a gorgeous seating choice for any parlor. Pecan brown upholstery comes accented with beige coloring to place emphasis on the warm brown tones. Solid wood framework ensures stability and durability while high density foam cushions provide comfortable padding. Loose back pillows featuring fringe trim and mesmerizing patterns add that extra bit of detail to raise this loveseat and sofa set to the next level.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6403sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:15"},
  {id: 1028, name: "Elwick Sofa", number: nil, price: nil, description: "Relinquish your old sofa and find comfort in the arms of this dark gray sofa set. The soft fabric is backed by dense foam cushion to deliver a distinguished level of luxury. Scrolled arms are elegantly detailed by nailhead trim as it wraps the soft curves and base with metallic accents. Nestle up with a good book on the accent chair or simply lounge out on the spacious sofa. However you define relaxation, the sofa set will satisfy all your comfort needs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6884sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:19"},
  {id: 1029, name: "Reanna Sofa", number: nil, price: nil, description: "Distinguished curves and tufted accents create a fluid, flowing aesthetic with this sofa and loveseat set. Every angle is covered in plush foam cushions and its breathable leatherette upholstery keeps you cool and comfortable. Coil springs take this design a step further, adding plenty of support to keep you relaxed and well-supported. Chrome legs add finishing detail as they gently curve in contrast.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6414rd-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:25"},
  {id: 1030, name: "Benigno Sofa", number: nil, price: nil, description: "Surround yourself in elegance as you relax against the various upholsteries of this gorgeous sofa collection. Available in four colors, this sophisticated set will be a sure topic of conversation when guests come over. Nailhead trim decorates the leatherette panels while linen-like upholstery wraps the flared exterior. Reversible seat cushions and back pillows allow you to customize your home area to perfection.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6412-sf-1.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:30"},
  {id: 1031, name: "Alessio Sofa", number: nil, price: nil, description: "Visitors will wonder if they wandered into a palace when they enter and find this ornate sofa  awaiting them. An elaborate wooden trim decorates the base and front of the rolled armrests and continues the frame to accentuate the top of the backrest. Sleek faux leather lines the flared arms and back while sumptuous chenille fabric covers the seat cushions in soft luxury. Resting atop elegantly turned bun feet, this sofa  will earn your decorating respect and grant your home a majestic air.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6406-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:51:37"},
  {id: 1032, name: "Lesath Sofa", number: nil, price: nil, description: "Featuring wide and deep cushioned seats to sink back into after your long day, this low profile sofa set is a must-have for the workaholic. T-style cushioning and sloped track arms create a sleek modern appeal while gray chenille fabric takes lounging to the next level. Uniquely printed pillows elevate its sophisticated design, ensuring this sofa set blends right into your living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2251-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:19"},
  {id: 1043, name: "Lynne Sofa", number: nil, price: nil, description: "A transitional design with contemporary accents, this gorgeous sofa is a classic look fit for casual homes and fine estates alike. The brown chenille upholstery is a chic touch that will provide hours of endless comfort. With detailed welt trim and a decorative nailhead border, the plush cushions and rolled arms add an elegant touch perfect for this collection.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6818-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:47:55"},
  {id: 1044, name: "Hetty Sofa", number: nil, price: nil, description: "Beautifully tailored, this sofa features an elegantly curved backrest with ornate nailhead trim. Traditional influences are portrayed by rolled armrests and wood bun feet. Upholstered in soft brown fabric to effortlessly blend into any home with ease, this sofa  will become the perfect focal point of your living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6854-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:47:59"},
  {id: 1045, name: "Kate I Sofa", number: nil, price: nil, description: "Modern design gets a retro twist with this fun modern sofa with sleek leatherette upholstery and tapered legs. The U-shaped frame encompasses plush tufted cushions that are as attractive as they are comfortable. This mid-century modern inspired design is sure to be a hit in any contemporary home!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6505-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:04"},
  {id: 1046, name: "Chantal Sofa", number: nil, price: nil, description: "Let your living room make a powerful opening statement with this chic and comfy set! The high, flaring armrests wrap around both sides, gently cradling the lengthy seat cushion between. A series of varied patterned accent pillows accompany each of these pieces, offering customizable comfort and adding plenty of style to the design. Available in multiple colors, these pieces will make an inviting impression right from the start.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2661-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:08"},
  {id: 1047, name: "Imani Sofa", number: nil, price: nil, description: "Featuring regal and sophisticated designs with modern hues, this sofa calls attention to your living room. Soft beige linen upholstery features deep button tufting for a lavish and extraordinary appearance that is only topped by the subtle nailhead trim. Its unique design is supported upon leveled wood feet. Sink into this beautiful and comfortable piece with a cup of tea and a good book!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6860-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:12"},
  {id: 1033, name: "Jaya Sofa", number: nil, price: nil, description: "Prominently display this comfy sofa in your living room to easily guide the conversation over to these contemporary seats. The conspicuous welt trim adds sleek contrast to the faux nubuck upholstery and highlights the plush armrests and seat cushions. Strike up a conversation and keep it going long into the night so you can relax against the comfortable cushions for as long as possible.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6503db-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:23"},
  {id: 1034, name: "Karlee Sofa", number: nil, price: nil, description: "Game day just got better! Invite your closest friends over to watch the game while comfortable reclining seats add a touch of relaxation. The sofa features plush cushions and multiple reclining seats that your guests will fall in love with!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6988-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:27"},
  {id: 1035, name: "Glynis Sofa", number: nil, price: nil, description: "Velvet is making a comeback and its here to stay! Upholstered in soft velvet, this sofa set features contemporary designs combined with old-fashioned elements. The deep seats feature plush cushions filled with Dacron-wrapped foam and sinuous wire springs, all to provide optimal comfort. Gently sloped armrests add dimension without breaking a sweat with the durable hardwood supporting the entire frame. Matching accent pillows give a unique flair to a beautifully tailored set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm1276-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:30"},
  {id: 1036, name: "Wezen Sofa", number: nil, price: nil, description: "Perfect for bold and daring personalities, this sofa features a distinctive and striking structure that calls for attention. Angled armrests rested on cylindrical chrome legs showcase its futuristic features and the two-tone coloring highlights the vivid leatherette upholstery. Available in 2 colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6412wh-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:33"},
  {id: 1038, name: "Oliviera Sofa", number: nil, price: nil, description: "Fine and divine, this contemporary style sofa set offers it all! The silver, velvet-like upholstery is luxuriously soft while the loose back pillows provide a comfortable place to sit back and lounge. Chic accent pillows showcase vibrant purple hues and bold floral prints for a look that is as fun as it is attractive. The flared arms and its paired nailhead trim complete this contemporary look for a collection that has undeniable sophistication.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6204-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:36"},
  {id: 1040, name: "Keara Sofa", number: nil, price: nil, description: "Put your comfort first with this reclining sofa. Multiple reclining seats allow everyone to sit back in ease. Plush cushions and oversized armrests provide rest and relaxation after a long day. This reclining sofa will provide your family with the best comfort!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6984-pm-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:44"},
  {id: 1041, name: "Janie Sofa", number: nil, price: nil, description: "Enhance your living room decor with retro styles and chic designs. The simplified structure of this sofa is supported on long mid-century modern inspired legs that create an elevated and throwback appeal. High density foam cushions provide a plush and comfortable seating area for your guests, allowing this one-of-a-kind design to take center stage!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6977gy-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:49"},
  {id: 1048, name: "Tabitha Sofa", number: nil, price: nil, description: "Add some traditional elements to your home with the help of this sophisticated sofa. Elegant designs and intricately carved detailing give this sofa a look of lavishness while the cozy foam filled cushions provide practical comfort day after day.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6110-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:16"},
  {id: 1049, name: "Nazzareno Sofa", number: nil, price: nil, description: "Accentuate glamour and elegance with this unique, statement upholstery collection. Premium Jacquard fabric draws attention to the beautifully sloped arms and their lined nailhead trim. Paired accent pillows showcase matching patterning while enhancing the soft velvet fabric wrapped tightly around the T-cushions and button tufted back.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6305-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:20"},
  {id: 1051, name: "Genna Sofa", number: nil, price: nil, description: "Fun and functional, this stylish sofa showcases the best of modern designs. The mid-century modern styles legs and simple track arms create a no-fuss framework while whimsical accent pillows add extra pops of color!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm8820-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:27"},
  {id: 1109, name: "Rydel Sofa", number: nil, price: nil, description: "Entertain in style with these structured seats. The rolled arms come to life with nailhead accents while loose back pillows add visual depth to the collection. Smooth chenille fabric creates a warm environment with the paired brown coloring.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6127-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:48:31"},
  {id: 1052, name: "Kensett Sofa", number: nil, price: nil, description: "The low back of this traditional style sofa creates an air of elegance to make even the most basic space a place of refined sophistication. The plush chenille upholstery gets a dramatic twist with ornately designed accent pillows adding extreme comfort and over-the-top style. For warmth and charm, the rolled arms are trimmed with intricately carved wood for an absolutely stunning touch.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6210-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:42"},
  {id: 1053, name: "Verdante Sofa", number: nil, price: nil, description: "Add bold coloring to your living space with this gorgeous emerald green sofa set. The plush microfiber upholstery is soft to the touch and features foam-filled padding for a comfortably firm seat. Style wise, this collection features dramatic curved arms and a raised panel back accentuated with gorgeous nailhead trim. The accent pillows are fashioned with a shimmering gold tint and showcase lovely designs for a piece that represents chic design with a fun twist.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2271-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:45"},
  {id: 1054, name: "Hallie Sofa", number: nil, price: nil, description: "A quintessential representation of mid-century modern styles, this chenille upholstered sofa features gorgeous accents such as button tufting and sloped track arms. Extra padding within the arms enhance the comfort of the already plush foam-filled structure while durable hardwood legs and framework offer peace of mind for a numbers years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm8821-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 19:04:24"},
  {id: 1055, name: "Nicanor Sofa", number: nil, price: nil, description: "Beautifully designed and masterfully executed, this traditional style sofa offers a grand experience beyond compare. Elegantly rolled arms are lined with ornate wood trim for a charming touch that adds real warmth. As a dramatic statement, the plush foam-filled cushions feature floral printed chenille upholstery with matching accent pillows. Guests will flock to this collection eagerly and await the comfort and beauty that follow.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6407-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:56"},
  {id: 1056, name: "Gilda Sofa", number: nil, price: nil, description: "Comfort and luxury go hand in hand with this gorgeous sofa set. Each cushion features gel infused memory foam and Dacron-wrapped high density foam to create a plush and relaxing seating space for you and your guests. Neutral accent pillows stylishly add decor while the low profile structure draws attention to the rolled arms. Supported on solid wood feet, this sofa set is the perfect addition a chic home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm1271-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:49:55"},
  {id: 1057, name: "Jamael Sofa", number: nil, price: nil, description: "Visitors will wonder if they wandered into a palace when they enter and find this ornate sofa  awaiting them. An elaborate wooden trim decorates the base and front of the rolled armrests and continues the frame to accentuate the top of the backrest. Sleek faux leather lines the flared arms and back while sumptuous chenille fabric covers the seat cushions in soft luxury. Resting atop elegantly turned bun feet, this sofa will earn your decorating respect and grant your home a majestic air.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6405-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:49:59"},
  {id: 1058, name: "Leigh Sofa", number: nil, price: nil, description: "Sit back and sink yourself into this ultra-comfortable reclining sofa. Upholstered in soft gray fabric to enhance your lounging experience, each recliner features a manual side lever for easy relaxation. Tufted and plush cushions provide optimal comfort for you to kick back and dream on after a long day.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6238-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:03"},
  {id: 1224, name: "Stanford Sofa", number: nil, price: nil, description: "Featuring button tufted cushions with nail head trim borders, this fabric sofa set offers a timeless design bound to fit any living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6269tl-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:55:15"},
  {id: 1061, name: "Pollux Sofa", number: nil, price: nil, description: "Stretch out your legs and lean back into a comfortable position without having to fight over seats! You and your family can all enjoy reclining functions with this comfortable sofa. Each seat comes upholstered in black leatherette for a cool and relaxing experience. Plush cushions and baseball stitching accents add shape and dimension to your stylish living room!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6981-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:15"},
  {id: 1062, name: "Percey Sofa", number: nil, price: nil, description: "Simple, neutral and sophisticated are all key features to describe this collection. The off-white upholstery creates a bright and welcoming visual while chevron printed accent pillows make a fun statement. Bold contrasting trim cleans up the edges and allows attention to focus on the stylized design.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm1278-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:19"},
  {id: 1063, name: "Wezen Sofa", number: nil, price: nil, description: "Perfect for bold and daring personalities, this sofa features a distinctive and striking structure that calls for attention. Angled armrests rested on cylindrical chrome legs showcase its futuristic features and the two-tone coloring highlights the vivid leatherette upholstery. Available in 2 colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6412rd-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:23"},
  {id: 1064, name: "Kris Sofa", number: nil, price: nil, description: "Enjoy luxury and comfort with this top grain leather match reclining sofa. Large plush cushions with tufted accents create a comfortable seating environment and convenient side levers provide easy access into a reclined position. Oversized armrests and cushions make it easy to lounge around for hours, so much so that youll never want to get up from these comfortable seats!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6293-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:27"},
  {id: 1065, name: "Elly Sofa", number: nil, price: nil, description: "Prominently display this comfy sofa in your living room to easily guide the conversation over to these contemporary seats. The conspicuous welt trim adds sleek contrast to the faux nubuck upholstery and highlights the plush armrests and seat cushions. Strike up a conversation and keep it going long into the night so you can relax against the comfortable cushions for as long as possible.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6504-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:55:20"},
  {id: 1066, name: "Chantal Sofa", number: nil, price: nil, description: "Let your living room make a powerful opening statement with this chic and comfy set! The high, flaring armrests wrap around both sides, gently cradling the lengthy seat cushion between. A series of varied patterned accent pillows accompany each of these pieces, offering customizable comfort and adding plenty of style to the design. Available in multiple colors, these pieces will make an inviting impression right from the start.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2664-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:55:24"},
  {id: 1067, name: "Kallie Sofa", number: nil, price: nil, description: "Fill your home with uplifting vibes using this radiant red sofa. A fun and romantic rich red color leaves a striking impression that enhances the simplistic structures. Complemented with angled chrome legs for some flair and pizzazz, this sofa set will add color and life into your living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6848-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:55:28"},
  {id: 1068, name: "Keara Sofa", number: nil, price: nil, description: "Put your comfort first with this reclining sofa. Multiple reclining seats allow everyone to sit back in ease. Plush cushions and oversized armrests provide rest and relaxation after a long day. This reclining sofa will provide your family with the best comfort!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6984-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:55:31"},
  {id: 1070, name: "Chantal Sofa", number: nil, price: nil, description: "Let your living room make a powerful opening statement with this chic and comfy set! The high, flaring armrests wrap around both sides, gently cradling the lengthy seat cushion between. A series of varied patterned accent pillows accompany each of these pieces, offering customizable comfort and adding plenty of style to the design. Available in multiple colors, these pieces will make an inviting impression right from the start.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2662-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:55:38"},
  {id: 1071, name: "Jolanda I Sofa", number: nil, price: nil, description: "With the luxurious presence of this glam sofa in your home, youll feel and relax like the queen of the castle. Featuring a curved back design with beautifully tufted detailing and curved arms adorned by perfectly placed nail head trim, this piece is a must-have for the sophisticated household.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6159bk-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:55:45"},
  {id: 1072, name: "Joni Sofa", number: nil, price: nil, description: "Classy rolled arms and charming nailhead trim work together to create a traditional style sofa with handsome appeal. Brown breathable leatherette upholstery creates a cozy retreat, perfect for relaxing with a hot beverage and plush blanket. The weathered look provides a rustic vibe while the ornate bun feet add elegance for a dynamic look with tons of character!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6194-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:55:50"},
  {id: 1074, name: "Safiya Sofa", number: nil, price: nil, description: "Your eyes will not know where to look with this stunning contemporary style sofa set! The curved back is accented with elegant rolled arms and decorative nailhead trim for a design that screams chic. The silver bun feet provide a beautiful compliment to the navy blue microfiber upholstery. Finishing up the look are vibrantly designed accent pillows with beautiful blue hues, and fun striped and damask print designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2234-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:05"},
  {id: 1075, name: "Jaya Sofa", number: nil, price: nil, description: "Prominently display this comfy sofa in your living room to easily guide the conversation over to these contemporary seats. The conspicuous welt trim adds sleek contrast to the faux nubuck upholstery and highlights the plush armrests and seat cushions. Strike up a conversation and keep it going long into the night so you can relax against the comfortable cushions for as long as possible.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6503db-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:11"},
  {id: 1076, name: "Glynis Sofa", number: nil, price: nil, description: "Velvet is making a comeback and its here to stay! Upholstered in soft velvet, this sofa set features contemporary designs combined with old-fashioned elements. The deep seats feature plush cushions filled with Dacron-wrapped foam and sinuous wire springs, all to provide optimal comfort. Gently sloped armrests add dimension without breaking a sweat with the durable hardwood supporting the entire frame. Matching accent pillows give a unique flair to a beautifully tailored set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm1276-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:16"},
  {id: 1077, name: "Karlee Sofa", number: nil, price: nil, description: "Game day just got better! Invite your closest friends over to watch the game while comfortable reclining seats add a touch of relaxation. The sofa features plush cushions and multiple reclining seats that your guests will fall in love with!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6988-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:19"},
  {id: 1078, name: "Wezen Sofa", number: nil, price: nil, description: "Perfect for bold and daring personalities, this sofa features a distinctive and striking structure that calls for attention. Angled armrests rested on cylindrical chrome legs showcase its futuristic features and the two-tone coloring highlights the vivid leatherette upholstery. Available in 2 colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6412wh-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:26"},
  {id: 1079, name: "Oliviera Sofa", number: nil, price: nil, description: "Fine and divine, this contemporary style sofa set offers it all! The silver, velvet-like upholstery is luxuriously soft while the loose back pillows provide a comfortable place to sit back and lounge. Chic accent pillows showcase vibrant purple hues and bold floral prints for a look that is as fun as it is attractive. The flared arms and its paired nailhead trim complete this contemporary look for a collection that has undeniable sophistication.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6204-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:30"},
  {id: 1080, name: "Pollux Sofa", number: nil, price: nil, description: "Add pops of neutral coloring to your most-visited room! This two-tone sofa collection features shades of brown that work well with any home dcor. Paired with a built-in storage console, this reclining set is a must-have for the avid homebody.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6864-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:33"},
  {id: 1081, name: "Kristi Sofa", number: nil, price: nil, description: "Upgrade your living room with this chic and trendy seating collection. Foam padding for each piece provides undeniable comfort while warm linen-like fabric creates a beautiful canvas for the patterned accent pillows and ottoman. Nailhead trim accents the tuxedo style arms and rolled cushions keep the sides padded, while an optional ottoman is available for perfect relaxation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6835-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:37"},
  {id: 1082, name: "Rashid Sofa", number: nil, price: nil, description: "Eyes will pop when they land on this exquisite, traditional style sofa set. The mixture of colors, textures and patterns creates a fanciful experience that will welcome the senses. Intricate carved wood trim, floral print pillows and chair backs, rich rolled leather arms and soft fabric upholstery are a few of the many features that make this sofa set so amazing!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6789-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:42"},
  {id: 1083, name: "Jericho Sofa", number: nil, price: nil, description: "Regal and elegant, this sofa set delivers the majestic flair your fancy sitting room's been seeking! Relax upon the top grain leather match cushions and lean against the button tufted backrest. The intricate carved detail along the curving wood frame provides a grand aura that radiates sophistication. Complete with rolled armrests and cabriole legs, this set provides both beauty and splendor that is surpassed only by its comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6786-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:45"},
  {id: 1084, name: "Bensen Sofa", number: nil, price: nil, description: "If this sofa set looks plush and comfy, it", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6151-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:48"},
  {id: 1085, name: "Listowel Sofa", number: nil, price: nil, description: "Spend your down-time putting your feet up on this sofa set! Flip up the footstools on these reclining seats and lean back to find that perfect relaxation spot. The center backrest of the sofa can be lowered to reveal a concealed table top with a convenient USB plug. Upholstered in luxurious bonded leather and featuring plush armrests and headrests, this sofa set is perfect for making the most of your relaxation time.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6992-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:52"},
  {id: 1089, name: "Leifur Sofa", number: nil, price: nil, description: "Clean lines and simple designs make this modern sofa set a true showstopper! Box-like framework showcases sleek track arms and smooth upholstery while the slim stainless steel framework not only acts as a sturdy base but also adds a stylish touch that pushes the boundaries of imagination and creativity.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6791wh-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:13"},
  {id: 1090, name: "Carin Sofa", number: nil, price: nil, description: "Enhance your living room's contemporary appeal with this chic sofa set! Entirely upholstered in padded linen-like fabric, each piece features angled feet and armrests. Lean back against the button tufted backrest and let your worries drift away as you relax against the stylish foam-filled cushions. Available in two neutral colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6134lg-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:17"},
  {id: 1091, name: "Liana Sofa", number: nil, price: nil, description: "Liven up your living room with this transitional sofa set. Sit down on the box cushioned seats and lean back against the padded linen-like fabric upholstery for simple and convenient relaxation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6792-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:22"},
  {id: 1092, name: "Turton Sofa", number: nil, price: nil, description: "Fill your home with warm and inviting pieces starting with this cozy sofa set. Plush headrests provide extra comfort while beautiful nailhead trim helps accent the rolled armrests and bun feet. Boasting sleek top grain leather match upholstery, this collection provides durable and comforting seating for hours of enjoyment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6191by-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:27"},
  {id: 1093, name: "Kamilah Sofa", number: nil, price: nil, description: "This sofa set adds both grandeur and stylish comfort to your living room! Stretch out on the single seat fabric cushions and rest against the rolled armrests to enjoy the most majestic and comfortable seat in your home. Button tufts along the top grain leather match backrest off er a dynamic visual element that helps draw the eye towards the intricate carved detailing along the top.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6787-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:36"},
  {id: 1094, name: "Viscontti Sofa", number: nil, price: nil, description: "Retro-inspired modern is in the air with this sofa collection. This minimalist set showcases impeccable tailoring, soft sloped arms, and richly textured upholstery. Contoured lines give a modern look, while minimal nailheads and beautiful pillow patterns bring just enough retro feel. High-resiliency foam cushions provide superior comfort that lasts.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2206-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:40"},
  {id: 1095, name: "Salome Sofa", number: nil, price: nil, description: "Relax in style with this updated sofa collection. The smooth leatherette upholstery features a gorgeous neutral gray coloring while contrasting welt trim in white emphasizes the sleek lines. Bucket cushions gently curve and support, providing a stylish seating design for the reclining seats.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6798-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:44"},
  {id: 1096, name: "Sullivan Sofa", number: nil, price: nil, description: "What appears on the surface as an assuming sofa set will blow you away with the comfort it brings. Crown cushions off er maximum support with 2-inch gel memory foam, while the textured microfiber fabric is soft to the touch. The earth-tone colors, from the mocha body fabric and dark brown patterns on the accent pillows, will work well with transitional spaces for an understated look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6132-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:49"},
  {id: 1098, name: "Ruth Sofa", number: nil, price: nil, description: "You'll absolutely love the versatility of this reclining sectional set. Aside from the superior comfort and relaxation this set provides, its customizable design easily conforms to fit your home decorating needs. Choose to display this set as an L-shaped sectional with the corner seat add-on or as a more traditional sofa and love seat combo. Added functionality comes in the form of the loveseat duo, which comes equipped with a lift-top storage unit and built-in cup holders.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6783br-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:56"},
  {id: 1099, name: "Wilford Sofa", number: nil, price: nil, description: "Here's a living room piece that will surely delight traditional fans! A bold frame crafted with intricate wooden details, bun feet, and rolled arms is paired with a unique combination of two equally gorgeous fabrics: a burgundy fabric for the seats and back, while the arms are wrapped in brown leatherette. Accent pillows are included in matching burgundy shade that adds even more luxury to this already upscale set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6307-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:54:00"},
  {id: 1100, name: "Leifur Sofa", number: nil, price: nil, description: "Clean lines and simple designs make this modern sofa set a true showstopper! Box-like framework showcases sleek track arms and smooth upholstery while the slim stainless steel framework not only acts as a sturdy base but also adds a stylish touch that pushes the boundaries of imagination and creativity.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6791bk-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:54:04"},
  {id: 1087, name: "Randa Sofa", number: nil, price: nil, description: "Simple, sleek and structured, this sofa collection offers it all. The smooth dark gray leatherette provides a beautiful exterior for the contemporary design while deep button tufting accents the sectioned backrest and wide arms.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6797-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:57:00"},
  {id: 1102, name: "Liana Sofa", number: nil, price: nil, description: "Liven up your living room with this transitional sofa set. Sit down on the box cushioned seats and lean back against the padded linen-like fabric upholstery for simple and convenient relaxation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6793-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:54:11"},
