  {id: 1104, name: "Kerian Sofa", number: nil, price: nil, description: "Sleek design, flawless style and plush comfort are all wrapped into one amazing package with this stunning sofa set. Upholstered in a padded chenille fabric and accented by both nailhead and welting trim, this set is sure to be a show stopper. Structured track arms create a chic appeal while paired with printed accent pillows for perfect relaxation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6157bl-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:54:20"},
  {id: 1105, name: "Bloomington Sofa", number: nil, price: nil, description: "This handsome flannelette sofa set possesses comfort and convenience with its easy reclining function. Prop up your feet and recline into relaxation after a long hard day of work, or spend some quality time watching a movie with your loved ones on these cushioned pieces. Available in 2 color options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6129br-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:54:24"},
