  {id: 1134, name: "Madelyn Sofa", number: nil, price: nil, description: "The bright coloring of these gorgeous sofas is sure to make a statement in any setting. Paired with modern elements of button tufting, track arms and tapered wood legs, these sofas are wonderful additions to the contemporary home. Button tufted accents along the back draw attention to the plush design while rolled side pillows add some curves to the linear structure.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm8819.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:23:10"},
  {id: 1135, name: "Turton Sofa", number: nil, price: nil, description: "Fill your home with warm and inviting pieces starting with this cozy sofa set. Boasting sleek top grain leather match upholstery, this collection provides durable and comforting seating for hours of enjoyment. Rolled arms come adorned with nailhead trim, which stylishly pop against the brown coloring.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6191-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:23:14"},
  {id: 1136, name: "Kerian Sofa", number: nil, price: nil, description: "Sleek design, flawless style and plush comfort are all wrapped into one amazing package with this stunning sofa set. Upholstered in a padded chenille fabric and accented by both nailhead and welting trim, this set is sure to be a show stopper. Structured track arms create a chic appeal while paired with printed accent pillows for perfect relaxation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6157br-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:23:18"},
  {id: 1159, name: "MarleneSofa", number: nil, price: nil, description: "A conservative home will love the neutral color palette of this sofa set. The chenille fabric has an earthy texture that adds to the pleasant atmosphere, while the sloped arms and plush cushions are very comfortable and cozy. The accent pillows are the perfect complement, with their intricate scale pattern providing visual contrast to the solid mocha fabric.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6096-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:01:01"},
  {id: 1147, name: "Ysabel Sofa", number: nil, price: nil, description: "Add some modern charm to your home with this flannelette living room set. The tufted cushions provide visual interest while the slightly angled back and armrests offer the best setting for long movies or gatherings. Available in 3 color options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6716gy-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:25"},
  {id: 1148, name: "Arklow Sofa", number: nil, price: nil, description: "Choose between traditional and modern elements without forgoing comfort and luxury. Two options are available to ensure a chic pairing with existing decor, each with corresponding accent pillows to accentuate the stylish appearance. Nailhead trim highlights the straight lines and offers a visual contrast to the gently sloped arms.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm1241-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:29"},
  {id: 1149, name: "Odette Sofa", number: nil, price: nil, description: "Not one to sacrifice style for comfort, this piece was made in your honor. The modern design of this reclining sofa set offers endless comfort all the while beautifying your home. Padded faux leather upholstery with deep tufted cushions is accentuated by curved cut-out arms.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6150bk-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:33"},
  {id: 1150, name: "Davenport Motion Sofa", number: nil, price: nil, description: "Smooth comfort is right at your fingertips with this delightful living room set. The sleek top grain leather match upholstery fits right in with any setting while plush seats and arms offer hours of enjoyment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6327-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:39"},
  {id: 1151, name: "Campbell Sofa", number: nil, price: nil, description: "There's no reason to compromise comfort for elegance---this upholstery set has them both. Three color options are available, all of which are muted and subdued, making the intricate patterns on the accent pillow the central focus. Nailhead trim on the arms top off this simple, yet sophisticated look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6095tl-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:43"},
  {id: 1152, name: "Benedict Sofa", number: nil, price: nil, description: "Add functionality and comfort to your room with this great sofa set. Rolled arms, padded leatherette seating and sturdy turned bun feet are just some great feature this sofa set offers.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6311-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:46"},
  {id: 1153, name: "Mallory Sofa", number: nil, price: nil, description: "Intended to evoke the mid-century modern era, the simple looks of this sofa fits perfectly on any home looking for a throwback feel. Flared armrests, tapered and sturdy legs, and three buttons adorn this simple yet charming living room piece.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm8811-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:49"},
  {id: 1154, name: "Tatum Sofa", number: nil, price: nil, description: "Make luxury the focus of your space with this detailed plush leatherette sofa collection. Brilliantly supple leatherette upholstery defines each of these comfortable and sophisticated pieces. Traditional profiles, romantic sweetheart back cushions and highly density cushioning makes each design a timeless addition.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm7615-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:53"},
  {id: 1155, name: "Antoinette Sofa", number: nil, price: nil, description: "Leave a lasting impression to visitors of your home with this timeless reimagining of the chesterfield sofa. Cues from the classic design are kept with essential changes to bring it to the modern day.  The reverse camelback seat and arms are deeply tufted with acrylic buttons, and velvet fabric is used for maximum comfort. Matching pillows with intricate pattern are included, for an even more upscale look that will sure impress guests and keep them talking.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2225-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:56"},
  {id: 1157, name: "Antoinette Sofa", number: nil, price: nil, description: "Leave a lasting impression to visitors of your home with this timeless reimagining of the chesterfield sofa. Cues from the classic design are kept with essential changes to bring it to the modern day.  The reverse camelback seat and arms are deeply tufted with acrylic buttons, and velvet fabric is used for maximum comfort. Matching pillows with intricate pattern are included, for an even more upscale look that will sure impress guests and keep them talking.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2223-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:00:18"},
  {id: 1158, name: "Langdon Left Chair", number: nil, price: nil, description: "Padded in a gray color fabric, this corner sofa will complement any living room. Combine with multiple Right Chairs and Armless Chairs for a modular masterpiece you can call your own! Matching pillow included.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6037gy-lt.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:00:56"},
  {id: 1160, name: "Zaffiro Sofa", number: nil, price: nil, description: "Glamourous, modern elegance with a touch of tradition is what this sofa collection is all about! It's a very trim take on a classic English arm sofa, featuring curved pleated arms and a single row of nailhead trim across the sweetheart style back and front of arms. A comfortable, single cushion bench seat sits gracefully on tall tapered wooden legs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2232-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:01:06"},
  {id: 1162, name: "Viviana Sofa", number: nil, price: nil, description: "The essence of the classic chesterfield lives on in this beautiful sofa and love seat set. It features the same classic deep tufting, the nailhead trim, and rolled arms. The unique updated silhouette, however, brings it to the modern times. Contrasting, dark pillows pop on top of the gray fabric that's soft to the touch.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2291-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:05:49"},
  {id: 1163, name: "Salvatore Sofa", number: nil, price: nil, description: "The rigid silhouette of this upholstery set is reminiscent of the classic tuxedo sofa updated for the contemporary home. It features deep acrylic button tufting on both sides of the arms, with nailhead trim on the edges. A simple shape with straight lines coupled with intricate details creates a living room piece that could be as timeless as you want your home to be.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2280-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:05:53"},
  {id: 1164, name: "Grandolf Motion Sofa", number: nil, price: nil, description: "Plush cushions accented with two recliners perfect to cozy up at home. This spacious set features smooth microfiber cushion fine points, and spacious center console storage to easily tuck away controllers or personal favorites.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6813-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:10"},
  {id: 1165, name: "Stallion Motion Sofa", number: nil, price: nil, description: "Transitional looks and plush comfort make this matching sofa, love seat, and chair set a great addition to any living space. Expertly upholstered in top grain leather match.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6319-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:17"},
  {id: 1166, name: "Wimbledon Motion Sofa", number: nil, price: nil, description: "A great addition for the family room, this comfortable recliner sofa set has plush cushions covered in a warm brown bonded leather. Invite family and friends over and sit back in relaxation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6314-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:23"},
  {id: 1167, name: "Ramsey Sofa", number: nil, price: nil, description: "The spacious mod appeal with eye-catching chrome details perfectly complements the radiant chenille upholstery. This piece is designed with down feather blend for total seating comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6815-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:27"},
  {id: 1168, name: "Campbell Sofa", number: nil, price: nil, description: "There's no reason to compromise comfort for elegance---this upholstery set has them both. Three color options are available, all of which are muted and subdued, making the intricate patterns on the accent pillow the central focus. Nailhead trim on the arms top off this simple, yet sophisticated look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6095iv-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:30"},
  {id: 1169, name: "Branford Sofa", number: nil, price: nil, description: "From rich upholstery hues to perfect curves, this collection features a traditional influence that is ready to be dressed up modern. Intricate wood carving outlining the collection arms and base, decorative feet  impeccably comfortable cushioning give each piece a timeless feel.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm7620-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:34"},
  {id: 1170, name: "Marilyn Sofa", number: nil, price: nil, description: "Play mix and match with the versatile color palette of this sofa. It features slightly angled arms and a simple silhouette that harkens back to the mid-century era. On top of that, there's comfort and durability to be had between the removable plush cushions and the tall, tapered legs. Top it all off with your choice of optional matching pillows.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm8817-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:37"},
  {id: 1171, name: "Thelon Sofa", number: nil, price: nil, description: "From dramatic angled legs to elegantly rolled arms, this textured piece is ready to move, shift and grow with your space. The generously sized design collection is updated  given an edgy complement by the buttery soft leatherette upholstery and traditional silhouettes. Available in this refreshing white and classic black.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm7605-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:41"},
  {id: 1173, name: "Langdon Right Chair", number: nil, price: nil, description: "Padded in a gray color fabric , this corner sofa will complement any living room. Combine with multiple Left Chairs and Armless Chairs for a modular masterpiece you can call your own! Matching pillow included.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6037gy-rt.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:50"},
  {id: 1174, name: "Zaffiro Sofa", number: nil, price: nil, description: "Glamourous, modern elegance with a touch of tradition is what this sofa collection is all about! It's a very trim take on a classic English arm sofa, featuring curved pleated arms and a single row of nailhead trim across the sweetheart style back and front of arms. A comfortable, single cushion bench seat sits gracefully on tall tapered wooden legs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2233-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:57"},
  {id: 1175, name: "Garret Sofa", number: nil, price: nil, description: "Contemporary style with white embroidered stitching, this sofa set has adjustable headrests upholstered in black bonded leather match.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6310-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:05"},
  {id: 1176, name: "Zaffiro Sofa", number: nil, price: nil, description: "Glamourous, modern elegance with a touch of tradition is what this sofa collection is all about! A very trim take on a classic English-arm sofa, featuring curved pleated arms, and a single row of nailhead trim across the back and front of arms. Elegant and modern sofa with a comfortable yet stylish slender bench seat stands gracefully on tall tapered wooden legs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2231-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:09"},
  {id: 1178, name: "Salvatore Sofa", number: nil, price: nil, description: "The rigid silhouette of this upholstery set is reminiscent of the classic tuxedo sofa updated for the contemporary home. It features deep acrylic button tufting on both sides of the arms, with nailhead trim on the edges. A simple shape with straight lines coupled with intricate details creates a living room piece that could be as timeless as you want your home to be.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2282-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:21"},
  {id: 1179, name: "Sheldon Motion Sofa", number: nil, price: nil, description: "Enjoy the comfort and modern style of this sofa, love seat, and chair, all with built-in recliners. Expertly upholstered in bonded leatherette with decorative stitching details.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6320-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:26"},
  {id: 1180, name: "Sarles Motion Sofa", number: nil, price: nil, description: "This functional living room group features a love seat and sofa with plush cushions, recliners, and upholstered in gray leatherette. The sofa also includes a handy built-in dropdown beverage holder and storage.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6326-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:33"},
  {id: 1181, name: "Hughes Motion Sofa", number: nil, price: nil, description: "Whether you like to sit back and relax in a recliner or just rest your tired back, this sofa set delivers on all levels. Featuring bonded leather match and padded headrests, this sofa set will make the perfect addition to any living space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6312-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:39"},
  {id: 1182, name: "BONAPARTE Sofa", number: nil, price: nil, description: "For a traditional set, this sofa and love seat pair has a few surprises. The seat features a distinct two-tone back with tufted leatherette breaking up the beautifully-patterned fabric. Contrasting welt spices up the otherwise standard, single seat cushion. Elegant rolled arms and intricate wood trims add to the luxury that it brings to any living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1642.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:44"},
  {id: 1183, name: "GAFFEY Sofa", number: nil, price: nil, description: "This functional living room group features a sofa and love seat with built-in recliners and a stand-alone recliner. The love seat includes a center console with two cup holders and a pair of bluetooth speakers, allowing you to play your music wirelessly. The whole set is upholstered in black bonded leather match.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6826-sf_1.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:50"},
  {id: 1184, name: "Bonsallo Sofa", number: nil, price: nil, description: "Simple, straight lines produce an elegant contemporary living room set. Comfort is the priority in the design of this upholstered sofa, love seat, and chair in black bonded leather match.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1292.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:08:18"},
  {id: 1185, name: "DUDHOPE Sofa", number: nil, price: nil, description: "This attractive transitional set includes nailhead trim and over-stuffed back, with end recliners on the sofa and love seat. A matching recliner adds a cozy, relaxing feel to the end of a long day.  Finished in a rustic dark brown bonded leather match.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1500.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:26:44"},
  {id: 1187, name: "PLAYA Sofa", number: nil, price: nil, description: "There are many ways to liven up a space; one way is to splash some colors. This love seat does that, with its modern design and neutral gray fabric combined with bright yellow, orange, and blue pattern on the pillows. A sectional variant is also available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1556.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:26:56"},
