  {id: 1243, name: "VISCONTTI Sofa", number: nil, price: nil, description: "Low arms that sweep up to the back and T-cushion seating give this sofa group its stunning looks. With minimal nailhead trim around the front legs and pillows that match the vintage taupe hue of the soft fabric perfectly, this set will bring style to any contemporary home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1160.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:40:03"},
  {id: 1244, name: "DINAR Sofa", number: nil, price: nil, description: "This oversized and comfortable seating group has large pillow arm rests and ample seating. The rustic dark brown bonded leather brings out the contrasting top stitching and adds to the elegance of the set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1348.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:40:08"},
