  {id: 1247, name: "Claire Sofa", number: nil, price: nil, description: "Cool, vibrant fabric shades accented with plush tufted cushions. This transitional piece is available in three colors and accented with eye-catching floral pillows that will vitalize any living space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6266bl-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:40:29"},
