  {id: 1264, name: "BERKSHIRE Sofa w/ Center Console", number: nil, price: nil, description: "This versatile living room group has multiple options for comfort! The three pieces may be combined with a corner chair to form a sectional. Likewise, a love seat upgrade with a center console and a sofa upgrade with a folding console and storage are also available. Upholstered in sturdy brown leather-like vinyl, each piece has a comfy recliner or handy drink tray.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6551s-btd.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:30:44"},
  {id: 1265, name: "FRANKLIN Sofa", number: nil, price: nil, description: "With a mix of patterns and textures, this smart seating group has attractive carved trim and extra designer cushions, and is perfect for a traditional home. An optional sleeper sofa is also available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1658.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:30:51"},
  {id: 1267, name: "Rosanna II Sectional", number: nil, price: nil, description: "Show your passion for pillows with this loose back pillow sectional. Welt trim lines each cushion for a contoured design and the built-in apron keeps dirt and dust away. Arrange the pillow back cushions to cater to your particular comfort needs and delve into deep comfort with its dense foam fill. Slim track arms add finishing detail, framing the sectional for a well-focused living space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6367gy-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:31:02"},
  {id: 1250, name: "Avdira Sofa", number: nil, price: nil, description: "This contemporary seating group features chrome accents, designer throw pillows and a neutral mix of suede and leatherette. For the seat and back, choose between gold or silver in a stunning typographic pattern, paired with espresso arms and base.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6063-sf_3.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:40:42"},
  {id: 1251, name: "THESSALY Sofa", number: nil, price: nil, description: "Sleek and contemporary, this seating group features large padded arms, with finer details like double stitching on the seat cushions and silver accents. The matching pillows have a darker shade in contrast to the espresso leatherette or gray fabric seat and back.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1338.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:40:49"},
