  {id: 1256, name: "Tekir Sofa", number: nil, price: nil, description: "This sleek contemporary seating group adds comfort and style to any living room. Contrasting and pronounced stitching adds to the flair of this beautiful sofa group, which comes in either dark chocolate or white bonded leather.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6032-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:41:14"},
  {id: 1257, name: "Sofia Sofa", number: nil, price: nil, description: "This modern sofa features a tried and true design, making it a favorite living room piece. Plush seating and expert upholstery promise long-lasting quality and style. Available in a variety of colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6761gr-sf_1.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:41:18"},
  {id: 1269, name: "Maxine II Sectional", number: nil, price: nil, description: "Simple yet chic, this transitional sectional is the perfect fixture to unify your living room together! The linen-like fabric upholstery and decorative skirt add extra refinement that complements the draping skirt and sloped armrests for a chic look everyone will love. Complete with a welt trim, this sectional is the ideal piece to transform your home into a relaxing paradise with a warm and cozy ambiance.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6379bg-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:35:49"},
  {id: 1270, name: "Patty Sectional", number: nil, price: nil, description: "When looking for a functional piece to\r\nupgrade your home, look no further than this\r\nsectional! Designed with unparalleled comfort\r\nin mind, this piece enhances your comfort\r\nwith adjustable headrests without taking\r\naway from the contemporary aesthetics. This\r\nmultifunctional sectional provides the perfect\r\nplace to stretch out and relax while also easily\r\nconverting into a bed for guests. Decorated\r\nwith contrast stitching for a modern look,\r\nthis sectional is the perfect combination of\r\ncomfort and style to make your home a chic\r\ngathering place for friends and family!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6514bk-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:36:21"},
  {id: 1271, name: "Badalona II Sectional", number: nil, price: nil, description: "Blending a mix of contemporary fashion with traditional elements, this simple yet sleek sectional is a warm and inviting way to update your living space with transitional style! The spacious design showcases stylish T-cushion seating that is upholstered in linen-like fabric for a comfy yet durable feel. Giving it a touch of character with its rolled arms, this sofa set has cozy comfort written all over it!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6377bg-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:36:26"},
  {id: 1272, name: "Marian Sectional", number: nil, price: nil, description: "Give yourself the gift of comfort with the soft linen-like fabric and comforting foam cushions that cover this spacious sectional. Its modular design gives this piece complete versatility, changing shape to accommodate a wide variety of living spaces. Sloped arms add angular intrigue and frame the sofa for a focused aesthetic. With plenty of accent pillows and sleek block legs to complement, this grey sectional will add a cool touch to keep you comfortably relaxed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6369-4.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:36:46"},
  {id: 1273, name: "Rhian Sectional", number: nil, price: nil, description: "Take home this charming sofa set and create the perfect atmosphere for your beautiful home. A perfect contemporary blend of traditional and modern elements, this transitional design is covered in linen-like fabric and features rolled arms for a classic appearance. The overstuffed cushions provide not only a soft and comfortable feel, but also offer a visually sleek look that complements the minimalistic style of this chic sofa set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6329gy-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:36:50"},
  {id: 1274, name: "Monique Sectional w/ 2 Recliners 3 Drop-Down Tables Console", number: nil, price: nil, description: "Surround yourself in comfort and style with the reclining sectional. Soft nubuck fabric is paired with dense foam cushions to create plush pockets of comfort from every angle. Oversized head and arm rests billow as the latch activated recliners smoothly slide up to create a relaxing pose with supported leg rests. Never leave your seat with a storage compartment for quick stowing. Update your home to expansive living room seating with integrated functionality that keeps your home looking refined.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6519-3.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:37:26"},
  {id: 1315, name: "Sarin Sectional", number: nil, price: nil, description: "Create a luxurious and sophisticated living room with this uniquely shaped sectional . Curved for design and comfort, the sectional features a tufted back paired with sloped armrests, all for a modern appeal. Matching accent pillows, available in two different sizes, add a charming touch.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6370.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:37:49"},
  {id: 1324, name: "Jaylene Sectional", number: nil, price: nil, description: "A handsome tuxedo style sectional set that will blend perfectly into any modern home with its modular design. Tightly upholstered in gray linen fabric, this seating set features a low backrest with deep seats. Kick up your feet on its matching ottoman and relax in ease.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6120.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:19:28"},
  {id: 1275, name: "Marian Sectional", number: nil, price: nil, description: "Give yourself the gift of comfort with the soft linen-like fabric and comforting foam cushions that cover this spacious sectional. Its modular design gives this piece complete versatility, changing shape to accommodate a wide variety of living spaces. Sloped arms add angular intrigue and frame the sofa for a focused aesthetic. With plenty of accent pillows and sleek block legs to complement, this grey sectional will add a cool touch to keep you comfortably relaxed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6369-3.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:38:00"},
  {id: 1276, name: "Sadie Sectional w/ Ottoman", number: nil, price: nil, description: "If you have a taste for the classics, then this contemporary piece is the perfect addition to your home. With a bit of a retro spin, this minimalist sectional is sleek in design with chrome bracket feet and slim track arms. The corner design is covered in soft fabric to enhance our relaxation and help you fall in love with your living room all over again.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6178-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:38:16"},
  {id: 1277, name: "Ornella Sectional", number: nil, price: nil, description: "A neutral design that fits a multitude of living space needs and dcor styles, this classic sectional is the perfect piece to place in an ever-changing household. The linen upholstery showcases the fitted cushions and track arms while masking the high-density foam cushions within. Button tufted inner arms add extra details to the overall appeal while the light gray upholstery can be paired with a variety of dcor pieces.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2671-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:38:23"},
  {id: 1280, name: "Cassandra Sectional", number: nil, price: nil, description: "Transform your dreams of luxury into reality by starting with this elegant living room collection. The intricate wood trim draws attention to the smooth chenille fabric while enhancing the printed patterns of the accent pillows and fitted cushions. High density foam cushions ensure comfort for all seated guests and the hardwood frame offers structural integrity for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6409-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:38:53"},
  {id: 1281, name: "Joelle Sectional", number: nil, price: nil, description: "Showcasing a singularly simple elegance, this sectional highlights the best of transitional design! With a stylish skirt running around the entire frame and a minimalistic look, this sleek piece will charm everyone with its chic appearance. Charming and quaint, this piece will complete your living space and give your home an inviting sense of coziness.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6206-3.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:52:16"},
