  {id: 1284, name: "Libbie 6 Pc. Modular Seating Set", number: nil, price: nil, description: "Come home to comfort with this sizable sectional and ottoman set. Tufted accents form a distinguished pattern as they gracefully accent the plush grid stitched cushions. Sloped bases add curvaceous detail to the sectional and match beautifully with the ottoman. Rest your legs after a long day and kick them up on the ottoman for a relaxing pose. Rediscover what comfort means with this refined sectional and ottoman set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6456-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:53:25"},
  {id: 1285, name: "Elwick Sectional", number: nil, price: nil, description: "Relinquish your old chair and find comfort in the arms of this sylish chair. The soft fabric is backed by dense foam cushion to deliver a distinguished level of luxury. Scrolled arms are elegantly detailed by nailhead trim as it wraps the soft curves and base with metallic accents. Nestle up with a good book on the accent chair or simply lounge out on the comfortable chair. However you define relaxation, this chair will satisfy all your comfort needs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6885-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:53:29"},
  {id: 1286, name: "Marian Sectional", number: nil, price: nil, description: "Give yourself the gift of comfort with the soft linen-like fabric and comforting foam cushions that cover this spacious sectional. Its modular design gives this piece complete versatility, changing shape to accommodate a wide variety of living spaces. Sloped arms add angular intrigue and frame the sofa for a focused aesthetic. With plenty of accent pillows and sleek block legs to complement, this grey sectional will add a cool touch to keep you comfortably relaxed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6369-2.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:53:35"},
  {id: 1287, name: "Rhian Sectional", number: nil, price: nil, description: "Take home this charming sofa set and create the perfect atmosphere for your beautiful home. A perfect contemporary blend of traditional and modern elements, this transitional design is covered in linen-like fabric and features rolled arms for a classic appearance. The overstuffed cushions provide not only a soft and comfortable feel, but also offer a visually sleek look that complements the minimalistic style of this chic sofa set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6329lg-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:53:39"},
  {id: 1288, name: "Monique Sectional w/ 2 Recliners 2 Drop-Down Tables Console", number: nil, price: nil, description: "Surround yourself in comfort and style with the reclining sectional. Soft nubuck fabric is paired with dense foam cushions to create plush pockets of comfort from every angle. Oversized head and arm rests billow as the latch activated recliners smoothly slide up to create a relaxing pose with supported leg rests. Never leave your seat with a storage compartment for quick stowing. Update your home to expansive living room seating with integrated functionality that keeps your home looking refined.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6519-1.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:54:14"},
