  {id: 1296, name: "Norma Sectional w/ Ottoman", number: nil, price: nil, description: "Comfort is top priority with this chenille fabric sectional. Dense foam filled cushions hug every part of the linear stitched design while built-in functionality makes this piece timeless. Lifting the soft rounded ottoman reveals plenty of storage while easy pull tabs convert the sectional into a comforting sleeper. Simplify your changing needs with the ease of comfort of the sectional sofa set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6440-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:55:12"},
