  {id: 1298, name: "Eilidh Sectional", number: nil, price: nil, description: "Define your home with this fashion forward sectional. Chrome legs glisten against the sleek black leatherette, adding a sophisticated touch and glamorous polish to the spacious sectional. Plush cushions and coil springs deliver undeniable comfort and lasting support to keep you comfortably relaxed. Lounge out on the chaise or cozy up on oversize armrests as stresses seem to slip away. Refine and distinctively distinguish with this stunning leatherette sectional.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6422bk-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:55:31"},
