  {id: 1303, name: "JoyaSectional", number: nil, price: nil, description: "Come home to comfort and style, this sectional sofa features a clean-cut visual, and can be paired with the matching patterned arm chair and ottoman to add personality. Its simple lines are supported on long, tapered legs, giving a chic and modern appearance. Printed pillows make the perfect accent pieces and provide added comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm8232.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:56:17"},
