  {id: 1307, name: "Kate II Sectional", number: nil, price: nil, description: "Modern design gets a retro twist with this fun modern sofa set with sleek leatherette upholstery and tapered legs. The U-shaped frame encompasses plush tufted cushions that are as attractive as they are comfortable. This mid-century modern inspired design is sure to be a hit in any contemporary home!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6506.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:15:54"},
  {id: 1308, name: "Hardy Sectional w/ Console", number: nil, price: nil, description: "Bask in the alluring comfort of this corner sectional and feel the days troubles and worries drift away. Flip up the footstools and recline to find the perfect position for relaxation, or stretch out on the leatherette upholstered chaise for a quick catnap. The convenient center console features a dual cup holder and storage compartment to help store everything you need to make your living room your sanctuary.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6781bk.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:16:15"},
  {id: 1309, name: "Hera Sectional", number: nil, price: nil, description: "With soft chenille fabric to pair alongside the chrome supports, this sectional embodies both old-fashioned and contemporary styles in one design. Two ogee-patterned pillows add visual dimension to the simple L-shaped structure. Chrome finished legs and armrest beams add a modern flair that will update any living space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6857.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:16:22"},
