  {id: 1312, name: "Glasgow Sectional", number: nil, price: nil, description: "If you and your guests are the type that like to lounge around the living room with your feet up or just like sitting in the company of friends and family, this corner sofa set offers all of that and then some.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6822br-t.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:17:02"},
  {id: 1313, name: "Jolanda II Sectional", number: nil, price: nil, description: "A regal design to fit with any upscale living room, this sectional incorporates traditional and modern styles together. Crystal-like acrylic buttons adorn the tufting along the backrest while nailhead trim runs down the armrests as glamorous accents to the structured sectional. Pillows included.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6158bl.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:17:10"},
  {id: 1316, name: "Jolene Sectional", number: nil, price: nil, description: "Recharge after a long day on this reclining sectional. With plenty of seats and plush cushions, this sectional will provide your family with the best comfort around. A storage console doubles as an armrest, tucking items out of sight, while two cup holders keep drinks near at hand. Upholstered in brown leatherette, this reclining sectional will bring a whole new level of relaxation to your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6838.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:17:16"},
  {id: 1317, name: "Betria Sectional", number: nil, price: nil, description: "Make your living room shine and sparkle with this gorgeous contemporary sectional. Upholstered in a glitter-like shined fabric for a sleek modern appeal, the sectional provides a wide seating area for you and your guests. Sloped armrests and angled backrests are unique designs that make this sectional pop with little effort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2263.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:17:21"},
