  {id: 1326, name: "Jolanda II Sectional", number: nil, price: nil, description: "A regal design to fit with any upscale living room, this sectional incorporates traditional and modern styles together. Crystal-like acrylic buttons adorn the tufting along the backrest while nailhead trim runs down the armrests as glamorous accents to the structured sectional. Pillows included.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6158bk.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:19:40"},
  {id: 1327, name: "Karlee II Sectional", number: nil, price: nil, description: "With your familys comfort in mind, this sectional offers two reclining seats and a large pushback chaise. An armrest doubles as a storage compartment while two cup holders add convenience. Plush cushioning ensures you get the best comfort, especially when paired with the soft chenille fabric.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6853.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:19:59"},
  {id: 1328, name: "Jolanda II Sectional", number: nil, price: nil, description: "A regal design to fit with any upscale living room, this sectional incorporates traditional and modern styles together. Crystal-like acrylic buttons adorn the tufting along the backrest while nailhead trim runs down the armrests as glamorous accents to the structured sectional. Pillows included.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6158gy.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:20:04"},
  {id: 1329, name: "Gatria II Sectional", number: nil, price: nil, description: "Stretch out your legs and lean back into a comfortable position without having to fight over seats! You and your family can all enjoy reclining functions with this comfortable sofa set or sectional. Each seat comes upholstered in black leatherette for a cool and relaxing experience. Plush cushions and baseball stitching accents add shape and dimension to your stylish living room!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6982.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:20:18"},
  {id: 1332, name: "Blaire Sectional", number: nil, price: nil, description: "This sectional guarantees you will always be ready for any situation when you're hosting a get-together. The chaise and loveseat offer plenty of space for guests to sit and relax while the storage space beneath the chaise's cushion provides the perfect place to hide clutter to make room for everyone. Quickly transform this sectional into a guest bed by revealing the extension beneath the loveseat's cushions so you need not worry about unexpected guests staying the night.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6839.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:43:03"},
  {id: 1338, name: "Hadley II Sectional w/ 2 Consoles", number: nil, price: nil, description: "A spacious design to accommodate you and your friends, this L-shaped sectional is a perfect fi t for the frequent movie night host. Recline in comfort with the double fabrics and enjoy having your drink near at hand with the convenient storage consoles and cup holders.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6871.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:44:16"},
  {id: 1337, name: "Pollock Sectional, White", number: nil, price: nil, description: "Talking about making a statement! This sectional and ottoman combination is daring with its use of color as the focal point of the design. Against the simple ivory backdrop, the stunning array of hues on the matching pillows and ottoman demand attention. If the colors don't take your guests\r\naback, the plush and comfortable cushions upholstered in stain-resistant\r\nRevolution Fabric will certainly be a pleasant and welcome surprise.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm8230.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:44:04"},
  {id: 1339, name: "Valter Sectional w/ Ottoman", number: nil, price: nil, description: "The versatile design of this sectional permits the best of all worlds, whether you need seats to host a get-together in your living room or if an unexpected guest needs to spend the night on the pull-out bed. Choose whether to have the chaise on the left or right by switching where the ottoman is positioned, guaranteeing you'll be able to make this piece work with any dcor situation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6837.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:44:29"},
  {id: 1345, name: "Dolton Motion Love Seat", number: nil, price: nil, description: "Bring a sense of relaxation into your living room decor with this durable leatherette sofa set. Soft lumbar and headrest padding add extra comfort along with the broad armrests. Choose between the regular recliner set or the power-assist set, which comes with an integrated German-engineered motor for easy operation. Either way, you can't go wrong with these spectacular piece for your living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6128br-lv-pm.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:45:39"},
  {id: 1341, name: "Lauren I Sectional", number: nil, price: nil, description: "Never compromise your comfort for the sake of style with this sofa set. Supported atop metal bar legs, each piece showcases contemporary style from their slender track arms to their sleek shape. Curl up with a pillow and let the soft chenille fabric whisk your worries away.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6856.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:44:40"},
  {id: 1340, name: "Hagen Sectional, Gray", number: nil, price: nil, description: "How lovely would it be to come home each day to this inviting sectional? Tightly stitched in soft flannelette upholstery, this sofa is padded to perfection! Whether you choose to kick off your shoes and stretch your tired body across the chaise or snuggle up against the track armrest, grab a pillow and get comfortable because this sectional was made for your enjoyment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6799gy.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:44:36"},
  {id: 1392, name: "KEMI Storage Console", number: nil, price: nil, description: "This optional center console with cupholders and ample storage is offered in white or black.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1242.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:45:12"},
  {id: 1342, name: "Stanford II Sectional", number: nil, price: nil, description: "Kick it up a notch in your living space with this stunning sectional set. Lay upon the plush cushions, rest your feet upon the lovely square ottoman and feel the stress of the day melt away. From the gorgeous nailhead trim to lavish rolled arms, this set will take you into a world of comfort and luxury that is all your own.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6270tl.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:44:45"},
  {id: 1344, name: "Wessington Sectional", number: nil, price: nil, description: "There's three ways to experience this beautiful living room piece: as a grand corner sofa, a two-piece sectional, or as a sofa/love seat set. Choose the best way to make your living room the warmest place in the home with the flared and fitted back pillows and smooth padded fabric wrapping tightly around every cushion and corner. Snuggle up with the coordinating throw pillows or lean against the soft padded armrests, either way friends and family alike will be instantly smitten with the welcoming and relaxed vibe of this piece.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6121.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:45:27"},
