  {id: 1347, name: "Denton Sectional", number: nil, price: nil, description: "For smaller spaces, this medium-sized sectional is the perfect option. With a reversible chaise that fits on either left or right side, it effortlessly converts into a bed, making it not only a good looking contemporary piece, but also a smart, versatile choice.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6149iv.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:46:05"},
  {id: 1348, name: "Foreman Sectional", number: nil, price: nil, description: "Sweet relaxation is all yours with this versatile sectional sofa. Enjoy lounging in its cushioned seats, which allow you to fully stretch out and take a breather from the long day. Upholstered in cozy flannelette fabric and filled with foam cushions, this piece adds functionality with its optional pull-out sleeper. Perfect for unexpected guests, this sectional is necessary in every home!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6124gy.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:46:13"},
  {id: 1349, name: "Sofia II Sectional", number: nil, price: nil, description: "This L-shaped sectional makes the most of a space-conscious home with its convenient corner design. The smooth fabric upholstery showcases welted edges, matching accent pillows and button tufted seat backs, making this two-piece sectional a delightful addition to any living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6861gy.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:46:17"},
