  {id: 1418, name: "KEMI Storage Console", number: nil, price: nil, description: "This optional center console with cupholders and ample storage is offered in white or black.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1240.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:18:50"},
  {id: 1419, name: "GLASGOW Sectional", number: nil, price: nil, description: "The transitional shape of this sectional will enhance any living room with plush upholstery cushions and extra heavy elephant skin microfiber. The sectional features a recliner chaise lounge and an end recliner.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1458.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:18:56"},
  {id: 1420, name: "Lodia I Dining Table", number: nil, price: nil, description: "Pair your dining room with this simple yet eye-catching dining chair design. These padded leatherette chairs create an air of modern elegance with the help of sleek chrome legs. Available in black or white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3825wh-t.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:19:02"},
  {id: 1421, name: "KEMI Speaker Console", number: nil, price: nil, description: "This optional center console with bluetooth speakers allows you to play all of your favorite music wirelessly in your living room. Available in white or black bonded leather match.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1236.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:19:12"},
  {id: 1422, name: "Walcott Daybed w/ Trundle", number: nil, price: nil, description: "Multipurpose style defines this chic daybed, featuring a robust wooden construction, stylish curving sides, and decorative round finials. A pull-out trundle offers extra bedding space as needed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm1928wh.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:19:24"},
  {id: 1424, name: "LAVENA Sectional", number: nil, price: nil, description: "Great for a larger living area, this two toned sectional has soft comfortable seating and is trimmed in espresso leatherette. Paired with either a tan or espresso elephant skin microfiber, it looks great as an addition to any contemporary style home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1717.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:19:38"},
  {id: 1425, name: "FLORIA Storage Console", number: nil, price: nil, description: "This optional center console with cupholders and ample storage is offered to match all three colors of this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1226.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:19:48"},
  {id: 1432, name: "Synergy Collection ", number: "4727PU", price: nil, description: "The need for additional storage space in your modern home will be met with the Synergy Collection. The two segments of this ottoman serve equally as storage space, yet two different functional tops define each of their roles. With the first section, an airlift mechanism lifts the seat to reveal storage below. The second section is a fully extended lift top that not only reveals storage space, but will bring the seat top towards you for those times when you need an extra table surface. This padded ottoman is covered in dark brown bi-cast vinyl with white contrast stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4727PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4727PU.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:11:46"},
  {id: 1433, name: "Bayshore Collection ", number: "5447-36", price: nil, description: "Transitional aesthetic meets modern lines in the casually elegant Bayshore Collection. Offering flexibility in the collection are the options of two dining tables. The 47.5-inch fixed oak veneer square table top. And the rectangular oak veneer tabletop with leaf. Both tables feature quartered book-match walnut inlay veneers with a heavily burnished finish. Supporting the uniquely veneered table top is a storage table base with a display shelf. Both tables are complimented by dark brown bi-cast vinyl chairs that feature wood cap and legs. Coordinating server is also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5447-36.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:11:56"},
  {id: 1435, name: "Fielding Collection ", number: "5525-72", price: nil, description: "Classic soft modern styling creates the look of the Fielding Collection. Unfettered design makes for a classically refined profile, while black inset glass is utilized for perfect contrast to the brown finish of the wood table frame. Flanking the table are the side chairs, offered in either dark or light gray fabric. The accompanying server has drawer, behind door and wine rack storage for style and functional usage. Offered in both traditional and counter height for perfect placement in your dining room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5525-72.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5525-72.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:11:59"},
  {id: 1436, name: "Festus Collection ", number: "5466-62", price: nil, description: "Offered for your casual dining room is the Festus Collection. Extending to support and frame the corners of the light toned genuine marble tabletop are dark cherry finished legs. The coordinating chairs and bench feature dark brown bi-cast vinyl padded seats, each presenting a wrapped fold as the main focal accent.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5466-62.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5466-62 with bench.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72 5466-62_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5466-62.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:12:01"},
  {id: 1437, name: "Toulon Collection ", number: "5438-1", price: nil, description: "Classic framing provides elegant contrast to the unique rustic look of the Toulon Collection. Wire-brushed distressing provides texture to the acacia veneer of this lovely bedroom suite. The functional drawers of the footboard allow for additional storage. The French provincial inspired routing lends decorative touch to each piece, while dual drawer and door storage are accented with wide set horizontal metal and wood hardware providing ample space to store your personal possessions.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5438.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5438.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:12:27"},
  {id: 1438, name: "Claire Collection ", number: "469PU", price: nil, description: "This functional two-seat storage ottoman reverses to reveal 2 individual serving trays and 2 cleverly stored stools. Covered in dark brown bi-cast vinyl, this look is also offered in mottled brown polished microfiber.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/469PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/469PU.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:13:23"},
  {id: 1439, name: "Daisy Collection", number: "710-36RD", price: nil, description: "Daisy Collection combines superb visual appearance and fine quality that you need in your dining area. Three distinct elegant flared tulip bases support beveled glass tabletops on the rectangular and round traditional dining height tables and a round gathering height table. Additional offering is the trestle table with black glass insert. Counter and dining height chairs feature clean lines and sleek curves; available in both white and bi-cast vinyl and dark brown bi-cast vinyl. The set is constructed of hardwood solids and veneers in a refreshing espresso finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-36RD.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/710-36RD.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:13:38"},
  {id: 1527, name: "Elwell Collection ", number: "4728BK", price: nil, description: "The wedge shape of the Elwell chair-side table allows for placement in the smallest of spaces while still providing ample space for a small table lamp or accessory display.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4728BK Front.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4728BK Front.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:13:50"},
  {id: 1440, name: "Ameillia Collection ", number: "586-82", price: nil, description: "The solid, clean lines of the Arts and Crafts movement are interpreted from modern times in the Ameillia Collection. Substantial tapered legs and the wood veneer complement this simple and refined dining offering. Newly offered in a grey with brown undertone finish, the collection is also available in a dark oak finish. The rectangular table is flanked by the perfectly coordinating chair or bench option.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586-82.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/586-82.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:13:55"},
  {id: 1441, name: "Bayshore Collection ", number: "5447-24S", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-24S & 5447-29S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5447-24S & 5447-29S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:13:58"},
  {id: 1443, name: "Zaira Collection ", number: "1885N-1", price: nil, description: "The Zaira Collection offers modern traditional design showcasing beautiful nail head accenting headboard which elegantly contrasts its dark grey fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1885N-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1885N-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:14:24"},
  {id: 1444, name: "Ameillia Collection ", number: "586-60", price: nil, description: "Blending the clean lines of Arts & Crafts with functional movement, the Ameillia Collection is a solid addition to your casual dining space. The drop-leaf counter height table features a Lazy-Susan making mealtime service a breeze. Substantial tapered legs and birch veneer in a dark oak finish complement this simple and refined dining option.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586-60.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/586-60.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:14:29"},
  {id: 1445, name: "Woodrow Collection ", number: "2042-1", price: nil, description: "Industrial design is subtly used to achieve a cool look for your bedroom in the Woodrow Collection. Dark metal hardware and corner banding with rivet look lend to the casual look of this bedroom group. Melamine laminate features a weathered-wood look that furthers the intended design. Black bi-cast vinyl accents of the headboard provides distinct complementing contrast to the finish of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2042-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2042-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:14:46"},
  {id: 1446, name: "Anika Collection ", number: "1915-60", price: nil, description: "Drawing inspiration from Danish mid-century modern design, the Anika Collection is a stylish addition to your homes dining space. The gentle curve of the table top is perfectly accentuated by the accompanying wood framed chairs, all featuring legs that are the signature to this classic look. Off-white bi-cast vinyl padded chair seats provide stark contrast to the light ash finish over ash veneer, furthering the contemporary design. The accompanying server features brushed nickel hardware and soft close mechanisms on the doors and storage drawers for quiet and sure closure.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1915-60.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1915-60.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:15:53"},
  {id: 1447, name: "Sinclair Collection ", number: "8202GRY-3", price: nil, description: "A hint of retro styling provides a clean and classic look for your contemporary home in the Sinclair Collection. Offered in a traditional seating or sectional configuration, the options allow for the perfect placement within your living room. The collection is available in either chocolate or gray fabric with contrast pillows that furthers the look and versatility for placement within a number of home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8202GRY_.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8202GRY_.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:15:57"},
  {id: 1448, name: "Watt Collection", number: "5178-60", price: nil, description: "Blending the visual impact of marble with the hyper-stylized look of metalwork is the Watt Collection. An intricately designed chrome finished metal base rises to support the faux marble look of the table top while continuous frame chairs  offered in dark grey or camel brown fabric with contrast stitching  further lend to the contemporary feel of this casual dining collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5178-60 5178BRS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5178-60 5178GYS.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5178-60 5178BRS.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:15:59"},
  {id: 155, name: "Hankinson Bed", number: nil, price: nil, description: "With a look all its own, this set demands attention. The rustic natural tone finish enhances the slatted, wingback style headboard and emphasizes each drawer panel. Matching case goods are each equipped with ball bearing metal glides and felt-lined top drawers.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7576.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:27:10"},
  {id: 1449, name: "Allura Collection ", number: "1916-1", price: nil, description: "Glamour reigns in the design of the Allura Collection. Framing each piece is a decorative beveled mirror accent that enhances the illumination from the touch-engaged LED back-light of the headboard and mirror, as well as the under-light of the night stand. Alligator embossing and high polished crystal-enhanced hardware boldly accent the silver finish of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1916-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1916-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:16:10"},
  {id: 1450, name: "Odelia Collection ", number: "1708-1", price: nil, description: "Making a statement to the glamorous nature of your personal design aesthetic is the Odelia Collection. The striking silver finish of the collection serves to highlight the decorative accents that reign the design  crocodile embossed drawer fronts with polished nickel hardware, mirrored top drawer fronts with their faceted knob hardware and crystal-embellished button-tufted pearl bi-cast vinyl inserts on the headboard and foot board. The available twin, full, queen, Eastern King and California King bed options allow for perfect placement in your bedroom space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1708-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1708-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:25:42"},
  {id: 1452, name: "Alonza Collection ", number: "1845LED-1", price: nil, description: "Adding a bold touch of glamour to your boudoir is the Alonza Collection. Finished in a brilliant white, the embossed alligator board is reflected in the inlay mirrors of the bed and case pieces. The newly available back-lit LED headboard and mirror illuminate with a delicate touch, creating a dazzling glow. Turned feet provide a distinct departure from the linear design of the collection, adding a distinctly feminine flair. Drawer pulls add to the allure of the collection with an inlay crystal and chrome look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1845LED-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1845LED-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:26:02"},
  {id: 1454, name: "Lyric Collection ", number: "1737W-1", price: nil, description: "Taking the expected design elements of hard contemporary and putting a decidedly feminine curve into the mix makes the Lyric Collection a unique addition to your new bedroom design. With each curve comes a new twist - satin nickel hardware accents the glossy white finish, bow-front case pieces feature ball bearing drawer glides and compliment the padded sleigh headboard & footboard, while a round, contemporary mirror reflects the modern designs that you have selected. A final, unique, addition to the collection is the glass topped night stand that furthers the contemporary feel.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1737W-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1737W-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:26:25"},
  {id: 1453, name: "Copley Collection ", number: "815TPU-1", price: nil, description: "The Copley Collection features clean contemporary design that will complement any home decor. With economical and environmental concerns in mind, the night stand, dresser and mirror are conveniently packed in one carton. Chest and additional night stands are also available. The Copley Collection showcases a wide beveled wood frame with satin nickel hardware accented in espresso finish on select hardwoods and veneers. To offer more flexibility, it offers three headboard options: wood sleigh headboard, panel headboard with white bi-case vinyl inserts, and fully upholstered dark brown bi-cast vinyl headboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/815TPU-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/815TPU-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:26:18"},
  {id: 1455, name: "Bonaventure Park Collection ", number: "1935PN-1", price: nil, description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered pilasters frame the serpentine fronted case goods, while egg and dart molding, acanthus leaf motif and bale, and button hardware lend to the traditional look. Burl inlay creates beautiful contrast to the gold-highlighted warm cherry finish of the collection. Button tufting features prominently on the traditional low profile bed, while the footboard with heavy wood framing.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935PN-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1935PN-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:26:33"},
  {id: 1456, name: "Emilio Collection ", number: "8367TP-3", price: nil, description: "Subtle texture lends visual and tactile interest in the Emilio Collection. The set-up process allows you to configure the three-seat unit to accommodate the chaise on either the left or right side, providing for perfect placement within your living space. The accompanying ottoman can be an added comfort to put feet up when relaxing. The collection is offered in either taupe or chocolate, furthering the versatility of the sectional seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8367TP-3 8367TP-5 8367TP-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8367TP-3 8367TP-5 8367TP-4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:26:52"},
  {id: 1457, name: "Elan Collection", number: "H10128", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant rectangular lamp shade. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H10128_lights on_c.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H10128_lights on_c.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:03"},
  {id: 1458, name: "Barrington Collection ", number: "8378BRW-L", price: nil, description: "Soft Contemporary styling lends a cool, classic look to your modern living space in the Barrington Collection. Stitch tufting provides soft contrast to the cleanly designed lines of this seating arrangement. The attached chaise lounge and accompanying ottoman provide the opportunity for putting your feet up while you enjoy your downtime. The seating group is offered in gray, black and brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8378BRW-L -R -4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8378BRW-L -R -4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:09"},
  {id: 1459, name: "Florentina Collection ", number: "1867", price: nil, description: "The elaborate designs of Old World Europe are treated with a distinct modern touch in the Florentina Collection. The eye-catching jewel tufting of the headboard reflects with a brilliance intended to accentuate the dusky taupe coloring of the faux silk and the rich silver  with gold undertone- finish of the wood veneer. Bombe case goods present their distinct shape as a unique focal point in your elegant bedroom. With details such as shell and acanthus leaf scrolling, carved cabriole feet and delicately designed knob hardware, the traditional look of the collection is solidified.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1867.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1867.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:15"},
  {id: 1461, name: "Mahala Collection ", number: "8200BRW-3PW", price: nil, description: "Plush seating is paired with brown top grain leather and vinyl match in the Mahala Collection to create the ultimate platform for relaxation. Offered in two reclining options, a manual or power engaged. The motion mechanisms allow for quick transition from seated to prone with either the quick pull of the manual tab or the push of the power button.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8200BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8200BRW.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:27"},
  {id: 1462, name: "Seaford Collection ", number: "5510-66", price: nil, description: "Subtle industrial influence creates the visual appeal of the casual dining tables of the Seaford Collection. V-matched veneer is finished in a gray tone highlights the tone variation of the wood grain. Angled trestle bases support the table tops of the collection while X-back chairs feature bi-cast vinyl padded seats for comfort.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510-66.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5510-66.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:37"},
  {id: 1463, name: "Kenner Collection ", number: "8245GY-3", price: nil, description: "A classic and functional option for your living room is the Kenner Collection. Unfettered design allows for your individual decorative aspirations to soar. The sofa is available in both a pull out sleeper or traditional setup. The sofa and love seat are paired with contrast pillows. Two fabric options are available  Gray or Brown fabric  for versatile placement in a number of environments.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8245GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8245GY.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:42"},
  {id: 1464, name: "Seaford Collection ", number: "5510-36", price: nil, description: "Subtle industrial influence creates the visual appeal of the casual dining tables of the Seaford Collection. V-matched veneer is finished in a gray tone highlights the tone variation of the wood grain. Angled trestle bases support the table tops of the collection while X-back chairs feature bi-cast vinyl padded seats for comfort.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5510-36.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:47"},
  {id: 1466, name: "Lucille Collection ", number: "1192RN", price: nil, description: "Retro lines need not stay in the past with the mid-century inspired lines of the Lucille Collection. With fabric offerings that range from neutral to bold such as beige, gray, blue, and orange further complemented with button-tufted accenting and stylishly appointed legs, this classic accent chair will provide a look that shows your personal style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1192RN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1192RN.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:54"},
  {id: 1467, name: "Ferriday Collection ", number: "8228TP", price: nil, description: "Providing the flexible option for relaxation, sleep and storage, the Ferriday Collection will be a stylish and functional addition to your living room. Under seat storage is revealed with the pull of a tab on the end chaise. The lower portion of the seating configuration pulls out to reveal a pop up trundle that creates a bed space creating a relaxing environment with minimal effort. The collection is offered in blue or taupe fabric, both with contrast stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8228TP.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8228TP.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:58"},
  {id: 1468, name: "Anke Collection ", number: "8312DG-3", price: nil, description: "Mid-Century modern Danish styling serves as the driving design inspiration in the Anke Collection. Offered in two colors  light or dark grey  each serves as a distinct contrast to the light ash or walnut finished legs. Button tufting provides focal interest as subtly curved low-profile arms give way to the slightly splayed back.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8312DG.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8312DG.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:01"},
  {id: 1469, name: "Iola Collection ", number: "8437-1LT", price: nil, description: "Traditionally styled for your living space, the Iola Collection will provide you with a functional chair to fit your personal needs. Via the attached controller, you are taken from seating to reclining or standing position. The taupe 100% polyester cover, rolled arms and nail head accent further lend the classic look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8437-1LT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8437-1LT.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:08"},
  {id: 1528, name: "Ladd Collection ", number: "4723", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4723.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4723.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:20"},
  {id: 1474, name: "Chehalis Collection ", number: "3581-30", price: nil, description: "With a design that is inspired by the traditional look of Craftsman furniture, the Chehalis Collection features slate inlay on the table fronts, and a brown cherry finish that enhances the oak veneers of this well-appointed occasional offering. The cocktail table has a lift mechanism that allows for the extension of the table's top towards your seated position. Drawers feature prominently allowing ample storage space for your personal affects.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3581-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3581-30.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:20:33"},
  {id: 1475, name: "Alta Collection ", number: "1255F1S", price: nil, description: "Blending the comfort of a lounge chair with the functionality of the internal lift mechanism, the Alta Collection will be a welcome addition to your home. With an electric mechanism that, with a push of a button, takes you from fully reclined to standing, this chair aids in your mobility. The lift chair is offered in dark brown bi-cast vinyl, with contrast stitching, for versatile placement in your transitional to contemporary home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1255F1S 1249F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1255F1S 1249F1S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:20:53"},
  {id: 1476, name: "Nicolo Collection ", number: "1216F1S", price: nil, description: "The classic shape of a wing back chair is modernized and styled to lend an air of sophisticated whimsy to your home is the Nicolo Collection. The bold medallion print features a tonal grey color scheme that blends effortlessly with your modern traditional aesthetic.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1216f1s_2014H-85.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1216f1s_2014H-85.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:20:55"},
  {id: 1477, name: "Tulney Collection ", number: "4966DG", price: nil, description: "The Tulney Collection is designed with the modern traditional home in mind. Designed to use as a bed or a cozy relaxation nook, it features a trundle that provides the extra space that you need for overnight guests. Covered in a neutral toned gray fabric, the black button-tufted back panel, and the nailhead accent along the curved arm panels complete the traditional look. Also available in brown and dark gray fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4966DG.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4966DG.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:21:03"},
  {id: 1478, name: "Lindley Collection ", number: "1947-96", price: nil, description: "Modern traditional styling is lent a rustic touch in the design of the Lindley Collection. Walnut veneers, over solid wood, are finished in a dusty gray that complements the rich tone of the natural wood look. The dining table features an X-support trestle base and is flanked by oval backed neutral toned fabric lending to versatile placement with your home dcor. Round pull hardware punctuates each drawer front of the display china and server, while graceful lines lend a distinct feminine touch to the entire collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1947-96 1947-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1947-96 1947-50.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1947-96 1947-40.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:21:50"},
  {id: 1479, name: "Orson Collection ", number: "1191F4S", price: nil, description: "The padded upper back of the Orson Collection is supported by wooden slats that give way to the substantially sized seat of this whimsical accent chair. The collection has six available fabric options -\u0080\u0093 Blue tonal stripe, Black & White swirl, Multi-color poppies, Purple Medallion, Voyage and Grey Medallion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1191f4s_2014H-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1191f4s_2014H-78.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:21:54"},
  {id: 1470, name: "Beacher Collection ", number: "5488-36RD", price: nil, description: "Elevating to suit your needs, the Beacher Collection is a fun and functional addition to your industrial styled home. Metal legs rise to support the turn-rod adjustable height table and stools creating a platform that can be customized at any given time. Weathered wood veneer is segmented into a quadrant pattern on the tabletop for visual interest with faux riveted metal banding providing accent to the table and stools.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5488-36RD.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5488-24.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5488-36RD.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:23"},
  {id: 1471, name: "Talon Collection ", number: "8511TP", price: nil, description: "Designed with numerous room decors in mind, the transitional Talon Collection will be the perfect option for your living room. This stationary group features amply stuffed seating and a bonded leather match covering that is offered in either taupe or black.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8511TP_2546-31_2014S-92.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8511TP_2546-31_2014S-92.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:30"},
  {id: 1472, name: "Rubin Collection ", number: "9734BR-3", price: nil, description: "With base design elements that touch retro styling, the Rubin Collection is a perfect option for your modern home. Light brown or chocolate Champion microfiber allows for versatile placement in a number of living room d cor themes. Coordinating toss pillows compliment the clean look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9734BR_3402-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9734BR_3402-30.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:34"},
  {id: 1482, name: "Langdale Collection ", number: "1212F1S", price: nil, description: "A tasteful accent to any room in your home is the Langdale Collection. The tufted fan back serves as the focal point, while dark cherry finish, on the wood legs, makes for a perfect contrast against either the oatmeal linen, french note, or grey chevron fabric offerings.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1212f2s_2014H-84.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1212f2s_2014H-84.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:22:39"},
  {id: 1483, name: "Cabernet Collection ", number: "4520", price: nil, description: "Created in the profile of a wine barrel the Cabernet wine refrigerator will be the talk of your next gathering. The door of the unit opens to reveal row upon row of wine storage racks ready for you to load your favorite bottles. The lift top conveniently provides storage and the controls that keep your favorite wine at the optimal temperature. The dark oak finish complements the rustic look of this unique unit.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4520.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4520.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:23:05"},
  {id: 1484, name: "Alamosa Collection ", number: "8335-4", price: nil, description: "Transitionally styled for your home is the Alamosa Collection. Unfettered design allows for placement in a number of casual living room settings. The ottoman features diamond patterned fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8335-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8335-4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:23:12"},
  {id: 1485, name: "Fedora Collection ", number: "4614-F3", price: nil, description: "Providing a stylish and function addition to your home is the Fedora Collection. Designed for placement in a number of settings the top opens to reveal ample storage for your personal items. The ottoman is offered in the neutral tones of grey or brown for further decorative flexibility.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4614-F3.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4614-F3.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:23:25"},
  {id: 1486, name: "Gowan Collection ", number: "8477-4", price: nil, description: "Presenting the Gowan Collection, the ottoman framing is accented with bold nailhead and covered in geometric floral pattern fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8477NF-3 8477-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8477NF-3 8477-4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:23:45"},
  {id: 1487, name: "Mayville Collection ", number: "2147BK-12", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147BK-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147BK-12.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:23:55"},
  {id: 1488, name: "Moderne Collection ", number: "1200BRW", price: nil, description: "Drawing inspiration from the timeless look of Art Deco lounges, the Moderne Collection will add a hint of masculine aesthetic to your home's dcor. Hugging the contour of your body, the curved seat and back of the low-profile chair sits atop a swivel base allowing for 360-degree movement. The chair is covered in black or brown bi-cast vinyl with nailhead and roll-tucked back accent.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1200BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1200BRW.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:10"},
  {id: 1489, name: "Harmony Collection ", number: "1195F1S", price: nil, description: "A straight back gives way to the delicate slope of the arms in the Harmony Collection. This elegant accent chair is offered in a neutral beige fabric for ultimate flexibility for placement in your home. Low polish nailhead provides stylish contrast and decorative flair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1195F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1195F1S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:12"},
  {id: 1490, name: "Langdale Collection ", number: "1212F2S", price: nil, description: "A tasteful accent to any room in your home is the Langdale Collection. The tufted fan back serves as the focal point, while dark cherry finish, on the wood legs, makes for a perfect contrast against either the Oatmeal-Colored or the French Note fabric offerings.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1212f1s_C(2014)_2015S-134.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1212f1s_C(2014)_2015S-134.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:13"},
  {id: 1491, name: "Factory Collection ", number: "3228-15", price: nil, description: "Blending the look of vintage industrial with modern design is the Factory Collection. Burnished rustic wood planks make up the desk top and features wrought iron style metal framing that supports both the top and the wooden display shelves. The continuous finished design makes this unit flexible for placement as a freestanding piece. Matching bookcase and occasional tables are also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3228-15.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3228-15.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:18"},
  {id: 1493, name: "Florian Collection ", number: "5538W", price: nil, description: "Ultra modern styling is exemplified with the design of the Florian Collection. The collection is offered in two color options  black metal legs with black glass top or white metal legs with clear glass top  for the perfect fit in your casual dining space. Bi-cast vinyl covered seats in coordinating black or white complete the contemporary look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5538W.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5538W.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:32"},
  {id: 1494, name: "Adlai Collection ", number: "1277", price: nil, description: "Complementing your home's dcor is the Adlai Collection. The modern wingback accent chair is offered in a blue or gray quatrefoil pattern, adding distinct flair to any room in your home. Wood legs support, lending further accent to the modern traditional profile of the chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1277F1S 1277F2S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1277F1S 1277F2S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:36"},
  {id: 1495, name: "Glamour Collection ", number: "1349-1", price: nil, description: "The beauty of the Glamour Collection lies in the simple lines and style. The panel headboard and footboard feature a metal grid pattern to give your bedroom suite an added touch of characteristic. Cherry veneers and select hardwoods in espresso finish with bold hardware accent give the Glamour Collection a desired look to your home decor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1349-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1349-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:47"},
  {id: 1496, name: "Bonaventure Park Collection ", number: "1935-30", price: nil, description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered cabriole legs support the serpentine shaped tops of the occasional tables, while egg and dart molding, along with the acanthus leaf motif lend accent to the traditional look. Creating additional interest is the distinct tray-style top of the cocktail table, with inset glass providing support to your decorative accents. Burl inlay on end, and sofa tables create beautiful contrast to the gold-highlighted cherry finish of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1935-30.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:25:26"},
  {id: 187, name: "Galesburg Bed", number: nil, price: nil, description: "Both cottage and contemporary, this bedroom set combines two styles all into one. The beautiful platform style bed features a slat panel headboard with contrast border trim, smooth wood details and comes complete with coordinating case goods.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7040.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:29:31"},
  {id: 1497, name: "Marston Collection ", number: "2615DC-36", price: nil, description: "Refined elegance is exemplified in the design of the Marston Collection. With three available table options, there is a perfect match for your home  A double pedestal base rises to support the clipped-corner rectangular tabletop of the 96-inch table, the oval topped pedestal table, and the counter height display base table, each are each flanked by chairs that feature turned front legs and nail head accent, along with a neutral tone fabric that covers the seats and backs. In support of the collection are the functional china and server. Featuring drawer and door storage, each with oval bale pull and knob hardware, you can be assured of plentiful space in which to stow or display your tabletop dcor. The server also features a black melamine laminated top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2615DC-36 2615DC-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2615DC-36 2615DC-40.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:32:54"},
  {id: 1498, name: "Aris Collection ", number: "1422-1", price: nil, description: "Classic in design and bold in style, the Aris Collection makes for an inviting presence in your bedroom. Large bun feet serve to support the massive yet elegantly simple case pieces, while the warm brown cherry finish on select hardwoods and veneers completes the overall look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1422-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1422-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:32:59"},
  {id: 1499, name: "Moorewood Park Collection ", number: "1704-30", price: nil, description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the gracefully scrolled motifs that feature prominently throughout the collection. Each occasional table features canted curved pilasters and legs that enhance the profile of the collection with lower display shelves providing additional space for you to show off your decorative choices.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1704-30.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:18"},
  {id: 1500, name: "Jenkins Collection ", number: "5553-01", price: nil, description: "The Jenkins Collection occasional group shows a strong personality with the look of a leather edge banding and etched center motif. Featuring curved metal base and a warm tobacco finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5553-01.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5553-01.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:23"},
  {id: 1501, name: "Sinclair Collection ", number: "8202CH-3", price: nil, description: "A hint of retro styling provides a clean and classic look for your contemporary home in the Sinclair Collection. Offered in a traditional seating or sectional configuration, the options allow for the perfect placement within your living room. The collection is available in either chocolate or gray fabric with contrast pillows that furthers the look and versatility for placement within a number of home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8202CH.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8202CH.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:30"},
  {id: 1503, name: "Savarin Collection ", number: "8226GY", price: nil, description: "One need not feel constricted by the spatial limitations of their homes layout with the Savarin Collection. The modular sectional allows for the extension of either the left or right side with the swap of the individual chair and ottoman components. Decorative versatility comes in the form of the two fabric options, dark brown or light gray and stitch tufting that furthers the transitional styling to complete the look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8226GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8226GY.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:37"},
  {id: 1504, name: "Savarin Collection ", number: "8226DB", price: nil, description: "One need not feel constricted by the spatial limitations of their homes layout with the Savarin Collection. The modular sectional allows for the extension of either the left or right side with the swap of the individual chair and ottoman components. Decorative versatility comes in the form of the two fabric options, dark brown or light gray and stitch tufting that furthers the transitional styling to complete the look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8226DB.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8226DB.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:41"},
  {id: 1505, name: "Sinclair Collection ", number: "8202CH-SC", price: nil, description: "A hint of retro styling provides a clean and classic look for your contemporary home in the Sinclair Collection. Offered in a traditional seating or sectional configuration, the options allow for the perfect placement within your living room. The collection is available in either chocolate or gray fabric with contrast pillows that furthers the look and versatility for placement within a number of home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8202CH-TS 8202CH-CA.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8202CH-TS 8202CH-CA.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:45"},
  {id: 1506, name: "Madaleine Collection ", number: "1385-1", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1385-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1385-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:50"},
  {id: 1507, name: "Adriano Collection ", number: "1217F1S", price: nil, description: "Dark grey woven fabric provides a textural statement to the grandly styled Adriano Collection. Wing-backed, as a nod to traditional form, the chair features nailhead accents and button-tufting which ultimately serve to create the pinnacle in tailored styling.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1217F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1217F1S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:53"},
  {id: 1508, name: "Helena Collection ", number: "5327-48", price: nil, description: "With a deep cherry finish and clean transitional lines, the Helena Collection is a versatile addition to your casual dining space. The 48 round table top allows for placement in smaller dining settings. Surrounding the table are the dark brown bi-cast vinyl upholstered chairs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5327-48.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5327-48.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:55"},
  {id: 1509, name: "Arles Collection ", number: "1270F2S", price: nil, description: "The slender-back profile of the Arles Collection gracefully gives way to the ample seat of this modern-traditional accent chair. High polish nail head accenting provides perfect contrast to the bold-hued coverings that are offered -\u0080\u0093 blue, orange, and grey.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1270F2S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1270F2S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:59"},
  {id: 1510, name: "Reverie Collection ", number: "4602PU", price: nil, description: "Adding a touch of glamour to your home is the Reverie Collection. Black bi-cast vinyl covers this stylish ottoman. The attached top opens to reveal ample storage space. Polished nailhead accent trim encircles the base of the unit, providing a sophisticated touch.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4602PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4602PU.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:04"},
  {id: 1511, name: "Barlowe Collection ", number: "1193F2S", price: nil, description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the French note linen-like fabric offerings.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F2S revised_2014H-83.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1193F2S revised_2014H-83.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:10"},
  {id: 1512, name: "Gladstone Collection ", number: "251-01", price: nil, description: "These stately and oversized traditional occasional tables are finished in a rich dark cherry finish. Key design features include cabriole legs, black marble top with simulated wood components used to create the fretwork panels with the delicate floral bouquet motif.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/251-01.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/251-01.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:14"},
  {id: 1513, name: "Devon Collection ", number: "1197", price: nil, description: "The classic wing-back chair is updated for the modern traditional home in the Devon Collection. The elongated, button-tuft accented chair back gives way to the gentle slope of the low-profile arm while wood legs provide support. The collection is offered in brown or beige fabric coverings for versatile placement in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1197F1S 1197F2S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1197F1S 1197F2S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:17"},
  {id: 1522, name: "Cline Collection ", number: "5530-78", price: nil, description: "With subtle country aesthetic lending distinct influence to the design of the Cline Collection it will place perfectly in your traditional casual dining space. Gently curved arms descend from the traditional Windsor back chair creating an inviting environment in which to enjoy your meal or conversation time. The rectangular table top features rounded corners that enhance the updated style. The two tone finish lends visual contrast making this a unique choice for your dining space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5530-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5530-78.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:55"},
  {id: 1523, name: "Elwell Collection ", number: "4728AK", price: nil, description: "The wedge shape of the Elwell chair-side table allows for placement in the smallest of spaces while still providing ample space for a small table lamp or accessory display.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4728AK Front.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4728AK Front.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:29:00"},
  {id: 1525, name: "Hall Tree Collection ", number: "5322A", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5322.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5322.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:29:32"},
  {id: 1524, name: " Fleming Collection", number: "4732PU", price: nil, description: "Moving through your living space with the greatest of ease is the Fleming Collection. Situated on casters, the multi-functional ottoman features display storage and defined quad seating that, when turned over, can be used as serving trays.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4732PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4732PU.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:29:26"},
  {id: 1526, name: "Parlier Collection ", number: "1234-1", price: nil, description: "Delicate carvings and a woven rattan back grace the show wood frame in the Parlier Collection. The enhanced texture of the wood grain is highlighted by a grey weathered finish, while a natural color fabric covers the plush feather down seating in this elegant offering. The coordinating ottoman allows for the achievement of ultimate relaxation.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1234-1 1234-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1234-1 1234-4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:29:40"},
  {id: 1514, name: "Trammel Collection ", number: "5554-30", price: nil, description: "The traditional brown mahogany finish and unique shape makes the Trammel Collection a perfect addition to your living room. Serpentine lines form the boxed table tops, each edged with short grain mahogany border. Wheat sheaf carved accents top spiral turned legs while display shelving is supported by traditional bun feet.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5554-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5554-30.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:22"},
  {id: 1515, name: "Arles Collection ", number: "1270F1S", price: nil, description: "The slender-back profile of the Arles Collection gracefully gives way to the ample seat of this modern-traditional accent chair. High polish nail head accenting provides perfect contrast to the bold-hued coverings that are offered -\u0080\u0093 blue, orange, and grey.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1270F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1270F1S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:24"},
  {id: 1516, name: "Clair Collection ", number: "471PU", price: nil, description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471PU Open.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/471PU Open.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:39"},
  {id: 1517, name: "Ridder Collection ", number: "8237PU-1PW", price: nil, description: "In the Ridder Collection, transitional styling allows for placement in a number of environments, making it a versatile and functional choice for your living room. Dark brown bi-cast vinyl furthers the decorative versatility of this plush power reclining chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8237PU-1PW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8237PU-1PW.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:44"},
  {id: 1518, name: "Hall Tree Collection ", number: "5333A", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5333.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5333.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:48"},
  {id: 1519, name: "Blasey Collection ", number: "4738PU", price: nil, description: "Convenient, stylish storage space will be added to your home with the dark brown bi-cast vinyl upholstered Blasey Collection. When turned over, the comfortable ottoman bench seating reveals a functional service tray and removable seating cubes.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4738PU opened.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4738PU closed.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4738PU opened.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:34:53"},
  {id: 1520, name: "Elwell Collection ", number: "4728ES", price: nil, description: "The wedge shape of the Elwell chair-side table allows for placement in the smallest of spaces while still providing ample space for a small table lamp or accessory display.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4728ES Front.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4728ES Front.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:00"},
  {id: 1530, name: "Sage Collection ", number: "5512-66", price: nil, description: "Burnished wood tabletops sit atop modern-industrial framing in the Sage Collection. Double X-back chairs feature wood upholstered cushioned seats and top-rail accenting that perfectly complements the 66-inch fixed top table. The burnished finish highlights the wood veneer and lends distinct character to this casual dining collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5512-66.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5512-66.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:29:55"},
  {id: 1531, name: "Massey Collection ", number: "5491-48", price: nil, description: "Designed for the more modest of contemporary dining spaces, the Massey Collection will provide big style for the space it occupies. An intertwined espresso-finished X-base supports a round glass top for maximum style. Four neutral toned arm chairs provide stylish support while you and guests enjoy a meal and conversation.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5491-48 5491A.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5491-48 5491A.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:29:58"},
  {id: 1532, name: "Glendive Collection ", number: "5509-92", price: nil, description: "Classic traditional styling is exemplified in the design of the Glendive Collection. Double pedestals rise to support the table top with a brown cherry finish highlighting the veneer of the wood grain. Turned legs support the urn back chairs, each seat covered with a neutral tone fabric that complements the finish of the collection. The functional display china features door and drawer storage which will provide ample space in which to stow your tabletop accessories. Knob hardware accents the drawers and doors of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5509-92.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5509-92.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:30:01"},
  {id: 1533, name: "Selbyville Collection ", number: "5489-36", price: nil, description: "Transitional lines paired with mixed media elements create the casual look of the Selbyville Collection. The fixed wood top of the group features a rectangular black glass insert that allows you to look down onto the under-table wine storage rack. Metal framing supports the table and wood seat swivel chairs. The cherry finish of the wood is accented by the Gunmetal finished metal.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5489-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5489-36_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5489-36.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:30:04"},
  {id: 1534, name: "Yannis Collection ", number: "5503", price: nil, description: "Sleek contemporary styling provides the platform from which you will create your casual dining space in the Yannis Collection. Ultra-bright high gloss finish of the tabletop and V-shaped support provides a distinct contrast to the high polish chrome base plate. The continuous base of the accenting chairs rises to support gray bi-cast vinyl seats with diamond pattern stitching providing additional visual interest. A smooth glide system opens with ease to reveal the self-storing butterfly leaf.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5503.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5503.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:30:05"},
  {id: 1535, name: "Diego Collection ", number: "5460-36", price: nil, description: "At home in your casual dining space or perhaps in your recreation room, the Diego Collection serves as a casual gathering spot to relax and enjoy a meal, or to catch up with friends and family. The birch veneer of the collection features a versatile espresso finish. The pedestal display base allows for open storage. The matching chairs feature wooden vertical slat backs and padded seats with black bi-cast vinyl covering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5460-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5460-36.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:30:07"},
  {id: 1536, name: "Haughton Collection ", number: "8240-3", price: nil, description: "Combining traditional styling with plush comfort is the Haughton Collection. Brown top grain leather with vinyl match is accented with contrast stitching and nailhead accent supporting the masculine feel of this seating group. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection reclines for the ultimate in comfort. The sofa and love seat feature dual reclining ends with the solo chair extending for individual comfort.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8240.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8240.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:30:27"},
  {id: 1537, name: "Chama Collection ", number: "5469-60", price: nil, description: "A complement to the modern or transitional home, the Chama Collection is a unique addition to the overall dcor of your homes dining room. Framed in metal with a faux wood veneer top, the circular patterns provide focal accent to the table base as well as the accompanying chair backs. The padded seats are covered in chocolate brown fabric for ultimate flexibility for placement in a number of casual dining rooms.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5469-60.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5469-60.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:30:43"},
  {id: 1539, name: "Alta Collection ", number: "8222-1LT", price: nil, description: "Blending the comfort of a lounge chair with the functionality of the internal lift mechanism, the Alta Collection will be a welcome addition to your home. With an electric mechanism that, with a push of a button, takes you from fully reclined to standing, this chair aids in your mobility. The lift chair is offered in dark brown bi-cast vinyl, with contrast stitching, for versatile placement in your transitional to contemporary home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8222-1LT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8222-1LT.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:05"},
  {id: 1540, name: "Orsina Collection ", number: "5477N-96", price: nil, description: "Casting a glamorous reflection of your personal style, the Orsina Collection will dazzle your friends and family as they enter the sophisticated dining space you have created. A sparkling silver finish enhances the mirrored table apron and fronts of the server while the pearl bi-cast vinyl of the accompanying chairs lends elegant contrast. Crystal button tufting lends additional sparkle to the collection. The server provides ample drawer and behind door storage allows for the safe keeping of your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5477N-96.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5477N-96.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:18"},
  {id: 1541, name: "Veltry Collection ", number: "5328-45RD", price: nil, description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Veltry Collection provides an unexpectedly elegant addition to a number of dining spaces. A weathered finish covers the poplar wood veneer of the two table options; a 95.5-inch rectangular trestle table or 45-inch round pedestal table, both featuring nail head accent banding. Nailhead-accented, neutral-tone finished fabric chairs provide subtle contrast that complements the look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-45RD.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-45RD_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5328-45RD.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:21"},
  {id: 1542, name: "Bevelle Collection ", number: "1958-96", price: nil, description: "Modern glamour is exemplified in the design of the Bevelle Collection. Acrylic crystals frame each piece in the collection, reflecting the light to create eye-catching drama. The silver finish serves as the perfect complement to the high-polish decorative knob hardware of the china and server while medallion accents grace all pieces. Providing contrast to finish is the dark gray bi-cast vinyl of the side chairs and arm chairs. A coordinating bedroom is also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1958-96 1958-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1958-96 1958-50.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1958-96 1958-40.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:23"},
  {id: 1543, name: "Frankford Collection ", number: "5456", price: nil, description: "Perfect for the smaller scale, traditional dining space is the Frankford Collection. The brown finish enhances the veneer of the table and accompanying chairs. A storage shelf base provides functionality to the collection while the sheaf back chairs and the neutral tone fabric seats further the traditional element of the casual dining group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5456.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5456.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:25"},
  {id: 1545, name: "Wilner Collection ", number: "5445-60", price: nil, description: "The contemporary design of the Wilner Collection will add flair to your modern home. From the tops of the oblong column legs reach metal supports that suspend the decorative shelf under beveled glass. Black bi-cast vinyl with white baseball stitching covers the table and chairs of this distinct dining collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5445-60.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5445-60.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:30"},
  {id: 1546, name: "Rochelle Collection ", number: "5435-36", price: nil, description: "The design of the Rochelle Collection is a unique play on contemporary design. Natural walnut veneer is utilized to provide stark contrast to the wire-brushed, raised panel pedestal base of this two tone counter height table. Ultra-low back chairs, featuring dark brown bi-cast vinyl, are available with either swivel or stationary seat.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5435-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5435-36_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5435-36.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:31"},
  {id: 1549, name: "Clair Collection ", number: "471TPE", price: nil, description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471TPE.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/471TPE.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:37:12"},
  {id: 1550, name: "Miami Collection ", number: "5430-60", price: nil, description: "Ultra-modern styling is achieved in the design of the Miami Collection. The high gloss grey tabletop features chrome legs that exemplify the tenants of contemporary interior design. Continuous metal frame bases support the grey bi-cast vinyl seats of the coordinating side chairs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5430-60.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5430-60.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:37:16"},
  {id: 1551, name: "Ameillia Collection ", number: "586GY-82", price: nil, description: "The solid, clean lines of the Arts and Crafts movement are interpreted from modern times in the Ameillia Collection. Substantial tapered legs and the wood veneer complement this simple and refined dining offering. Newly offered in a grey with brown undertone finish, the collection is also available in a dark oak finish. The rectangular table is flanked by the perfectly coordinating chair or bench option.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586GY-82.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/586GY-82.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:37:18"},
  {id: 1552, name: "Schleiger Collection ", number: "5400-94", price: nil, description: "Transitionally styled with a burnished brown finish, the Schleiger Collection features bold accenting and functional storage options. Sturdy legs support the metal and rivet banded table top with chair and bench options, allowing for versatile seating configurations. Metal and rivet banding with nailhead accent also features prominently on the open hutch and buffet, and mobile kitchen cart.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-94.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-94 5400-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-07.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5400-94.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:37:20"},
  {id: 1553, name: "Colmar Collection ", number: "5411RF-82", price: nil, description: "With a design that eans toward transitional styling, the wire-brushed Colmar Collection will be a welcome addition to your home casual dining space. A light burnished oak finish enhances the grain of the wood veneer allowing the character to shine through. The chairs feature light neutral fabric seats that complement the tone of wooden finish. Providing additional storage space for your tabletop dcor is the accompanying server. Wine bottle display shelving, as well as drawer and door storage feature prominently. Cylindrical wood and metal hardware graces the front of the unit.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5411RF-82.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5411RF-82.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:37:42"},
  {id: 1555, name: "Moorewood Park Collection ", number: "1704-60", price: nil, description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that feature prominently throughout the collection. Two elegant table options allow for perfect placement within your dining room  the first, a 108-inch rectangular top leg table and the second, a round 60-inch fixed-top table. Flanking the two table options are the subtly ornate dining chairs with their prominent medallion backs and decorative neutral tone seats. The china features canted curved pilasters and legs that enhance the profile of the collection while button and bale, along with knob, hardware featured in an antiqued bronze finish lend subtle contrast. Behind glass display storage along with the doors and drawers of the supporting buffet provides ample storage space for your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-60.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1704-60.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:11"},
  {id: 1557, name: "Rancho Portola Collection ", number: "5155", price: nil, description: "The faux marble top of the contemporary Rancho Portola Collection will serve as the focal point of your casual dining room. The metal X-frame base creates a unique design feature while supporting the table top. The black bi-cast vinyl chairs perch on metal legs and feature contrast stitching for the ultimate in contemporary styling.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5155_6chairs.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5155_6chairs.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:14"},
  {id: 1558, name: "Dryden Collection ", number: "5268-48", price: nil, description: "The Dryden Collection will provide a classic look for your traditional casual dining space. The metal table base consists of turned legs that rise to support the decorative apron and faux marble table top. Metal framed chairs are backed by decorative scrollwork and feature black bi-cast vinyl seats. This unique offering will be the perfect addition to your modest dining space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5268-48.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5268-48.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:30"},
  {id: 1559, name: "Essex Collection ", number: "1260F2S", price: nil, description: "With a classic profile that is covered in a dark grey or blue fabric, the Essex Collection utilizes high polish nail head accenting to provide a modern twist to the design of this elegant accent chair. Rolled tufting furthers the traditional look as do the cherry finished support legs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1260F2S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1260F2S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:43"},
  {id: 1560, name: "Nantes Collection ", number: "5423-66", price: nil, description: "Transitionally styled for placement in your casual dining room is the Nantes Collection.The acacia veneer provides a unique look and texture to this wire-brushed dining offering. Slightly curved legs create subtle motion to the wood vertical slat back chairs with neutral-toned fabric-covered padded seats.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5423-66.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5423-66.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:45"},
  {id: 1561, name: "Ahmet Collection ", number: "5039-48", price: nil, description: "Cream colored bi-cast vinyl chairs provide an excellent contrast to the table's espresso finish in the Ahmet Collection. Scaled for a smaller dining space, the rectangular table provides comfortable seating for four.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5039_2014D-183.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5039_2014D-183.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:46"},
  {id: 1562, name: "Aubriella Collection ", number: "5115-92", price: nil, description: "Designed for your sophisticated dining space, the Aubriella Collection will add the elegant modern touch that you desire. The clipped corner pedestal base rises to support the rectangular table top. Wood sling back chairs feature a neutral tone fabric seat and delicately splayed support legs, furthering the modern classic look of the collection. The coordinating server feature drawers and door storages for ease of placement for your table top accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5115-92.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5115-92.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:48"},
  {id: 1563, name: "Cristo Collection ", number: "5070-64", price: nil, description: "Dark espresso wood legs serve as an elegant contrast to the neutral toned marble tabletop in the Cristo Collection. Dark brown bi-cast vinyl covers the flanking chairs and optional bench.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5070_64_2014D-170.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5070_64_2014D-170.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:50"},
  {id: 1564, name: "Fillmore Collection ", number: "5048-72", price: nil, description: "Ultra-modern in design and ultra-inviting in feel, the Fillmore Collection will be the perfect addition to your contemporary home. Seating designed to cradle your body is covered in a cool grey fabric that contrasts perfectly against the espresso finish over oak veneer of the dining table. The fixed top table seats six comfortably, allowing you to spend quality time with your friends and family.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5048-shot-1-2-final.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5048-shot-1-2-final.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:52"},
  {id: 1565, name: "Isleton Collection ", number: "5147BK-78", price: nil, description: "Classic country styling is achieved with the two-tone look of the Isleton Collection. The classic combination of black and cherry finish is utilized to emphasize the wood veneer of the table top and distinct shape of the turned legs of the table and chairs. The chair backs feature a double X-pattern and brown bomber jacket fabric seats. Blending each of these elements creates a classic look that will be right at home in your casual dining room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5147BK-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5147BK-78.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:54"},
  {id: 1566, name: "Mill Valley Collection", number: "5108-84", price: nil, description: "With traditional touches that blend elegantly with the casual look of the Mill Valley Collection, your dining room will be a warm and inviting space to share meals with your friends and family. The weathered wash finish of this dining offering has hints of grey and white alluding to a rusticated lifestyle. Neutral tone padded fabric chairs feature nailhead accent and wood leg support. The coordinating server features drawers, door and wine storage for the ultimate convenience.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5108-84.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5108-84.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:56"},
  {id: 1571, name: " ", number: "1188", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1188BK_DB_RD-24.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1188BK_DB_RD-24.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:15"},
  {id: 1573, name: "Amara Collection ", number: "5035", price: nil, description: "Whether used as an accessory in a bedroom, as alternative to a traditional dining chair or function as its intended, the versatility of the barstool is unmatched. As part of our Amara Collection, the metal barstool provides not only the seating space that you need, but also a fun accent for your home. Distressed for an industrial feel, each color offering  Silver, Black or White  is available in 18-inch, 24-inch and 29-inch heights.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5034_5035_BARSTOOLS_2014D-228.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5034_5035_BARSTOOLS_2014D-228.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:23"},
  {id: 1574, name: "Havre Collection", number: "5021-54", price: nil, description: "Sophisticated in its simplicity, the Havre Collection will be the center of attention in your dining room. Square beveled glass is placed atop an accordion shaped pedestal wood base. Finished in a rich dark espresso, the base prominently lends to the contemporary design. Each of the wood framed chairs features a flared design inset with either beige or dark brown fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5021-54_2014D-143.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5021-54_2014D-143.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:25"},
  {id: 1575, name: "Ronan Collection ", number: "2617N-36", price: nil, description: "With the look of natural wood planking and a burnished rustic finish, the Ronan Collection melds with your image of a transitionally styled dining room. The substantially sized table features an extension leaf that allows for the expansion of the table to seat eight. Beige fabric covers the seat of the coordinating chairs, accenting the table perfectly.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2617N-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2617N-36.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:26"},
  {id: 1576, name: "Alouette Collection", number: "17811", price: nil, description: "Like a window into your design world, the Alouette Collection provides a classic, yet modern platform for your dining experience. Offered in a rectangular or square top, this all glass table is a vision to behold.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/17811-2_2014D-147.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/17811-2_2014D-147.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:27"},
  {id: 1567, name: "Flannery Collection ", number: "5038-48", price: nil, description: "With a scale appropriate for any number of smaller dining spaces, the Flannery Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble table top and the minimalistic design of the metal ladderbacked chairs that feature dark brown bi-cast vinyl seats. The table and chairs are constructed of metal in black finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5038-48_2014D-192.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5038-48_2014D-192.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:58"},
  {id: 1568, name: "Aleron Collection ", number: "8548BLK-1", price: nil, description: "With a substantial profile that exudes sophistication and power, the Aleron Collection will provide you with the perfect accent seating addition to your living or work space. Button tufting highlights the plush design of the wing-back styled arms and seatback. When the release of the reclining mechanism is combined with separate ottoman, in this swivel base chair, you will find yourself fully reclined and ready to relax. The collection is offered in black or dark brown bonded leather match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8548brw_2014H-92.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8548brw_2014H-92.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:39:19"},
  {id: 1569, name: "Deryn Park Collection ", number: "2243-76", price: nil, description: "Walking into the dining room that is occupied by the Deryn Park Collection will immediately invoke your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. Burl inset flanks the book-match veneered cherry-finished tabletop. With two table options  the rectangular double pedestal base, and the oval topped single pedestal  the collection allows you the flexibility to fit the scale of your dining room. Each chair features an elaborately designed back and a richly hued fabric cover. The china and coordinating server provide ample display and storage space for your tabletop accessories. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243_76X2_H_2014D-2.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2243_76X2_H_2014D-2.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:39:23"},
  {id: 1570, name: "Creswell Collection ", number: "5056-78", price: nil, description: "Country visits town in the earthy Nash Collection. This casual solid wood dining room offering is featured in a warm two-tone buttermilk and medium tone burnished oak finish. Updated ladder-back chairs flank and feature arched and beveled detail. The dining group is further complimented by a small china that features storage shelving that is fronted by wood-framed glass doors and wine bottle and hanging glass rack storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5056-78_mixing photo 2014D-29.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5056-78_mixing photo 2014D-29.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:39:26"},
  {id: 1578, name: "Euro Casual Collection ", number: "2516-48", price: nil, description: "With inspiration drawn from traditional French decorative accents the effortlessly elegant Euro Casual Collection adds warmth and charm to your dining room. A classic urn pedestal base acts as the sole support for the routed round table top. The rustic weathered finish on the birch veneers hints of time gone by and the complimenting fabric on the wood-framed accenting chairs lends a distinct flair to the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2516-48 2516S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2516-48 2516S.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:31"},
  {id: 1579, name: "Broome Collection ", number: "2524-36", price: nil, description: "With just a hint of Craftsman styling and a defined transitional look, the Broome Collection provides you and your family ample space to enjoy your time together. The dark brown finish on hardwood veneers adds to the classic look of the collection. The counter height tabletop expands to seat eight comfortably and is supported by a storage base. The warm brown bi-cast vinyl seat of the chairs blends effortlessly with the table's warm finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2524-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2524-36.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:34"},
  {id: 1580, name: "Devlin Collection ", number: "2538-60", price: nil, description: "The Devlin Collection offers the classic look of transitional styling with a nod to the Arts & Craft movement all in a well appointed six-piece group. Neutral tone fabric covers the seats of the chairs and bench in the espresso finished collection. Notch accent completes the look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2538-60_2014D-188.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2538-60_2014D-188.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:38"},
  {id: 1581, name: "Hahn Collection ", number: "2529-64", price: nil, description: "White marble top stands proudly on the espresso finished base in the Hahn Collection. A warm compliment to your modern or transitional dining room, the bold design is an instant classic.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2529_S_13.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2529_S_13.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:39"},
  {id: 1582, name: "Clayton Collection ", number: "2515-96", price: nil, description: "Blending industrial and transitional style is the Clayton Collection. Clean lines and the warm burnished oak finish on pine veneers give the group a classic look, while the rod and turnbuckle accents on the table base and bench add the industrial flair that are so popular today. Planking is used to further achieve the design elements on both the table top and coordinating china curio. Glass fronted door storage as well as wine rack and drawers complete the look of the curio.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2515-96.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2515-96.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:42"},
  {id: 1583, name: "Warrick Collection ", number: "8213-1", price: nil, description: "The classic rolled arm chair is updated in the Warrick Collection with a stylish gray fabric cover that allows for versatile placement in your traditional home. The push back recliner eases into the prone position with motion that is initiated by your push.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8213.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8213.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:45"},
  {id: 1584, name: "Teague Collection ", number: "2544-64", price: nil, description: "A natural selection for your transitional home, the Teague Collection will compliment your lifestyle. Faux marble is set in a diamond pattern in this casual dining offering. With dark brown bi-cast vinyl seating and a espresso finish to compliment it all, this dining collection will be a welcome addition to your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2544-64_2014D-176.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2544-64_2014D-176.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:49"},
  {id: 1585, name: "Maeve Collection ", number: "2547-72", price: nil, description: "Lacking any appearance of pretension, the Maeve Collection provides a stylish spot for your family to enjoy their time together. A dark cherry finish on the table and wood frame chairs is complimented by the seats of dark brown bi-cast vinyl covered chairs. The cutout that tops each chair back is a simple design element that lends graceful style to this modest dining collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2547-72.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2547-72.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:51"},
  {id: 505, name: "Dwight II Round Counter Ht. Table", number: nil, price: nil, description: "Create a warm and inviting feeling in your dining room with this transitional dining group. Featured here in brown cherry, this counter height table features tall and sleek wooden legs that stylishly support the molding trim round table top.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3988rpt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:48:39"},
  {id: 1586, name: "Mayville Collection ", number: "2147SG-1", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147SG.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147SG.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:57"},
  {id: 1588, name: "Junipero Collection ", number: "2423-36", price: nil, description: "Utilizing the traditional elements of Mission styling, the Junipero Collection adds the feel of the early 20th Century design movement to your casual dining room. The pedestal table base supports an oval top and features storage accessible behind the drop-panel door. Framing, unique to the classic style, carries from the chairbacks to the table base. The rich brown finish serves to highlight the wood veneer.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2423-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2423-36.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:22"},
  {id: 1589, name: "Dover Collection ", number: "2434-48", price: nil, description: "Dark brown PVC chairs compliment a rich espresso finished table in the transitional Dover Collection. This cleanly designed set seats four, making it a perfect addition to your casual dining space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2434-48.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2434-48.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:24"},
  {id: 1590, name: "Saddleback Collection ", number: "5302C", price: nil, description: "A space apart from the hustle and bustle of todays hectic lives, this gathering height table with four saddle back stools are designed for you to enjoy a good meal with or without your friends and families. Available in three finishes: black sand-through, warm cherry, and oak.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5302C.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5302C.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:26"},
  {id: 1591, name: "Saddleback Collection ", number: "5302BK", price: nil, description: "A space apart from the hustle and bustle of todays hectic lives, this gathering height table with four saddle back stools are designed for you to enjoy a good meal with or without your friends and families. Available in three finishes: black sand-through, warm cherry, and oak.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5302BK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5302BK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:29"},
  {id: 1592, name: "Ride Collection ", number: "1155", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1155 Low.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1155 Low.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:30"},
  {id: 1593, name: "Ride Collection ", number: "1149", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1149 Low.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1149 Low.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:31"},
  {id: 1594, name: "Walden Collection ", number: "8215GY-1", price: nil, description: "Created for comfort and designed with versatile placement in mind, the Walden Collection will be a welcome addition to your traditional casual living space. The push back recliner eases into the prone position with motion that is initiated by your push. The collection is offered in brown or gray fabric covering, both featuring nailhead accent for a decorative touch.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8215GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8215GY.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:34"},
  {id: 1595, name: "Decatur Collection ", number: "2456-64", price: nil, description: "The casual Decatur Collection is the transitional style that you have been searching for in your dining space. Wood legs in espresso finish support both the marble table top and chair seats. Covered in dark brown bi-cast vinyl, the tufted accenting on the chair and bench lend not only to the design but also to your comfort, when you sit with family and friends over a casual meal. Also available in counter height dining.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2456-64.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2456-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2456-64.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:33"},
  {id: 1596, name: "Ohana Collection ", number: "1393BK-48", price: nil, description: "The design of Ohana Collection captures the essence of a casual country home. Its antique white and warm cherry, or antique black and warm cherry finishes give it a striking two-toned apprearance. The solid wood table top and unique chair back supported by turned legs complement Ohana Collection with a touch of elegance. This group is further accented by the curio which features two sliding glass doors. Its a warm look youll love having in your home", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1393BK-48.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1393BK-48.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:35"},
  {id: 1599, name: "Verona Collection ", number: "727-36", price: nil, description: "From traditional to modern, the Verona Collection fits beautifully into any home dcor. The table features oak veneer with walnut inlay in a distressed amber finish. The chair design features bi-cast vinyl in a deep chocolate finish that is easy to clean and is luxurious to the touch. A stunning combination of color and design gives the Verona Dining Collection a classic look into contemporary furniture.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/727-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/727-36.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:51"},
  {id: 1600, name: "Archstone Collection", number: "3270-36", price: nil, description: "Contemporary design, sleek seating and the combination of black finish with white accents are all the ingredients you need to create a stylish setting for exceptional dining. The white faux marble top pairs perfectly with a cut out center chair back, the color contrast and stylish design create a rich visual enhancement. Chairs are available in white bi-cast vinyl and black bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3270-36_BK.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3270-36_W.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3270-36_BK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:53"},
  {id: 1601, name: "Verona Collection ", number: "727-72", price: nil, description: "From traditional to modern, the Verona Collection fits beautifully into any home dcor. The table features oak veneer with walnut inlay in a distressed amber finish. The chair design features bi-cast vinyl in a deep chocolate finish that is easy to clean and is luxurious to the touch. A stunning combination of color and design gives the Verona Dining Collection a classic look into contemporary furniture.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/727-72.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/727-72.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:57"},
  {id: 1602, name: "Jervis Collection ", number: "5872N-1", price: nil, description: "Imagine the mansion style headboard of the Jervis Collection serving as the focal point in your glamorous bedroom. Covered in a deep gray tone fabric for a versatile personal decorative touch, while button tufting and nail head accent lend sophisticated elegance to the refined shape of the headboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5872N-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5872N-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:59"},
  {id: 1603, name: "Crown Point Collection ", number: "1372-78", price: nil, description: "Adorn your dining area with Crown Point Collection. This grand scale casual dining in warm merlot finish is as strong and durable as they are stunning. Table top is constructed of mango veneer with strong support tapered legs. Attractive X-back dining chair with comfortable leather-look dark brown seat completes the unsophisticated streamlined look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1372-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1372-78.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:02"},
  {id: 1604, name: "Olney Collection ", number: "5275", price: nil, description: "Designed for your modest dining space, the Olney Collection provides a stylish and functional surface for your mealtime needs. In this five-piece packed offering, the metal table base rises to support the faux marble fixed tabletop. Vertical accents grace the table apron and the top rails of the dark brown bi-cast vinyl covered chairs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5275.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5275.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:04"},
  {id: 1605, name: "Jonas Collection ", number: "2558", price: nil, description: "At home in contemporary or transitional settings, the Jonas Collection will add the splash of style that you have been looking for. The medium cherry finish of the five piece table group will blend well with your new or existing design scheme. Black bi-cast vinyl seats compliment the boat shaped chair back.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2558_mixing color_2014D-200.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2558_mixing color_2014D-200.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:05"},
  {id: 1607, name: "Barolo Collection ", number: "4517", price: nil, description: "Minimalistic lines, combined with a soft rustic aesthetic and functional appointments create the look of the Barolo Collection. Open display shelf, wine bottle rack, discreet behind door cabinet and drop-door storage provide ultimate functionality to your home's kitchen, bar or recreation area. Black metal framing flanks the natural rustic tone wood lending to the industrial look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4517.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4517.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:43"},
  {id: 1620, name: "Wade Collection ", number: "1883N-1", price: nil, description: "Drawing inspiration from traditional Danish modern design, the neutral grey tone of the Wade Collection lends to the contemporary feel. The low-profile bed features a button-tufted shelter headboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1883N-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1883N-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:39:44"},
  {id: 1608, name: "Mosely Collection ", number: "5103", price: nil, description: "Designed for your cozy dining nook, the transitionally styled Mosely Collection will be a perfect fit. Vertical slat back chairs  featuring black bi-cast vinyl seating with contour stitching  flank the routed tabletop. The five-piece dining collection is offered in a dark brown cherry finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5103_2014D-203.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5103_2014D-203.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:46"},
  {id: 1609, name: "Shankmen Collection ", number: "5104", price: nil, description: "Wood rails top the dark brown bi-cast covered chairs in the Shankmen Collection.Seating four comfortably, the round tabletop is supported by the gently curved legs of the display table base. The collection is offered in an espresso finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5104_2014D-202.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5104_2014D-202.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:48"},
  {id: 1610, name: "Ameillia Collection ", number: "586-76", price: nil, description: "Alive with an exciting Arts & Crafts flair, the contemporary style of Ameillia Collection uses smooth dark oak finish and clean line design to create an inviting atmosphere to enhance your dining experience. The contemporary design appeals to the sense with its subtle attention to details. Chair seat and bench seat feature easy to clean dark brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586-76.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/586-76.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:50"},
  {id: 1611, name: "Clancy Collection ", number: "5067", price: nil, description: "Traditional country styling is scaled for your cozy dining space in the Clancy Collection. Beige fabric seats provide contrast to the four coordinating chairs and round top pedestal table, which are finished in a warm black tone, lending to the classic look of the group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5067.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5067.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:51"},
  {id: 1612, name: "Ameillia Collection ", number: "586", price: nil, description: "Alive with an exciting Arts & Crafts flair, the contemporary style of Ameillia Collection uses smooth dark oak finish and clean line design to create an inviting atmosphere to enhance your dining experience. The contemporary design appeals to the sense with its subtle attention to details. Chair seat and bench seat feature easy to clean dark brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/586.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:44:03"},
  {id: 1613, name: "Bayshore Collection ", number: "5447-29S", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-24S & 5447-29S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5447-24S & 5447-29S.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:44:06"},
  {id: 1614, name: "Atwood Collection ", number: "2505BK-36", price: nil, description: "At home in a kitchen nook or home bar, the Atwood Collection is an useful addition to any home. The three-piece table group features a drop-leaf table top, wine storage, and Napoleon back chairs. Available in black and espresso two-tone finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2505BK-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2505BK-36.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:44:11"},
  {id: 1615, name: "Oklahoma Collection ", number: "2469", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2469.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2469.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:44:13"},
  {id: 1616, name: "Bayshore Collection ", number: "5447-24FAS", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-24FAS 5447-29FAS.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5447-24FAS 5447-29FAS.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:44:15"},
  {id: 1617, name: "Tayton Collection ", number: "2867-1", price: nil, description: "Black metal framing provides classic contrast to the brown fabric inserts on the headboard and footboard of the Tayton Collection. Quatrefoil accenting, prominent jointing and nail head embellishment further the traditional look of the bed.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2867-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2867-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:44:17"},
  {id: 1618, name: "Crawford Collection ", number: "5546-84", price: nil, description: "Blending traditional lines with modern glamour is the Crawford Collection. Finished in an eye-catching silver, the collection will be a dramatic addition to your home's dining room. Cabriole legs lend traditional accent to all pieces in the collection. Unique accenting abounds in this collection, the tabletop features inset opaque glass panels and the chairs are enhanced with crystal button tufting. The china lends visual impact as well as functional display and behind drawer and door storage areperfect for your prized table top accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5546-84.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5546-84.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:44:25"},
  {id: 1622, name: "Bayshore Collection ", number: "5447-29FAS", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-24FAS 5447-29FAS.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5447-24FAS 5447-29FAS.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:39:54"},
  {id: 1623, name: "Elista Collection ", number: "5873N-1", price: nil, description: "Modern styling combined with the look of tailored menswear creates a uniquely appointed offering for your bedroom in the Elista Collection. Dark gray tweed fabric is interwoven to create eye-catching drama on the headboard and footboard. The collection also features a coordinating bench and stool.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5873N-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5873N-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:39:58"},
  {id: 1624, name: "Swivel Counter Height Chair Edmond Collection ", number: "1140E-24S", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1140E-24S & 1140E-29S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1140E-24S & 1140E-29S.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:01"},
  {id: 1626, name: "Branton Collection ", number: "1968-1", price: nil, description: "The rustic modern look of the Branton Collection is a unique choice for your bedroom. An antique brown finish highlights the pine veneer while the black base rails that support the collection provide subtle contrast for a rustic industrial look. Unfettered framing allows for the veneer pattern to provide decorative accent. Horizontal hardware accents each case piece.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1968.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1968.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:09"},
  {id: 1627, name: "Beaugrand Collection ", number: "5177-84", price: nil, description: "Leaning towards the styles of industrial, contemporary and transitional, the Beaugrand Collection will be an appropriate choice for a number of dining room decors. Offered in two table styles  round or rectangular  both options of the dining collection feature decorative stainless steel apron trim banding and modified X-base. The coordinating sling-back chair is upholstered in neutral grey fabric with brown tone, accenting by nailheads.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5177-84.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5177-84.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:11"},
  {id: 1628, name: "Erwan Collection ", number: "1961-1", price: nil, description: "Taking a nod from contemporary design, the look of the Erwan Collection is a versatile choice for the modern home. A rich espresso finish highlights the okume veneer and beveled drawer fronts which are punctuated with gunmetal finished hardware and bold framing that blend together to create this soft contemporary bedroom offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1961-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1961-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:17"},
  {id: 1657, name: "Potrero Collection ", number: "2026PU-1HB", price: nil, description: "Versatile placement options, while utilizing minimum space makes the Potrero Collection the right choice for your home. Three styles, each offered in a single cover are available  Grey fabric with vertical channel seaming, black bi-cast vinyl with x-stitch pattern and brown fabric with square pattern.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2026PU-1HB.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2026PU-1HB.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:38"},
  {id: 1629, name: "Verlyn Collection ", number: "1946-1", price: nil, description: "Traditional from the canopy of the four post bed to the burl drawer fronts and turned feet of the case goods, the Verlyn Collection provides an elegant addition to your bedroom space. A classic cherry finish is utilized to highlight the cherry and ash burl veneers. Knob hardware provides refined contrast to the drawer fronts, while turned feet rise to support each case piece. The metal canopy rail that encircles the bed is supported by finial-topped turned posts, lending to the grandeur of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1946.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1946.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:22"},
  {id: 1630, name: "Terron Collection ", number: "1909RF-1", price: nil, description: "Redefining, soft contemporary design is achieved by blending classic elements to create the look of the Terron Collection. The bow-fronted case goods and sleigh bed feature book-matched mindy veneer that is beautifully highlighted by a medium oak finish. Off-set drawers on the dresser and the floating top design of each case pieces provides unique design character that makes this collection a perfect fit for your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1909RF-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1909RF-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:27"},
  {id: 1631, name: "Bryndle Collection ", number: "1882N-1", price: nil, description: "The modern traditional styling of the Bryndle Collection is characterized by the button-tufted headboard and footboard, as well as the nail head accenting on headboard. Further complimenting the design is the dark grey fabric that covers.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1882N-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1882N-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:30"},
  {id: 1632, name: "Pell Collection ", number: "1967W-1", price: nil, description: "Ultra-modern from the straight lines that defines the profile to the two-tone espresso and white finish, the Pell Collection is a stylish choice for your bedroom. Bold finish contrast is rather contrasted by nickel hardware for the ultimate in contemporary accenting. Elevating the functionality of the collection is the bookcase headboard and off-set storage mirror compartment.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1967W-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1967W-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:35"},
  {id: 1634, name: "Laurelin Collection ", number: "1714BK-1", price: nil, description: "Casual transitional styling lends versatility to the placement of the Laurelin Collection in a number of bedroom settings. Black and White sand-through finishes are available creating distinctly different looks from traditional to country casual, with antiqued bronze knob hardware punctuating the look of each framed drawer front. Hidden drawers in the nightstand and dresser provide discrete storage for your valuables, while the storage drawers of the footboard provide a more visible means of additional storage capability. Bun feet support the case goods and a sleigh headboard finish off the transitional design of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1714BK-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1714BK-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:49"},
  {id: 1635, name: "Alouette Collection ", number: "17813", price: nil, description: "Like a window into your design world, the Alouette Collection provides a classic, yet modern platform for your dining experience. Offered in a rectangular or square top, this all glass table is a vision to behold. When accented with a traditional style wood chair upholstered in microfiber, the collection takes on an urban sophisticated look. When accented with a more modern bi-cast vinyl chair, the dining group suddenly becomes a study in contemporary design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/17813_2014D-148.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/17813_2014D-148.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:50"},
  {id: 1636, name: "Anika Collection", number: "1915-1", price: nil, description: "Drawing inspiration from Danish mid-century modern design, the Anika Collection is a stylish addition to your bedroom. The curved framing of each case piece is perfectly accentuated by polished chrome hardware and features soft-close mechanisms on the doors and storage drawers for quiet and sure closure. Offered alongside the traditional case pieces is a four-door chest. Ivory bi-cast vinyl covers the padded wood rail-topped headboard, providing stark contrast to the light ash finish over ash veneers. All pieces in the collection feature tapered legs that are signature to this classic look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1915-1_9.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1915-1_9.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:55"},
  {id: 1637, name: "Moritz Collection ", number: "1706-1", price: nil, description: "Taking contemporary design to a new level is the Moritz Collection. Dramatically eye-catching from the distinct veneer pattern of the faux veneer to the high-gloss sheen and chrome accents, this bedroom collection is sure to give your bedroom the modern look that you so desire. The dark smoky tone of the faux veneer is lent magnificent accenting by the silver-tone of the patterned grain. The nickel finish of the elongated vertical hardware provides complementing visual contrast.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1706-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1706-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:41:02"},
  {id: 1638, name: "Ember Collection ", number: "5797N-1", price: nil, description: "Light neutral toned fabric and nail head accent create a classic look that makes the Ember Collection a perfect choice for a multitude of bedroom decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5797N-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5797N-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:41:06"},
  {id: 1639, name: "Terrace Collection ", number: "1907W-1", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1907W-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1907W-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:41:11"},
  {id: 1641, name: "Allura Collection ", number: "1916BK-1", price: nil, description: "Glamour reigns in the design of the Allura Collection. Framing each piece is a decorative beveled mirror accent that enhances the illumination from the touch-engaged LED back-light of the headboard and mirror, as well as the under-light of the night stand. Alligator embossing and high polished crystal-enhanced hardware boldly accent the available silver or black finish of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1916BK-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1916BK-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:41:23"},
  {id: 1642, name: "Albright Collection ", number: "1717-1", price: nil, description: "Refined elegance is exemplified in the design of the Albright Collection. Classic elements of understated traditional design combined with a barnwood gray finish over oak veneer, high polish knob hardware and the light neutral tone of the fabric covered headboard and footboard, blend effortlessly to create a sophisticated modern traditional look for your bedroom. Elongated, tapered turned legs support the case pieces and bed.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1717-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1717-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:41:29"},
  {id: 1644, name: "Earl Collection ", number: "8205BR-1", price: nil, description: "Plush seating morphs into an enveloping relaxation platform with the pull of the manual recline mechanism in the Earl Collection. The collection is offered with a chocolate or brown covering that lends to the dcor of your transitionally styled home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8205BR-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8205BR-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:53"},
  {id: 1645, name: "Sorrel Collection ", number: "1927-1", price: nil, description: "As a unique addition to a bedroom with either modern or rustic aesthetic, the Sorrel Collection will surely turn heads. Poplar solids feature a heavily burnished finish in this cleanly designed offering. Unfettered framing is boldly accented with two-tone exposed dovetail joints, metal pull hardware on the drawer fronts, and tapered legs that provide strong support.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1927-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1927-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:58"},
  {id: 1647, name: "Granbury Collection ", number: "1911-1", price: nil, description: "Classic traditional styling is updated for your home in the Granbury Collection. Design features that define this timeless look; pewter finish button and bale hardware, picture framed fronts, tapered feet, and routed pilasters play against the casual grey rub-through finish, creating a look that is both modern and stately.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1911-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1911-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:48:52"},
  {id: 1648, name: "Lorenzi Collection ", number: "2220-1", price: nil, description: "The contemporary design of the Lorenzi Collection is enhanced by the addition of the durable black vinyl covering that encases each piece in the collection. Painted grey hardware provides a distinct contrast to the fabric-\u0080\u0099s finish. Scaled for urban living, this collection will prove to be a unique and stylish addition to your master, youth, and guest bedrooms.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2220.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2220.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:48:58"},
  {id: 1649, name: "Terrace Collection ", number: "1907-1", price: nil, description: "The traditional shape and accenting of Craftsman style is perfectly achieved in the design of the Terrace Collection. A rustic burnished oak finish that accentuates the natural characteristics of the solid poplar wood lends to the design, while antiqued bronze finished hardware adorns each case piece. Drawers and door storage provide ample storage space for your personal items.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1907-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1907-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:03"},
  {id: 1650, name: "Eunice Collection ", number: "1844DC-1", price: nil, description: "Traditional aesthetic doesn-\u0080\u0099t always have to be grand in scale or accent to achieve a timeless look. The Eunice Collection takes the form of traditional case pieces and utilizes an espresso finish and understated knob hardware to create bedrooms style that can range from transitional to cottage. Recessed framing carries over from the design of the headboard to the drawer fronts of the case pieces and storage footboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1844DC-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1844DC-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:08"},
  {id: 1651, name: "Celandine Collection ", number: "1928-1", price: nil, description: "The look of traditional design is updated for the modern traditional home in the Celandine Collection. Crystal tufting immediately draws the eyes to the pearlized finish of the bi-cast vinyl headboard insert, while high polished knob hardware stands out from the silver finish of the collection. With each of the aforementioned elements, subtle glamour will be achieved in the design of your elegant bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1928.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1928.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:15"},
  {id: 1652, name: "Beechnut Collection ", number: "1904", price: nil, description: "Blending the elements of contemporary design and rustic aesthetic, the Beechnut Collection is a unique addition to your master, youth or guest bedroom. Dark under-paneling serves to highlight the light finish of the embossed faux-wood veneer of the raised panels on the bed and case goods. Contrasting cup hardware punctuates each drawer front.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1904.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1904.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:20"},
  {id: 1653, name: "Ridley Collection ", number: "3551-30", price: nil, description: "Industrial styling is softened by the blending of natural elements to create a stylish look in the Ridley Collection. A creamy white stone marble top is supported by the weathered wood finished base of each table -\u0080\u0093 comprised of wood framing that includes display shelving with slat construction and angled supports.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3551-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3551-30.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:25"},
  {id: 1655, name: "Baldwyn Collection ", number: "5789N-1", price: nil, description: "A rolled and tufted headboard provides elegant touches to the casual Baldwyn Collection. Offered in black bi-cast vinyl and charcoal fabric, this bed offers not only flexible placement, but the opportunity to style the room to fit your needs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5789N Front View.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5789N Front View.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:35"},
  {id: 1656, name: "Cadmus Collection ", number: "1890N-1", price: nil, description: "Offered in dark grey fabric, the Cadmus Collection tufting headboard will provide you with a versatile option for your contemporary home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1890N-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1890N-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:37"},
  {id: 1658, name: "Chasin Collection ", number: "1896N-1", price: nil, description: "At home in a number of room settings, the Chasin Collection is styled to fit your needs. With an unfettered design in a neutral grey tone fabric, the bed will be the perfect platform for your decorative dreams to become reality.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1896N.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1896N.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:39"},
  {id: 1659, name: "Faust Collection ", number: "1834-1", price: nil, description: "Modern traditional styling is utilized in the Faust Collection, making it the perfect addition to your bedroom. Traditional bun feet support each piece in the collection while the dark cherry finish further lends to the look. Dark brown bi-cast vinyl padded inserts on the headboard feature nailhead accent, while the drawer unit of the footboard provides additional storage space.  Round, antiqued bronze finished knob hardware adorns each drawer front.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1834.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1834.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:44"},
  {id: 1660, name: "Potrero Collection ", number: "1831P-1", price: nil, description: "Versatile placement options, while utilizing minimum space makes the Potrero Collection the right choice for your home. Three styles, each offered in a single cover are available  Grey fabric with vertical channel seaming, black bi-cast vinyl with x-stitch pattern and brown fabric with square pattern.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1831P-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1831P-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:48"},
  {id: 1661, name: "Baldwyn Collection ", number: "5789BK-1", price: nil, description: "A rolled and tufted headboard provides elegant touches to the casual Baldwyn Collection. Offered in black bi-cast vinyl and charcoal fabric, this bed offers not only flexible placement, but the opportunity to style the room to fit your needs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5789BK Front View.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5789BK Front View.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:50"},
  {id: 1662, name: "Deleon Collection ", number: "1881PU-1", price: nil, description: "Designed for your modern home, the DeLeon Collection allows for your creativity and space allowance to create the room of your dreams. Serving as the canvas of your bedroom makeover, the dark brown bi-cast vinyl bed features a low-profile footboard and a dramatic diamond stitch pattern that adorns the headboard. Let your creativity flow with the addition of the DeLeon Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1881PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1881PU.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:51"},
  {id: 1663, name: "Cumberland Collection ", number: "2159-1", price: nil, description: "A classic addition to your transitional bedroom will be the Cumberland Collection. Traditional accents such as, the bun foot that supports each piece and rich medium brown finish on birch veneer, and selected hardwood blend with framing and lines that compliment your personal style. Hidden drawer storages in the night stand and dresser are a clever way to hide your valuables. The newly offered twin and full beds allow for placement that compliments both youth and modestly scaled spaces.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2159-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2159-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:56"},
  {id: 1664, name: "Clementine Collection ", number: "1799-1", price: nil, description: "With a design as sweet as the name implies, the Clementine Collection will be a bright and classic addition for your bedroom sanctuary. Wooden knob hardware stands boldly against the double bow fronted case goods while the additional decorative accents of framed bead-board paneling and scalloped base carry over to the design of the turned post headboard and footboard - further enhancing the classic look of this lovely bedroom. The Clementine Collection is offered in youth as well.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1799-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1799-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:50:04"},
  {id: 1668, name: "Lucian Collection", number: "H11761", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant circular lamp shade. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11761.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11761.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:45:14"},
  {id: 1669, name: "Kari Collection ", number: "2146-1", price: nil, description: "Complimenting the clean design of your home is the Kari Collection. Straight lines dominate the design of this transitional suite. The headboard features distinct framing that is carried throughout the design of the case pieces-each accented with subtle knob hardware. The warm brown cherry finish compliments a number of design schemes allowing for flexible placement in any of your home's bedrooms.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2146-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2146-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:45:19"},
  {id: 1670, name: "Linnea Collection ", number: "1811W-1", price: nil, description: "Ultra-contemporary in design and scale, the Linnea Collection will add modern flair to your bedroom. Finished in high-gloss white, each piece of the suite is accented with chrome finished feet for the ultimate sturdy in contrast. The headboard features a white bi-cast vinyl padded insert that is flanked by flat panel framing. Each case piece is highlighted with elongated, chrome-finished hardware.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1811W-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1811W-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:45:24"},
  {id: 1671, name: "Alain Collection ", number: "8225-3", price: nil, description: "The perfect addition to your casual transitional living room is the Alain Collection. Amply appointed back and seat cushions provide the ultimate in comfort, while matching toss pillows lend a decorative touch. Lightly textured gray fabric provides visual and tactile interest.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8225.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8225.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:35"},
  {id: 1672, name: "Morelle Collection ", number: "1356BK-1", price: nil, description: "The warmth of cottage living is invoked by the classic styling of the adult and youth Morelle Collection. The low post bed features picture framing and round finials with the case pieces featuring molded drawer fronts and knob hardware. The newly offered cherry finish offers an additional option to the classic black and white finishes that are currently available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1356BK-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1356BK-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:39"},
  {id: 1673, name: "Iniko Collection ", number: "8203RD-3", price: nil, description: "Contemporary styling is exemplified in the design of the Iniko Collection. Offered in gray or red leather gel match coverings, the cleanly designed seating group will fit perfectly in your modern home. Chrome legs support and provide decorative accent that is in line with the sleek look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8203RD.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8203RD.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:43"},
  {id: 1674, name: "Marceau Collection ", number: "8224TN-3", price: nil, description: "Modern traditional styling makes for a lovely addition to your living room in the Marceau Collection. Flared arms meet the straight back to create a clean profile that is accented with high polish double nailhead. The front base rail features a single accent line of nailhead for an additional decorative touch. Button tufting lends to the tailored look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8224TN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8224TN.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:45"},
  {id: 1665, name: "Alonza Collection ", number: "1845-1", price: nil, description: "Adding a bold touch of glamour to your boudoir is the Alonza Collection. Finished in a brilliant white, the embossed alligator board is reflected in the inlay mirrors of the bed and case pieces. The newly available back-lit LED headboard and mirror illuminate with a delicate touch, creating a dazzling glow. Turned feet provide a distinct departure from the linear design of the collection, adding a distinctly feminine flair. Drawer pulls add to the allure of the collection with an inlay crystal and chrome look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1845.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1845.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:50:12"},
  {id: 1666, name: "Mayville Collection ", number: "2147-1", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:50:22"},
  {id: 1676, name: "Millwood Collection", number: "50990-T", price: nil, description: "With a look that blends the transitional design element of wood and accenting that lends to a modern traditional aesthetic, the Millwood Collection will help to create the ambiance that you are looking to achieve in your entertainment room. The decorative metal base and framing of the collection provide an industrial feel, lending to the casual contrast of the distressed ash veneer of the shelving and entertainment unit-\u0080\u0099s top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/50990-T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/50990-T.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:53"},
  {id: 1677, name: "Bechette Collection ", number: "8204-3", price: nil, description: "Modern traditional styling is exemplified in the design of the Bechette Collection. Recessed rolled arms feature nailhead accent for profile definition and decorative touch while contrast toss pillows lend a soft modern look to the traditional frame.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8204.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8204.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:56"},
  {id: 1678, name: "Breaux Collection ", number: "8235SS", price: nil, description: "Contemporary design is utilized to create the look of the Breaux Collection. The collection is offered in gray or sesame cover for ultimate design versatility, with two configurations  sofa with end chaise or traditional sofa, love seat and chair  allowing for perfect placement within your living room. Reversible back cushions further the functionality and chrome legs support and lend to the modern design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8235SS-L 8235SS-R.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8235SS-L 8235SS-R.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:59"},
  {id: 1679, name: "Florian Collection ", number: "5538BK", price: nil, description: "Ultra modern styling is exemplified with the design of the Florian Collection. The collection is offered in two color options  black metal legs with black glass top or white metal legs with clear glass top  for the perfect fit in your casual dining space. Bi-cast vinyl covered seats in coordinating black or white complete the contemporary look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5538BK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5538BK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:03"},
  {id: 1680, name: "Potrero Collection ", number: "2025-1HB", price: nil, description: "Versatile placement options, while utilizing minimum space makes the Potrero Collection the right choice for your home. Three styles, each offered in a single cover are available  Grey fabric with vertical channel seaming, black bi-cast vinyl with x-stitch pattern and brown fabric with square pattern.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2025-1HB.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2025-1HB.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:05"},
  {id: 1681, name: "Zoey Collection ", number: "5790-1", price: nil, description: "Make a statement in your bedroom with the Zoey Collection platform bed. This dramatic bed is covered with dark brown bi-cast vinyl, matching night stand is also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5790-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5790-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:13"},
  {id: 1682, name: "Erath Collection ", number: "8244SD-3", price: nil, description: "Mid-Century modern design creates the look of the Erath Collection. High seatbacks and low slung arms lend shape to the profile of the collection while the dramatic tones of blue, orange and sand create visual and decorative interest. Splayed wood legs that are synonymous with mid-century styling support this modern seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8244SD.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8244SD.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:17"},
  {id: 1683, name: "Lotte Collection ", number: "8207-3", price: nil, description: "At home in a soft contemporary or modern traditional home, the Lotte Collection will be a stylish addition to your living space. Wood legs rise to support the frame of this seating group, lending a clean and airy feel to the look of the collection. Contoured track arms and contrast toss pillows further the sophisticated, stylish profile.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8207.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8207.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:19"},
  {id: 1684, name: "Erath Collection ", number: "8244RN-3", price: nil, description: "Mid-Century modern design creates the look of the Erath Collection. High seatbacks and low slung arms lend shape to the profile of the collection while the dramatic tones of blue, orange and sand create visual and decorative interest. Splayed wood legs that are synonymous with mid-century styling support this modern seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8244RN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8244RN.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:21"},
  {id: 1687, name: "Midwood Collection ", number: "9616CN-3", price: nil, description: "Traditional design elements lend and air of refined relaxation to the Midwood Collection. The rolled arms and camelback design feature nail head accent while the contrasting show wood routed frame accentuates the brown bonded leather match or the chocolate chenille covering in this traditional seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9616CN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9616CN.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:31"},
  {id: 1688, name: "Mandeville Collection ", number: "8239-3", price: nil, description: "The timeless look of traditional styling is achieved in the design of the Mandeville Collection. Brown chenille fabric is paired with a show wood frame to create a delicate contrast of textures. Elegant carvings, contrast toss pillows and a curved arm profile further lend to the classic look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8239.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8239.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:32"},
  {id: 1689, name: "Grande Isle Collection ", number: "8234RD-3", price: nil, description: "Your traditional home will be perfectly outfitted with the addition of the Grande Isle Collection. The show wood frame defines the profile of the collection while the two available cover options - Brown fabric with bi-cast vinyl accent or red print fabric  lend further traditional emphasis. Contrast toss pillows complete the look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8234RD.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8234RD.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:35"},
  {id: 1690, name: "Clemencia Collection ", number: "8380-3", price: nil, description: "Modern traditional design is executed with perfection in the Clemencia Collection. Contoured low-profile english roll arms paired with button tufting and contrast pillows create a warm and inviting option for your living room. Natural colored fabric covers, complete the traditional look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8380.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8380.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:36"},
  {id: 1691, name: "Stevensville Collection ", number: "5504-78", price: nil, description: "Rustic styling, that is so popular in the dcor of many homes, is executed in the design of the Stevensville Collection. Rough-hewn plank effect hardwood veneers feature a dark finish that effectively captures the highs and lows of the wood grain. Accompanying the casual dining group is the server with rolling barn hardware that allows the door to float from open to closed, exposing ample storage space. Ladder back chairs are framed in wood and feature neutral tone fabric seats.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5504-78.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5504-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5504-78_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5504-78.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:14:26"},
  {id: 1692, name: "Jarita Collection ", number: "8329CH-3", price: nil, description: "The classic transitional styling of the Jarita Collection creates a look that is perfect for your casual living space. Offered in black or brown bi-cast vinyl, or the newly available chocolate fabric, each piece in the collection offers plush seats, backs and arms. With the pull of the manual reclining mechanism, you are taken from a seated to prone position in an easy motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8329CH.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8329CH.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:14:48"},
  {id: 1693, name: "Thibodaux Collection ", number: "8233FA-3", price: nil, description: "Classically styled for the most traditional of homes, the Thibodaux Collection will complete the vision you have for your elegant living room. Offered in two coverings  Brown fabric with bi-cast vinyl accent or a neutral toned acanthus print fabric  the collection combines these covers with a dramatic show wood frame that features carvings and scrolled arms. Contrast toss pillows complete the look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8233FA.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8233FA.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:14:54"},
  {id: 1695, name: "Nicasio Collection ", number: "8223BK-3PW", price: nil, description: "Designed for comfort, the Nicasio Collection will provide a restful place in which to unwind. Low profile arms feature subtle stitch tufting that complements the transitional styling of the seating group. The all leather covering is available in dark brown or black providing a neutral palate from which to extend your personal decorative style. Power reclining mechanisms allow for the smooth transition from seated to prone, with the press of a button.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8223BK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8223BK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:15:20"},
  {id: 1696, name: "Mahala Collection ", number: "8200BRW-3", price: nil, description: "Plush seating is paired with brown top grain leather and vinyl match in the Mahala Collection to create the ultimate platform for relaxation. Offered in two reclining options, a manual or power engaged. The motion mechanisms allow for quick transition from seated to prone with either the quick pull of the manual tab or the push of the power button.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8200BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8200BRW.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:16:04"},
  {id: 1698, name: "Corazon Collection ", number: "8355-3PW", price: nil, description: "Contemporary styling blends with supreme comfort in the Corazon Collection. Complementing gray fabric lends contrast to the navy gray top grain leather cover. Power reclining mechanisms bring you to a prone position with the touch of a button on the sofa, love seat, and accompanying chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8355_PW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8355_PW.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:16:21"},
  {id: 1699, name: "Alamosa Collection ", number: "8335", price: nil, description: "Transitionally styled for your home is the Alamosa Collection. Unfettered design allows for placement in a number of casual living room settings. It allows the movement of an armless chair, within the configuration, to extend the left or right side to fit your space. Covered in brown chenille, the feather down blend seats and backs are supported by eight-way hand tied construction. The collection also features contrast diamond patterned toss pillows and coordinating ottoman.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8335-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8335-4.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:17:03"},
  {id: 1700, name: "Hight Rowley Collection ", number: "3217PU", price: nil, description: "Interactive, stylish and just plain fun, the Rowley Collection provides a multifunctional table for your living space. The hydraulic gas lift of the metal table base easily ascends with the push of a button to take the dark cherry finish table from cocktail height to dining level. Accompanied by four dark brown bi-cast vinyl covered storage ottomans that act as dining chairs, this versatile group is the perfect option for those looking for additional space as well as style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3217PU Low.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3217PU High.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3217PU Low.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:17:56"},
  {id: 1701, name: "Huron Collection ", number: "5285-64", price: nil, description: "Combining the look of natural elements with transitional styling, the Huron Collection will be a welcome addition to your home's casual dining space. Placed atop legs that feature the look of weathered wood, is a faux bluestone marble top creating stunning contrast that is further enhanced by the flanking dark grey fabric-covered button-tufted chairs and bench.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5285-64.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5285-64_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5285-64.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:00"},
  {id: 1702, name: "Okello Collection ", number: "8370BRW-3", price: nil, description: "Designed for your transitionally decorated living space, the Okello Collection provides a plush platform to enjoy your relaxation moment. Strategically placed stitching provides contouring that enhances your comfort and lends visual interest. This seating group is covered in brown AireHyde match furthering the transitional look. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8370BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8370BRW.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:12"},
  {id: 1703, name: "Shreveport Collection ", number: "8238-AC", price: nil, description: "The substantial size and customizable configuration of the Shreveport Collection creates the perfect platform for relaxation in your living space. Bookending this seating group are the left or right end units that are offered as reclining chair or push back reclining chaise. An armless chair, console unit, corner seat, and armless reclining chair make up the middle part of this sectional offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8238_LR%2BCN%2BAR%2BCR%2BAC%2BRC.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8238_LR%2BCN%2BAR%2BCR%2BAC%2BRC.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:20"},
  {id: 1704, name: "Ynez Collection ", number: "8212-AC", price: nil, description: "Sectional seating allows for the intersection of ample seating space and comfort in the Ynez Collection. Chocolate fabric covers the seats and backrest of this casual offering with the contrasting texture of brown leather gel providing a visual and functional touch to the arms, back and base rail. Dual recliners bookend the armless chair, armless reclining chair, console and corner unit creating a comfortable spot for your friends and family to gather.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8212.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8212.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:25"},
  {id: 1706, name: "Ride Collection", number: "1178", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1178BLK,1178RED,1178WHT _2014D-232.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1178BLK,1178RED,1178WHT _2014D-232.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:32"},
  {id: 1707, name: "Dandelion Collection ", number: "2466-48", price: nil, description: "Traditional does not need to mean old and stuffy. Take the gracefully turned pedestal base and sweeping arm of the accenting chairs of the Dandelion Collection, and traditional takes on a whole new meaning. The distressed dark brownish grey finish of the table is a fresh look, further complimented by the exquisitely soft grayish fabric covering each of the chairs. This collection is sure to be the highlight of your dining room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2466-48.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2466-48.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:35"},
  {id: 1708, name: "Kismet Collection ", number: "8369GY-2LPW", price: nil, description: "Soft modern styling paired with the ample size of the Kismet Collection creates a dramatic look for your casual living room. Power reclining mechanisms extend the end recliners of the two one arm love seats while power armless reclining chair and center corner provide additional seating within the defined space of the sectional. For additional styling complement, the seating group is covered in gray AireHyde match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8369GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8369GY.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:37"},
  {id: 1709, name: "Ride Collection ", number: "1148", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1148 Low.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1148 Low.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:38"},
  {id: 1710, name: "Decatur Collection ", number: "2456-36", price: nil, description: "The casual Decatur Collection is the transitional style that you have been searching for in your dining space. Wood legs in espresso finish support both the marble table top and chair seats. Covered in dark brown bi-cast vinyl, the tufted accenting on the chair and bench lend not only to the design but also to your comfort, when you sit with family and friends over a casual meal. Also available in counter height dining.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2456-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2456-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2456-36.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:44"},
  {id: 1711, name: "Laertes Collection ", number: "8318-3PW", price: nil, description: "Providing ample seating for your friends and family is the Laertes Collection. The classic sectional shape is book-ended by stationary chaise options or USB port enhanced end power recliners. Taupe gray top grain leather provides a gentle touch while darker tone fabric lends stark contrast. The power reclining mechanism bring you to your desired position with a touch of the button. The collection is available in several different configurations to choose from to complete your seating arrangement.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8318 3561.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8318 3561.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:19:10"},
  {id: 1712, name: "Phelps Collection ", number: "9789CF-3LC", price: nil, description: "Not every home is created the same and the unique design of the Phelps Collection allows for maximum flexibility with its reversible chaise. With the chocolate microfiber covering, refined track arm, and comfortable seating, the collection's style is compatible in a number of settings. The matching ottoman provides addtional comfort and function to your living area.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9789CF-3LC new2015.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9789CF-3LC new2015.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:19:12"},
  {id: 1713, name: "Ouray Collection ", number: "8323-3", price: nil, description: "Slightly flared arms give way to the clean lines of the Ouray Collection creating a modern traditional look for your casual living room. Pebble textured velvet feels smooth against your hand as you sink into the supporting plush contrast scatter back pillows. Dark brown contrast welting provides additional focal interest.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8323.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8323.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:19:15"},
  {id: 1714, name: "Pecos Collection ", number: "8480BRW-2LCN", price: nil, description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors  gray, red and dark brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480BRW_2LCN%2BCR%2B2R.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8480BRW_2LCN%2BCR%2B2R.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:19:17"},
  {id: 1716, name: "Sedley Collection ", number: "5415RF-FBH", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5415RF-FBH_open.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5415RF-FBH_open.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:51:33"},
  {id: 1717, name: "Cornelia Collection ", number: "8216DG-3", price: nil, description: "Casual traditional styling creates the look of the Cornelia Collection. The seating group is offered in two coverings, sand or dark gray fabric to easily blend and complement to your homes dcor. Nail head trim along with rolled arms lend to the soft traditional style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8216DG.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8216DG.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:51:38"},
  {id: 1718, name: "Pecos Collection ", number: "8480RED-3", price: nil, description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors  gray, red and dark brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480RED.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8480RED.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:51:45"},
  {id: 1719, name: "Jarita Collection ", number: "8329BLK-3", price: nil, description: "The classic transitional styling of the Jarita Collection creates a look that is perfect for your casual living space. Offered in black or brown bi-cast vinyl, each piece in the collection offers plush seats, backs and arms. With the pull of the manual reclining mechanism, you are taken from a seated to prone position in an easy motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8329BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8329BLK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:51:49"},
  {id: 1720, name: "Ride Collection ", number: "1147", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1147 Low.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1147 Low.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:51:52"},
  {id: 1721, name: "Pecos Collection ", number: "8480BRW-3", price: nil, description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors  gray, red and dark brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8480BRW.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:51:58"},
  {id: 1722, name: "Gowan Collection ", number: "8477NF-3", price: nil, description: "Wide arm contemporary framing is accented with bold nail heads in the Gowan Collection. Eight-way hand-tied seat construction provides support for the feather and polyester blend seating. Offered in beige and brown chenille, the neutral tone bodies are complemented by the contrasting geometric floral pattern toss pillows and nail head accented ottoman.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8477NF.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8477NF.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:00"},
  {id: 1723, name: "Deryn Collection ", number: "8327GY-3", price: nil, description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Contrast toss pillows and an additional chair option are featured in a modern teal or grey herringbone pattern to complement the teal, beige and grey seating body covers. Natural tone finished legs support the frame while tailored stitch tufting lends further accent to this thoroughly modern collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8327GY.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:04"},
  {id: 1724, name: "Elevated Collection ", number: "9769BR", price: nil, description: "With the ease of touch, your relaxation experience is lifted in more ways than one. The Elevated Collection is a convenient addition to your home and lifestyle. The electronic lift mechanism takes you from seated to reclined or fully lifted to a standing position. Offered in two neutral tones, the chair will be a perfect fit, blending into many home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9769BR-1LT_1_2014S-122.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9769BR-1LT_1_2014S-122.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:18"},
  {id: 1725, name: "Saddleback Collection ", number: "5302A", price: nil, description: "A space apart from the hustle and bustle of todays hectic lives, this gathering height table with four saddle back stools are designed for you to enjoy a good meal with or without your friends and families. Available in three finishes: black sand-through, warm cherry, and oak.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5302A.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5302A.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:21"},
  {id: 1727, name: "Ohana Collection ", number: "1393W-36", price: nil, description: "The design of Ohana Collection captures the essence of a casual country home. Its antique white and warm cherry, or antique black and warm cherry finishes give it a striking two-toned apprearance. The solid wood table top and unique chair back supported by turned legs complement Ohana Collection with a touch of elegance. This group is further accented by the curio which features two sliding glass doors. Its a warm look youll love having in your home", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1393W-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1393W-36.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:29"},
  {id: 1728, name: "Rubin Collection ", number: "9734BK-3", price: nil, description: "With base design elements that touch retro styling, the Rubin Collection is a perfect option for your modern home. With multiple covering options to suit your personal needs and style, the collection allows for versatile placement in a number of living room decor themes. Options include - light brown or chocolate textured plush microfiber; Black, dark brown or taupe bonded leather match; Fabric medallion print accent chair that provides a pop of color via purple, gold and green tones.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9734BK-shot2-original.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9734BK-shot2-original.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:32"},
  {id: 1729, name: "Cranley Collection ", number: "9700FCP", price: nil, description: "The reclining Cranley Collection utilizes a release mechanism that with a gentle pull sends you straight into your ultimate comfort zone. Offered in three coverings -\u0080\u0093 black bonded leather match, brown bonded leather match or chocolate textured plush microfiber with dark brown bi-cast vinyl. Corner wedge is available to transform this versatile seating collection into a luxurious sectional. The collection is also available in power reclining mechanism.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9700FCP.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9700FCP.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:37"},
  {id: 1730, name: "Pendu Collection ", number: "8326BRW-3", price: nil, description: "Contoured for your ultimate comfort and designed for placement in homes with transitional or contemporary style, the Pendu Collection will provide the relaxing platform you need for your downtime. Plush seating and backs extend from seated to prone with a pull of the manual reclining mechanism on each piece in the collection -\u0080\u0093 dual reclining sofa, love seat and chair. The top and front bodies of each piece in the collection is covered in black or brown top grain leather, with leather match covering those areas beyond your initial reach.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8326BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8326BRW.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:42"},
  {id: 1731, name: "Greeley Collection ", number: "8325BLK-3", price: nil, description: "Designed to be the comfortable spot that you nestle into after a long day, the Greeley Collection will be a welcome addition to your homes living room. Plush seating and backs extend from seated to prone with a pull of the manual reclining mechanism on each piece in the collection  dual reclining sofa, love seat and chair. The top and front bodies of each piece in the collection is covered in black or brown top grain leather, with leather match covering those areas beyond your initial reach.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8325BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8325BLK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:46"},
  {id: 1732, name: "Greeley Collection ", number: "8325BRW-3", price: nil, description: "Designed to be the comfortable spot that you nestle into after a long day, the Greeley Collection will be a welcome addition to your homes living room. Plush seating and backs extend from seated to prone with a pull of the manual reclining mechanism on each piece in the collection  dual reclining sofa, love seat and chair. The top and front bodies of each piece in the collection is covered in black or brown top grain leather, with leather match covering those areas beyond your initial reach.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8325BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8325BRW.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:49"},
  {id: 1733, name: "Rubin Collection ", number: "9734TP-3", price: nil, description: "With base design elements that touch retro styling, the Rubin Collection is a perfect option for your modern home. With multiple covering options to suit your personal needs and style, the collection allows for versatile placement in a number of living room decor themes. Options include - light brown or chocolate textured plush microfiber; Black, dark brown or taupe bonded leather match; Fabric medallion print accent chair that provides a pop of color via purple, gold and green tones.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9734TP_ALL.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9734TP_ALL.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:53"},
  {id: 1734, name: "Galena Collection ", number: "5050-36", price: nil, description: "The convenient height of the Galena Collection along with the warm cherry finish will be a welcome addition to your casual dining space. The five-piece offering includes the counter height table with display storage base and four coordinating chairs that have dark brown bi-cast vinyl seats. The transitional styling makes the placement of the collection appropriate for numerous home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5050-36_new.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5050-36_new.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:56"},
  {id: 1736, name: "Talon Collection ", number: "8511BK", price: nil, description: "Designed with numerous room decors in mind, the transitional Talon Collection will be the perfect option for your living room. This stationary group features amply stuffed seating and a bonded leather match covering that is offered in either taupe or black.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8511BK-shot2_mixing color (2015).jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8511BK-shot2_mixing color (2015).jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:53:06"},
  {id: 1737, name: "Adair Collection ", number: "8413TL-3", price: nil, description: "The Adair Collection offers a classic look to your stylish home. Classic lines form the profile of this versatile look. Offered in 4 trend-driven colors -\u0080\u0093 teal, grey, yellow and beige -\u0080\u0093 your choice of fabric will allow for your decorative personality to shine.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8413TL_all_mixing color (2015).jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8413TL_all_mixing color (2015).jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:53:07"},
  {id: 1738, name: "Ramsey Collection ", number: "8518", price: nil, description: "Thoroughly modern, the Ramsey Collection features a hint of retro styling blended with a trendy grey cover that will show off your personal style. Coordinating stitching segments each cushion creating a center focal point that draws your eyes. Track style arms further lend to the classic look of the Ramsey Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8518.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8518.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:53:13"},
  {id: 1739, name: "Laurelton Collection ", number: "9636-3", price: nil, description: "Generous seating combined with functional touches makes the Laurelton Collection the perfect addition to your living room. The double glider reclining love seat-\u0080\u0099s center console features dual cup holders and hidden storage. Charcoal and chocolate textured plush microfiber fabric are available as cover options for this amply appointed seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9636_shotin2016.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9636_shotin2016.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:21:57"},
  {id: 1856, name: "Langdale Collection ", number: "1212F4S", price: nil, description: "A tasteful accent to any room in your home is the Langdale Collection. The tufted fan back serves as the focal point, while dark cherry finish, on the wood legs, makes for a perfect contrast against either the oatmeal linen, french note, or grey chevron fabric offerings.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1212F4S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1212F4S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:22:05"},
  {id: 1740, name: "Ackerman Collection ", number: "8500BLK", price: nil, description: "With a design style that is flexible for placement in number of living environments, the Ackerman will be a welcome addition to your home. Dual reclining ends are featured on the sofa and love seat for maximum comfort. That comfort extends to the matching reclining chair. The bonded leather match collection is offered in either grey or black.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8500BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8500BLK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:08"},
  {id: 1741, name: "Hume Collection ", number: "8579DB-3", price: nil, description: "Adaptable to be at home in a number of traditional or transitional settings, the Hume Collection provides a stylish look to your living room. Featuring the classic styles of an elevated foot and rolled arms, the Hume Collection will provide you with a comfortable and versatile platform to showcase your decorative taste. The collection is offered in dark brown bonded leather match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8579DB_ALL.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8579DB_ALL.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:09"},
  {id: 1742, name: "Walden Collection ", number: "8215BJ-1", price: nil, description: "Created for comfort and designed with versatile placement in mind, the Walden Collection will be a welcome addition to your traditional casual living space. The push back recliner eases into the prone position with motion that is initiated by your push. The collection is offered in brown or gray fabric covering, both featuring nailhead accent for a decorative touch.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8215BJ.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8215BJ.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:12"},
  {id: 1743, name: "Vernon Collection", number: "9603BLK", price: nil, description: "With defined angles that exemplify contemporary design, the Vernon Collection will blend effortlessly into your modern home. Metal legs support the bonded leather seating group while also enhancing the look of the collection. The headrests atop each piece add function to this already unique group. The collection is offered in black or white bonded leather.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9603BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9603BLK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:16"},
  {id: 1744, name: "Marille Collection ", number: "9724BLK", price: nil, description: "With either the extended stretch of the reclining sofa or soothing rock of the reclining chair, your comfort is taken care of in the Marille Collection. Drop-down cup holders add additional function to the collection. The collection is offered in brown bonded leather match, black bonded leather match, dark brown 100% polyester or taupe 100% polyester.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9724BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9724BLK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:18"},
  {id: 1746, name: "Cantrell Collection ", number: "9778BLK", price: nil, description: "Your casual living room deserves a bold look and the Cantrell Collection will deliver. The black bonded leather match seating group features contrast stitching and manual pull reclining mechanism. Plush seating ensures comfort of your family and friends, as do the dual reclining seats of the love seat, end recliners of the sofa and chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9778BLK 3422.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9778BLK 3422.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:21"},
  {id: 1747, name: "Charley Collection", number: "9715PU", price: nil, description: "Like the embrace of a dear friend, the Charley Collection allows you to be yourself. Whether stretching out for a long nap or curling up with a good book, each piece is welcoming in its comforting hug. Golden brown chenille, chocolate chenille or dark brown bi-cast vinyl covers the collection adding another layer of softness.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9715PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9715PU.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:23"},
  {id: 1748, name: "Brooks Collection ", number: "9739CH", price: nil, description: "Relaxation is serious business. Serious comfort is what the Brooks Collection offers in this substantially sized upholstered seating group. Channel-tufting covers the pillow arms, overstuffed cushions and is offered in either dark brown or red bonded leather -\u0080\u0093 or our new chocolate brown textured plush microfiber option. The unique feature of this collection is the wide chaise that extends from the sectional sofa. The coordinating ottoman tucks neatly into the face of the sofa, effectively extending your lounging space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9739CH Shot1_2014S-63.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9739CH Shot1_2014S-63.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:25"},
  {id: 1749, name: "Laurelton Collection ", number: "9636CC-3", price: nil, description: "Generous seating combined with functional touches makes the Laurelton Collection the perfect addition to your living room. The double glider reclining love seat-\u0080\u0099s center console features dual cup holders and hidden storage. Charcoal and chocolate textured plush microfiber fabric are available as cover options for this amply appointed seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9636CC_shotin2016.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9636CC_shotin2016.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:28"},
  {id: 1750, name: "Yates Collection ", number: "5167-96", price: nil, description: "Blending the look of country style with the popular modern industrial aesthetic, the Yates Collection manages to achieve a look that is unique unto itself. The turned legs of the trestle base rise to support the burnished dark oak table top. Neutral fabric covered chairs feature wood support legs  with a unique turned block look  and nailhead accent. The accompanying chinas mirrored back, display shelving, light feature, lower door storage, and drawer storage provide ample room to show off your table top accessories. The look of turned pilasters and framed panel doors further lend to the stylish collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5167-96.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5167-96.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:50"},
  {id: 1751, name: "Tala Collection ", number: "4501-F2", price: nil, description: "A bold statement for any room the Tala Collection provides function and style for your living space. Offered in dark blue and brown, each piece is boldly accented with a white quatrefoil pattern. The attached lift top allows for discrete storage space within your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4501-F2.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4501-F2_open.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4501-F2.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:55"},
  {id: 1752, name: "Dwyer Collection ", number: "9701BLK", price: nil, description: "A thoroughly modern seating option for your contemporary home, the Dwyer Collection provides a comfortable venue for your downtime.Black vinyl features contrast baseball stitching and raised cushions that slightly flare furthering the modern design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9701BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9701BLK.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:59"},
  {id: 1753, name: "Ameillia Collection ", number: "586-36", price: nil, description: "The solid, clean lines of the Arts & Crafts movement are interpreted for modern times in the Ameillia Collection. Substantial tapered legs and the birch veneer, in a dark oak finish, complement this simple and refined dining option.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/586-36.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:03"},
  {id: 1754, name: "Andover Collection ", number: "2458-36", price: nil, description: "Your cozy breakfast nook will be complete with the Andover Collection. The transitional pedestal base lends a casual feel to this five-piece offering. The table and spindle-back chairs are featured in an antique oak and black two-tone finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2458-36 Shot 1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2458-36 Shot 1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:06"},
  {id: 1755, name: "Waneta Collection ", number: "8214BRW-1", price: nil, description: "Styled for the transitional home, the Waneta Collection will provide the platform you seek for rest and relaxation. The push back recliner eases into the prone position with motion that is initiated by your push. Offered in a brown leather gel match cover, this stylish push-back chair will serve you well in your downtime.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8214BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8214BRW.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:09"},
  {id: 1757, name: "Cranley Collection ", number: "9700BRW-3", price: nil, description: "The reclining Cranley Collection utilizes release mechanism that with a gentle pull sends you straight into your ultimate comfort zone. Tufted bonded leather covers the overstuffed arms, seats and backs furthering the comfort for you, your family and friends. Offered in black or brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9700BRW_2456-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9700BRW_2456-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:13"},
  {id: 1759, name: "Lucille Collection ", number: "1192BE", price: nil, description: "Retro lines need not stay in the past with the mid-century inspired lines of the Lucille Collection. With fabric offerings that range from neutral to bold such as beige, gray, blue, and orange further complemented with button-tufted accenting and stylishly appointed legs, this classic accent chair will provide a look that shows your personal style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1192BE.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1192BE.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:21"},
  {id: 1760, name: "Rubin Collection ", number: "9734CH-3", price: nil, description: "With base design elements that touch retro styling, the Rubin Collection is a perfect option for your modern home. Light brown or chocolate Champion microfiber allows for versatile placement in a number of living room d cor themes. Coordinating toss pillows compliment the clean look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9739CH Shot1_2014S-63.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9739CH Shot1_2014S-63.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:43"},
  {id: 1761, name: "Ferriday Collection ", number: "8228BU", price: nil, description: "Providing the flexible option for relaxation, sleep and storage, the Ferriday Collection will be a stylish and functional addition to your living room. Under seat storage is revealed with the pull of a tab on the end chaise. The lower portion of the seating configuration pulls out to reveal a pop up trundle that creates a bed space creating a relaxing environment with minimal effort. The collection is offered in blue or taupe fabric, both with contrast stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8228BU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8228BU.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:44"},
  {id: 1762, name: "Arles Collection ", number: "1270F3S", price: nil, description: "The slender-back profile of the Arles Collection gracefully gives way to the ample seat of this modern-traditional accent chair. High polish nail head accenting provides perfect contrast to the bold-hued coverings that are offered -\u0080\u0093 blue, orange, and grey.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1270F3S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1270F3S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:07"},
  {id: 1763, name: "Daisy Collection", number: "710-54", price: nil, description: "Daisy Collection combines superb visual appearance and fine quality that you need in your dining area. Three distinct elegant flared tulip bases support beveled glass tabletops on the rectangular and round traditional dining height tables and a round gathering height table. Additional offering is the trestle table with black glass insert. Counter and dining height chairs feature clean lines and sleek curves; available in both white and bi-cast vinyl and dark brown bi-cast vinyl. The set is constructed of hardwood solids and veneers in a refreshing espresso finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-54.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/710-54.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:10"},
  {id: 1764, name: "Sedley Collection ", number: "5415RF-1", price: nil, description: "Whether your home leans to transitional or contemporary design, the Sedley Collection will be the perfect fit for your bedroom. From the distinct walnut veneer pattern -\u0080\u0093 with walnut finish - to the unique cut-away design and horizontal metal hardware of the case goods, each design component lends to placement in a variety of bedroom spaces. The dark brown tone of the inset headboard fabric compliments the finish of the group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5415RF-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5415RF-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:14"},
  {id: 1765, name: "Veloce Collection ", number: "8219-30", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8219-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8219-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:20"},
  {id: 1766, name: "Barlowe Collection ", number: "1193F4S", price: nil, description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the french note fabric offerings. New fabric options include: blue, grey, dark teal, chain link print, and paisley print.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F4S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1193F4S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:22"},
  {id: 1767, name: "Barlowe Collection ", number: "1193F5S", price: nil, description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the french note fabric offerings. New fabric options include: blue, grey, dark teal, chain link print, and paisley print.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F5S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1193F5S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:23"},
  {id: 1769, name: "Charisma Collection ", number: "1194CH", price: nil, description: "High polished nailhead accents the profile of the Charisma Collection. This modern traditional accent chair provides a stylish, yet functional addition to your home. The chair is offered in four distinct colors: teal, taupe, indigo and chocolate.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1194CH.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1194CH.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:26"},
  {id: 1770, name: "Colusa Collection ", number: "4741FA", price: nil, description: "Additional storage space is always welcome in any home. The Colusa Collection will provide you with the extra room you need to store your personal items. Covered in a neutral grey fabric, this transitionally designed ottoman will place perfectly in a number of home decors. Button tufting lends a stylish touch to the piece.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4741FA.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4741FA.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:35"},
  {id: 1771, name: "Delmar Collection ", number: "5511-36", price: nil, description: "The burnished finish and classic profile of the Delmar Collection will be a perfect fit for your modest casual dining space. Splat back wood chairs with brown bi-cast vinyl seats flank the counter and dining height table offerings. Routed detailing provides a linear focal point on the tables tops.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5511-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5511-36.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:38"},
  {id: 1772, name: "Iola Collection ", number: "8437DBR-1LT", price: nil, description: "Traditionally styled for your living space, the Iola Collection will provide you with a functional chair to fit your personal needs. Via the attached controller, you are taken from seating to reclining or standing position. The taupe or dark brown 100% polyester cover, rolled arms and nail head accent further lend the classic look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8437DBR-1LT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8437DBR-1LT.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:49"},
  {id: 1774, name: "Fiorella Collection ", number: "8412-1", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8412-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8412-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:57"},
  {id: 1775, name: "Orson Collection ", number: "1191F5S", price: nil, description: "The padded upper back of the Orson Collection is supported by wooden slats that give way to the substantially sized seat of this whimsical accent chair. The collection has six available fabric options -\u0080\u0093 Blue tonal stripe, Black & White swirl, Multi-color poppies, Purple Medallion, Voyage and Grey Medallion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1191f5s_2014H-79.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1191f5s_2014H-79.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:58"},
  {id: 1776, name: "Orson Collection ", number: "1191F3S", price: nil, description: "The padded upper back of the Orson Collection is supported by wooden slats that give way to the substantially sized seat of this whimsical accent chair. The collection has six available fabric options -\u0080\u0093 Blue tonal stripe, Black & White swirl, Multi-color poppies, Purple Medallion, Voyage and Grey Medallion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1191f3s_2014H-77.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1191f3s_2014H-77.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:59"},
  {id: 1777, name: "Deryn Collection ", number: "8327TL-1S", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327TL 8327TL-1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8327TL 8327TL-1S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:30:07"},
  {id: 1778, name: "Adelaide Collection ", number: "1245F2S", price: nil, description: "The traditional wing back styling of the Adelaide Collection is given a modern touch with the addition of high polish nail head accenting. A light neutral fabric covering with matching kidney pillow allows for placement in a multitude of settings.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1245F2S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1245F2S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:30:10"},
  {id: 1779, name: "Milford Collection ", number: "8509-1LT", price: nil, description: "When comfort is no longer an option but a necessity, the Milford collection will provide you the multifunctional platform that you need. With an electric mechanism that, with a push of a button, takes you from fully reclined to standing, this chair aids in your mobility. Covered in a neutral toned Chenille fabric and designed with a nod to traditional styling, this chair will be the perfect accent to your home and life.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8509-1lt-shot2_2014S-123.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8509-1lt-shot3_2014S-123.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8509-1lt-shot2_2014S-123.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:30:14"},
  {id: 1781, name: "Morris Collection ", number: "2051FBK-1", price: nil, description: "Ball finials, prominent decorative jointing and classic quatrefoil pattern lend to the modern traditional look of the Morris Collection. The collection is offered in twin and full size bed options for versatile placement within your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2051FBK-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2051FBK-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:31:09"},
  {id: 1782, name: "Alida Collection ", number: "8555BLK-1", price: nil, description: "Serving as a perfect accent in your contemporary home is the Alida Collection. The reclining mechanism of the chair combined with the separate ottoman allows for complete extension into a relaxed position. Fitted with a convenient swivel base, the chair faces the action at all times. Cover options include black or white bonded leather match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8555blk_2014H-94.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8555blk_2014H-94.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:31:15"},
  {id: 1819, name: "Halston Collection ", number: "2952-30", price: nil, description: "Extraordinary contemporary design is utilized in the creation of the Halston Collection. Streamlined table legs extend and intersect to support the glass tabletops in this unique occasional table offering. The espresso finish of the wood legs furthers the modern feel of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2952-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2952-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:30"},
  {id: 1783, name: "Vestavia Collection ", number: "1936-1", price: nil, description: "The contemporary styling of the Vestavia Collection provides a unique platform from which to redecorate your bedroom. Faux wood printed veneer provides subtle texture and a grey finish as perfect contrast to the dark brown finish of the base rails of the case pieces and back panels of the headboard and footboard. Clean lines lend to the angular modern look and are enhanced by the horizontal brushed nickel hardware. Offered in both adult and youth beds, this collection provides great flexibility to your rooms at home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1936.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1936.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:31:23"},
  {id: 1784, name: "Aleron Collection ", number: "8548BRW-1", price: nil, description: "With a substantial profile that exudes sophistication and power, the Aleron Collection will provide you with the perfect accent seating addition to your living or work space. Button tufting highlights the plush design of the wing-back styled arms and seatback. When the release of the reclining mechanism is combined with separate ottoman, in this swivel base chair, you will find yourself fully reclined and ready to relax. The collection is offered in black or dark brown bonded leather match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8548blk_2014H-92.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8548blk_2014H-92.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:31:27"},
  {id: 1785, name: "Kellen Collection ", number: "8545-1LT", price: nil, description: "Creating a platform for your mobility is the Kellen Collection. The dark brown bonded leather covering is highlighted by transitional styling, making this not only a functional choice but one that is compatible with numerous home decors. The power lift mechanism takes you from fully reclined to a standing position.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8545-1LT shot2_mixing photo_2014S-124.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8545-1LT shot2_mixing photo_2014S-124.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:31:32"},
  {id: 1888, name: "Zara Collection ", number: "4663", price: nil, description: "Woven metal rods intertwine to create an elegant nest that supports the frosted glass tabletop of the Zara Collection. An elegant chrome finish adds to the allure of this accent table.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4663.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4663.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:38:25"},
  {id: 1786, name: "Jerrick Collection ", number: "1957-1", price: nil, description: "Classic transitional design serves as a base for the natural qualities of the solid wood utilized to create the rustic look of the Jerrick Collection. Metal hardware furthers the authentic rustic look while a burnished finish serves to highlight the wood grain while allowing each plank to serve as a unique accent to the overall design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1957-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1957-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:38:31"},
  {id: 1787, name: "Tiana Collection ", number: "2052FW-1", price: nil, description: "The arched panels of the headboard and footboard create eye-catching drama in the Tiana Collection. The white finish along with ball finials and the circle motif - that centers the headboard and footboard -\u0080\u0093 all lend to the traditional look of the collection. Twin and full bed size options are available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2052FW-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2052FW-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:38:41"},
  {id: 1788, name: "Lucida Collection ", number: "2039TW-1", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2039TW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2039TW.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:38:49"},
  {id: 1789, name: "Lia Collection ", number: "2048FW-1", price: nil, description: "Traditional styling lends to the classic look of the Lia Collection. Offered in twin and full, this white metal bed features prominent decorative jointing and ball finials creating a casual traditional option for your bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2048FW-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2048FW-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:38:53"},
  {id: 1790, name: "Cullen Collection ", number: "1855-1", price: nil, description: "Clean lines and unfettered design lend to the versatile contemporary styling of the Cullen Collection. The bed features dark brown vinyl padded inserts with a single accenting button. Each case piece in the collection is punctuated with silver finished knob hardware. The brown cherry finish further makes this modern group a versatile choice for placement in a number of bedroom looks.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1855.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1855.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:39:00"},
  {id: 1792, name: "Lia Collection ", number: "2047FBK-1", price: nil, description: "Designed for the traditional home, the Mardelle Collection is a timeless look for your bedroom. Offered in twin and full, this black metal bed features X-panels accent with medallion centers and ball finials, lending to the classic look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2047FBK-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2047FBK-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:39:18"},
  {id: 1793, name: "Edina Collection ", number: "2145T-1", price: nil, description: "Enhancing the contemporary design of your bedroom is the focus of the Edina Collection. The espresso-hinted cherry finish builds on the unexaggerated lines of this bedroom suite, blended with the tufted vinyl inserts on the headboard and the polished nickel finished hardware, culminates to achieve the modern look. Whether it is a hard contemporary or a softer transitional feel, your dcor design options are wide open with this adult bedroom collection, as well as youth.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2145T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2145T.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:39:21"},
  {id: 1794, name: "Woodrow Collection ", number: "2042T-1", price: nil, description: "Industrial design is subtly used to achieve a cool look for your bedroom in the Woodrow Collection. Dark metal hardware and corner banding with rivet look lend to the casual look of this bedroom group. Melamine laminate features a weathered-wood look that furthers the intended design. Black bi-cast vinyl accents of the headboard provides distinct complementing contrast to the finish of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2042T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2042T-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:39:23"},
  {id: 1796, name: "Aristide Collection ", number: "1723-1", price: nil, description: "Offered as an elegant statement to your personal style the Aristide Collection will lend a sophisticated look to your modern bedroom. Updated contemporary design is utilized to create the dramatic look blending a trend-forward gray finish on oak solids and veneers with bold, elongated hardware in a gold finish. The subtle curves of the panel headboard, low profile footboard and rails are covered in a supple, modern light gray fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1723-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1723-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:39:52"},
  {id: 1795, name: "Cinderella Collection ", number: "1386D-1", price: nil, description: "The Cinderella Collection is your little child'\u0080\u0099s dream. The Victorian styling incorporates floral motif hardware, ecru painted finish and traditional carving details that will create the feeling of a room worth of a fairy tale princess. Offering regular bed, daybed and canopy poster bed in both ecru painted white wash and dark cherry finishes.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1386D.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1386D.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:39:47"},
  {id: 1797, name: "Bernal Heights Collection ", number: "1810-1", price: nil, description: "With hints of modern, industrial and country styling and nod to trend driven design, the Bernal Heights Collection will be a stylish addition to your home. Cup pull hardware is featured prominently on each case piece while nailhead accents serve to enhance the neutral toned fabric headboard. A warm cherry finish rounds out the look of the Bernal Heights Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1810-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1810-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:40:05"},
  {id: 1798, name: "Lorenzi Collection ", number: "2220T-1", price: nil, description: "The contemporary design of the Lorenzi Collection is enhanced by the addition of the durable black vinyl covering that encases each piece in the collection. Painted grey hardware provides a distinct contrast to the finish of cover. Scaled for urban living, this collection will prove a unique and stylish addition to your master, youth, and guest bedrooms.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2220T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2220T.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:40:21"},
  {id: 1799, name: "Bernal Heights Collection ", number: "1810T-1", price: nil, description: "With hints of modern, industrial and country styling and nod to trend driven design, the Bernal Heights Collection will be a stylish addition to your youth and adult bedrooms. Cup pull hardware is featured prominently on each case piece while nailhead accents serve to enhance the neutral toned fabric headboard. A dark walnut finish rounds out the look of the Bernal Heights Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1810T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1810T-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:40:31"},
  {id: 1800, name: "Mayville Collection ", number: "2147TSG", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147TSG.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147TSG.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:40:51"},
  {id: 1801, name: "Cinderella Collection ", number: "1386DNC-1", price: nil, description: "The Cinderella Collection is your little girl's dream. The Victorian styling incorporates floral motif hardware, dark cherry finish and traditional carving details that will create the feeling of a room worth of a fairy tale princess. offering regular bed, daybed and canopy poster bed in both dark cherry and ecru painted white wash finishes.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1386DNC-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1386DNC-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:40:58"},
  {id: 1810, name: "Glamour Collection ", number: "1349T-1", price: nil, description: "The beauty of the Glamour Collection lies in the simple lines and style for your adult or youth bedroom. The panel headboard and footboard feature a grid pattern to give your bedroom suite an added touch of character. Select hardwoods and veneers in warm cherry finish with bold hardware accent give the Glamour Collection a desired look to your home dcor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1349T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1349T-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:32:27"},
  {id: 1811, name: "Octavia Collection ", number: "4967BK-NT", price: nil, description: "With a look that lends to sophisticated urban styling, the Octavia Collection will be a welcome addition to your home. Gray fabric-covered inserts feature button detailing along with distinct black metal framing to achieve the modern look of the daybed. A metal frame trundle glides from beneath the main sleeping platform to provide additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4967BK-NT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4967BK-NT.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:32:36"},
  {id: 1812, name: "Lorena Collection ", number: "4965W-NT", price: nil, description: "Classically styled for your traditional home, the Lorena Collection is offered in a white finish with accenting finials and turned metal connectors that complete the look of this daybed. The metal trundle provides additional sleep space to fit your needs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4965W-NT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4965W-NT.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:32:47"},
  {id: 1802, name: "Beechnut Collection ", number: "1904T-1", price: nil, description: "Blending the elements of contemporary design and rustic aesthetic, the Beechnut Collection is a unique addition to your master, youth or guest bedroom. Dark under-paneling serves to highlight the light finish of the embossed, faux-wood veneer of the raised panels on the bed and case goods. Contrasting cup hardware punctuates each drawer front.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1904T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1904T.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:41:03"},
  {id: 1804, name: "Raku Collection ", number: "1711-1", price: nil, description: "Refined elegance is exemplified in the design of the Raku Collection. Classic elements of understated traditional design combined with a barnwood gray finish over walnut veneer, muted pewter finishknob hardware and the light neutral tone of the headboard and footboard, blend effortlessly to create a sophisticated modern traditional look for your bedroom. Elongated, tapered turned legs support the case pieces and bed.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1711-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1711-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:41:28"},
  {id: 1803, name: "Pallina Collection ", number: "2021TW-1", price: nil, description: "Perfectly at home in a child'\u0080\u0099s or second bedroom, the Pallina Collection will be a stylish addition to your home. Crafted of metal in white powder coating, with refined design that decorates the headboard and footboard, this elegant bed will pair with a number of room styles. With twin or full option to fit your needs, the metal slat system requires that a mattress only is needed to complete the bed.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2021tw-shot1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2021tw-shot1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:41:20"},
  {id: 1805, name: "Mayville Collection ", number: "2147TW", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147TW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147TW.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:41:34"},
  {id: 1806, name: "Jones Collection ", number: "4964BK-NT", price: nil, description: "The design of the Jones Collection utilizes accents such as finials, and medallion connections to provide a traditional look to this functional daybed. The accompanied metal trundle provides additional sleep space in times of need.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4964BK-NT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4964BK-NT.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:41:38"},
  {id: 1807, name: "Cinderella Collection", number: "1386T-1", price: nil, description: "The Cinderella Collection is your little child-\u0080\u0099s dream. The Victorian styling incorporates floral motif hardware, ecru painted finish and traditional carving details that will create the feeling of a room worth of a fairy tale princess. Offering regular bed, daybed and canopy poster bed in both ecru painted white wash and dark cherry finishes.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1386T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1386T-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:41:43"},
  {id: 1808, name: "Veloce Collection ", number: "8219-3", price: nil, description: "Bringing to mind the sleek styling of an Italian race car, bold contemporary styling creates eye-catching drama for your living room with the Veloce Collection. Color blocked black and ivory bi-cast vinyl covers the ultra-low profile seating and accompanying glass-topped cocktail table, while chrome legs provide support.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8219.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8219.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:41:46"},
  {id: 1814, name: "Therese Collection ", number: "4969GY", price: nil, description: "The gray fabric covering of the Therese Collection blended with nailhead accent and clean lines, creates a look that will compliment your home decor. Whether used for sleeping or relaxing, the clean-line daybed design allows for placement in a number of room sizes and configurations, while the under-bed trundle pulls out to accommodate your additional sleep space needs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4969GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4969GY.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:06"},
  {id: 1815, name: "Auberon Collection ", number: "4968BK-NT", price: nil, description: "Modern traditional styling plays well with the dcor of your home in the Auberon Collection. Quatrefoil pattern is, along with distinct jointing, as a decorative statement with the black metal framing serving as an update to the traditional look. A metal frame trundle glides from beneath the main sleeping platform to provide additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4968BK-NT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4968BK-NT.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:10"},
  {id: 1816, name: "Adra Collection ", number: "4949BK", price: nil, description: "The black vinyl covering of the Adra Collection blended with clean contemporary lines, creates a look that will compliment your home's decor. Whether used for sleeping or relaxing, the clean-line trundle design allows for placement in a number of room sizes and configurations, while the under-bed trundle pulls out to accommodate your additional sleep space needs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4949BK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4949BK.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:14"},
  {id: 1817, name: "Potrero Collection ", number: "2025T-1HB", price: nil, description: "Versatile placement options, while utilizing minimum space makes the Potrero Collection the right choice for your home. Three styles, each offered in a single cover are available -\u0080\u0093 Grey fabric with vertical channel seaming, black bi-cast vinyl with x-stitch pattern and brown fabric with square pattern.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2025T-1HB.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2025T-1HB.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:23"},
  {id: 1818, name: "Deryn Collection ", number: "8327BLK-3", price: nil, description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Contrast toss pillows and an additional chair option are featured in a modern teal or gray herringbone pattern to complement the teal fabric, beige fabric and gray fabric seating body covers. Tailored stitch tufting lends further accent to this thoroughly modern collection. The collection is also available in chair, love seat, sofa and sectional covered with red or black leather gel match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8327BLK.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:27"},
  {id: 1820, name: "Roland Collection ", number: "4950", price: nil, description: "With a modern design that includes clean lines and a dark brown bi-cast vinyl or modern grey fabric, the Roland Collection will be a functional addition to your home. Nestled below the twin bed is the easily accessed lower trundle unit. Casters make quick work of extending this extra sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4950+Shoot+1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4950+Shoot+1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:42"},
  {id: 1821, name: "Courtney Collection ", number: "4960DB-NT", price: nil, description: "The multi-functionality of a daybed provides a level of flexibility that makes it a welcome addition to almost any home. The Courtney Collection is finished in black and features the design accent of whimsical swirls. When used as a bed, with the addition of the trundle, your sleep space capability doubles.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4960DB-NT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4960DB-NT.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:46"},
  {id: 1822, name: "Schleiger Collection ", number: "5400-30", price: nil, description: "Transitionally styled with a burnished brown finish, the Schleiger Collection features bold accenting for your living room. Sturdy legs support the metal and rivet banded table tops of the cocktail table, sofa table and end table.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5400-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:50"},
  {id: 1823, name: "Roland Collection ", number: "4950GY", price: nil, description: "With a modern design that includes clean lines and a dark brown bi-cast vinyl or modern grey fabric, the Roland Collection will be a functional addition to your home. Nestled below the twin bed is the easily accessed lower trundle unit. Casters make quick work of extending this extra sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4950GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4950GY.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:33:54"},
  {id: 1825, name: "Mariacarla Collection ", number: "3526-30", price: nil, description: "Blending elements of traditional design creates the classic look of the Mariacarla Collection. Genuine marble table tops perch atop acanthus leaf relief-enhanced cabriole legs in this occasional table offering. The dark cherry leg finish of the collection serves to highlight not only the traditional style but the marble as well.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3526-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3526-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:04"},
  {id: 1826, name: "Chama Collection ", number: "5469-30", price: nil, description: "A complement to the modern or transitional home, the Chama Collection is a unique addition to the overall dcor of your home's living room. Framed in metal with a faux wood veneer top, the circular patterns provide focal accent to the cocktail and end table bases, ultimately lending to the flexibility for placement in a number of casual living room settings.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5469-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5469-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:07"},
  {id: 1827, name: "Zen Collection ", number: "3216B-31", price: nil, description: "This great contemporary three-piece occasional group features a tray top design in espresso finish. Matching sofa table is also offered in Zen collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3216B-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3216B-31.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:10"},
  {id: 1829, name: "Fiorella Collection ", number: "8412-30", price: nil, description: "The elaborate designs of Old World Europe are treated with a distinct modern touch in the Florentina Collection. The marble topped tables feature a delicate grey hue that accents the silver, with gold undertone finish of the wood base. With details such as shell and acanthus leaf scrolling and cabriole legs, the traditional look of the collection is solidified.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8412-30 8412-04.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8412-30 8412-04.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:51"},
  {id: 1830, name: "Santos Collection ", number: "8079-30", price: nil, description: "Blending the elements of Craftsman styling, industrial design, and natural wood tones to achieve the unique look of the Santos Collection. The design of this occasional offering is enhanced by distressing its solid rubberwood table tops, which cover in natural brown finish allowing for the grain to capture one-\u0080\u0099s eye. Staple accenting on the table's edge hints at a rough-hewn industrial look that has been softened for your living room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8079-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8079-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:54"},
  {id: 1831, name: "Anna Claire Collection ", number: "5428-30", price: nil, description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Anna Claire Collection provides an unexpectedly elegant addition to a number of living spaces. A driftwood finish covers the wood of the bases that support the rusticated zinc tabletops. Nail head accent table banding adds to the creative look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5428-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:56"},
  {id: 1832, name: "Beaugrand Collection ", number: "5177-30", price: nil, description: "With leaning towards the styles of industrial, contemporary and transitional, the Beaugrand will be an appropriate choice for a number of living room decors. The sofa table, end table, and cocktail table feature decorative metal banding and are supported by a modified X-base pedestal.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5177-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5177-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:57"},
  {id: 1833, name: "Chorus Collection ", number: "3205-30", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3205-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3205-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:43:53"},
  {id: 515, name: "Dwight III 48\" Round Table", number: nil, price: nil, description: "This dining table features a roomy table top resting upon block legs, with a solid wood construction for long-lasting quality and style. The chairs showcase slatted backs and padded leatherette seats. Choose between a 42\" or 48\" table top.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3988gy-rt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:50:09"},
  {id: 1834, name: "Mooney Collection ", number: "3226-30", price: nil, description: "In a unique turn of design, the Schmid Collection features off-set table bases in a rich dark cherry finish that perfectly complements the cool creamy tone of the faux marble tabletops. Each base features a display shelf, providing you the extra space to show off your prized possessions.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9712BE _3226-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9712BE _3226-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:16"},
  {id: 1837, name: "Daria Collection", number: "3224N-05", price: nil, description: "A continuous metal frame comprises the support system in the rustic Daria Collection. Each piece features wood shelving, with hints of grey within the finish, lending distinct character. Bookcase is offered in two widths, 26-inch and 40- inch wide, for the perfect placement in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3224N.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3224N.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:25"},
  {id: 1839, name: "Firth II Collection ", number: "3401W-30", price: nil, description: "Intersecting deep cherry finished wood ovals are set atop rounded wooden bases and serve to support beveled glass tops in the Firth II Collection. Add a touch of quality and contemporary style to your home with this sleek design which melds glass and wood into a classic contemporary design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3401W-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3401W-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:27"},
  {id: 1840, name: "Pierre Collection ", number: "3508-30", price: nil, description: "Oval table tops are supported by elegantly curved legs in the Pierre Collection. The rich espresso finish is complemented by the glass insert table tops. Lower shelving provides a platform to display your prized possessions.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3508-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3508-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:28"},
  {id: 1841, name: "Alouette Collection ", number: "17809", price: nil, description: "Like a window into your design world, the Alouette Collection provides a classic, yet modern platform for your living room experience. The cocktail and end table feature square tabletops with glass supports that are connected by metal hardware.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/17809.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/17809.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:29"},
  {id: 1842, name: "Brussel II Collection ", number: "3292-01", price: nil, description: "Extra seating is never a problem with the functional Brussel II Collection. The four stools, with dark brown bi-cast vinyl seat cover, tuck neatly under the cocktail table when not in use. The geometric circular design and warm brown cherry finish will be a perfect addition to any home dcor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3292-01.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3292-01.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:34"},
  {id: 1889, name: "Afton Collection ", number: "4730NF", price: nil, description: "Providing stylish storage space in your home is the Afton Collection. The button-tufted lift-top storage ottoman is offered in a cream fabric and bi-cast vinyl options in dark brown, purple, red and taupe. Turned legs support this lovely accent piece.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4730NF.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4730NF.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:39"},
  {id: 1844, name: "Oriole Collection ", number: "8334DBR-3", price: nil, description: "At home in transitional to contemporary settings, the Oriole will be a welcome addition to your living room. The black AireHyde match cover is utilized for comfort and durability. Ample seating creates a plush platform for your relaxation, with each piece in the collection offering unique functionality. The dual reclining sofa features a drop-down center seatback that opens to reveal a table top and cup holders. Glider reclining mechanisms provide additional comfort on the love seat with center console unit. The Chair completes the seating collection with swivel and glider reclining function.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8334DBR.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8334DBR.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:46"},
  {id: 1858, name: "Grande Isle Collection ", number: "8234TT-3", price: nil, description: "Your traditional home will be perfectly outfitted with the addition of the Grande Isle Collection. The show wood frame defines the profile of the collection while the two available cover options - Brown fabric with bi-cast vinyl accent or red print fabric  lend further traditional emphasis. Contrast toss pillows complete the look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8234TT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8234TT.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:07"},
  {id: 1859, name: "Qirin Collection ", number: "4506PU", price: nil, description: "Mottled coloring provides realistic enhancement to the alligator embossed bi-cast vinyl seat of the Nestor Collection. Supported by a chrome base, this modern accent bench is a glamorous addition to your home's dcor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4506PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4506PU.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:15"},
  {id: 1860, name: "Elista Collection ", number: "5873N-ST", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5873N-ST.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5873N-ST.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:22"},
  {id: 1845, name: "Olas Collection ", number: "3604-31", price: nil, description: "Completing the contemporary vision you seek to create in your living space is the Olas Collection. Minimalistic black metal framing is utilized as a support for glass tabletops in this modern occasional 3-piece offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3604-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3604-31.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:51"},
  {id: 1893, name: "Scottsdale Collection ", number: "5310W", price: nil, description: "A fun addition to your smaller dining space, the Scottsdale Collection offers simplicity with a versatility that enhances any dining area. This three-piece counter height set features a sturdy table excellent for work or dine, and two plush upholstered saddle back stools for additional seating comfort. Made of selected hardwoods and veneers.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5310W.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5310W.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:45"},
  {id: 1847, name: "Breaux Collection ", number: "8235SS-3", price: nil, description: "Contemporary design is utilized to create the look of the Breaux Collection. The collection is offered in gray or sesame cover for ultimate design versatility, with two configurations  sofa with end chaise or traditional sofa, love seat and chair  allowing for perfect placement within your living room. Reversible back cushions further the functionality and chrome legs support and lend to the modern design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8235SS.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8235SS.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:55"},
  {id: 1848, name: "Vasily Collection ", number: "3561-31", price: nil, description: "Mid-century modern design provides inspiration in the Vasily Collection. Cherry finished wood legs are joined by an inner, high-polished chrome ring and rise to support the glass tops in this three-piece occasional table offering. Included are two round end tables and one oval cocktail table.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3561-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3561-31.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:58"},
  {id: 1849, name: "Daria Collection ", number: "3224N-16", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3224N-16.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3224N-16.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:45:02"},
  {id: 1850, name: "Radley Collection ", number: "8324-4", price: nil, description: "Refined for placement in the most traditional of homes, yet inviting enough for more casual settings, the turned legs ottoman of Radley Collection will be a statement to your preference for classic style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8324-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8324-4.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:45:08"},
