  {id: 1852, name: "Cleo Collection ", number: "4500-F2", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4500-F2.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4500-F2.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:45:19"},
  {id: 1853, name: "Temptation Collection ", number: "8337FA-3", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8337FA-3 8337FA-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8337FA-3 8337FA-4.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:45:30"},
  {id: 1854, name: "Tala Collection ", number: "4501-F1", price: nil, description: "A bold statement for any room the Tala Collection provides function and style for your living space. Offered in dark blue and brown, each piece is boldly accented with a white quatrefoil pattern. The attached lift top allows for discrete storage space within your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4501-F1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4501-F1_open.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4501-F1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:45:34"},
  {id: 1855, name: "Cleo Collection ", number: "4500-F3", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4500-F3.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4500-F3.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:45:44"},
  {id: 1862, name: "Fedora Collection ", number: "4614-F1", price: nil, description: "Providing a stylish and function addition to your home is the Fedora Collection. Designed for placement in a number of settings the top opens to reveal ample storage for your personal items. The ottoman is offered in the neutral tones of grey or brown for further decorative flexibility.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4614-F1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4614-F1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:32"},
  {id: 1863, name: "Rhett Collection ", number: "1266F1S", price: nil, description: "Traditionally framed with a slightly flared arm, the wing back Rhett Collection is a welcome addition to your home dcor. Contrasting dark nail head accent, and button tufting further the classic look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1266F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1266F1S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:34"},
  {id: 1864, name: "Savonburg Collection ", number: "8427-CR", price: nil, description: "With a design that is driven by trend and style, the classic look of the Savonburg Collection blends with a number of modern and traditional settings. This Chesterfield style seating group is offered in neutral tone fabric and features button tufting and a heavily rolled arm that transitions to encompass the entire back of each piece in the collection. The substantial size of this offering allows for maximum comfort that is enhanced by the accompanying toss pillows. Offered in both sectional and traditional seating styles.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8427.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8427.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:40"},
  {id: 1865, name: "Afton Collection ", number: "4730TPE", price: nil, description: "Providing stylish storage space in your home is the Afton Collection. The button-tufted lift-top storage ottoman is offered in a cream fabric and bi-cast vinyl options in dark brown, purple, red and taupe. Turned legs support this lovely accent piece.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4730TPE.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4730TPE.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:44"},
  {id: 1866, name: "Afton Collection ", number: "4730PPE", price: nil, description: "Providing stylish storage space in your home is the Afton Collection. The button-tufted lift-top storage ottoman is offered in a cream fabric and bi-cast vinyl options in dark brown, purple, red and taupe. Turned legs support this lovely accent piece.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4730PPE.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4730PPE.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:48"},
  {id: 684, name: "Levna Dining Table", number: nil, price: nil, description: "A sleek dining table for six with a high gloss lacquer coating for a sleek vibe. Matching Parson style chairs are padded in durable leatherette. Chairs and table are available in black or white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3822bk-t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 00:19:31"},
  {id: 1867, name: "Jair Collection", number: "H10130", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant circular lamp shade. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H10130_c.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H10130_c.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:53"},
  {id: 1868, name: "Lenora Collection", number: "H13475", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant circular lamp shade. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H13475.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H13475.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:54"},
  {id: 1869, name: "Inara Collection", number: "H11303", price: nil, description: "The floating orbital orbs accent lighting floor lamp gravity defying design features five aluminum wraped sparkling orbs suspended mid-air, arranged in orbital order on an elegant curved stand, illuminating warm white light rays. The piece is beautifully crafted using high quality satin nickel finish metal. Great accent lighting that can enhance the surrounding ambiance, perfect for a night light, or a mood light to brighten up any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11303.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11303.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:07"},
  {id: 1870, name: "Lambart Collection ", number: "H11765", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11765.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11765.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:08"},
  {id: 1871, name: "Diya Collection ", number: "H11297", price: nil, description: "The metal saturn three orbs accent light gravity defying design features three aluminum wraped sparkling orbs suspended mid-air, illuminating warm white light rays. The piece is beautifully crafted using high quality satin nickel finish metal. Great accent lighting floor lamp that can enhance the surrounding ambiance, perfect for a night light, or a mood light to brighten up any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11297_c_on.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11297_c_on.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:09"},
  {id: 1873, name: "Mill Valley Collection", number: "1869-1", price: nil, description: "When looking to furnish your traditional home, you choose pieces that are timeless. The classic look of the cherry finished Mont Belvieu Collection will allow you to fulfill your design desire. Pairing the panel bed of the collection with the traditional look of Louis Philippe styling, instantly creates a classic look to your bedroom. Carved finials and squared pilasters provide traditional accent to the bed as does the shell and scroll motif of the headboard and footboard that carries over to the collection's mirror.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1869-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1869-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:15"},
  {id: 1874, name: "Lenci Collection", number: "H11296", price: nil, description: "The metal saturn three orbs accent light gravity defying design features three aluminum wraped sparkling orbs suspended mid-air, illuminating warm white light rays. The piece is beautifully crafted using high quality satin nickel finish metal. Remarkable addition piece on your night stand, end table, or sofa table. Great accent lighting table lamp that can enhance the surrounding ambiance, perfect for a night light, or a mood light to brighten up any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11296_e.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11296_e.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:18"},
  {id: 1875, name: "Olympia Collection ", number: "8308", price: nil, description: "There is no mistaking the Olympia Collection for anything but a bold study on contemporary design. Sleek lines extend with the push of a button on taking you from a seated to prone position with amazing ease, whether you are on the dual reclining sofa, dual reclining love seat, or reclining chair. The raisin tone top grain leather covers the seats, top part of the arms and front part of the backs, while leather match covers those areas beyond your initial reach. White contrast stitching further accents the design. The collection is available in several different configurations to choose from to complete your seating arrangement.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8308_LCPW%2BCN%2BAC%2BCR%2BAC%2B5R.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8308_LCPW%2BCN%2BAC%2BCR%2BAC%2B5R.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:20"},
  {id: 1876, name: "Norwich Collection ", number: "5055-82", price: nil, description: "Traditional design elements are elegantly layered to create the beautiful Norwich Collection. Shell motif, egg & dart molding, rope molding, ball & claw feet and elegantly designed inlay begin the design journey. Book-match cherry veneer prominently highlights the top of the rectangular table and features oval inlay decorative accenting. The table is flanked by chairs that are accented by beige fabric seats. With the china's glass fronted doors providing a view of your cherished tabletop accessories, there is also drawer and wood fronted cabinets that allow for additional storage space. The collection is offered in a warm cherry finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5055-82_mixing color 2014D-10.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5055dr-top_2014D-10.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5055-82_mixing color 2014D-10.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:24"},
  {id: 2001, name: "Gavino Collection ", number: "2049F-1", price: nil, description: "The Gavino Collection is styled for the modern bedroom, utilizing minimalistic design elements to create a unique look. Gray metal framing provides contrast to the brown fabric inserts of the headboard and footboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2049F-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2049F-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:08:57"},
  {id: 1877, name: "Amara Collection ", number: "6468", price: nil, description: "Fun, funky and functional, the Amara Collection will provide your home with interesting conversation pieces and a look that is as unique as you are. With the turn of a crank, the adjustable table (6414) can be raised or lowered to suit your individual needs. Black iron is complimented by the bold red and white hued design of the -\u0080\u009CAtellier Loft-\u0080\u009D print that appears on the dining tabletop and carries its theme to the caster supported cocktail table (6409) -\u0080\u0093 paired with our tractor seat adjustable iron barstool (6412), you will have created the creative focal point for your dining space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/6468.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/6468.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:46"},
  {id: 1890, name: "Barlowe Collection ", number: "1193F1S", price: nil, description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the french note fabric offerings. New fabric options include: blue, grey, dark teal, chain link print, and paisley print.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1193F1S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:49"},
  {id: 1880, name: "Mayville Collection ", number: "2147SG-12", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147SG-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147SG-12.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:07"},
  {id: 1881, name: "Eleena Collection ", number: "H11762", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Elegantly crafted stand features high quality metal and glass that comes in black finish. Great addition piece on your night stand, end table, or sofa table to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11762.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11762.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:10"},
  {id: 1882, name: "Metz Collection ", number: "8303-AC", price: nil, description: "Configurable to fit your lifestyle, the Metz Collection is a unique take on contemporary styling. With a stance that can take the shape of a sectional in one moment by adding the one-arm love seat as a chaise the next, flexibility reigns in your space. An armless chair allows you to extend the sectional by dividing the available left side two-seater and right side chaise, or use as a separate seat. A wide ottoman provides space to kick up your heels, allow for extra seating, or when aligned together with the sectional, you can create one large sleeping area. Offered in graphite fabric cover.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8303-AC 8303-OT 8303-LL_with2pillows.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8303-AC 8303-OT 8303-LL_with2pillows.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:13"},
  {id: 1883, name: "Orson Collection ", number: "1191F6S", price: nil, description: "The padded upper back of the Orson Collection is supported by wooden slats that give way to the substantially sized seat of this whimsical accent chair. The collection has six available fabric options -\u0080\u0093 Blue tonal stripe, Black & White swirl, Multi-color poppies, Purple Medallion, Voyage and Grey Medallion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1191f6s_2014H-79.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1191f6s_2014H-79.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:14"},
  {id: 1884, name: "Archstone Collection", number: "3270-48", price: nil, description: "Contemporary design, sleek seating and the combination of black finish with white accents are all the ingredients you need to create a stylish setting for exceptional dining. The white faux marble top pairs perfectly with a cut out center chair back, the color contrast and stylish design create a rich visual enhancement. Chairs are available in white bi-cast vinyl and black bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3270-48_W.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3270-48_W.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:15"},
  {id: 1885, name: "Kaitlyn Collection ", number: "468CP", price: nil, description: "Functional cocktail ottoman with casters features storage and seating that reverse to reveal up to four individual serving trays.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/468CP.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/468CP.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:20"},
  {id: 1886, name: "Clair Collection ", number: "471LP", price: nil, description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/471.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:30"},
  {id: 1887, name: "Clair Collection ", number: "471FA-1S", price: nil, description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in purple medallion fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/471.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:31"},
  {id: 1891, name: "Semplice Collection ", number: "1279F3S", price: nil, description: "Designed for placement in a multitude of settings, the classically understated lines of Semplice Collection will complement your homes dcor. Offered in either dark gray or beige fabric covering, the welt accented chair will provide a comfortable platform for any room in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1279F3S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1279F3S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:32"},
  {id: 1894, name: "Cranley Collection ", number: "9700BLK-3", price: nil, description: "The reclining Cranley Collection utilizes release mechanism that with a gentle pull sends you straight into your ultimate comfort zone. Tufted bonded leather covers the overstuffed arms, seats and backs furthering the comfort for you, your family and friends. Offered in black or brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9700BLK_2456-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9700BLK_2456-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:48"},
  {id: 1895, name: "Millwood Collection ", number: "5099-22", price: nil, description: "With a look that blends the transitional design element of wood and accenting that lends to a modern traditional aesthetic, the Millwood Collection will help to create the ambiance that you are looking to achieve in your home or office. The decorative metal base and framing of the collection provides an industrial feel, lending to the casual contrast of the distressed ash veneer of the shelving and handscraped weathered tops.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5099-22.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5099-22.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:04"},
  {id: 1896, name: "Factory Collection ", number: "3228-12", price: nil, description: "Blending the look of vintage industrial with modern design is the Factory Collection. Burnished rustic solid wood planks make up the shelves and features wrought iron style metal framing. The continuous finished design makes this unit flexible for placement as a freestanding piece. Matching desk and occasional tables are also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3228-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3228-12.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:21"},
  {id: 1897, name: "Ian Lynman Collection ", number: "8047-T", price: nil, description: "The Ian Lynman Collection is offered in a warm cherry finish on select hardwoods and birch veneer and transitional styling. Nickel hardware, glass-fronted and side media storage further compliment the look of the unit. Ready-To-Assemble construction.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8047-T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8047-T.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:24"},
  {id: 1898, name: "Millwood Collection ", number: "5099-15", price: nil, description: "With a look that blends the transitional design element of wood and accenting that lends to a modern traditional aesthetic, the Millwood Collection will help to create the ambiance that you are looking to achieve in your home or office. The decorative metal base and framing of the collection provides an industrial feel, lending to the casual contrast of the distressed ash veneer of the shelving and handscraped weathered tops.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5099-15.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5099-15.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:29"},
  {id: 1899, name: "Scottsdale Collection ", number: "5310C", price: nil, description: "A fun addition to your smaller dining space, the Scottsdale Collection offers simplicity with a versatility that enhances any dining area. This three-piece counter height set features a sturdy table excellent for work or dine, and two plush upholstered saddle back stools for additional seating comfort. Made of selected hardwoods and veneers.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5310C.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5310C.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:36"},
  {id: 1900, name: "Tempe Collection ", number: "2601-15", price: nil, description: "With a scale appropriate for any number of smaller home office spaces, dorms or bedrooms, the Tempe Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble desk top and the minimalistic design of the accompanying dark brown bi-cast vinyl desk chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2601-15.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2601-15.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:39"},
  {id: 1901, name: "Pendu Collection ", number: "8326BLK-3", price: nil, description: "Contoured for your ultimate comfort and designed for placement in homes with transitional or contemporary style, the Pendu Collection will provide the relaxing platform you need for your downtime. Plush seating and backs extend from seated to prone with a pull of the manual reclining mechanism on each piece in the collection -\u0080\u0093 dual reclining sofa, love seat and chair. The top and front bodies of each piece in the collection is covered in black or brown top grain leather, with leather match covering those areas beyond your initial reach.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8326BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8326BLK.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:43"},
  {id: 1902, name: "Adrian Collection ", number: "1217F2S", price: nil, description: "Offered in gray woven fabric or gray herringbone fabric, a textural statement is foremost in the design of the grandly appointed Adriano Collection. Wing-backed, as a nod to traditional form, the chair features nailhead accents and button-tufting which ultimately serve to create the pinnacle in tailored styling.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1217F2S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1217F2S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:45"},
  {id: 1908, name: "Factory Collection ", number: "3228-30", price: nil, description: "Blending the look of vintage industrial with modern design is the Factory Collection. Burnished rustic wood planks are framed with wrought iron style metal supports in this stylish occasional table offering. The sofa and end tables feature X-framing that draws inspiration from the bracing seen in so many industrial settings, while the reproduction factory cart takes a functional object and turns it into a piece of art. Matching bookcase is also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3228-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3228-12.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:50:24"},
  {id: 1909, name: "Vega Collection ", number: "459B-PU", price: nil, description: "The cocktail ottoman with storage trunk of the Vega Collection offers an inventive way to store your assorted odds and ends out of the way but still within reach. The fully upholstered ottomans feature removable tops that open up to a finished interior perfect for storage while the removable top also functions as a tray. Base finish is espresso, available in either light brown mottled microfiber or dark brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/459B-PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/459B-PU.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:50:30"},
  {id: 1910, name: "Sedley Collection ", number: "5415RF-15", price: nil, description: "Whether your home leans to transitional or contemporary design, the Sedley Collection will be the perfect fit for your home office needs. From the distinct walnut veneer pattern to the unique framing of the desk, bookcase and file cabinet, each design component lends to placement in a variety of office settings. The dark metal horizontal hardware and metal support framing complements the finish of the group while providing distinct contrast. Convenience factors include drawer storage, reversible return desk for convenient placement within the space and open display shelves and door storage of the bookshelf.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5415RF-15DKT 5415RF-16RDT 5415RF-17MT 5415RF-18.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5415RF-15DKT 5415RF-16RDT 5415RF-17MT 5415RF-18.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:50:52"},
  {id: 1911, name: "Mayville Collection ", number: "2147W-12", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147W-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147W-12.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:01"},
  {id: 1903, name: "Mendon Collection ", number: "8404DB-1", price: nil, description: "Whether utilized as an accent to your existing living room suite or as a stand-alone chair in your home, the Mendon Collection will add a modern touch to your space. Clean lines are covered in either dark brown or taupe bi-cast vinyl in this contemporary selection. The manual reclining mechanism allows you to reach a relaxed position with just the pull of a lever.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8404DB-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8404DB-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:53"},
  {id: 1904, name: "Inglewood Collection ", number: "14020-12", price: nil, description: "Sophistication merges with elegant lines and classic shapes in the Inglewood Collection. Display shelves flank the unit while door storage on the base allows for additional placement of your favorite entertainment items. The decorative cherry veneer is bathed in a rich and deep cherry finish that flows beautifully over the clean traditional design, giving an understated elegance for any casual entertaining setting.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/14020-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/14020-12.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:54:58"},
  {id: 1906, name: "Orton Collection ", number: "3447-30", price: nil, description: "Creatively designed to meet the needs of your casual living room is the Orton Collection. Faux marble tabletops are complimented by a rich cherry finish that covers each of the table's box-framed aprons and legs. The cocktail table features display shelf and a convenient lift tabletop that makes this functional group a welcome addition to your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3447-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3447-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:55:05"},
  {id: 1913, name: "Pepperville Collection ", number: "8046-T", price: nil, description: "Contemporary Pepperville Collection features fluted paneling, glass front and side media storage. Available in espresso finish on select hardwoods and birch veneer with satin nickel hardware. Ready-To-Assemble construction.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8046-T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8046-T.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:08"},
  {id: 1914, name: "Laurelin Collection ", number: "1714W-1", price: nil, description: "Casual transitional styling lends versatility to the placement of the Laurelin Collection in a number of bedroom settings. Black and White sand-through finishes are available creating distinctly different looks from traditional to country casual, with antiqued bronze knob hardware punctuating the look of each framed drawer front. Hidden drawers in the nightstand and dresser provide discrete storage for your valuables, while the storage drawers of the footboard provide a more visible means of additional storage capability. Bun feet support the case goods and a sleigh headboard finish off the transitional design of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1714W-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1714W-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:15"},
  {id: 1915, name: "Mayville Collection ", number: "2147W-1", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147W.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147W-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147W.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:22"},
  {id: 1916, name: "Palmyra Collection ", number: "8411", price: nil, description: "Configurable to your space and personal needs, the Palmyra Collection will serve as a functional, stylish and comfortable platform for your ultimate downtime. The right and left love seats are available with or without a functional console -\u0080\u0093 featuring cup holders and lift top storage. The center wedge unit is available as either a plush seat or a wood table that features receptacles and USB ports. The Palmyra Collection is offered in dark brown bonded leather match. Eight seating configurations are available to meet the needs of your space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8411 2LCN_WD_2R.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8411 2L_CR_2R.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8411 2LCN_WD_2R.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:25"},
  {id: 723, name: "MONTCLAIR II 5Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Transitional and stately, this counter height table fits four comfortably in straight back chairs with padded fabric seats and fabric insert in the back. Also available in regular height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1118.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:22:21"},
  {id: 1917, name: "Division Collection ", number: "B2008TF-1", price: nil, description: "Reaching for new heights in your child-\u0080\u0099s bedroom is the Division Collection. Allowing for creative placement in the room and separate from the structure of this unique metal bunk system is a full bed. Perched above the built-in student desk is the twin bed. With metal framing that lends an air of contemporary style and a light graphite finish, this cool loft bed will serve your family for many years to come.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2008TF.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2008TF.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:28"},
  {id: 1918, name: "Carla Collection ", number: "8060-T", price: nil, description: "A cherry finish, glass doors and open media storage are the focal points of the Carla Collection. Additional side accessory storage can be found behind the faux door panels on this transitionally styled entertainment unit. Ready-To-Assemble construction.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8060-T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8060-T.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:31"},
  {id: 1919, name: "Sicily Collection ", number: "3534-30", price: nil, description: "With framing that gracefully conforms to the uniquely cut-away glass and wood display shelving, the Sicily Collection lends a distinct modern look to your living room. The curves of the display platforms lend to the look of a modified hourglass profile for each table. Discreet drawer storage lends additional functionality to the cocktail table.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3534-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3534-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:34"},
  {id: 1920, name: "Hillcrest Manor Collection ", number: "2169SL-1", price: nil, description: "Traditionally styled bedrooms require a sense of grandeur, and the Hillcrest Manor Collection meets the requirement fully. The grandly scaled case goods feature framed marble tops with hints of the rich natural tones of brown and cream. Acanthus leaf carvings along with egg and dart molding, beaded molding, pull and knob antiqued hardware, and a rich cherry finish further the traditional style. Full extension drawer glides add convenience to the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2169SL-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2169SL-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:39"},
  {id: 1921, name: "Hatchett Lake Collection ", number: "3522-12", price: nil, description: "With a hint of whimsy and a nod to lake house living, the Hatchett Lake Collection will be the centerpiece of your living room. The functional bookcase takes shape in the form of a boat, complete with lighting, glass display shelves and door storage. A coordinating occasional offering is also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3522-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3522-12.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:54"},
  {id: 1923, name: "Deryn Park Collection ", number: "2243SL-1", price: nil, description: "Walking into the bedroom that is occupied by the Deryn Park Collection immediately displays your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. With two bed options  A graceful sleigh bed or stately poster bed the collection allows you the flexibility to fit the scale of your bedroom and the design to accommodate your personal style. Design elements include burl inlay, traditional bale and knob hardware, claw feet and shell motifs. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243SL-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2243SL-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:52:12"},
  {id: 1924, name: "Jarita Collection ", number: "8329BRW-3", price: nil, description: "The classic transitional styling of the Jarita Collection creates a look that is perfect for your casual living space. Offered in black or brown bi-cast vinyl, each piece in the collection offers plush seats, backs and arms. With the pull of the manual reclining mechanism, you are taken from a seated to prone position in an easy motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8329BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8329BRW.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:52:17"},
  {id: 1925, name: "Breaux Collection ", number: "8235GY-3", price: nil, description: "Contemporary design is utilized to create the look of the Breaux Collection. The collection is offered in gray or sesame cover for ultimate design versatility, with two configurations  sofa with end chaise or traditional sofa, love seat and chair  allowing for perfect placement within your living room. Reversible back cushions further the functionality and chrome legs support and lend to the modern design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8235GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8235GY.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:52:19"},
  {id: 1926, name: "Earl Collection ", number: "8205CH-1", price: nil, description: "Plush seating morphs into an enveloping relaxation platform with the pull of the manual recline mechanism in the Earl Collection. The collection is offered with a chocolate or brown covering that lends to the dcor of your transitionally styled home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8205CH-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8205CH-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:52:29"},
  {id: 1927, name: "Destry Collection ", number: "4507-F1", price: nil, description: "With a base that lends to a modern look and seat that has design roots that lean towards a more traditional styling, the Destry Collection will be a versatile choice for your home. The continuous frame of the black metal base supports the button tufted fabric seat. Offered in dark gray and beige for the perfect pairing to your home dcor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4507-F1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4507-F1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:52:32"},
  {id: 1939, name: "Yara Collection ", number: "4508-PH", price: nil, description: "Providing extra seating in your casual dining space, the Yara is a modern take on the classic barstool. Intersecting circles stack one upon the other to create eye-catching style and serve as the base to support the gray fabric seat. The accent barstools are offered in 19.5-inch and 28-inch heights to meet the requirements for your space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4508-PH 4508-SH.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4508-PH 4508-SH.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:51"},
  {id: 1928, name: "Deryn Collection ", number: "8327BLK-CR", price: nil, description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Contrast toss pillows and an additional chair option are featured in a modern teal or gray herringbone pattern to complement the teal fabric, beige fabric and gray fabric seating body covers. Tailored stitch tufting lends further accent to this thoroughly modern collection. The collection is also available in chair, love seat, sofa and sectional covered with red or black leather gel match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327BLK_L%2BCR%2BR+3593.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8327BLK_L%2BCR%2BR+3593.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:52:34"},
  {id: 1929, name: "Tarantula Collection ", number: "5543-30", price: nil, description: "These old world Mediterranean styled tables are rich in the heritage look. Featuring in a burnish brown cherry finish and a beveled marble top, the classy look of Tarantula Collection is timeless.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5543-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5543-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:52:43"},
  {id: 1930, name: "Fiorella Collection ", number: "8412-3", price: nil, description: "The elaborate designs of Old World Europe are treated with a distinct modern touch in the Fiorella Collection. The eye-catching jewel tufting reflects with a brilliance intended to accentuate the dusky taupe coloring of the faux silk and the rich silver, with gold undertone finish of the show wood frame. With details such as shell and acanthus leaf scrolling, routed pilaster and cabriole legs, the traditional look of the collection is solidified. The accenting faux silk toss pillows feature traditional fringe detailing and a complementing detail pattern.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8412_all_mixing color (2015).jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8412_all_mixing color (2015).jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:52:57"},
  {id: 1931, name: "Sinclair Collection ", number: "8202GRY-SC", price: nil, description: "A hint of retro styling provides a clean and classic look for your contemporary home in the Sinclair Collection. Offered in a traditional seating or sectional configuration, the options allow for the perfect placement within your living room. The collection is available in either chocolate or gray fabric with contrast pillows that furthers the look and versatility for placement within a number of home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8202GRY-TS 8202GRY-CA_.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8202GRY-TS 8202GRY-CA_.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:06"},
  {id: 1933, name: "Columbus Collection ", number: "8490FBR-AC", price: nil, description: "With a configuration options that allow for placement that is perfect for your space, the Columbus Collection will be a welcome addition to your living room. Ample seating is covered in either cobblestone fabric or dark brown breathable faux leather resulting in a pleasurable seating experience. Bookending this substantially sized seating group are the left or right end units that are offered as reclining chair or push back chaise. Armless chair, console unit, corner seat, and armless reclining chair make up the middle part of this sectional offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8490FBR_LR%2BCN%2BAC%2BCR%2BAR%2BRC.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8490FBR_LR%2BCN%2BAC%2BCR%2BAR%2BRC.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:25"},
  {id: 1934, name: "Kennelly Collection ", number: "4510", price: nil, description: "Opening to reveal additional seating, the Kennelly Collection is a fun and functional accent for your home. The larger nesting accent ottoman provides additional storage when the smaller ottoman is removed. Offered in brown, blue, mustard and red, the larger ottoman is encircled by high-polish nail head accenting for added stylistic drama.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4510.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4510.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:28"},
  {id: 1935, name: "Tempe Collection ", number: "2601-48", price: nil, description: "With a scale appropriate for any number of smaller dining spaces, the Tempe Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble table top and the minimalistic design of the dark brown bi-cast vinyl chairs. The table and chair are constructed of metal in black finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2601-48_2014D-193.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2601-48_2014D-193.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:31"},
  {id: 1936, name: "Daisy Collection ", number: "710-30", price: nil, description: "Daisy Collection combines superb visual appearance and fine quality that you need in your living room area. The table group features an elegant tulip base and clear glass top to provide an open airy feel. Constructed of hardwood veneers in refreshing espresso finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/710-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:37"},
  {id: 1937, name: "Semplice Collection ", number: "1279F2S", price: nil, description: "Designed for placement in a multitude of settings, the classically understated lines of Semplice Collection will complement your homes dcor. Offered in either dark gray or beige fabric covering, the welt accented chair will provide a comfortable platform for any room in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1279F2S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1279F2S.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:39"},
  {id: 1938, name: "Veltry Collection ", number: "5328-96", price: nil, description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Veltry Collection provides an unexpectedly elegant addition to a number of dining spaces. A weathered finish covers the poplar wood veneer of the two table options; a 95.5-inch rectangular trestle table or 45-inch round pedestal table, both featuring nail head accent banding. Nailhead-accented, neutral-tone finished fabric chairs provide subtle contrast that complements the look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-96.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-96_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5328-96.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:41"},
  {id: 1940, name: "Gerald Collection ", number: "9600", price: nil, description: "Infinitely comfortable, the Gerald Collection offers the substantial seating space that you need in your home. With a rich brown bonded leather match cover, three reclining seats, cup holders and hidden storage. This seating group will compliment your home not only with its style but function as well.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9600_5seats_2014S-46.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9600_5seats_2014S-46.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:54"},
  {id: 1941, name: "Benwick Collection ", number: "5425-90", price: nil, description: "From every angle, the modern traditional design of the Benwick Collection shines through. Offered with two table options  a classic turned-leg table and a display base counter height table. Each table is flanked by elegantly designed fabric covered chairs that are supported by turned dark cherry legs. Nail head accenting furthers the chairs modern traditional styling. The accompanying server features ample behind door storage, wine bottle rack, and brushed nickel knob hardware. Birch veneer is used throughout the collection and is enhanced by a dark cherry finish", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5425-90.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5425-90.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:56"},
  {id: 1943, name: "Aura Collection ", number: "H10081", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant rectangular lamp shade on black base. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H10081_b.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H10081_b.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:01"},
  {id: 1944, name: "Loyalton Collection ", number: "5149-48", price: nil, description: "Traditional elements of wood and metal blend to create the casual look of the Loyalton Collection. Forged of metal, the double-X patterns flow from chair back to table apron, while the traditional look of the tables turned legs is given a modern update. Wood is utilized for the tables routed top, chair seats and chair backs. The collection is offered in two distinct styles to fit your needs  48 inches fixed rectangular top and 40 inches square counter height top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-48.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-48_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5149-48.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:01"},
  {id: 1945, name: "Toulon Collection ", number: "5438-96", price: nil, description: "Bold curves provide elegant contrast to the unique look of the Toulon Collection. The heavily scrolled base supports of the table feature routing with dark pewter-finished metal trestle that connects. Wire-brushed distressing provides texture to the acacia veneer of the table and pine of the accompanying chairs. The optional bench takes shape with inspiration drawn from church pews, allowing for a look that will add a special touch to your dining room. The French provincial inspired routing lends decorative touch to the accompanying server, while dual drawer and door storage provides ample space to stow your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5438-96.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5438-96.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:13"},
  {id: 1946, name: "Talbot Collection ", number: "8524RD", price: nil, description: "Designed with your bold design choices in mind, the contemporary Talbot Collection will provide your family and friends with a comfortable place to spend their quality time. Offered in red or black bonded leather match, the race car inspired bucket seat is fine tuned by contrast double stitching. Features include: adjustable headrests, reclining ends sofa, glider reclining love seat with console and glider mechanism equipped coordinating chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8524RD-shot2_mixing color (2015).jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8524RD_home_.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8524RD-shot2_mixing color (2015).jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:16"},
  {id: 1947, name: "Marie Louise Collection ", number: "2526-96", price: nil, description: "With inspiration drawn from the traditional French decorative accents the effortlessly elegant Marie Louise Collection adds warmth and charm to your dining room. A classic urn double pedestal trestle base acts as the focal point of the collection. The rustic weathered oak finish on the pine veneers hints of time gone by and the button-tufted bomber jacket fabric on the wood-framed accenting chairs compliments the casually elegant table perfectly.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2526-96 Shot 1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2526-96 Shot 2.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2526-96 Shot 1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:18"},
  {id: 1948, name: "Ride Collection ", number: "1156", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1156 Low.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1156 Low.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:19"},
  {id: 1949, name: "Ride Collection ", number: "1145", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1145 Low.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1145 Low.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:20"},
  {id: 968, name: "Appenzell Bunk Bed", number: nil, price: nil, description: "This multi-functional bunk bed has built-in steps to the top bunk, built-in drawers and is available with a full or twin size lower bunk bed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk922t-ex_1.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:13:15"},
  {id: 1950, name: "Alita Collection ", number: "2477-78", price: nil, description: "A reflection of your taste for clean design with both traditional and modern flair, the Alita Collection perfectly encompasses your style preference. Warm burnishing on warm cherry finished patterned veneers add depth to the casual dining offering. Coordinating server features door storage and wine bottle rack. Seat cushions are covered in dark brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2477-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2477-78.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:26"},
  {id: 1955, name: " ", number: "1267GY", price: nil, description: "Mid-century styling and ultra-modern design collide in the creation of the Thrive Collection. The curvaceous profile of the gray fabric covered chair and accompanying ottoman provide a unique look for your contemporary home. A swivel base provides movement for flow of conversation while the ottoman allows you to kick up your feet and relax in style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1267GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1267GY.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:39"},
  {id: 1956, name: "Edgar Collection ", number: "5106BK", price: nil, description: "Richly hued faux marble tops the metal counter height table base in the three-piece Edgar Collection. Vertical slat detailing provides stylish detail to this convenient table offering. Two black bi-cast vinyl covered barstools complement the collection while easily storing beneath the table allowing for placement in the coziest of dining spaces.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5106BK_2014D-223.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5106BK_2014D-223.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:41"},
  {id: 1957, name: "Brooksville Collection ", number: "2459", price: nil, description: "The book-match veneer of the table and the double-X chair back design of the Brooksville Collection stand out as the focal points of this transitional six-piece dining group. The fixed-top table, chairs and bench are offered in a warm cherry finish. The chairs and bench feature black bi-cast vinyl upholstered seating. Seating six comfortably, the collection is a great addition to your casual dining area.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2459 Shot 1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2459 Shot 1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:42"},
  {id: 1958, name: "Ohana Collection ", number: "1393W-78", price: nil, description: "The design of Ohana Collection captures the essence of a casual country home. Its antique white and warm cherry, or antique black and warm cherry finishes give it a striking two-toned apprearance. The solid wood table top and unique chair back supported by turned legs complement Ohana Collection with a touch of elegance. This group is further accented by the curio which features two sliding glass doors. Its a warm look youll love having in your home", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1393W-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1393W-78.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:46"},
  {id: 1959, name: "Delmar Collection ", number: "5511", price: nil, description: "The burnished finish and classic profile of the Delmar Collection will be a perfect fit for your modest casual dining space. Splat back wood chairs with brown bi-cast vinyl seats flank the counter and dining height table offerings. Routed detailing provides a linear focal point on the tables tops.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5511.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5511.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:48"},
  {id: 2034, name: "Edmund Collection ", number: "4970", price: nil, description: "Perfect for the flexible need of sleep space in your home, the Edmund Collection provides a stylish and functional option to extend your hospitality. The plush framing and rolled arms of the gray-covered button-tufted twin daybed lends to the classic look of your home. Stored discretely below the main sleeping platform is a roll-out trundle.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4970.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4970.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:35"},
  {id: 1951, name: "Comfort Living Collection ", number: "9909CH", price: nil, description: "The Comfort Living Collection, with our patent pending assembly method, allows you to customize the placement of the back supports to fit your living space needs. Working as either a right OR left facing grouping, the reversible 3-seater and chaise may be placed on either side, optimizing your special needs. Contrasting two-tone rhino microfiber and dark brown bi-cast vinyl lends a contemporary yet relaxed style. Available in chocolate rhino microfiber and brown rhino microfiber. 2 free pillows included.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9909CH.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9909CH.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:39"},
  {id: 1952, name: "Chicago Collection ", number: "2588-92", price: nil, description: "Design elements from traditional to mid-century modern are delicately balanced in the sophisticated Chicago Collection. This deep espresso finished dining group takes the uniquely routed accent of the apron and double pedestal table base and applies it to the accompanying server. The shape of the chairs conforms to your body, providing comfort and maximum style. From the grand sweep of the arms to the traditional nail-head accent, this chair is the ultimate in sophistication. The server features tassel drop pull hardware in a nickel finish and features door storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2588-92_2014D-16.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2588-92_2014D-16.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:44"},
  {id: 1953, name: "Metal Chairs, with 2555-84 Dining Table, Amara Collection", number: "5034", price: nil, description: "Boldly hued chairs from our Amara Collection provide a welcome pop of color in your whimsical room decor. Shown here with the table from our Derry (2555) Collection, the chairs can be mixed or matched to suit your personal style. Constructed of metal, the industrial chic chairs are finished in blue, red, yellow or rust. Not limited to the dining room, the Amara Collection can be used to accent any room of the house.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5034_MULTI_2014D-165.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5034_MULTI_2014D-165.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:07:47"},
  {id: 773, name: "WESTON I 5 Pc. Counter Ht. Table Set", number: nil, price: nil, description: "Update a small dining area with this modern counter height table and matching padded microfiber chairs. The table has simple square lines and the chair backs have a bold geometric design. Finished in espresso.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1116.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:36:36"},
  {id: 2009, name: "Morelle Collection ", number: "1356TPRW-T", price: nil, description: "The warmth of cottage living is invoked by the classic styling of the adult and youth Morelle Collection. The low post bed features picture framing and round finials with the case pieces featuring molded drawer fronts and knob hardware. The newly offered cherry finish offers an additional option to the classic black and white finishes that are currently available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1356TPRW-1T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1356TPRW-1T.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:56"},
  {id: 1962, name: "Charisma Collection ", number: "1194IN", price: nil, description: "High polished nailhead accents the profile of the Charisma Collection. This modern traditional accent chair provides a stylish, yet functional addition to your home. The chair is offered in four distinct colors: teal, taupe, indigo and chocolate.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1194IN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1194IN.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:02"},
  {id: 1963, name: "Summerlin Collection ", number: "1908-1", price: nil, description: "Classic elements of contemporary design are executed to create the look of the Summerlin Collection. Modified convex lines provide bold detailing to the case good drawer fronts, while brushed nickel hardware compliments. The dual panel black bi-cast vinyl padded headboard inserts feature detail stitching and provide contrast to the espresso finish of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1908.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1908-11.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1908.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:06"},
  {id: 1964, name: "Schleiger Collection ", number: "5400-1", price: nil, description: "Transitionally styled with a burnished brown finish, the Schleiger Collection features bold accenting that lends to a rustic industrial interpretation. Substantial framing provides a masculine profile while decorative metal and rivet banding on each piece of the group furthers the look. Each case piece features metal horizontal hardware.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5400-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:13"},
  {id: 1965, name: "Lindley Collection ", number: "1947-1", price: nil, description: "Modern traditional styling is lent a rustic touch in the design of the Lindley Collection. Walnut veneers over solid wood are finished in dusty gray to complement the rich tone of the natural wood look. Round pull hardware punctuates each drawer front, while graceful lines lend a distinctly feminine touch. Button-tufting features prominently on the padded wood-framed headboard and footboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1947-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1947-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:20"},
  {id: 1966, name: "Begonia Collection ", number: "1718GY-1", price: nil, description: "Casual transitional styling lends versatility to the placement of the Begonia Collection in a number of bedroom settings. The gray finish lends distinctly to the execution of different looks from traditional to country casual, with knob hardware punctuating the look of each framed drawer front. Hidden drawers in the nightstand and dresser provide discrete storage for your valuables, while the storage drawers of the footboard provide a more visible means of additional storage capability. Bun feet support the case goods and a sleigh headboard finish off the transitional design of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1718GY-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1718GY-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:26"},
  {id: 1968, name: "Marceline Collection ", number: "1866GY-1", price: nil, description: "Your bedroom reflects your personal style  Allured by trend forward design, the Marceline Collection satisfied your desired look. The striking gray rub-through or the newly offered gray water-based finishes of the collection feature hand distressing for a subtle weathered look. Geometric molding provides a distinct contrast to the traditionally framed case goods. Substantially sized turned legs enhance the look of the oversized case pieces and mansion headboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1866GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1866GY.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:38"},
  {id: 1969, name: "Scottsdale Collection ", number: "5310BK", price: nil, description: "A fun addition to your smaller dining space, the Scottsdale Collection offers simplicity with a versatility that enhances any dining area. This three-piece counter height set features a sturdy table excellent for work or dine, and two plush upholstered saddle back stools for additional seating comfort. Made of selected hardwoods and veneers.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5310BK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5310BK.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:43"},
  {id: 1970, name: "Clair Collection ", number: "471NF", price: nil, description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471NF.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/471NF.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:48"},
  {id: 1972, name: "Cornelia Collection ", number: "8216SD-3", price: nil, description: "Casual traditional styling creates the look of the Cornelia Collection. The seating group is offered in two coverings, sand or dark gray fabric to easily blend and complement to your homes dcor. Nail head trim along with rolled arms lend to the soft traditional style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8216SD.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8216SD.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:57"},
  {id: 1973, name: "Breaux Collection ", number: "8235GY", price: nil, description: "Contemporary design is utilized to create the look of the Breaux Collection. The collection is offered in gray or sesame cover for ultimate design versatility, with two configurations  sofa with end chaise or traditional sofa, love seat and chair  allowing for perfect placement within your living room. Reversible back cushions further the functionality and chrome legs support and lend to the modern design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8235GY-L 8235GY-R.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8235GY-L 8235GY-R.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:58"},
  {id: 1974, name: "Edina Collection ", number: "2145-1", price: nil, description: "Enhancing the contemporary design of your bedroom is the focus of the Edina Collection. The espresso-hinted cherry finish builds on the unexaggerated lines of this bedroom suite, blended with the tufted bi-cast vinyl inserts on the headboard and the polished nickel finishedhardware, culminates to achieve the modern look. Whether it is a hard contemporary or a softer transitional feel, your dcor design options are wide open with this classic bedroom collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2145-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2145-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:57:03"},
  {id: 1975, name: "Verano Collection ", number: "1733-1", price: nil, description: "Appropriate for a number of bedroom designs, the Verano Collection is the perfect permanent canvas for your ever-evolving personal style. The rich espresso finish is delicately accented with discrete brushed nickel knob hardware and stylish framing that carries from the bed to the mirror in this modern transitional set. The pull-out tray on the nightstand provides additional space for your bedside needs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1733-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1733-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:57:26"},
  {id: 1976, name: "Iniko Collection ", number: "8203GY-3", price: nil, description: "Contemporary styling is exemplified in the design of the Iniko Collection. Offered in gray or red leather gel match coverings, the cleanly designed seating group will fit perfectly in your modern home. Chrome legs support and provide decorative accent that is in line with the sleek look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8203GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8203GY.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:57:28"},
  {id: 1977, name: "Laertes Collection ", number: "8318-AC", price: nil, description: "Providing ample seating for your friends and family is the Laertes Collection. The classic sectional shape is book-ended by stationary chaise options or USB port enhanced end power recliners. Taupe gray top grain leather provides a gentle touch while darker tone fabric lends stark contrast. The power reclining mechanism bring you to your desired position with a touch of the button. The collection is available in several different configurations to choose from to complete your seating arrangement.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8318.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8318.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:56"},
  {id: 1978, name: "Slater Collection ", number: "8401-3SC", price: nil, description: "Customizable for your modest space, the Slater Collection features an end chaise that allows you to stretch out. Covered with greyish brown fabric seating and dark brown bi-cast vinyl accent, the modern lines of this seating group are further enhanced by track arms. The chaise can be configured as right or left side placement based on the needs of your space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8401-3SC.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8401-3SC.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:57"},
  {id: 2033, name: "Lavi Collection ", number: "4519-15", price: nil, description: "Mid-Century modern design is utilized to create a minimalistic look in the Lavi Collection. Functional drawers are mounted below the desktop for easy access while the tapered legs are reinforced by metal horizontal supports.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4519-15.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4519-15.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:03"},
  {id: 1981, name: "Polson Collection ", number: "8019", price: nil, description: "Standing as a bold statement in your living room, the Polson Collection provides the perfect platform for your media storage and display. Bookshelf storage rises from each side to flank the lower television stand. The espresso finish is contrasted by the brushed satin nickel knobs that front the ample storage drawers and doors. Scoring and use of double knobs give the illusion of additional drawer storage. X-framing that is boldly featured on the side pier bookcases lends a trendy feel to this functional media unit.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8019-shot2_mixing color_2014H-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8019-shot2_mixing color_2014H-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:12"},
  {id: 1982, name: "Vortex Collection ", number: "8300-3PW", price: nil, description: "Providing a bold contemporary look for the modern living space, the Vortex Collection creates the perfect platform for relaxation. With the press of a button, the end seats on the sofa, love seat, and chair recline to a prone position. The adjustable headrests provide additional comfort for the user. A low profile seating combined with light grey leather match and stainless steel feet result in the ultra-modern feel of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8300.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8300.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:19"},
  {id: 1983, name: "Olympia Collection ", number: "8308-3PW", price: nil, description: "There is no mistaking the Olympia Collection for anything but a bold study on contemporary design. Sleek lines extend with the push of a button on taking you from a seated to prone position with amazing ease, whether you are on the dual reclining sofa, dual reclining love seat, or reclining chair. The raisin tone top grain leather covers the seats, top part of the arms and front part of the backs, while leather match covers those areas beyond your initial reach. White contrast stitching further accents the design. The collection is available in several different configurations to choose from to complete your seating arrangement.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8308.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8308.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:22"},
  {id: 1984, name: "Center Hill Collection ", number: "9668BRW", price: nil, description: "With plush seating that is uncommon in most traditional looks, the design of Center Hill Collection will be a welcome addition to your living room. Offered in bonded leather match, the covering comes in either dark brown or black. With traditional nailhead accent lending an elegant statement to each piece and the easy recline mechanisms adding to the comfort, the lovely Center Hill Collection will provide your friends and family a warm environment to spend their quality moment.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9668BRW_3468-30_2014S-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9668BRW_3468-30_2014S-12.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:24"},
  {id: 1985, name: "Columbus Collection ", number: "8490", price: nil, description: "With a configuration options that allow for placement that is perfect for your space, the Columbus Collection will be a welcome addition to your living room. Ample seating is covered in either cobblestone fabric or dark brown breathable faux leather resulting in a pleasurable seating experience. Bookending this substantially sized seating group are the left or right end units that are offered as reclining chair or push back chaise. Armless chair, console unit, corner seat, and armless reclining chair make up the middle part of this sectional offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8490 6LRRR_LR CN AC CR AR RR 3292.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8490 6LRRR_LR CN AC CR AR RR 3292.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:25"},
  {id: 1987, name: "Deryn Collection ", number: "8327BE-3", price: nil, description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Contrast toss pillows and an additional chair option are featured in a modern teal or grey herringbone pattern to complement the teal, beige and grey seating body covers. Natural tone finished legs support the frame while tailored stitch tufting lends further accent to this thoroughly modern collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327BE.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8327BE.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:28"},
  {id: 1988, name: "Piedmont Collection ", number: "8059-T", price: nil, description: "The classic transitional design and a warm brown cherry finish compliment an array of home entertainment spaces. The Piedmont Collection-\u0080\u0099s focal points are the concave curved front display shelves and routed pilasters. Media storage features glass-fronted doors for easy remote control access. Ready-To-Assemble construction.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8059-T._2014H-13.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8059-T._2014H-13.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:32"},
  {id: 1989, name: "Marille Collection ", number: "9724BRW", price: nil, description: "With either the extended stretch of the reclining sofa or soothing rock of the reclining chair, your comfort is taken care of in the Marille Collection. Drop-down cup holders add additional function to the collection. The collection is offered in brown bonded leather match, black bonded leather match, dark brown 100% polyester or taupe 100% polyester.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9724BRW Shot1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9724BRW-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9724BRW Shot1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:34"},
  {id: 1990, name: "Comfort Living Collection ", number: "9909BR", price: nil, description: "The Comfort Living Collection, with our patent pending assembly method, allows you to customize the placement of the back supports to fit your living space needs. Working as either a right OR left facing grouping, the reversible 3-seater and chaise may be placed on either side, optimizing your special needs. Contrasting two-tone rhino microfiber and dark brown bi-cast vinyl lends a contemporary yet relaxed style. Available in chocolate rhino microfiber and brown rhino microfiber. 2 free pillows included.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9909BR.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9909BR.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:36"},
  {id: 1991, name: "Synnove Collection ", number: "8209BR-3SC", price: nil, description: "Casual contemporary styling creates a relaxed look for your living room in the Synnove Collection. Light brown fabric covers the reversible configuration of the three seating sectional sofa. Further complemented by the contrasting geometric pattern toss pillows. An ottoman is utilized as the base for the reversible end chaise cushion, creating the option of a left or right extension of the sofa seating. Slightly flared arms lend to the modern profile of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8209BR-3SC.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8209BR-3SC.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:37"},
  {id: 1992, name: "Charisma Collection ", number: "1194TL", price: nil, description: "High polished nailhead accents the profile of the Charisma Collection. This modern traditional accent chair provides a stylish, yet functional addition to your home. The chair is offered in four distinct colors: teal, taupe, indigo and chocolate.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1194TL.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1194TL.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:38"},
  {id: 1993, name: "Charisma Collection ", number: "1194TP", price: nil, description: "High polished nailhead accents the profile of the Charisma Collection. This modern traditional accent chair provides a stylish, yet functional addition to your home. The chair is offered in four distinct colors: teal, taupe, indigo and chocolate.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1194TP.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1194TP.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:38"},
  {id: 1994, name: "Barlowe Collection ", number: "1193F6S", price: nil, description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the french note fabric offerings. New fabric options include: blue, grey, dark teal, chain link print, and paisley print.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F6S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1193F6S.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:39"},
  {id: 1995, name: "Essex Collection ", number: "1260F1S", price: nil, description: "With a classic profile that is covered in a dark grey or blue fabric, the Essex Collection utilizes high polish nail head accenting to provide a modern twist to the design of this elegant accent chair. Rolled tufting furthers the traditional look as do the cherry finished support legs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1260F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1260F1S.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:40"},
  {id: 1996, name: "Lifestyle Collection ", number: "468F25S", price: nil, description: "When designing your living space the accent pieces you choose not only to fill the room but allow for the expression of your individual style to come shining through. Offered in a multitude of fabrics and frames, our accent collection will compliment your unique style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/468F25S_2014H-82.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/468F25S_2014H-82.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:41"},
  {id: 2002, name: "Jayla Collection ", number: "2050F-1", price: nil, description: "Modern traditional styling is utilized to create the design of the Jayla Collection. Black metal framing is perfectly contrasted by the brown bi-cast vinyl button-tufted inserts of the headboard and footboard, creating a unique look for your bedroom. The collection is offered in twin and full size beds.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2050F-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2050F-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:01"},
  {id: 2003, name: "Tulney Collection ", number: "4966BR", price: nil, description: "The Tulney Collection is designed with the modern traditional home in mind. Designed to use as a bed or a cozy relaxation nook, it features a trundle that provides the extra space that you need for overnight guests. Covered in a neutral toned gray fabric, the black button-tufted back panel, and the nailhead accent along the curved arm panels complete the traditional look. Also available in brown and dark gray fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4966BR.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4966BR.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:09"},
  {id: 2004, name: "Deryn Park Collection ", number: "2243-1", price: nil, description: "Walking into the bedroom that is occupied by the Deryn Park Collection immediately displays your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. With two bed options  A graceful sleigh bed or stately poster bed the collection allows you the flexibility to fit the scale of your bedroom and the design to accommodate your personal style. Design elements include burl inlay, traditional bale and knob hardware, claw feet and shell motifs. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2243-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:14"},
  {id: 2005, name: "Carrier Collection ", number: "3257RF-30", price: nil, description: "Designed for placement in a number of living room settings, the Carrier Collection is a functional and stylish addition to your home. The cocktail-\u0080\u0099s tabletop lifts to extend to your seated position and is supported by casters for ease of movement, the end table and chairside table feature a functional drawer. All three pieces in the collection feature lower display shelving. An dark espresso finish further lends to the look of this versatile occasional grouping.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3257RF-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3257RF-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:17"},
  {id: 1998, name: "Aviana Collection ", number: "1977T-1", price: nil, description: "Created for the traditional bedroom, the Aviana Collection is a study in classic styling and modern presentation. An antiqued gray finish provides an open canvas for your personal decorative touch. Carved feet support classically styled case goods -\u0080\u0093 each featuring teardrop hardware with an antiqued pewter finish. Raised panels further the traditional look of the case piece drawer fronts. The collection is offered in twin, full, queen, eastern king and california king for perfect placement in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1977T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1977T.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:46"},
  {id: 1999, name: "Cinderella Collection ", number: "1386TPP-1", price: nil, description: "The Cinderella Collection is your little girl's dream. The Victorian styling incorporates floral motif hardware, antique ecru finish and traditional carving details that will create the feeling of a room worth of a fairy tale princess. A canopy bed completes the fantasy of this whimsical collection. Turned posts reach for the heights and are topped with carved finials. The additional trundle provides the extra sleeping space for princesses visiting from other kingdoms. Also available in dark cherry finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1386TPP-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1386TPP-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:51"},
  {id: 2007, name: "Miami Collection ", number: "5430-30", price: nil, description: "Ultra-modern styling is achieved in the design of the Miami Collection. High gloss dark grey tabletops feature chrome legs that exemplify the tenants of contemporary interior design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5430-30 5430-04.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5430-30 5430-04.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:23"},
  {id: 2008, name: "Mayville Collection ", number: "2147T-1", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147T.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:26"},
  {id: 2010, name: "Reid Collection ", number: "5267RF-30", price: nil, description: "A classic look for your traditional home, the Reid Collection offers an updated country style that will be a warm and inviting addition to your living room. A cherry finish graces the wood veneer of the group. Each table in the collection supported by substantially appointed turned legs while functional drawers on each piece and casters on the cocktail table provide for storage and convenient movement.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5267RF-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5267RF-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:28"},
  {id: 2011, name: "Ruby Collection ", number: "4962DB-NT", price: nil, description: "The multi-functionality of a daybed provides a level of flexibility that makes it a welcome addition to almost any home. The Ruby Collection is finished in burnished bronze and is a sturdy in traditional styling. When used as a bed, with the addition of the trundle, your sleep space capability doubles.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4962DB-NT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4962DB-NT.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:32"},
  {id: 2012, name: "Elista Collection ", number: "5873N-BH", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5873N-BH.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5873N-BH.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:35"},
  {id: 2014, name: "Tigard Collection ", number: "4603PU", price: nil, description: "With a clean transitional style, the functional storage ottoman of the Tigard Collection will provide the extra storage or seating space that your home needs. The track-style side supports buffer the tufted lift top of the unit, which opens to reveal the storage space below. When closed, the unit can function as additional seating or as an occasional piece. Covered in a fashionable brown bi-cast vinyl, makes this unit a perfect fit in many home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4603PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4603PU.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:46"},
  {id: 2015, name: "Brussel Collection ", number: "3219PU-01", price: nil, description: "Perfect for apartment and smaller living spaces, this stylish, espresso finished, contemporary occasional group features clean lines, a glass top, and wedge seating that fits perfectly under the tabletop for those who desire a streamlined look. Three cocktail table options allow for extra seating or accessory display. The seat of pie-shaped ottoman and stool is covered in dark brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3219PU-01.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3219PU-01.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:03"},
  {id: 2016, name: "Destry Collection ", number: "4507-F2", price: nil, description: "With a base that lends to a modern look and seat that has design roots that lean towards a more traditional styling, the Destry Collection will be a versatile choice for your home. The continuous frame of the black metal base supports the button tufted fabric seat. Offered in dark gray and beige for the perfect pairing to your home dcor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4507-F2.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4507-F2.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:06"},
  {id: 2017, name: "Cleo Collection ", number: "4500-F1", price: nil, description: "", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4500-F1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4500-F1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:10"},
  {id: 2018, name: "Cavendish Collection ", number: "5556-30", price: nil, description: "Generous curves and a warm cherry finish enhance the traditional look of the Cavendish Collection. Carved egg and dart molding accent the apron and glass insert provides a view onto the display shelves.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5556-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5556-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:18"},
  {id: 2020, name: "Bingsley Collection ", number: "4692-13", price: nil, description: "Danish mid-century modern design is infused in the style platform of the Bingsley Collection decorative ottoman bench that also served as additional seating. Wood framing features the expected delicate tapering of the legs classic to this style and provides an elegant contrast to the dark grey tone of the button-tufted fabric seat.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4692-13.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4692-13.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:22"},
  {id: 2021, name: "Rubin Collection ", number: "9734DB-3", price: nil, description: "With base design elements that touch retro styling, the Rubin Collection is a perfect option for your modern home. With multiple covering options to suit your personal needs and style, the collection allows for versatile placement in a number of living room decor themes. Options include - light brown or chocolate textured plush microfiber; Black, dark brown or taupe bonded leather match; Fabric medallion print accent chair that provides a pop of color via purple, gold and green tones.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9734DB_ALL.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9734DB_ALL.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:24"},
  {id: 2023, name: "Wichfield Collection ", number: "4611PU", price: nil, description: "The Wichfield Collection provides a multi-functional option for your casual living space. Utilized as seating, storage ottoman or cocktail table, the unit-\u0080\u0099s lift-top function opens to reveal modest storage space, while the padded dark brown bi-cast vinyl-covered top provides comfort in those times that additional seating space is needed. Further enhancing the function of this piece is the wood display shelf that is finished in warm brown cherry.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4611PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4611PU.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:38"},
  {id: 2024, name: "Lucca Collection", number: "H10125", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality white finish wood and glass, and an elegant rectangular lamp shade. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H10125_c.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H10125_c.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:40"},
  {id: 2025, name: "Annalina Collection ", number: "H10076", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Elegantly crafted stand features high quality metal and glass that comes in satin nickel finish. Great addition piece on your night stand, end table, or sofa table to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H10076.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H10076.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:16:28"},
  {id: 2026, name: "Orson Collection ", number: "1191F2S", price: nil, description: "The padded upper back of the Orson Collection is supported by wooden slats that give way to the substantially sized seat of this whimsical accent chair. The collection has six available fabric options -\u0080\u0093 Blue tonal stripe, Black & White swirl, Multi-color poppies, Purple Medallion, Voyage and Grey Medallion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1191F2S-revised_2015S-128.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1191F2S-revised_2015S-128.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:16:31"},
  {id: 2027, name: "Oriole Collection ", number: "8334BLK-3", price: nil, description: "At home in transitional to contemporary settings, the Oriole will be a welcome addition to your living room. The black AireHyde match cover is utilized for comfort and durability. Ample seating creates a plush platform for your relaxation, with each piece in the collection offering unique functionality. The dual reclining sofa features a drop-down center seatback that opens to reveal a table top and cup holders. Glider reclining mechanisms provide additional comfort on the love seat with center console unit. The Chair completes the seating collection with swivel and glider reclining function.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8334BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8334BLK.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:16:52"},
  {id: 2028, name: "Rory Collection ", number: "4605GY", price: nil, description: "In looking for an accent piece for your home, your desire style and functionality -\u0080\u0093 the Rory Collection delivers on both counts. Offered in black bonded leather, grey linen fabric, and brown snakeskin print bi-cast vinyl, this decorative bench features button tufting and a continuous X-frame design. The padded seat, along with a clean design, provides the perfect spot for a moments rest.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4605gy.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4605gy.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:16:56"},
  {id: 2030, name: "Madigan Collection ", number: "4514-15", price: nil, description: "At home in a dorm, bedroom or modestly scaled office space, the Madigan Collection blends functional space with industrial style. Dark metal framing supports the vinyl-wrap desk top and shelves providing subtle contrast for maximum style effect. A coordinating desk chair accompanies and features a bi-cast vinyl seat that is supported by metal framing.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4514-15.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4514-15.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:06"},
  {id: 2031, name: "Orson Collection ", number: "1191F1S", price: nil, description: "The padded upper back of the Orson Collection is supported by wooden slats that give way to the substantially sized seat of this whimsical accent chair. The collection has six available fabric options -\u0080\u0093 Blue tonal stripe, Black & White swirl, Multi-color poppies, Purple Medallion, Voyage and Grey Medallion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1191F1S_2014H-77.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1191F1S_2014H-77.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:10"},
  {id: 2032, name: "Afton Collection ", number: "4730PU", price: nil, description: "Providing stylish storage space in your home is the Afton Collection. The button-tufted lift-top storage ottoman is offered in a cream fabric and bi-cast vinyl options in dark brown, purple, red and taupe. Turned legs support this lovely accent piece.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4730PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4730PU.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:19"},
  {id: 2035, name: "Laszlo Collection ", number: "3593-01", price: nil, description: "Contemporary styling lends a unique look to the dcor of your living room in the Laszlo Collection. The three panels of the table base intersect to support glass tabletops. Chrome connections provide additional decorative touch while the brown finish presents a neutral palette that blends effortlessly in a number of environments.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3593.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3593.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:23"},
  {id: 2036, name: "Toulon Collection ", number: "5438-30", price: nil, description: "Bold curves provide elegant contrast to the unique look of the Toulon Collection. The heavily scrolled base supports of the tables feature French provincial inspired routing while wire-brushed distressing provides texture to the acacia veneer of this elegant occasional collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5438-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5438-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:26"},
  {id: 2037, name: "Cora Collection ", number: "8004", price: nil, description: "A rich espresso finish lends to the modern look of the Cora Collection. Curved railings along with open display shelves create an inviting space for you to show off your prized possessions. Two book units flank a lower TV stand, creating a continuous look -\u0080\u0093 or for added convenience, each can serve as a separate unit.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8004-S 8004-T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8004-S 8004-T.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:30"},
  {id: 2038, name: "Sloan Collection ", number: "8049-T", price: nil, description: "Fluted glass-fronted media storage and a warm espresso finish on select hardwoods and birch veneer compliment the Sloan Collection. Further accenting the collection are satin nickel door pulls and side display shelving. Ready-To-Assemble construction.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8049-T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8049-T.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:34"},
  {id: 2039, name: "Julia Collection ", number: "4961DB-NT", price: nil, description: "The multi-functionality of a daybed provides a level of flexibility that makes it a welcome addition to almost any home. The Julia Collection is finished in white and draws design inspiration from the look of a delicate garden trellis. When used as a bed, with the addition of the trundle, your sleep space capability doubles.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4961DB-NT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4961DB-NT.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:37"},
  {id: 2041, name: "4690-F3 4690-F4 Recife Collection ", number: "4690-F2", price: nil, description: "From the boudoir to the parlor, the Recife Collection adds a touch of glamour anywhere it goes. This fully upholstered accent ottoman is offered in the chic hues of indigo, beige, and dark grey -\u0080\u0093 all featuring nail head accent that trims the profile of the seat base and X-leg supports.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4690-F2 4690-F3 4690-F4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4690-F2 4690-F3 4690-F4.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:51"},
  {id: 1161, name: "Vincenzo Sofa", number: nil, price: nil, description: "A retro-inspired modern is in the air with this sofa collection. Ringing in retro, this minimalist collection showcases impeccable tailoring, soft sloped arms, and richly textured upholstery. High-resiliency foam cushions provide superior comfort that lasts.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2203-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:05:45"},
  {id: 2042, name: "Falls Collection ", number: "8077-T", price: nil, description: "Ready-To-Assemble for your convenience, the Falls Collection offers the functional storage that you require for your recreational room. With transitional design elements, this TV stand features glass fronted media storage, slate accent, triangular door pulls and a brown cherry finish, making it the perfect choice for your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8077-t_2014H-16.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8077-t_2014H-16.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:54"},
  {id: 2044, name: "Deryn Park Collection ", number: "2243-114", price: nil, description: "Walking into the dining room that is occupied by the Deryn Park Collection will immediately invoke your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. Burl inset flanks the book-match veneered cherry-finished tabletop. With two table options  the rectangular double pedestal base, and the oval topped single pedestal  the collection allows you the flexibility to fit the scale of your dining room. Each chair features an elaborately designed back and a richly hued fabric cover. The china and coordinating server provide ample display and storage space for your tabletop accessories. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243_114_RSX2_H_2014D-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2243_114_RSX2_H_2014D-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:58"},
  {id: 2045, name: "Daria Collection ", number: "3224N-30", price: nil, description: "A continuous metal frame comprises the support system in the Daria Collection.Topped with a weathered wood veneered table top, with hints of grey within the finish, lending distinct character. This rustic occasional offering will be the centerpiece to your casual living space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3224N-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3224N-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:18:00"},
  {id: 2046, name: "Makah Collection ", number: "5496-78", price: nil, description: "The look of Arts and Crafts styling is updated for the modern home in the Makah Collection. Classically framed chairs pair with the tapered leg table to create this casual dining look. A dark brown finish highlights the wood veneer allowing for the neutral tone of the seats to blend with little effort. The drawers of the server, table apron and chairs feature framing that lends accent to the classic look. The accompanying server features a double wine rack as well as drawer and behind door storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5496-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5496-78.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:18:02"},
  {id: 2047, name: "Ohana Collection ", number: "1393BK-78", price: nil, description: "The design of Ohana Collection captures the essence of a casual country home. Its antique white and warm cherry, or antique black and warm cherry finishes give it a striking two-toned apprearance. The solid wood table top and unique chair back supported by turned legs complement Ohana Collection with a touch of elegance. This group is further accented by the curio which features two sliding glass doors. Its a warm look youll love having in your home", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1393BK-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1393BK-78.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:18:05"},
  {id: 2048, name: "Phelps Collection ", number: "9789BRG-3LC", price: nil, description: "Not every home is created the same and the unique design of the Phelps Collection allows for maximum flexibility with its reversible chaise. With two available coverings chocolate microfiber and brownish gray fabric, refined track arm, and comfortable seating, the collection's style is compatible in a number of settings. The matching ottoman provides additional comfort and function to your living area.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9789BRG.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9789BRG.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:18:07"},
  {id: 2049, name: "Sedley Collection ", number: "5415RF-78", price: nil, description: "Whether your home leans to transitional or contemporary design, the Sedley Collection will be the perfect fit for your casual dining needs. From the distinct walnut veneer pattern to the unique cut-away design of the trestle table base, bench, and server, each design component lends to placement in a variety of dining spaces. The chocolate brown tone of the chair fabric compliments the finish of the group. Convenience factors in the self-storing table leaf, while the server provides additional function with sliding doors that open to reveal wine bottle rack and shelf storage. Drawer storage with recessed pull hardware features prominently at the center of the server.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5415RF-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5415RF-78.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:18:09"},
  {id: 2053, name: "Aram Collection ", number: "8206BRW-3", price: nil, description: "With amply appointed offerings that create not only a comfortable seating experience but a functional one as well, the Aram Collection will be a welcome addition to your home. The seating group is offered in a brown fabric or dark brown AireHyde for comfort and style that will blend effortlessly with your transitional decorative preference. Manual motion mechanisms operate with the pull of a side-mounted tab, that once engaged, take you from seated to reclined in an easy motion. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends and a drop down center seat back with cup-holders, electric receptacles, USB port and tabletop space, the dual glider reclining ends of the love seat flank a center mounted console with storage, electric receptacles and cup-holders, and the reclining chair features a glider mechanism that allows for easy back and forth motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8206BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8206BRW.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:21"},
  {id: 2054, name: "Baine Collection ", number: "4503PU", price: nil, description: "Providing a multifunctional addition to your casual living space is the Baine Collection. Contemporary in styling, this lift-top ottoman features lower drawer storage and black bi-cast vinyl covering with contrast stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4503pu-shot1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4503pu-shot2.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4503pu-shot1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:34"},
  {id: 2055, name: "Mendon Collection ", number: "8404TP-1", price: nil, description: "Whether utilized as an accent to your existing living room suite or as a stand-alone chair in your home, the Mendon Collection will add a modern touch to your space. Clean lines are covered in either dark brown or taupe bi-cast vinyl in this contemporary selection. The manual reclining mechanism allows you to reach a relaxed position with just the pull of a lever.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8404TP-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8404TP-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:40"},
  {id: 2056, name: "Elevated Collection ", number: "9769", price: nil, description: "With the ease of touch, your relaxation experience is lifted in more ways than one. The Elevated Collection is a convenient addition to your home and lifestyle. The electronic lift mechanism takes you from seated to reclined or fully lifted to a standing position. Offered in two neutral tones, the chair will be a perfect fit, blending into many home decors.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9769 Shot1_C(2014)_2015S-143.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9769 Shot1_C(2014)_2015S-143.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:46"},
  {id: 2057, name: "Vincent Collection ", number: "3299-01", price: nil, description: "Glass overlays the intricate acacia wood block staggered pattern of the Vincent Collection. Each intricate pattern surrounds a center contrasting block. These unique tables feature display shelves and a modern two-toned natural acacia and espresso finish, with glass insert table tops.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3299-01.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3299-01.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:49"},
  {id: 2058, name: "Azalea Collection ", number: "5145W-78", price: nil, description: "Classic styling coupled with a sophisticated country aesthetic creates a beautiful look for your home in the Azalea Collection. The book match veneer of the table top is highlighted by utilizing a natural finish, while the antique white of the table base, chairs and server helps capture the natural contours of the wood grain. The scalloped chair rail tops the intricate pattern that is woven to create the distinct design of the chair backs, which carries over to the glass-backed door fronts of the server. The servers door and drawer storage provide space to store table top accessories while the wine rack lends additional functionality.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5145W-78.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5145W-78 Top View.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5145W-78.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:53"},
  {id: 2060, name: "Fulbright Collection ", number: "5520-78", price: nil, description: "An updated look for the casual country inspired dining space, the Fulbright Collection is a warm and inviting addition to your home. A weathered gray rub through finish serves to contrast the coffee finish of the table top, seats and server top, lending to the updated styling of the traditional look. The available bench provides an additional seating option beyond the expected side chair configuration, creating an open and inviting communal look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5520-78.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5520-78_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5520-78.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:10"},
  {id: 2059, name: "Bart Collection ", number: "5794AK-1", price: nil, description: "Scaled not only for ease of shipment, but size of bedroom, the Bart Collection is a clever addition to your child's space. The bed features a welcoming design to myriad dcor schemes with horizontal framing on the headboard and optional light oak or cherry finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5794AK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5794AK.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:08"},
  {id: 2062, name: "Vestavia Collection ", number: "1936T-1", price: nil, description: "The contemporary styling of the Vestavia Collection provides a unique platform from which to redecorate your bedroom. Faux wood printed veneer provides subtle texture and a grey finish as perfect contrast to the dark brown finish of the base rails of the case pieces and back panels of the headboard and footboard. Clean lines lend to the angular modern look and are enhanced by the horizontal brushed nickel hardware. Offered in both adult and youth beds, this collection provides great flexibility to your rooms at home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1936T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1936T-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:13"},
  {id: 2063, name: "Bevelle Collection ", number: "1958-1", price: nil, description: "Modern glamour is exemplified in the design of the Bevelle Collection. Acrylic crystals frame each piece in the collection, reflecting the light to create eye-catching drama. The silver finish serves as the perfect complement to the high-polish decorative knob hardware and medallion accents. A stylish mirrored vanity, with coordinating stool, provides additional function to the collection. Providing contrast to finish is the dark gray bi-cast vinyl, button-tufted headboard panel. A coordinating dining room is also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1958-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1958-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:17"},
  {id: 2064, name: "Daisy Collection", number: "710-72TR", price: nil, description: "Daisy Collection combines superb visual appearance and fine quality that you need in your dining area. Three distinct elegant flared tulip bases support beveled glass tabletops on the rectangular and round traditional dining height tables and a round gathering height table. Additional offering is the trestle table with black glass insert. Counter and dining height chairs feature clean lines and sleek curves; available in both white and bi-cast vinyl and dark brown bi-cast vinyl. The set is constructed of hardwood solids and veneers in a refreshing espresso finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-72.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/710-72.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:21"},
  {id: 2065, name: "Geoffrey Collection", number: "9723", price: nil, description: "Sure to please the gadget lover in any household is the Geoffrey Collection. With the touch of a button you automatically recline in this comfortable seating offering. Further enhancing this electronic wonder is the textured chocolate plush microfiber cover. Also available in traditional manual pull reclining mechanism.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9723++SHOT1++0104++++final_2014S-34.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9723++SHOT1++0104++++final_2014S-34.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:30"},
  {id: 2066, name: "Archstone Collection", number: "3270-60", price: nil, description: "Contemporary design, sleek seating and the combination of black finish with white accents are all the ingredients you need to create a stylish setting for exceptional dining. The white faux marble top pairs perfectly with a cut out center chair back, the color contrast and stylish design create a rich visual enhancement. Chairs are available in white bi-cast vinyl and black bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3270-60 _BK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3270-60 _BK.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:35"},
  {id: 2067, name: "Vega Collection ", number: "458B-PU", price: nil, description: "The cocktail ottoman with storage trunk of the Vega Collection offers an inventive way to store your assorted odds and ends out of the way but still within reach. The fully upholstered ottomans feature removable tops that open up to a finished interior perfect for storage while the removable top also functions as a tray. Base finish is espresso, available in either light brown mottled microfiber or dark brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/458B-PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/458B-PU.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:38"},
  {id: 2068, name: "Staunton Collection ", number: "4742PU", price: nil, description: "Transitionally styled to accent a number of home decors and covered in dark brown bi-cast vinyl, the Staunton Collection provides the additional storage and seating space that your home requires. Metal riveted accents grace each corner of the unit and wood legs provide support. The lift-top of the ottoman opens to reveal storage space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4742PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4742PU.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:41"},
  {id: 2069, name: "Barlowe Collection ", number: "1193F7S", price: nil, description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the french note fabric offerings. New fabric options include: blue, grey, dark teal, chain link print, and paisley print.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F7S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1193F7S.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:44"},
  {id: 2070, name: "Antoinetta Collection ", number: "1919-1", price: nil, description: "Traditional elements of Old World European styling are blended to create the look of the Antoinetta Collection. Acanthus leaf motif as well as bead and heavily carved moldings serve as the initial draw to the traditional design. Canted pilasters, marble tops, sunburst medallion, and classic button and bale hardware further accent the case goods. Cherry veneers and burl inlay are highlighted by a warm cherry finish with gold tipping.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1919.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1919.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:48"},
  {id: 2072, name: "Ride Collection ", number: "1157", price: nil, description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1157 Low.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1157 Low.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:54"},
  {id: 2074, name: "Avery Collection ", number: "5448-78", price: nil, description: "Dine in style and comfort with the Avery Collection. The table features ash veneers in a rich espresso finish and a flared open base which adds a soft contemporary touch. The table extends from 60-inche to 78-inche by using the extension leaf conveniently under the table top when not in use. The contemporized parsons chair completes the look by adding a touch of luxurious comfort. The chair is upholstered in a linen-like fabric that adds a sophisticated contrast to the dark finish of the table and chair legs. The Avery Collection will add comfort and style to your home dining experience.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5448-78 NEW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5448-78 NEW.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:16:19"},
  {id: 2073, name: "Copley Collection ", number: "815PU-1", price: nil, description: "The Copley Collection features clean contemporary design that will complement any home decor. With economical and environmental concerns in mind, the night stand, dresser and mirror are conveniently packed in one carton. Chest and additional night stands are also available. The Copley Collection showcases a wide beveled wood frame with satin nickel hardware accented in espresso finish on select hardwoods and veneers. To offer more flexibility, it offers three headboard options: wood sleigh headboard, panel headboard with white bi-case vinyl inserts, and fully upholstered dark brown bi-cast vinyl headboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/815PU-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/815PU-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:16:18"},
  {id: 2075, name: "Rory Collection ", number: "4605BK", price: nil, description: "In looking for an accent piece for your home, your desire style and functionality -\u0080\u0093 the Rory Collection delivers on both counts. Offered in black bonded leather, grey linen fabric, and brown snakeskin print bi-cast vinyl, this decorative bench features button tufting and a continuous X-frame design. The padded seat, along with a clean design, provides the perfect spot for a moments rest.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4605BK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4605BK.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:00"},
  {id: 2077, name: "Aviana Collection ", number: "1977-1", price: nil, description: "Created for the traditional bedroom, the Aviana Collection is a study in classic styling and modern presentation. An antiqued gray finish provides an open canvas for your personal decorative touch. Carved feet support classically styled case goods  each featuring teardrop hardware with an antiqued pewter finish. Raised panels further the traditional look of the case piece drawer fronts. The collection is offered in twin, full, queen, eastern king and california king for perfect placement in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1977.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1977-7_hp.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1977.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:17"},
  {id: 2078, name: "Moorewood Park Collection ", number: "17049-3", price: nil, description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers of the show wood frame belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that lend accent to the profile of the collection. The natural tone fabric body of the seating collection is accented beautifully with contrast toss pillows highlighted with subtle shades of cream and teal. The collection also features reversible seat cushions. Button tufting and gracefully scrolled arms lend to the elegant traditional styling.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/17049.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/17049.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:21"},
  {id: 2080, name: "Wasola Collection ", number: "8414DBR-3", price: nil, description: "Designed for the ultimate relaxation, the Wasola Collection provides plush seating and unique features to satisfy your comfort needs. The center seat of the sofa reclines along with the two end seats, a function that equalizes the race for a relaxed position. Dual reclining seats of the love seat flank the functional center console-\u0080\u0099s lift top storage and cup holders. A glider reclining chair completes the seating offering. The Wasola Collection is offered in brown 100% polyester fabric or dark brown leather gel match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8414DBR.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8414DBR.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:30"},
  {id: 2081, name: "Fielding Collection ", number: "5525-36", price: nil, description: "Classic soft modern styling creates the look of the Fielding Collection. Unfettered design makes for a classically refined profile, while black inset glass is utilized for perfect contrast to the brown finish of the wood table frame. Flanking the table are the side chairs, offered in either dark or light gray fabric. The accompanying server has drawer, behind door and wine rack storage for style and functional usage. Offered in both traditional and counter height for perfect placement in your dining room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5525-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5525-36.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:33"},
  {id: 2119, name: "Fairhope Collection ", number: "35800-T", price: nil, description: "Metal scroll-work lends a feminine touch to the side supports and framing of the beautiful Fairhope Collection. The three display shelves of this entertainment unit feature faux marble tops creating a timeless look and elegant functionality.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/35800-T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/35800-T.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:22:36"},
  {id: 2082, name: "Kenner Collection ", number: "8245BR-3", price: nil, description: "A classic and functional option for your living room is the Kenner Collection. Unfettered design allows for your individual decorative aspirations to soar. The sofa is available in both a pull out sleeper or traditional setup. The sofa and love seat are paired with contrast pillows. Two fabric options are available  Gray or Brown fabric  for versatile placement in a number of environments.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8245BR.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8245BR.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:40"},
  {id: 2083, name: "Deryn Collection ", number: "8327TL-3", price: nil, description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Contrast toss pillows and an additional chair option are featured in a modern teal or grey herringbone pattern to complement the teal, beige and grey seating body covers. Natural tone finished legs support the frame while tailored stitch tufting lends further accent to this thoroughly modern collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327TL.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8327TL.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:48"},
  {id: 2084, name: "Jude Collection ", number: "8201BLK-3", price: nil, description: "Plush seating with well-appointed features makes the Jude Collection a comfortable and functional addition to your living room. The seating group is offered in either brown or black leather gel match coverings for a bold, yet, neutral statement. Manual motion mechanisms operate with the pull of a side-mounted tab, that once engaged, take you from seated to reclined in an easy motion. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends and a drop down center seat back with cup-holders and tabletop space, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8201BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8201BLK.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:51"},
  {id: 2085, name: "Rowe Collection ", number: "B2013SBDC-1", price: nil, description: "Maximizing sleep space is achieved with the stylish Rowe Collection. This transitional bedroom group is featured in a dark cherry finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2013SBDC-1 -R.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2013SBDC-1 -R.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:55"},
  {id: 2086, name: "Garcia Collection ", number: "2046-1", price: nil, description: "Transitionally styled for your bedroom is the Garcia Collection. Created for versatile placement within a number of environments the louvered panel accents, distinct framing along with a cool gray finish over birch veneer combine to provide a clean palate for your personal decorative style. Nickel knob hardware provides subtle, yet distinct, contrast to the fronts of each case piece. The available desk is a functional addition to the collection with keyboard tray and drawer storage. The collection is offered in twin, full, queen, eastern king and california king for the perfect fit within your bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2046-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2046-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:23:00"},
  {id: 2088, name: "Clair Collection ", number: "471RED", price: nil, description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471RED.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/471RED.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:23:19"},
  {id: 2090, name: "Etsu Collection", number: "H13441", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant circular lamp shade. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H13441_e.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H13441_e.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:26"},
  {id: 2091, name: "Center Hill Collection ", number: "9668BLK", price: nil, description: "With plush seating that is uncommon in most traditional looks, the design of Center Hill Collection will be a welcome addition to your living room. Offered in bonded leather match, the covering comes in either dark brown or black. With traditional nailhead accent lending an elegant statement to each piece and the easy recline mechanisms adding to the comfort, the lovely Center Hill Collection will provide your friends and family a warm environment to spend their quality moment.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9668blk-shot1_1217C(2014)_2015S-19.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9668blk-shot1_1217C(2014)_2015S-19.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:29"},
  {id: 2092, name: "Clair Collection ", number: "471PPE", price: nil, description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471PPE.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/471PPE.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:32"},
  {id: 2093, name: "Lenore Collection ", number: "8014", price: nil, description: "Designed to serve as the focal point of your entertainment room, the Lenore Collection will provide a functional and stylish platform to display your TV, decorative accents and media consoles. Transitional accents such as bun feet, metal knob hardware and a rich cherry finish lend to the classic look. A lighted bridge highlights the display shelf, each providing support to join the two side unit bookcases. Glass and solid door storage, along with the shelving of the bookcases, provides ample storage for your display accents.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8014.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8014.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:36"},
  {id: 2094, name: "Rowe Collection ", number: "B2013FFDC-1", price: nil, description: "Maximizing sleep space is achieved with the stylish Rowe Collection. This transitional bunk bed is featured in a dark cherry finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin and the newly added full over full configurations, the design allows you to choose the size that is right for your family. Two under bed options are available -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2013FFDC-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2013FFDC-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:38"},
  {id: 2095, name: "Cabernet Collection ", number: "4521", price: nil, description: "Created in the profile of a wine barrel the Chardonnay wine refrigerator will be the talk of your next gathering. The door of the unit opens to reveal row upon row of wine storage racks ready for you to load your favorite bottles. The lift top conveniently provides storage and the controls that keep your favorite wine at the optimal temperature. The dark cherry finish complements the rustic look of this unique unit.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4521.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4521.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:45"},
  {id: 2099, name: "Alta Collection ", number: "1249F1S", price: nil, description: "Blending the comfort of a lounge chair with the functionality of the internal lift mechanism, the Alta Collection will be a welcome addition to your home. With an electric mechanism that, with a push of a button, takes you from fully reclined to standing, this chair aids in your mobility. The lift chair is offered in dark brown bi-cast vinyl, with contrast stitching, for versatile placement in your transitional to contemporary home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1255F1S 1249F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1255F1S 1249F1S.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:16"},
  {id: 2101, name: "Hobson Collection ", number: "5478-72", price: nil, description: "Created with the look of natural simplicity, the Hobson Collection blends elements of contemporary design to achieve a unique offering for your dining space. The live edge table top features a light finish that serves to highlight the naturally occurring grain of the wood. Supporting the tabletop and accompanying bench are gray finished legs. The solid top is carried over in the design of the accompanying 47.5-inch bench. Wood framed chairs feature a modern profile chair back, wrapped in brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5478-72 5478S 5478-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5478-72 5479-72_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5478-72 5478S 5478-13.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:24"},
  {id: 101, name: "Celine Bed", number: nil, price: nil, description: "Feminine details and luxurious designs come together to form this elegant bedroom set. Featuring an extravagant gold finish to go with the padded and tufted headboard, this bed exudes royalty. Nailhead trim completes the regal appearance and a low footboard adds a touch of contemporary influence. Added utility with the power outlet hidden within the nightstand ensures this sophisticated set is not just easy on the eyes but also convenient and functional!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7432.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:01:51"},
  {id: 2102, name: "Welty Collection ", number: "8211", price: nil, description: "Functionality plays a role in the homes of many, whether entertaining overnight guests or seeking the ultimate in lounging as you unwind from a busy day. The Welty collection will provide not only a comfortable spot for your entertaining and relaxation needs, but a functional addition to your casual living space. With a pull of the under storage pop-up ottoman, the seating group becomes a platform that can serve as a lounger or bed. The chaise seat lifts to reveal under storage that is perfect for blankets or extra pillows for your overnight guest. The fabric covering is offered in fossil, an earthy tone for a neutral addition that is perfect for your home's dcor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8211.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8211.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:28"},
  {id: 2103, name: "Russian Hill Collection ", number: "1808-112", price: nil, description: "Blending the classic aesthetic of traditional design is the Russian Hill Collection. The nod to Old World styling comes in elements such as dental, rope and bead molding, shell motifs and faux marble accent, this dining collection goes above and beyond to create the desired look. An elegant double pedestal table serves the main course of this refined collection. Acanthus scroll design encompasses the table apron and complement the wood fromed fabric chairs. The stately china stands as the focal point topped with a carved shell accent and elaborate acanthus scroll design. The server features faux marble top, glass and wood door fronts, wine storage as well as service drawers. Further lending to the design of the china and server are the fixed antique finished hardware and pilaster accenting in the style of Corinthian columns. The Russian Hill Collection is offered in a traditional warm cherry finish with gold tipping solidifying the interpretation on traditional dcor.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1808-112.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1808-112.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:31"},
  {id: 2096, name: "Caffery Collection ", number: "4829DB", price: nil, description: "In creating the perfect recreational room, you need functional pieces that provide comfort to your friends and family. The Caffery Collection, with a quick adjustment to the click mechanism, turns from a casual sofa into a flat platform perfect for sleeping or just hanging out. Offered in a dark brown bi-cast vinyl with white contrast stitching or dark grey fabric, the collection also features cup holders at arms for added convenience.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4829DB-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4829DB-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:53"},
  {id: 2097, name: "Festus Collection ", number: "5466-30", price: nil, description: "Offered for your living room is the Festus Collection. Extending to support and frame the corners of the light toned genuine marble tabletop are dark cherry finished legs. At home in contemporary to transitional settings, the Festus Collection will be a stylish addition to your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5466-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5466-30.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:58"},
  {id: 2105, name: "Kavanaugh Collection ", number: "5409-78", price: nil, description: "Subtle contemporary design is called into play for the styling of the Kavanaugh Collection. Lending a distinct look to the tabletop is a classic checkerboard veneer pattern which is highlighted by a dark brown, with gray undertone finish. Providing contrast to the table is the brownish gray fabric coverings of the shallow cove back seats.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5409-78.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5409RF-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5409-78_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5409-78.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:33"},
  {id: 2106, name: "Westwood Collection ", number: "626-36", price: nil, description: "Deriving its look from a multitude of classic designs, the Westwood Collection is the perfect blend of traditional accents and transitional styling. Drawing from the classic details of matched oak veneer patterns and fabric-covered swivel seats  the transitional design is pulled together with functional table base storage, and a warm burnished oak finish. Also available in Napoleon style counter height chair", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/626-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/626-36.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:34"},
  {id: 2107, name: "Norman Collection ", number: "2514BK-36", price: nil, description: "Perfectly scaled for a cozy dining area is the Norman Collection. The counter height table features double display shelves, providing ample storage and display space. Each chair, in this five-piece dining offering, has a double X-back design that lends a transitional feel. The black finish compliments the casual feel of this offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2514BK-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2514BK-36.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:36"},
  {id: 2108, name: "Daisy Collection", number: "710-72", price: nil, description: "Daisy Collection combines superb visual appearance and fine quality that you need in your dining area. Three distinct elegant flared tulip bases support beveled glass tabletops on the rectangular and round traditional dining height tables and a round gathering height table. Additional offering is the trestle table with black glass insert. Counter and dining height chairs feature clean lines and sleek curves; available in both white and bi-cast vinyl and dark brown bi-cast vinyl. The set is constructed of hardwood solids and veneers in a refreshing espresso finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-72.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/710-72.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:42"},
  {id: 2109, name: "Leavitt Collection ", number: "1990-1", price: nil, description: "Unfettered transitional styling creates a unique offering for your bedroom in the Leavitt Collection. The framing of the case goods and bed lend an air of understated sophistication that is enhanced by the antiqued bronze pull hardware and brown cherry finish that graces the mindy veneer of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1990-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1990-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:49"},
  {id: 2110, name: "Elsmere Collection ", number: "1978W-1", price: nil, description: "Traditional elegance is captured in the design of the Elsmere Collection. From the feminine shape of the bomber case goods to the flair of feathered scroll that graces each piece of the bedroom suite, the romantic classicism of French provincial is perfectly executed. An antique gray finish is utilized to highlight the pine solids and tropical veneers with subtle silver tipping accents. Antiqued hardware with an elegant design that so perfectly complements the look of the group provides additional decorative accenting.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1978W-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1978W-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:54"},
  {id: 2111, name: "Potrero Collection ", number: "2024-1HB", price: nil, description: "Versatile placement options, while utilizing minimum space makes the Potrero Collection the right choice for your home. Three styles, each offered in a single cover are available  Grey fabric with vertical channel seaming, black bi-cast vinyl with x-stitch pattern and brown fabric with square pattern.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2024-1HB.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2024-1HB.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:59"},
  {id: 2112, name: "Marceline Collection ", number: "1866", price: nil, description: "Your bedroom reflects your personal style -\u0080\u0093 bold with an eye for trend forward design, the Marceline Collection achieves your desired look. The striking grey finish of the collection features hand rub-through distressing for a subtle weathered look. Geometric molding provides a distinct contrast to the traditionally framed case goods. Substantially sized turned legs enhance the look of the oversized case pieces and mansion headboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1866.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1866.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:04"},
  {id: 2113, name: "Savonburg Collection ", number: "8427-3", price: nil, description: "With a design that is driven by trend and style, the classic look of the Savonburg Collection blends with a number of modern and traditional settings. This Chesterfield style seating group is offered in neutral tone fabric and features button tufting and a heavily rolled arm that transitions to encompass the entire back of each piece in the collection. The substantial size of this offering allows for maximum comfort that is enhanced by the accompanying toss pillows. Offered in both sectional and traditional seating styles.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8427.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8427.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:20"},
  {id: 2116, name: "Hankins Collection ", number: "9669FCP", price: nil, description: "With plenty of room for your family and friends to get comfortable, the multifunctional Hankins Collection will be a welcome addition to your living room. The chocolate textured plush microfiber and dark brown bi-cast vinyl are the perfect complement to your transitional decorative style. Generously stuffed for your comfort and well-appointed for your convenience, this seating collection features an end reclining unit and chaise, as well as a console with cup holders and lift-up storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9669FCP.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9669FCP.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:31"},
  {id: 2117, name: "Brooks Collection ", number: "9739", price: nil, description: "Relaxation is serious business. Serious comfort is what the Brooks Collection offers in this substantially sized upholstered seating group. Channel-tufted, bonded leather covers the pillow arms, overstuffed cushions and is offered in a rich dark brown. The unique feature of this collection is the wide chaise that extends from the sectional sofa. The coordinating ottoman tucks neatly into the face of the sofa, effectively extending your lounging space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9739 Shot 2.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9739 Shot 2.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:35"},
  {id: 2118, name: "Bonaventure Park Collection ", number: "19359-3", price: nil, description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cabriole legs support the rolled arm show wood frame, while egg and dart molding, along with acanthus leaf motif lend to the base and top rail of each piece in the collection. Providing contrast to the gold-highlighted cherry finish of the frame is the brown tone chenille fabric. Complimenting contrast pillows feature three traditional patterns with each featuring accenting appropriate to their style such as faux leather piping or looped fringe. Pleated tufting is anchored by button accent providing classic prominent detail to this elegant seating collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/19359.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/19359.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:37"},
  {id: 2120, name: "Savion Collection ", number: "5494-106", price: nil, description: "Sophisticated soft contemporary design is achieved in your dining room with the addition of the Savion Collection. Two table types are offered as versatile options to fit in your space  a rectangular double pedestal table and an oval single pedestal table. Both featuring a distinct birdcage style base. An espresso finish highlights the unique veneer pattern. Dramatic flair is lent to the design by the accompanying chairs. Neutral tone fabric covers the substantially sized roll back arm and side chairs. Reeded fronts on the server along with the serpentine profile further the elegance of this distinctly sophisticated collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5494-106.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5494-106_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5494-106.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:39"},
  {id: 2128, name: "Clementine Collection", number: "B1799-1F", price: nil, description: "With a design as sweet as the name implies, the Clementine Collection will be a bright and classic addition for your childrens sanctuary. Scaled for your childs bedroom, the traditional bed and bunk bed offer a customizable sleep spaces to suit your individual needs. Wooden knob hardware stands boldly against the double bow-fronted case goods while the additional decorative accents of framed bead-board paneling and scalloped base carry over to the design of the turned post headboard and footboard  further enhancing the classic look of this lovely bedroom. The bunk bed features an optional full-size extension kit for the lower bunk. Also offered for each bed in the collection is a functional trundle allowing for the option of either storage or twin bed.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B1799-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B1799-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:40"},
  {id: 2121, name: "Compson Collection ", number: "5431-77", price: nil, description: "With lines that lean to contemporary and a natural finish that can be placed in transitional settings, the unique design of the Compson Collection allows for your decorative imagination to run wild. Convenience factors of the self-storing table leaf, and the two tone finish that highlights the natural grain of the walnut veneer table top, are some of the valuable features offered in this offering. Wood framed chairs have chocolate brown fabric seats and backs that further the two-tone look of the collection. Following the curve of the table top is the optional 60-inch bench. The accompanying server features an open display shelf along with drawer and door storage for stowing your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5431-77.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5431-77 5431-14.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5431_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5431-77.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:42"},
  {id: 2122, name: "Claire Collection", number: "5428-84", price: nil, description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Anna Claire Collection provides an unexpectedly elegant addition to a number of dining spaces. A driftwood finish covers the wood of the two base options; a rectangular trestle table or round pedestal table with a rusticated zinc tabletop that features nail head accent banding. Three chair options are available; button tufted back, curved arm, and nail head accented. Each with a neutral toned grey fabric that compliments the look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-84 5428-S3 5428-S1 5428-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-84 5428-S2.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-84 5428-S1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5428-84 5428-S3 5428-S1 5428-40.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:44"},
  {id: 2124, name: "Thurmont Collection ", number: "5052-118", price: nil, description: "Stately in design and presence, the Thurmont Collection provides a timeless statement to your formal dining room. Acanthus leaf carvings provide a continuous theme throughout the collection -featured on the china, table and chairs. Cherry book-match veneer provides a classic look to the table top as do the elegantly curved legs. Routing is featured prominently on the accenting chairs, flowing with each curve. The chair backs have an overlay wood design that highlights the richly toned hues of the chair's fabric. Serving as a grand focal point, the china's arched top and decorative beveled glass serve to display your tabletop accessories. Finally, a rich cherry finish adds to the overall design of the Thurmont Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5052-118-shot1_mixing color 2014D-3.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5052-118-shot3_2014D-3.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5052-118-shot1_mixing color 2014D-3.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:17"},
  {id: 2125, name: "Kiran Collection", number: "H11302", price: nil, description: "The floating orbital orbs accent lighting table lamp gravity defying design features three aluminum wraped sparkling orbs suspended mid-air, arranged in orbital order on an elegant curved stand, illuminating warm white light rays. The piece is beautifully crafted using high quality satin nickel finish metal. Remarkable addition piece on your night stand, end table, or sofa table. Great accent lighting that can enhance the surrounding ambiance, perfect for a night light, or a mood light to brighten up any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11302_c_light on.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11302_c_light on.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:21"},
  {id: 2133, name: "Potrero Collection ", number: "2026TPU-1HB", price: nil, description: "Versatile placement options, while utilizing minimum space makes the Potrero Collection the right choice for your home. Three styles, each offered in a single cover are available -\u0080\u0093 Grey fabric with vertical channel seaming, black bi-cast vinyl with x-stitch pattern and brown fabric with square pattern.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2026TPU-1HB.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2026TPU-1HB.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:30"},
  {id: 2126, name: "Aram Collection ", number: "8206NF-3", price: nil, description: "With amply appointed offerings that create not only a comfortable seating experience but a functional one as well, the Aram Collection will be a welcome addition to your home. The seating group is offered in a brown fabric or dark brown AireHyde for comfort and style that will blend effortlessly with your transitional decorative preference. Manual motion mechanisms operate with the pull of a side-mounted tab, that once engaged, take you from seated to reclined in an easy motion. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends and a drop down center seat back with cup-holders, electric receptacles, USB port and tabletop space, the dual glider reclining ends of the love seat flank a center mounted console with storage, electric receptacles and cup-holders, and the reclining chair features a glider mechanism that allows for easy back and forth motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8206NF.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8206NF.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:36"},
  {id: 2127, name: "Pecos Collection ", number: "8480GRY-2LCN", price: nil, description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors  gray, red and dark brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480GRY_2LCN%2BCR%2BAR%2B2R 3292.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8480GRY_2LCN%2BCR%2BAR%2B2R 3292.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:37"},
  {id: 114, name: "Anabelle Bed", number: nil, price: nil, description: "A bold statement piece to boost the appeal of any bedroom, this platform bed is a surefire hit to create a contemporary sleeping environment. The oversized wingback headboard features eye-catching button tufting and comes dual-lined with nailhead trim. The linen-like upholstery comes tightly wrapped around the platform structure, ensuring a clean yet cozy visual.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7677gy.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:05:53"},
  {id: 2131, name: "Bartly Collection ", number: "B2043SB-1", price: nil, description: "With options that allow for the perfect placement within your bedroom is the Bartly Collection. This transitional bedroom group is featured in a natural pine finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2043SB-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2043SB-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:49"},
  {id: 2132, name: "Abbeville Collection ", number: "1856T-1", price: nil, description: "The ever popular Louis Philippe style is updated with functional accoutrements in the Abbeville Collection. Button and bale hardware grace the drawer fronts of each piece in the collection, while unbeknownst to the casual observer, there is hidden drawer storage on the nightstand, dresser, and chest -\u0080\u0093 each easily accessible with a pull of the front top frame. The sleigh bed furthers the timeless look of this youth collection, which is also offered in adult collection. Okume veneers are elegantly highlighted with a traditional brown cherry finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1856T.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1856T.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:52"},
  {id: 2134, name: "Sprague Collection ", number: "8208-3SC", price: nil, description: "With a configuration that allows for the perfect fit with your living room, the transitionally styled Sprague Collection will be a welcome addition to your home. The three seat sofa features an ottoman that is paired with the reversible chaise cushion to create a right or left configured sectional. The fossil fabric that covers is an earthy neutral tone that furthers the versatile placement within your living room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8208-3SC.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8208-3SC.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:53"},
  {id: 2135, name: "Loyalton Collection ", number: "5149-36", price: nil, description: "Traditional elements of wood and metal blend to create the casual look of the Loyalton Collection. Forged of metal, the double-X patterns flow from chair back to table apron, while the traditional look of the tables turned legs is given a modern update. Wood is utilized for the tables routed top, chair seats and chair backs. The collection is offered in two distinct styles to fit your needs  48 inches fixed rectangular top and 40 inches square counter height top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-36_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5149-36.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:56"},
  {id: 2137, name: "Hollyhock Collection ", number: "5123-96", price: nil, description: "Rusticated country styling blends effortlessly into your home with the Hollyhock Collection. The distressed white finish not only serves as a bold color for your dining room, it also elegantly highlights the natural wood finish of the table top. The combination of white wood and dark metal forming the knob hardware of the china, presents a focal contrast to this functional piece. Drawer and door storage provide ample storage and display space for your table top accessories. The traditional look of the chairs  slat backs and finial topped  further lends to the country styling of this classic dining collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5123-96.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5123-50.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5123-96.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:29"},
  {id: 2139, name: "Mayville Collection ", number: "2147TBK", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147TBK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147TBK.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:34"},
  {id: 2140, name: "Lockwood Collection ", number: "5560-30", price: nil, description: "Serpentine lines form the boxed table tops: each crowned with elegant marble and edged with short grain mahogany border. Furthermore, in mahogany finish wheat sheaf carved accents top spiral turned legs while display shelving is supported by traditional bun feet. These unique and graceful features make the Lockwood Collection a perfect addition to your living room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5560.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5560.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:36"},
  {id: 2142, name: "Chrysanthe Collection ", number: "1912-1", price: nil, description: "With bold curves that are softened with elegant accentuation, the look of the Chrysanthe Collection is nothing short of utterly feminine. Clipped corner case tops are supported by dramatically curved canted pilasters that give way to the scroll-accented base moldings of each piece in the collection. Drawer fronts are punctuated by decorative metal hardware that features the look of white hang-up accentuated dark metal. The headboard rises in elegant fashion cresting with heavily scrolled framing that perfectly complements the case pieces. A water based finish highlights the oak veneers over oak solids, with subtle white hang-up lending a slightly weathered aesthetic.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1912-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1912-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:45"},
  {id: 26, name: "Haldus Bed", number: nil, price: nil, description: "Get lost in this undeniably industrial bedroom set. The bedroom set offers intrigue with distressed accents and a hand brushed black powder coating. Pointed lines detail the head and footboard, contrasting the rounded frame with edgy accents. The nightstand completes this set with a distinguished wire framed door, natural wood top and flared tapered feet. Available in Red or White, this bedroom set delivers a uniquely bold, industrial look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7502wh-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:51:21"},
  {id: 2143, name: "Jude Collection ", number: "8201BRW-3", price: nil, description: "Plush seating with well-appointed features makes the Jude Collection a comfortable and functional addition to your living room. The seating group is offered in either brown or black leather gel match coverings for a bold, yet, neutral statement. Manual motion mechanisms operate with the pull of a side-mounted tab, that once engaged, take you from seated to reclined in an easy motion. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends and a drop down center seat back with cup-holders and tabletop space, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8201BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8201BRW.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:50"},
  {id: 2144, name: "Keegan Collection ", number: "2546-96", price: nil, description: "Exuding the sophisticated elegance that your formal dining room calls for, the Keegan Collection will wow your dinner guests. The china cabinet stands at attention, not only functioning as a storage facility for all of your tabletops finest, but also as the grand centerpiece of this stylish dining offering. For additional storage, or for smaller spaces, the server features wine storage and unique mirror accent that adds a small height to the standard server. Storage features prominently on both pieces. Each of the dining tables in the collection  108 inch tabletop with double pedestal base and 96 inch tabletop with leg supports  feature a lovely veneer pattern that is highlighted by the rich brown cherry finish. Accenting hardware is featured in satin nickel. The complimenting chair features a neutral tone fabric seat and elegantly overlapping chair back design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2546-96_50_2014D-18.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2546-96_40_mixing color 2014D-18.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2546-96_50_2014D-18.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:56"},
  {id: 2145, name: "Amara Collection ", number: "6472", price: nil, description: "Fun, funky and functional, the Amara Collection will provide your home with interesting conversation pieces and a look that is as unique as you are. With the turn of a crank, the adjustable table (6414) can be raised or lowered to suit your individual needs. Black iron is complimented by the bold red and white hued design of the -\u0080\u009CAtellier Loft-\u0080\u009D print that appears on the dining tabletop and carries its theme to the caster supported cocktail table (6409) -\u0080\u0093 paired with our tractor seat adjustable iron barstool (6412), you will have created the creative focal point for your dining space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/6472.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/6472.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:27:02"},
  {id: 1, name: "Hesperos Bed", number: nil, price: nil, description: "Embolden your room with traditional designs and modern details that define this set. Decorated finials and carved floral accents beautifully frame the head and footboard. Lightened wood accents detail the set, creating soft contrast against these two beautiful finishes. Case goods are polished in elegance. Crafted with sculpted legs, this bedroom set truly sets itself apart with lavish designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7798wh-1-z.jpg", created_at: "2018-01-16 05:02:03", updated_at: "2018-01-19 04:38:30"},
  {id: 76, name: "Bryony Bed", number: nil, price: nil, description: "Cover your room with clean lines and simplistic designs that define this contemporary set. The plank designed bedroom set promotes soothing flow with linear lines that seem to travel from piece to piece. The high back headboard focuses the set and the low profile headboard contrasts with a clean design. Case goods rest on sleek legs and provide a steady foundation for its spacious storage drawers. Finished in a dark grey, this bedroom set adds cooler tones to complement the fluid designs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7511-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:14:02"},
  {id: 2148, name: "Claire Collection", number: "5428-45RD", price: nil, description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Anna Claire Collection provides an unexpectedly elegant addition to a number of dining spaces. A driftwood finish covers the wood of the two base options; a rectangular trestle table or round pedestal table with a rusticated zinc tabletop that features nail head accent banding. Three chair options are available; button tufted back, curved arm, and nail head accented. Each with a neutral toned grey fabric that compliments the look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-45RD 5428-S2 5428-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-45RD 5428-S1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-45RD 5428-S3.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5428-45RD 5428-S2 5428-40.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:24:17"},
  {id: 2149, name: "Benwick Collection ", number: "5425-36", price: nil, description: "From every angle, the modern traditional design of the Benwick Collection shines through. Offered with two table options  a classic turned-leg table and a display base counter height table. Each table is flanked by elegantly designed fabric covered chairs that are supported by turned dark cherry legs. Nail head accenting furthers the chairs modern traditional styling. The accompanying server features ample behind door storage, wine bottle rack, and brushed nickel knob hardware. Birch veneer is used throughout the collection and is enhanced by a dark cherry finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5425-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5425-36 5425-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5425-36.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:24:41"},
  {id: 94, name: "Janis Bed", number: nil, price: nil, description: "Enjoy the comfort of this classic mid-century modern style bed that boasts fun, retro flair and clean, linear lines. A horizontally tufted headboard features smooth fabric upholstery and plush foam padding for the perfect spot to read a relaxing bedtime story or watch a favorite late night show.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7676.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 00:59:55"},
  {id: 141, name: "Hankinson Bed", number: nil, price: nil, description: "With a look all its own, this set demands attention. The rustic natural tone finish enhances the slatted, wingback style headboard and emphasizes each drawer panel. Matching case goods are each equipped with ball bearing metal glides and felt-lined top drawers.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7576.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 01:22:00"},
  {id: 2150, name: "Compson Collection ", number: "5431-36", price: nil, description: "With lines that lean towards the contemporary and a natural finish that can be placed in transitional settings, the unique design of the Compson Collection allows for your decorative imagination to run wild. The versatility of two table offerings  one a 77-inch dining height table with self-storing table leaf, the second a 66-inch fixed top counter height table- along with the two tone finish that highlights the natural grain of the walnut veneer table top, are some of the valuable features offered in this dining collection. Wood framed chairs have chocolate brown fabric seats and backs that further the two-tone look of the collection. Following the curve of the table top is the optional 60-inch bench- for both table options. The accompanying server features an open display shelf along with drawer and door storage for stowing your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5431-36 5431-24 5431-24BH 5431-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5431-36 5431-24 5431-24BH 5431-40.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:24:44"},
  {id: 2151, name: "Culbert Collection ", number: "8018C", price: nil, description: "With your living room serving as the center for your family-\u0080\u0099s relaxation and social time, the Culbert Collection provides the platform for storage, display, and use of your home entertainment system. Featuring side shelving units along with bridge display storage, your television will be surrounded by books, DVD-\u0080\u0099s, and objects that bring you enjoyment. The lower supporting cabinet features glass fronted door storage that allows for easy use of remote controlled devices. This transitional unit is finished in a warm cherry and has round knob hardware that compliments.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8018C-P.T_2014H-2.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8018C-P.T_2014H-2.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:24:45"},
  {id: 2146, name: "Lyric Collection ", number: "1737NGY-1", price: nil, description: "Taking the expected design elements of hard contemporary and putting a decidedly feminine curve into the mix make the Lyric Collection a unique addition to your new bedroom design. With each curve comes a new twist  satin nickel hardware accents the glossy white or dark espresso or brownish grey finish, bowfront case pieces feature ball bearing drawer glides, and compliment the padded sleigh headboard and footboard, while a round, contemporary mirror reflects the modern designs that you have selected. A final unique addition to the collection is the glass-topped night stand that furthers the contemporary feel.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1737NGY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1737NGY.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:27:06"},
  {id: 5, name: "Brachium Bed", number: nil, price: nil, description: "Get the most out of your bedroom with this contemporary style bedroom set. The button tufted leatherette headboard offers unlimited comfort so you can lean into it in any angle. The LED light trim on the headboard adds a tasteful sense of convenience for your nightly reading materials and the decorative mirror accents adds a touch of contemporary style. The ornate bun feet compliment these stylish features and the French dovetail construction of the felt-lined top drawers blend traditional elements well. Available in 2 finishes.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7977sv-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:47:47"},
  {id: 11, name: "Claudette Bed", number: nil, price: nil, description: "Add this to your bedroom set to give your space a fresh, new classy upgrade. This contemporary style bedroom set comes complete with a button tufted leatherette headboard with added storage space of two drawers built into the stylish footboard. Add a modern touch of technical advancement as the headboard showcases an LED light trim that will enhance your convenience while giving your room an updated feel. The decorative mirror accents and crocodile-like front panels bring a unique combination of details that come in a silver rose finish. Each case good features felt-lined top drawers built with English dovetail construction to offer added storage space for all your necessities. Give your home the upgrade it needs and get the most out of your bedroom space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7972-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:50:13"},
  {id: 13, name: "Persephone Bed", number: nil, price: nil, description: "Stylish enough for a queen and elegant enough for everyone else, this bedroom set offers a majestic flair that cannot be rivaled! The curvaceous, high headboard showcases a thick ornate trim that accents the fabric upholstery and its decorative button tufts. Each of the case goods feature fluted details along their sides, drawing the eye up to the moulded top and down to the elegant bun feet. With traditional elements to liven up any home, this bedroom set will transform your home into a luxurious palace.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7661dr-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 20:53:27"},
  {id: 975, name: "Spring CreekTwin/TwinBunk Bed", number: nil, price: nil, description: "The straight clean lines and dark walnut, oak, or white finish create a modern Mission style that is perfect for a child", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk602t-oak.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-25 21:01:36"},
  {id: 50, name: "Kallisto Bed", number: nil, price: nil, description: "Stylize your bedroom with this design-forward set. Patterned honeycomb designs texturize with geometric shapes and clean lines to redefine any setting. Chestnut brown finishes are warm and rustic, showing distinguished natural wood tones. Peg-like legs add character to the case goods and provide steady support while handleless drawers complement the clean lines.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7582f-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:05:36"},
  {id: 52, name: "Isidora Bed", number: nil, price: nil, description: "Bring some elegance home while still maintaining a neutral tone with this transitional bedroom set! From the sleigh bed's sophisticated carved details to the gently moulded details at the top and base of the case goods, this design offers plenty of visual appeal to stimulate your environment! Complete with antique-like drawer pulls, this set is the perfect addition to complement your relaxed bedroom decor!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7799ch-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:11:56"},
  {id: 63, name: "Armus Bed", number: nil, price: nil, description: "Take advantage of this conveniently functional bedroom set that offers a contemporary blend of modern and traditional styles. Lean into the padded fabric headboard, which has been designed to maximize comfort. The nightstand comes equipped with a USB outlet, perfect for charging your smartphones and tablets, and the felt-lined top drawers give ample storage space for all your clutter. This transitional style bedroom set offers comfort and utility while giving your home a newly refined look that you won't be able to resist.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7719-1-z.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-25 21:20:41"},
  {id: 196, name: "Liza Bed", number: nil, price: nil, description: "Contrast defines this elegant bedroom: flowing lines are set against straight edges, while the smooth silver finish clashes beautifully with the textured, crocodile leatherette panels. The headboard and footboard have prominent top curves that swoop from left to right, while the legs curve gently outward away from the straight frame of the bed. The same leg shape can be found on the case goods while antique-looking handles exhibit curves as well. Lastly, both the bed and the case goods have crocodile leatherette front panels for that exotic look.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7264.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:33:10"},
  {id: 198, name: "Nisha Bed", number: nil, price: nil, description: "Sleek design, flawless style and warm comfort are all wrapped into one amazing package with this stunning platform bed. With the added touch of matching case goods, this set is show stopping! The camelback headboard is accentuated by a deep tufted padded leatherette and pairs well with a low profile crocodile-inspired footboard. Coordinating case goods with fierce textured crocodile panels and an arched framed mirror complete this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7091.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 01:33:23"},
  {id: 234, name: "Bryant Bed", number: nil, price: nil, description: "The sleek elegant lines accented with eye-catching button-tufted leatherette details bring about a very classy bedroom set. Crocodile skin leatherette adorn the front panels of the matching case goods with beautiful mirror accents. Bryant is a manifestation of class and style combined.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7288.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:33:12"},
  {id: 246, name: "Bennett Bed", number: nil, price: nil, description: "Put a twist on the classic sleigh bed with this curvy and elegantly designed bed. The stylish tufting and nailhead trim enhance the sleek rolled leatherette. Button tufting along the headboard and footboard creates an attractive appeal while you cozy up in this exquisite bed. Available in brown or white.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7603br.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:37:23"},
  {id: 283, name: "Landaluce Bed", number: nil, price: nil, description: "Finished in antique dark oak, this unique spin on a traditional bed features simple posts with round bun feet paired with elaborate wrought iron floral designs. Matching case goods have full extension drawers with felt lining on the top drawer.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7811.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:42:22"},
  {id: 298, name: "Velda II Bed", number: nil, price: nil, description: "The romantic simplicity of this English style bedroom group will add elegance and comfort to your home. Crafted of solid woods and veneer with a warm cherry finish. The gentle curves of the headboard and footboard add style and grace to your room. Felt-lined top drawers in all the case goods are a bonus!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7952.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:46:06"},
  {id: 331, name: "Lewisburg Bed", number: nil, price: nil, description: "Add elegance and style to your home with this timeless bedroom group featuring intricate wood designs and a dark cherry finish. The dramatic headboard and footboard become the focal point of your room and the antique brass pulls accent the ample storage.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7721.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:47:58"},
  {id: 346, name: "Crystal Lake Bed", number: nil, price: nil, description: "The straight-forward lines of the Crystal Lake contemporary bed and matching chest, dresser and night stand create an understated elegance for any room. The jewelry drawers under the mirror are high demand feature for anyone looking for convenient storage. Brushed nickel pulls accent the updated brown cherry finish and sleek lines of this beautiful bedroom group.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7910.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 02:53:26"},
  {id: 378, name: "Mariam Counter Ht. Table", number: nil, price: nil, description: "Centralize for a focused look with this sophisticated multi-tone counter-height dining set. Wire-brushed oak highlights the spacious square table while chunky post legs contrast with a bold black finish. Grey adds a balancing tone to the set as it wraps the chairs with soft fabric. Cushioned seats provide plenty of support and sleek leg rests keep you rested and relaxed. Easily serve guests and sit comfortably spaced with the dining set that expands to your changing needs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3375pt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:55:10"},
  {id: 430, name: "Holcroft Dining Table", number: nil, price: nil, description: "Bring elegance to the table with this fine collection of furniture! Gently turned legs add a level of sophistication to a design enhanced by the antique finish and appearance of the spacious tabletop. Padded fabric upholstery lines the backrest and seat of each coordinating chair, providing a comfortable place to sit for a full-course meal. Invite the entire family over to enjoy a lovely feast all together at one table.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3600t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:43:07"},
  {id: 382, name: "Alpena Round Dining Table", number: nil, price: nil, description: "Shine up your silverware, bring out the glassware and get ready for the dinner party of the century with this glorious, traditional style dining table. The ornate pedestal base provides the perfect structure for the crisscross patterned table top that, with its wide circular space, can fit all the friends and family you can imagine. Paired with upholstered chairs featuring espresso leatherette, rope-like trim and elegant carved legs, this table showcases your exquisite taste with a bold and impressive presence! Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3350rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:55:50"},
  {id: 383, name: "Lela Dining Table", number: nil, price: nil, description: "This industrial-inspired dining set is a great addition to any restoration-decorated space. The metal legs and chair frames contrast beautifully with the wooden table top and seat. Tapering legs sturdily uphold the entire piece while adding a touch of modern eccentricity.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3529gy-t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-27 02:55:55"},
  {id: 604, name: "BRIDLE I 7Pc. Dining TableSet", number: nil, price: nil, description: "For dining rooms with lighter walls, this dark espresso set will standout. Chairs have padded leatherette seat and wooden back, while the table top shows a subtle yet beautiful grain.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_699.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-27 03:00:05"},
  {id: 738, name: "TUSCANY II Formal Dining Table", number: nil, price: nil, description: "The rich details of this antique cherry dining room set is the perfect setting for all of your special occasions.  The elegant rectangular dining room table has romantic carvings on the French style legs and seats six with comfort.  Paired with the dramatic buffet and hutch, this dining group will make a stunning statement in your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_445.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:27:18"},
  {id: 128, name: "Fort Worth Bed", number: nil, price: nil, description: "Create a regal and luxurious setting in your bedroom with this grandiose leatherette tufted sleigh bed and its paired case goods showcasing genuine marble tops. Its padded headboard provides comfort while the matching footboard makes a bold statement. Case goods feature full extension ball bearing glides for smooth accessibility and top drawers are felt lined for your delicate items. Fall asleep feeling like royalty every night with this gorgeous set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7858.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 19:53:36"},
  {id: 214, name: "Jania Bed", number: nil, price: nil, description: "Add an enchanting atmosphere to any bedroom with this stylized metal bed. The lifted structure showcases a matching headboard and footboard with arched tubing and ornate scroll detailing. Metal construction ensures this bed stays durable and steady while smooth powder coating preserves the classic color.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7709bk.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-27 20:01:33"},
  {id: 167, name: "Orlaith Bed", number: nil, price: nil, description: "Grab some shut-eye without a care in the world. The beauty of this set emanates directly from the statement bed, which showcases bold nailhead trim along the padded linen-like fabric grids on its headboard and mirror. Extra storage space can be found within any of the case goods and the footboard of the bed itself. The drawer front panels feature a recessed fascia adorned with beautiful wooden bar pulls.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7697.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:06:11"},
  {id: 171, name: "Lennart Bed", number: nil, price: nil, description: "For a quick modern update to your home, this collection will add that trendy mid-century appeal. Coordinating case goods boast slim flared legs and recessed handle drawer pulls. A choice of oval or rectangular wall mountable mirror completes this set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7386a.jpg", created_at: "2018-01-16 05:02:04", updated_at: "2018-01-27 20:07:02"},
  {id: 265, name: "Vizela Bed", number: nil, price: nil, description: "Add curves into your bedroom with this contemporary styled bed. The arched platform design enhances the padded grid-like patterning along the smooth light gray or a Ivory leatherette.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7604gy.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:33:28"},
  {id: 322, name: "Gabrielle II Bed", number: nil, price: nil, description: "Add elegance to your bedroom with the timeless grace and European styling of the Gabrielle group. The gentle curves of the headboard and mirror create gentle visions of relaxation. A silky cherry finish is accented with antique gold knobs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7083.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:34:27"},
  {id: 359, name: "Kaliyah Dining Table", number: nil, price: nil, description: "Wine and dine with the help of this gorgeous antique inspired dining collection. Each piece features wood construction for durability and a simple antique white finish to enhance any dining atmosphere. The upolstered seat cushions pair beautifully with the slat back chairs, competing in design with the dining table that features six handy storage drawers. Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3194t-1-z.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 04:36:37"},
  {id: 409, name: "Alpena Counter Ht. Table", number: nil, price: nil, description: "Shine up your silverware, bring out the glassware and get ready for the dinner party of the century with this glorious, traditional style counter-height dining table. The ornate pedestal base provides the perfect structure for the crisscross patterned table top that, with its wide circular space, can fit all the friends and family you can imagine. Paired with upholstered chairs featuring espresso leatherette, rope-like trim and elegant carved legs, this table showcases your exquisite taste with a bold and impressive presence!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3350rpt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:39:43"},
  {id: 417, name: "Juniper Round Dining Table", number: nil, price: nil, description: "Keep your dining space sleek and simple with this stylish and attractive round table dining set! Between the smooth round table design and angular legs, this transitional table provides a sophisticated visual while also offering a convenient place to store items on the lower shelf. Lean back and relax against the ladderback chairs, enjoying the comfy feeling of the padded fabric seat as you and your family get ready for a meal together.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3162rt-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:41:24"},
  {id: 425, name: "Wallis Dining Table", number: nil, price: nil, description: "Set the table and enjoy some quality time with family and friends at this charming, transitional style dining collection. The rich walnut finish warms up the room while providing amazing rustic character. Matching chairs provide a classic look with their slat back design and ivory fabric seats to compliment any home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3463t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:42:30"},
  {id: 457, name: "Meagan II Round Counter Ht. Table", number: nil, price: nil, description: "Parson style counter-height chairs and a plank style round table top blend to create a contemporary design with rustic appeal. The open bottom shelf provides an interesting visual while providing useful storage space. The flared chairs are upholstered in sleek leatherette upholstery to combine trending style with modern comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3152rpt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:43:42"},
  {id: 469, name: "Norah I 7 PC. Dining Table Set", number: nil, price: nil, description: "Enjoy family dinners every night indulging in delicious food and funny stories gathered around this simple yet cozy dining set. The warm brown cherry finish creates a hearty and inviting atmosphere while padded leatherette seats ensure your familys comfort. A modest set, this collection is surely perfect for your home. Available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3351t-7pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:45:16"},
  {id: 472, name: "Beresford Dining Table", number: nil, price: nil, description: "Quaint and chic, this transitional set is a stylish and functional addition to any dining space. Save valuable space and keep the table compact for everyday family dinners but, for those large dinner parties, put in the 18 butterfly leaf and go to town! Matching dark gray finishes can be found along both table and chairs, which also come upholstered in gray fabric seat cushions. The extra table top height and tapered legs add just the perfect amount of interest to create a beautiful yet understated look that will blend beautifully with almost any dcor.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3356t-9pc.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:45:45"},
  {id: 772, name: "ASTORIA I Dining Table", number: nil, price: nil, description: "Black tempered glass sits on top of this large, solid wooden base. The dining table pairs nicely with stylish leatherette chairs with slightly curved back and a handy server, all of which are finished in dark cherry.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_619.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:36:22"},
  {id: 524, name: "Vicente Dining Table", number: nil, price: nil, description: "Host memorable gatherings with this gorgeous formal dining set. The beautiful wood framework comes accentuated with intricate pedestal carvings, distinct tabletop patterning and detailed chair backs. The dual pedestal legs create a sense of wondrous elegance that pair beautifully with the formal patterned fabric featured along the entire chair seat and back. Pair with the tall and sophisticated hutch to enhance the classic appearance.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3243t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 04:51:19"},
  {id: 319, name: "Sonoma Bed", number: nil, price: nil, description: "Let the rustic beauty and charm of this country style bedroom carry you away! The warm tones of the American oak finish and the antique metal ornamentation on the headboard and mirror help to create a quiet and relaxing mood. Crafted of solid woods and veneer, this charming bedroom suite reminds us of relaxed country living. Also available in espresso finish.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7496.jpg", created_at: "2018-01-16 05:02:05", updated_at: "2018-01-28 22:06:35"},
  {id: 444, name: "McGlinn 5 PC. Bar Table Set", number: nil, price: nil, description: "Perfect for kitchen nooks and man caves, this industrial style bar table set offers a fun, casual place to enjoy delicious food and good conversation. The round wood veneer tops come in a natural tone finish for a warm, rustic vibe. The slim metal frame features an antique black finish with crossing support beams and built-in footrests so you can sit and rest in absolute comfort.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3434bt-5pk.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:08:38"},
  {id: 450, name: "Anton II Counter Ht. Table", number: nil, price: nil, description: "Perfect for casual family dinners or game nights, this contemporary style counter height set provides the ultimate cozy atmosphere. The soothing gray finish is complimented with light gray fabric upholstery for a classic look. A center beam provides extra support and added charm to blend style and functionality into one beautiful piece.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3986pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:10:28"},
  {id: 538, name: "Eris II Counter Ht. Table", number: nil, price: nil, description: "This picturesque dining collection offers a wonderful alternative to traditional designs while maintaining a refined appearance. The neutral coloring adds a chic appeal and can be easily paired with any light decor. Easily host a classy dinner with the wide, expandable surface and multi-functional storage server.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3213pt.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 22:14:02"},
  {id: 579, name: "Luminar II Counter Ht. Table", number: nil, price: nil, description: "Contemporary inspired with radiant lighting to perfectly show off the fine points of this table. This is accented with plush key-hole chairs and an illuminated table base.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3559pt.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:18:11"},
  {id: 582, name: "Nova Dining Table", number: nil, price: nil, description: "Graceful curves durably support the wide, rectangular glass top. The elliptical metal posts feature beautiful satin plated powder coating, matching the metal chair frames. Relax in style as the padded microfiber cushions offer comfort while the black upholstery complements the black finished base.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3728t-xx1.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:18:29"},
  {id: 592, name: "AMADOR I 5 Pc. Dining Table Set", number: nil, price: nil, description: "With a broad appeal among contemporary and transitional fans, this updated ladder back style set features horizontal slits in the back of the chairs. Seats are padded and upholstered in leatherette, while the legs and table are finished in espresso.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_888.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 22:19:41"},
  {id: 395, name: "Richfield Dining Table", number: nil, price: nil, description: "Quite the attention grabber, this collection will\r\nimmediately become the focal point of your home.\r\nFamily and friends are sure to admire your fine taste\r\nwhen they lay eyes on this one-of-a-kind table. Bold\r\nposts create a sturdy base for the 12mm tempered\r\nglass top featuring smooth, curved edges. Matching\r\npadded faux leather chairs complete the look with\r\ntheir U-shaped chrome legs, which comes in either\r\nwhite or black. This set is available in both standard\r\nand counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3362bk-t-1-z.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-28 23:39:13"},
  {id: 557, name: "Gladstone II Counter Ht. Table", number: nil, price: nil, description: "Add luxury to your dcor with this genuine marble top pub table. Harmoniously matched with leatherette Parsons counter height chairs, this dining set will certainly enhance your dining atmosphere.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3823pt.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 23:41:50"},
  {id: 566, name: "Armous I Dining Table", number: nil, price: nil, description: "The mix makes the match of this beautiful dining table an appealing blend of airy and substanial with its dramatic table top finish, stunning nailhead trim against the natural wood hues create a landscape of lovely in your dining room. The industrial styling of this contemporary collection showcases a solid wood cross-leg base.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3533t.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 23:42:48"},
  {id: 627, name: "Hillsview I 60\" Dining Table", number: nil, price: nil, description: "In both casual and formal settings, this beautiful dining table welcomes you to refined contemporary dining space with solid wood in a rich dark cherry finish. Features squared table top with squared tapering legs. A clean  crisp silhouette brings focus to the solid construction of this dining room table. Available in three table sizes.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3916t-60.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 23:46:51"},
  {id: 630, name: "MAKRI Sofa", number: nil, price: nil, description: "These matching sofa, love seat, and chair are upholstered in durable bonded leather and are featured in red, black and gray. Chrome legs and foldable headrests make this set perfect for any contemporary living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1256.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-28 23:51:38"},
  {id: 647, name: "SANDY POINT Round Dining Table", number: nil, price: nil, description: "For the smaller dining space, this round table has a single base and is accented by four chairs with padded leatherette seats and backs. Finished in brown cherry.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_864.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 00:13:23"},
  {id: 675, name: "TUSCANY II Formal Dining Table", number: nil, price: nil, description: "The rich details of this antique cherry dining room set is the perfect setting for all of your special occasions.  The elegant rectangular dining room table has romantic carvings on the French style legs and seats six with comfort.  Paired with the dramatic buffet and hutch, this dining group will make a stunning statement in your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_445.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 00:16:12"},
  {id: 784, name: "Dani Bed", number: nil, price: nil, description: "With its pink color and contemporary elements, this stylish bedroom set brings with it everything your child needs in a bedroom. The curving headboard on this stylish bed features sleek plank details and sophisticated finials that are mirrored on its footboard, providing a cohesive look with plenty of visual appeal. Each of the matching case goods provides spacious drawers for storage that are reinforced with a sturdy dovetail construction, enhancing the ability of this set to meet the needs of your child throughout the years.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7159pk-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:43:39"},
  {id: 787, name: "Merope Twin Bed", number: nil, price: nil, description: "Your little girl is growing up and needs an upgrade! The contemporary design offers a padded linen-like fabric with button tufting and nailhead trim to add a sense of elegance in a youthfully modest way. She'll be the envy of all her peers with this popular style that not only looks good, but offers unlimited comfort whether she's in for a good night's rest or getting her read on with a fun book.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7196-1-z.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:44:16"},
  {id: 819, name: "Charm Bed", number: nil, price: nil, description: "Treat your little princess to a storybook book ending night after night. With this magical carriage bed carrying your darling duchess off to sleep every night, she'll have wonderful enchanted dreams. This magical carriage bed features entrancing swirl designs attached to realistic carriage wheels while the high-back, pink wingback tent boasts a matching contrast trim to top off the fairy tale appearance.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7715.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:50:26"},
  {id: 830, name: "Prismo Bed", number: nil, price: nil, description: "Vivid color styles perfectly complimented with detailed craftsmanship wood details. This bed is available in two sizes, an array of colors, and will fit easily in any child", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7941gr.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 00:54:41"},
  {id: 867, name: "Pine Brook Bed", number: nil, price: nil, description: "With a slat kit included and paneled headboard, this casual bedroom set will fit best in a child's room. Options include matching case goods, including a hutch and desk, all accented with wooden knobs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7908wh.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 01:00:58"},
  {id: 879, name: "Annemarie Bunk Bed", number: nil, price: nil, description: "Ensure your children have plenty of space to enjoy their room by making their bed a multi-purpose fixture! In addition to a twin-size loft bed with protective guardrails and a lower full-size bed underneath, this piece also offers multiple shelves for storage or display. Three wide shelves provide additional room for a personal touch while also doubling as an attached ladder to make accessing the top level even easier. Choose from three beautiful color options to begin the room transformation!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk965ex-l-f-1-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:04:03"},
  {id: 914, name: "Spring Creek Twin/Twin Bunk Bed, Gray", number: nil, price: nil, description: "The straight clean lines and a variety of finishes create a modern mission style that is perfect for a child's bedroom. Four styles are available in multiple size combinations, with a unique Twin/XL size. All styles feature an easy access ladder.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk602t-gy.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:06:31"},
  {id: 920, name: "Olga I Queen/Queen Bunk Bed", number: nil, price: nil, description: "Take it back a few decades with this industrial inspired bunk bed. The visible piping framework is finished in antique black to create an authentic throwback atmosphere. Built-in slat kits and ladder access makes this structure a perfect fit for immediate use. Available in eight different configurations and sizes, there will certainly be one to fit your kids's needs.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk913qq.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:07:56"},
  {id: 935, name: "Lorren Bunk Bed", number: nil, price: nil, description: "Create a warm and cozy environment in your child's bedroom with these two-tone youth bunk beds. Visually fun and designed with functionality in mind, these bunk beds feature upper-side guard rails with a securely attached step ladder making it convenient to access the top bunk. Available in 3 size options and 2 finish options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk620t-bl.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:10:20"},
  {id: 960, name: "Lovia Bunk Bed", number: nil, price: nil, description: "Full metal construction, clean straight lines, and a metallic gold finish give this bunk bed set a great, contemporary look. Beyond its looks, the versatility it offers is also unmatched. It comes with a movable ladder for convenient access to the top bunk, while bed posts are separable and may be converted into two separate beds. With three sizes available, this is a  bunk bed full of possibilities.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk1037f.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:12:12"},
  {id: 969, name: "Sherman Bunk Bed", number: nil, price: nil, description: "This bunk bed is a great space saver for smaller rooms. Features include built-in student desk and shelving, attached ladder and is available in twin or full size.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk1098f.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 01:13:19"},
  {id: 482, name: "Sturgis Dining Table w/ 20\" Leaf", number: nil, price: nil, description: "Stand out from the rest with this unique dining collection that showcases various glass inserts to pop against the dark gray finish and gray leatherette. Thoughtfully accented with nailhead trim, the contemporary inspired chairs showcase gorgeous leatherette upholstery to enhance the updated design. Chunky, tapering legs provide durable support for the 20 expandable leaf so hosting a room full of family and friends is no longer a daunting feat but something you actually look forward to!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3352t.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-29 01:27:09"},
  {id: 491, name: "Beresford Dining Table", number: nil, price: nil, description: "Quaint and chic, this transitional set is a stylish and functional addition to any dining space. Save valuable space and keep the table compact for everyday family dinners but, for those large dinner parties, put in the 18 butterfly leaf and go to town! Matching dark gray finishes can be found along both table and chairs, which also come upholstered in gray fabric seat cushions. The extra table top height and tapered legs add just the perfect amount of interest to create a beautiful yet understated look that will blend beautifully with almost any dcor.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3356t-9pc.jpg", created_at: "2018-01-16 05:02:06", updated_at: "2018-01-29 17:54:54"},
  {id: 600, name: "MEDIEVE Formal Dining Table", number: nil, price: nil, description: "The dining room is a very important place in your home. It is where the family gathers and great conversations happen. It deserves something grand like this elegant formal dining table, with two expandable leaves, intricate apron details, and lion claw feet. Chairs feature fabric padded seats with beautiful pattern and cabriole legs. Finished in antique oak, a matching hutch and buffet completes this gorgeous set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_411.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 17:57:10"},
  {id: 664, name: "NAPA VALLEY Formal Dining Table", number: nil, price: nil, description: "Celebrate your most festive occasions with this elegant formal dining table with expandable table and decorative veneer inlay top and carved double pedestals. The chairs have upholstered seats and backs for extra comfort. The matching buffet and hutch has etched glass doors and multiple shelves and drawers to store china and silver.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3005t-2.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 18:00:09"},
  {id: 702, name: "GEORGETOWN Formal Dining Table", number: nil, price: nil, description: "Six matching chairs have padded seats and harp shaped backs add elegance to your dining room. Intricate carvings adorn the double pedestal base, chair backs and table apron. Finished in a warm cherry. The matching server has the same beautiful carvings, ample storage and a built-in wine rack.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3222t.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:03:27"},
  {id: 619, name: "Julia Dining Table", number: nil, price: nil, description: "Define your living room with this transitional style dining set. Light oak finishes warm the set, creating an inviting ambiance with rustic undertones. Angled legs and the central support beam add character and support to the table while a handy leaf ensures spacious room. Chairs are exquisitely detailed with framing nailhead trim and soft curves along the arched backs. Keep dinnerware and spirits handy with the server that features unique x-cross cabinets, a dedicated wine rack and stemware glass holders. Timeless and functional, this dining set will keep your home organized, cozy and comfortable.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3014t-1-z.jpg", created_at: "2018-01-16 05:02:07", updated_at: "2018-01-29 18:06:25"},
  {id: 801, name: "Bobbi Bed", number: nil, price: nil, description: "Simple yet fun, this contemporary style youth bed collection will grow with your child. The bright white finish is paired with a colorful trim and matching round knobs for an adorably charming look kids dream of having. With multiple drawers and open shelving, the matching case goods will provide all the storage your little one will need and more!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7852bl-t.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:14:57"},
  {id: 721, name: "Redding I Dining Table", number: nil, price: nil, description: "A beautiful cracked glass insert at the center of the table top is the centerpiece of this unique dining set. An open shelf underneath and angled legs add more flair to an already remarkable design. It seats four comfortably and is also available in counter height.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm3026t_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:17:35"},
  {id: 853, name: "IsabellaCaptainTwin Bed", number: nil, price: nil, description: "Curved headboard and footboard in bright white with flowers painted and a delicate heart design, this girls bedroom set has an optional trundle or storage drawers. Matching chest, dresser and night stand have the same floral accents that bring about such delicate beauty.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm7619_1.jpg", created_at: "2018-01-16 05:02:08", updated_at: "2018-01-29 18:19:35"},
  {id: 891, name: "Annette Bunk Bed", number: nil, price: nil, description: "With a simple and sleek design that leaves plenty of room for fun, this transitional bunk bed is exactly what your children need! The built-in wood ladder provides safe and sturdy access to the top bunk that the slat-like guardrail helps make even more secure. Complete with sturdy panel headboards and footboards, this minimalistic design helps conserve space so your kids can maximize their play space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk619t-gy-1-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:24:46"},
  {id: 954, name: "Rainbow Bunk Bed", number: nil, price: nil, description: "There is a spectrum of choices for colors and styles in the RAINBOW COLLECTION. The Rainbow Collection is a series of metal bunk beds that come in multiple bed size combinations and six color options. Styles include a twin/twin, twin/full, and a twin/futon base combo, and each style comes in six colors. Common features include full metal construction with non-recycled heavy gauge tubing, and a focus on safety with improved rail reinforcements.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk1034-ag.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:33:43"},
  {id: 994, name: "Coney Island Bunk Bed", number: nil, price: nil, description: "Picket French headboard, footboard and sturdy square legs are design features of this twin over twin bunk bed. This bunk is perfect for guests or sleepovers. Finished in three colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm-bk524ch.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:34:50"},
  {id: 1000, name: "Manuela Sofa", number: nil, price: nil, description: "Impress your guests with the traditional stylings of this sofa set, which exudes a sense of class and elegance. Tailored with exquisitely refined details, this design provides a sense of grandeur to your luxurious home. Upholstered in a lavishly sleek flannelette fabric and adorned with button tufted cushions, this piece will help you melt against its comfy seats. Complete with matching accent pillows, this stylish sofa set is the key to filling your traditional home with comfortable elements to impress your guests.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6145bk-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:43:18"},
  {id: 1009, name: "Benigno Sofa", number: nil, price: nil, description: "Surround yourself in elegance as you relax against the various upholsteries of this gorgeous sofa collection. Available in four colors, this sophisticated set will be a sure topic of conversation when guests come over. Nailhead trim decorates the leatherette panels while linen-like upholstery wraps the flared exterior. Reversible seat cushions and back pillows allow you to customize your home area to perfection.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6412-sf-1.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:46:41"},
  {id: 1042, name: "Chantal Sofa", number: nil, price: nil, description: "Let your living room make a powerful opening statement with this chic and comfy set! The high, flaring armrests wrap around both sides, gently cradling the lengthy seat cushion between. A series of varied patterned accent pillows accompany each of these pieces, offering customizable comfort and adding plenty of style to the design. Available in multiple colors, these pieces will make an inviting impression right from the start.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2663-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:47:52"},
  {id: 1050, name: "Beltran Sofa", number: nil, price: nil, description: "This contemporary style sofa set features clean lines with classic silhouettes to fit a number of dcor styles. The luxurious chenille upholstery conforms to the body and provides a plush seating experience as multi-colored pillows catch the attention of friends and family. The track arms feature a sloping arched design for a stylish collection that will keep the whole family happy.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm3058-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:48:24"},
  {id: 1059, name: "Glynis Sofa", number: nil, price: nil, description: "Velvet is making a comeback and its here to stay! Upholstered in soft velvet, this sofa set features contemporary designs combined with old-fashioned elements. The deep seats feature plush cushions filled with Dacron-wrapped foam and sinuous wire springs, all to provide optimal comfort. Gently sloped armrests add dimension without breaking a sweat with the durable hardwood supporting the entire frame. Matching accent pillows give a unique flair to a beautifully tailored set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm1275-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:08"},
  {id: 1060, name: "Jaya Sofa", number: nil, price: nil, description: "Prominently display this comfy sofa in your living room to easily guide the conversation over to these contemporary seats. The conspicuous welt trim adds sleek contrast to the faux nubuck upholstery and highlights the plush armrests and seat cushions. Strike up a conversation and keep it going long into the night so you can relax against the comfortable cushions for as long as possible.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6503lb-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:11"},
  {id: 1021, name: "Manuela Sofa", number: nil, price: nil, description: "Impress your guests with the traditional stylings of this sofa set, which exudes a sense of class and elegance. Tailored with exquisitely refined details, this design provides a sense of grandeur to your luxurious home. Upholstered in a lavishly sleek flannelette fabric and adorned with button tufted cushions, this piece will help you melt against its comfy seats. Complete with matching accent pillows, this stylish sofa set is the key to filling your traditional home with comfortable elements to impress your guests.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6145bk-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:49"},
  {id: 1023, name: "Monika Sofa", number: nil, price: nil, description: "Contemporary and chic, this sophisticated sofa set features a leather gel upholstery and stainless steel trim. The modern approach offers a contrasting stainless steel trim against the majestically dark leather gel to offer a unique touch of eclectic details. Impress your guests with this modern day sofa set and lounge out with class and style. Available in 2 colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6423gy-sf-z.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:50:56"},
  {id: 1039, name: "Ester Sofa", number: nil, price: nil, description: "A unique tufted design along the backrest creates a stylish pattern that enhances the visual appeal without detracting from the comfortable upholstery and its spacious arm structures. Each piece rests atop rounded tapering legs for sturdy support and includes a pair of rolled pillows for added comfort and style.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6852-sf.jpg", created_at: "2018-01-16 05:02:09", updated_at: "2018-01-29 18:52:39"},
  {id: 1088, name: "Justine Sofa", number: nil, price: nil, description: "Fill your living space with style and comfort with this reclining sofa set. Luxurious brown top leather match upholstery features plush pillow top head and arm rests for ultimate comfort. The reclining capability will allow the perfect position for browsing channels, surfing the web or hitting the snooze.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6784-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:09"},
  {id: 1097, name: "Livvy Sofa", number: nil, price: nil, description: "Modern design takes on a casual feel with this attractive sofa set. Sleek box cushions boast soft fabric upholstery and a tufted design for a clean, refined look that fits any sophisticated space. The angled peg legs are the main feature of this sofa set, providing a clear mid-century vibe that takes it to the next level.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6800-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:53:52"},
  {id: 1101, name: "Carin Sofa", number: nil, price: nil, description: "Enhance your living room's contemporary appeal with this chic sofa set! Entirely upholstered in padded linen-like fabric, each piece features angled feet and armrests. Lean back against the button tufted backrest and let your worries drift away as you relax against the stylish foam-filled cushions. Available in two neutral colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6134gy-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:54:08"},
  {id: 1069, name: "Janie Sofa", number: nil, price: nil, description: "Enhance your living room decor with retro styles and chic designs. The simplified structure of this sofa is supported on long mid-century modern inspired legs that create an elevated and throwback appeal. High density foam cushions provide a plush and comfortable seating area for your guests, allowing this one-of-a-kind design to take center stage!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6977bk-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:55:35"},
  {id: 1073, name: "Haskell Sofa", number: nil, price: nil, description: "A clean slate to pair with the living room of your dreams, this simplistic sofa set is the perfect addition to start anew. The beige upholstery blends into any setting and offers printed accent pillows for added visual appeal. Nailhead trim outlines the clean structure as T-cushions and track arms both feature welt trim that enhances the minimalist appeal.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6303-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:02"},
  {id: 1086, name: "Negrini Sofa", number: nil, price: nil, description: "Although an unconventional choice of color for a living room, black still brings about a superior level of class and refinement to a home. This bold and ornate set features oversized rolled arms, complete with deep button tufting and nailhead trim. Beautiful silver throw pillows pop against the solid black backdrop to create a highly provocative space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2295-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:56:56"},
  {id: 1137, name: "Bloomington Motion Sofa", number: nil, price: nil, description: "This handsome flannelette sofa set possesses comfort and convenience with its easy reclining function. Prop up your feet and recline into relaxation after a long hard day of work, or spend some quality time watching a movie with your loved ones on these cushioned pieces. Available in 2 color options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6129gy-sf-pm.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:57:36"},
  {id: 1146, name: "Macroom Sofa", number: nil, price: nil, description: "Keep your living space neutral and neat with this upholstered sofa collection. The warm gray creates a simple backdrop for the bright back pillows and wraps tightly around the no-fuss structure. A modest design for the easy going household, this set will be a staple for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm3055-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 18:58:21"},
  {id: 1172, name: "Antoinette Sofa", number: nil, price: nil, description: "Leave a lasting impression to visitors of your home with this timeless reimagining of the chesterfield sofa. Cues from the classic design are kept with essential changes to bring it to the modern day.  The reverse camelback seat and arms are deeply tufted with acrylic buttons, and velvet fabric is used for maximum comfort. Matching pillows with intricate pattern are included, for an even more upscale look that will sure impress guests and keep them talking.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2224-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:06:45"},
  {id: 1177, name: "Viviana Love Seat", number: nil, price: nil, description: "The essence of the classic chesterfield lives on in this beautiful sofa and love seat set. It features the same classic deep tufting, the nailhead trim, and rolled arms. The unique updated silhouette, however, brings it to the modern times. Contrasting, dark pillows pop on top of the gray fabric that's soft to the touch.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm2291-lv.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:07:16"},
  {id: 1304, name: "Clare Sofa", number: nil, price: nil, description: "Versatile and multifunctional, this sofa set offers multiple arrangement options to personalize your living space. The handy ottoman can be integrated into a long sofa or doubles as a comfortable chaise while every seat offers plush cushioning for your comfort. Charming button tufts along the backs add unique style as the soft brown linen creates a warm and inviting atmosphere. End table included.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6862.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:15:20"},
  {id: 1318, name: "Dayna Sectional", number: nil, price: nil, description: "Kick back and relax after a long day on this elegant sectional. Upholstered in gray faux leather and supported on tapered chrome finished legs, this L-shaped sectional will be the focal point of your living room. This versatile seating piece features a pull-out bed that will prove convenient for overnight guests while a storage compartment within the chaise tucks away any spare bed sheets or accessories. Paired with two matching accent pillows and adjustable headrests, this multifunctional sectional will be the perfect addition to your home!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6292.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:17:26"},
  {id: 1319, name: "Glenda II Sectional", number: nil, price: nil, description: "Enjoy the cozy and inviting ambiance that this contemporary piece brings into your living room! The L-shaped sectional offers plenty of seats for everyone to stretch out while the button tufted cushions provide relaxing lumbar support. A sophisticated welt trim adds contrast to each of the color options and helps accentuate the sloping track arms for a stunning visual effect that will give your living room a modern vibe.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6851bk.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:17:35"},
  {id: 1320, name: "Estee Sectional", number: nil, price: nil, description: "With this beautiful tufted sectional, you wont have to compromise style for comfort. The warm gray finish creates a cozy and inviting ambience while maintaining a retro flair. Its tufted backrest and tapered wooden legs are the perfect addition to the minimalistic structure. Taking inspiration from the 70s and incorporating modern influences, this sectional is a trendy design that showcases the best of two different styles together.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6144.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:17:41"},
  {id: 1117, name: "Ronan Sofa", number: nil, price: nil, description: "Warm up the living room with this dark brown recliner set. The functional structures are beautifully upholstered in smooth leatherette, emphasizing the plush foam padding within. Spring coil cushions properly support and retain the cushion design, ensuring years of relaxation.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6331-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:21:40"},
  {id: 1125, name: "Turton Sofa", number: nil, price: nil, description: "Fill your home with warm and inviting pieces starting with this cozy sofa set. Boasting sleek top grain leather match upholstery, this collection provides durable and comforting seating for hours of enjoyment. Rolled arms come adorned with nailhead trim, which stylishly pop against the brown coloring.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6191-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:22:17"},
  {id: 1132, name: "Cornelia Sofa", number: nil, price: nil, description: "Add a statement to your home with this fashion-forward sofa collection. A perfect example of fine taste and luxurious style with perfectly placed nailhead trim, multiple back pillows and sloped arms. This sofa set offers plush cushions to warm your body and decorative pillows to accent your living space, everything you could ask for to complete your chic living space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm3071-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:22:58"},
  {id: 1209, name: "Parma Sofa", number: nil, price: nil, description: "Stylish and chic, this modern sofa, love seat, and chair feature plush seating and contemporary looks. Available in black, brown, or ivory to fit your unique dcor.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6324iv-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:23:40"},
  {id: 1212, name: "BLACKSBURG Sofa", number: nil, price: nil, description: "Casual and comfortable, this three piece contemporary leatherette living group features a full sofa, love seat and chair. Finished in deep black leatherette with contrasting, white stitching, this will bring not only comfort but also style to your home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1300.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:24:00"},
  {id: 1217, name: "DUDHOPE Sofa", number: nil, price: nil, description: "Accented with copper nailheads, this matching group is a great example of an updated transitional style. The set is upholstered in bonded leather with plush cushions and copper nailhead trim. An optional matching coffee table with copper nailhead trim is also available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1506.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:24:28"},
  {id: 1231, name: "MAKRI Sofa", number: nil, price: nil, description: "These matching sofa, love seat, and chair are upholstered in durable bonded leather and are featured in red, black and gray. Chrome legs and foldable headrests make this set perfect for any contemporary living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1256.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:25:53"},
  {id: 1232, name: "Lichfield Sofa", number: nil, price: nil, description: "A great looking addition to any home, this casual living room group features a sofa with built-in recliners and a love seat with two glider recliners and built-in console. A glider recliner is available, also upholstered in bonded leather match.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6819-s.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:25:57"},
  {id: 1186, name: "HAZLET Sofa", number: nil, price: nil, description: "Tired of the common microfiber or leatherette sofas? Looking for something that feels different? Try this unique seating group, fully upholstered in chenille fabric with a two-tone color palette. The seat is brown with stripes, while the base is dark brown. It has plush cushions and built-in recliners on the sofa and love seats. A stand-alone recliner chair is available to complete this unique set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1438.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:26:52"},
  {id: 1199, name: "VOLOS Sofa", number: nil, price: nil, description: "This set has unique features, such as the seat cushions tucked under the  rolled arms, curved chrome legs, and double-stitching on top. Available in red, white and espresso, this seating group will add modern style to any home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1380.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:28:33"},
  {id: 1258, name: "MAKRI Sofa", number: nil, price: nil, description: "These matching sofa, love seat, and chair are upholstered in durable bonded leather and are featured in red, black and gray. Chrome legs and foldable headrests make this set perfect for any contemporary living room.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1252.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:29:58"},
  {id: 1259, name: "NEW SARUM Sofa", number: nil, price: nil, description: "Inspired by modern design elements, this plush sofa, love seat, and chair are the epitome of urban chic. Soft flannelette fabric has a pleasant texture, while the matching pillows bring contrast to make this set a beautiful addition to any modern home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6019-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:30:03"},
  {id: 1268, name: "Nellie Sectional w/ Pull Out Sleeper", number: nil, price: nil, description: "Enhance your decor with gorgeous contemporary flair by displaying this multifunctional sectional front and\r\ncenter in your home! Keep linens and other items in the convenient storage compartment inside the ottoman\r\nfor when guests come to stay the night, easily pushing the two pieces together to create a comfy bed!\r\nPerfect for your guest room or family room, this piece is easy on the eyes while also helping conserve space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6517-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:35:42"},
  {id: 1278, name: "Nena Sectional", number: nil, price: nil, description: "No need to find a good excuse to enjoy this stylish living room reclinerall of your guests will want to spend as much time as possible relaxing against its top grain leather match surface! The plush foam beneath the upholstery adds plenty of comfort that is enhanced by the thick pillow-top armrests. Make the day even better by flipping up the footstool with the manual recline lever. Featuring prominent stitched details, this recliner brings a visually appealing presence to your living room!", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6439-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:38:30"},
  {id: 1279, name: "Marian Sectional", number: nil, price: nil, description: "Give yourself the gift of comfort with the soft linen-like fabric and comforting foam cushions that cover this spacious sectional. Its modular design gives this piece complete versatility, changing shape to accommodate a wide variety of living spaces. Sloped arms add angular intrigue and frame the sofa for a focused aesthetic. With plenty of accent pillows and sleek block legs to complement, this grey sectional will add a cool touch to keep you comfortably relaxed.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6369-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:38:46"},
  {id: 1253, name: "DUDHOPE Sofa", number: nil, price: nil, description: "Accented with copper nailheads, this matching group is a great example of an updated transitional style. The set is upholstered in bonded leather with plush cushions and copper nailhead trim. An optional matching coffee table with copper nailhead trim is also available.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1506.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:40:58"},
  {id: 1254, name: "Rhodes Sofa", number: nil, price: nil, description: "For the contemporary home, the straight lines, rectangular design, and neutral tones of this set is a perfect match. Chrome legs and oversized arms add to its character.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6605-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:41:03"},
  {id: 1255, name: "Newburg Motion Sofa", number: nil, price: nil, description: "Intricate detailed white stitching that perfectly shows off the posh leatherette cushions. This piece offers increased seating comfort with spacious arm rests, recline, and available in two colors.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6814rd-sf.jpg", created_at: "2018-01-16 05:02:10", updated_at: "2018-01-29 19:41:09"},
  {id: 1330, name: "Ruth Sectional", number: nil, price: nil, description: "You'll absolutely love the versatility of this reclining sectional set. Aside from the superior comfort and relaxation this set provides, its customizable design easily conforms to fit your home decorating needs. Choose to display this set as an L-shaped sectional with the corner seat add-on or as a more traditional sofa and love seat combo. Added functionality comes in the form of the loveseat duo, which comes equipped with a lift-top storage unit and built-in cup holders.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6783br-cnr.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:41:33"},
  {id: 1331, name: "Maybell Sectional w/ 2 Consoles, Mocha", number: nil, price: nil, description: "Host fun movie nights or crazy game day parties with the ultimate sofa set. With reclining capabilities, cup holders, storage compartments and plush chenille upholstery, you and your guests will not want to get up from your seats! The neutral fabric options are the perfect backdrop that will both blend in and enhance the beauty that fills a living space.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6773mc.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:41:49"},
  {id: 1333, name: "Hagen Sectional, Navy", number: nil, price: nil, description: "How lovely would it be to come home each day to this inviting sectional? Tightly stitched in soft flannelette upholstery, this sofa is padded to perfection! Whether you choose to kick off your shoes and stretch your tired body across the chaise or snuggle up against the track armrest, grab a pillow and get comfortable because this sectional was made for your enjoyment.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6799nv.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:43:10"},
  {id: 1334, name: "Jensen Sectional", number: nil, price: nil, description: "This sofa set showcases everything you look for in a living room collection. Separate the ottoman from the sectional to offer a spacious and comfortable seating arrangement for entertaining guests. Push the ottoman inwards to create a comfortable bed to stretch out on. Supported atop sturdy tapering wood legs, this sofa set will provide plenty of versatile comfort for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6790.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:43:15"},
  {id: 1335, name: "Hardy Sectional w/ Console", number: nil, price: nil, description: "Bask in the alluring comfort of this corner sectional and feel the day's troubles and worries drift away. Flip up the footstools and recline to find the perfect position for relaxation, or stretch out on the leatherette upholstered chaise for a quick catnap. The convenient center console features a dual cup holder and storage compartment to help store everything you need to make your living room your sanctuary.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6781br.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:43:28"},
  {id: 1336, name: "Stanford II Sectional", number: nil, price: nil, description: "Kick it up a notch in your living space with this stunning sectional set. Lay upon the plush cushions, rest your feet upon the lovely square ottoman and feel the stress of the day melt away. From the gorgeous nailhead trim to lavish rolled arms, this set will take you into a world of comfort and luxury that is all your own.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6270iv.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:43:33"},
  {id: 1346, name: "Peever II Sectional", number: nil, price: nil, description: "Add some modern charm to your home with this flannelette living room sectional. The tufted cushions provide visual interest while the slightly angled back and armrests offer the best setting for long movies or gatherings. Available in 3 color options.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6368nv.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:45:44"},
  {id: 1351, name: "Hetland Sectional", number: nil, price: nil, description: "Add a contemporary touch to your home with this sleek L-shaped sectional. The multitude of loose back pillows with alternating colors create a wonderful dimensional appearance and provide cushioned comfort for hours of fun, relaxation and leisure. Chic gray fabric, complemented by angled chrome legs, adds a neutral effect that will fit well with any household.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm6201.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:46:29"},
  {id: 1352, name: "Pennington Sectional", number: nil, price: nil, description: "Anticipate coming home to the comfort of this piece. Accompanied with several plush accent pillows, this sectional offers the perfect environment to relax and unwind. The simple and straight forward L-shaped structure fits well into any household and two color options ensure a easy fit with any existing decor.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/s/m/sm1111.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:46:34"},
  {id: 1291, name: "Joelle Sectional", number: nil, price: nil, description: "Showcasing a singularly simple elegance, this sectional highlights the best of transitional design! With a stylish skirt running around the entire frame and a minimalistic look, this sleek piece will charm everyone with its chic appearance. Charming and quaint, this piece will complete your living space and give your home an inviting sense of coziness.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6206-4.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:54:39"},
  {id: 1292, name: "Eilidh Sectional", number: nil, price: nil, description: "Define your home with this fashion forward sectional. Chrome legs glisten against the sleek black leatherette, adding a sophisticated touch and glamorous polish to the spacious sectional. Plush cushions and coil springs deliver undeniable comfort and lasting support to keep you comfortably relaxed. Lounge out on the chaise or cozy up on oversize armrests as stresses seem to slip away. Refine and distinctively distinguish with this stunning leatherette sectional.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6422bk-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:54:46"},
  {id: 1302, name: "Norma Sectional w/ Ottoman", number: nil, price: nil, description: "Comfort is top priority with this chenille fabric sectional. Dense foam filled cushions hug every part of the linear stitched design while built-in functionality makes this piece timeless. Lifting the soft rounded ottoman reveals plenty of storage while easy pull tabs convert the sectional into a comforting sleeper. Simplify your changing needs with the ease of comfort of the sectional sofa set.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6440-1-z.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:56:12"},
  {id: 1377, name: "BOURDET II Sectional", number: nil, price: nil, description: "Suitable for any contemporary home, this gray sectional made of bonded leather match will liven up any living room, literally. Blast your favorite tunes from the optional center console speakers, and adjust the pneumatic gas lift headrests to your liking.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1208.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 19:56:59"},
  {id: 1397, name: "KEMI Sectional", number: nil, price: nil, description: "Add flair to any modern living area with this contemporary sectional. Upholstered in bonded leather match with adjustable headrests, it is available in black or white. Two add-ons are offered: a center console with bluetooth speakers for entertainment in the living room, or a center console with extra storage capacity.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1234.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:00:28"},
  {id: 1360, name: "Skyler Sectional", number: nil, price: nil, description: "Enjoy the cozy feel of this lavish sectional with its warm and inviting design. The padded chenille fabric brightens any room with its ivory coloring and comes paired with gorgeous accent pillows. Rolled arms and plush backrest pillows work together to provide superior comfort for years to come.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6156-small.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:05:10"},
  {id: 1426, name: "Peever Sectional", number: nil, price: nil, description: "Whether having friends over to watch a movie or lounging around after work, this corner sofa will be a great addition to your living room. Upholstered in leatherette, there are four color options to choose from to match any home.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/c/m/cm6268bk.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:09:24"},
  {id: 1427, name: "AVON Sectional", number: nil, price: nil, description: "Perfect for a small apartment or dorm room, this sturdy sofa with chrome legs is available with a comfortable ottoman, which may convert into a chaise. Upholstered in either dark brown or black leatherette.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1696.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:09:56"},
  {id: 1442, name: "Darby Collection ", number: "8507BE", price: nil, description: "Creating a look that meets your needs for relaxation and entertaining is the Darby Collection. Covered in neutral fabric, this versatile sofa offers a clean contemporary look for your modern home. Weighted wedge seatbacks, along with coordinating toss pillows -\u0080\u0093 featured in a primary color chevron pattern- can be configured to offer not only support, but provide customized seating as well. Configurations can include, but are not limited to: sofa, chaise or twin bed. Let your imagination runs wild with the Darby Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8507BE_2014S-71.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8507BE_2014S-71.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:14:11"},
  {id: 1423, name: "KEMI Sectional", number: nil, price: nil, description: "Add flair to any modern living area with this contemporary sectional. Upholstered in bonded leather match with adjustable headrests, it is available in black or white. Two add-ons are offered: a center console with bluetooth speakers for entertainment in the living room, or a center console with extra storage capacity.", brand: "Furniture of America", dimensions: nil, images: nil, thumbnail: "https://www.foagroup.com/media/catalog/product/cache/1/image/040ec09b1e35df139433887a97daa66f/i/m/image_1232.jpg", created_at: "2018-01-16 05:02:11", updated_at: "2018-01-29 20:19:32"},
  {id: 1473, name: "Lyric Collection ", number: "1737NC-1", price: nil, description: "Taking the expected design elements of hard contemporary and putting a decidedly feminine curve into the mix makes the Lyric Collection a unique addition to your new bedroom design. With each curve comes a new twist -\u0080\u0093 satin nickel hardware accents the glossy white or dark espresso finish, bow-front case pieces feature ball bearing drawer glides and compliment the padded sleigh headboard & footboard, while a round, contemporary mirror reflects the modern designs that you have selected. A final unique addition to the collection is the glass-topped night stand that furthers the contemporary feel.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1737NC-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1737NC-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:20:15"},
  {id: 1480, name: "Morelle Collection ", number: "1356TBK-1", price: nil, description: "The warmth of cottage living is invoked by the classic styling of the adult and youth Morelle Collection. The low post bed features picture framing and round finials with the case pieces featuring molded drawer fronts and knob hardware. The newly offered cherry finish offers an additional option to the classic black and white finishes that are currently available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1356TBK-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1356TBK-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:22:04"},
  {id: 1481, name: "Mayville Collection ", number: "2147-12", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147-12.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:22:35"},
  {id: 1492, name: "Pecos Collection ", number: "8480GRY-3", price: nil, description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors  gray, red and dark brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480GRY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8480GRY.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:24:27"},
  {id: 1451, name: "Abbeville Collection ", number: "1856-1", price: nil, description: "The ever popular Louis Philippe style is updated with functional accoutrements in the Abbeville Collection. Button and bale hardware grace the drawer fronts of each piece in the collection, while unbeknownst to the casual observer, there is hidden drawer storage on the nightstand, dresser and chest  each easily accessible with a pull of the front top frame. The sleigh bed furthers the timeless look of this adult collection, as well as youth. Okume veneers are elegantly highlighted with a traditional brown cherry finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1856-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1856-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:25:57"},
  {id: 1460, name: "Barrington Collection ", number: "8378BLK-L", price: nil, description: "Soft Contemporary styling lends a cool, classic look to your modern living space in the Barrington Collection. Stitch tufting provides soft contrast to the cleanly designed lines of this seating arrangement. The attached chaise lounge and accompanying ottoman provide the opportunity for putting your feet up while you enjoy your downtime. The seating group is offered in gray, black and brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8378BLK-L -R -4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8378BLK-L -R -4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:21"},
  {id: 1465, name: "Galen Collection ", number: "B2053SBW-1", price: nil, description: "Providing flexible options to fit any size bedroom is the Galen Collection. This transitional bedroom group is featured in a white finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2053SBW-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2053SBW-1.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:27:51"},
  {id: 1521, name: "Mattawa Collection ", number: "5518-78", price: nil, description: "Rustic industrial styling heavily influences the design of the Mattawa Collection. Metal banded rivet accenting provides visual contrast to the chairs, table and server of this casual dining collection. The brown finish has hints of gray undertone lending to the rustic look. Accompanying the collection is the server, featuring drawers and behind door storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5518-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5518-78.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:28:49"},
  {id: 1547, name: "Orpheus Collection ", number: "5515GY", price: nil, description: "In keeping with the spirit of the need for versatility within the more modest of dining spaces, the Orpheus Collection provides function and style making it the perfect addition to your home. Mid-century modern design is immediately discernable as you take in the collection's profile. Stacking chairs allow for quick and compact storage, while the natural pine finish of the legs and gray finish of the table top, chair backs and seats lend to the contemporary styling.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5515GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5515GY.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:36:43"},
  {id: 1529, name: "Bonaventure Park Collection ", number: "1935-110", price: nil, description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered pilasters frame the serpentine fronted china and server, while egg and dart molding, acanthus leaf motif and bale, and button hardware lend to the traditional look of all pieces. Burl inlay creates beautiful contrast to the gold-highlighted cherry finish of the collection. Two table options provide flexibility for placement in your dining space  the first, a 110-inch double pedestal base rectangular top table, the second, a 76-inch oval top single pedestal base table. Button-tufted traditional tweed fabric features prominently on the accompanying wood-framed chairs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935-110 1935-55.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1935-110 1935-55.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:29:49"},
  {id: 1538, name: "Barrington Collection ", number: "8378GRY-L", price: nil, description: "Soft Contemporary styling lends a cool, classic look to your modern living space in the Barrington Collection. Stitch tufting provides soft contrast to the cleanly designed lines of this seating arrangement. The attached chaise lounge and accompanying ottoman provide the opportunity for putting your feet up while you enjoy your downtime. The seating group is offered in gray, black and brown bi-cast vinyl.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8378GRY-L -R -4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8378GRY-L -R -4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:30:47"},
  {id: 1556, name: "Tod Collection ", number: "5479-72", price: nil, description: "Capturing the natural beauty of a tree-\u0080\u0099s form lends a distinct look to the Tod Collection. The live edge table top features a light finish that serves to highlight the naturally occurring grain of the wood. The solid top is carried over in the design of the accompanying 60-inch bench, both supported with a distinct curved profile base. Wood-framed, brown fabric-covered chairs accompany this distinct table offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5479-72 5479S 5478-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5478-72 5479-72_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5479-72 5479S 5478-13.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:13"},
  {id: 1544, name: "Moorewood Park Collection ", number: "1704-108", price: nil, description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that feature prominently throughout the collection. Two elegant table options allow for perfect placement within your dining room  the first, a 108-inch rectangular top leg table and the second, a round 60-inch fixed-top table. Flanking the two table options are the subtly ornate dining chairs with their prominent medallion backs and decorative neutral tone seats. The china features canted curved pilasters and legs that enhance the profile of the collection while button and bale, along with knob, hardware featured in an antiqued bronze finish lend subtle contrast. Behind glass display storage along with the doors and drawers of the supporting buffet provides ample storage space for your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-108.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1704-108.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:31:27"},
  {id: 1502, name: "Emilio Collection ", number: "8367CH-3", price: nil, description: "Subtle texture lends visual and tactile interest in the Emilio Collection. The set-up process allows you to configure the three-seat unit to accommodate the chaise on either the left or right side, providing for perfect placement within your living space. The accompanying ottoman can be an added comfort to put feet up when relaxing. The collection is offered in either taupe or chocolate, furthering the versatility of the sectional seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8367CH-3 8367CH-5 8367CH-4.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8367CH-3 8367CH-5 8367CH-4.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:33:32"},
  {id: 1572, name: "Chehalis Collection ", number: "35810-T60", price: nil, description: "With a design that is inspired by the traditional look of Craftsman furniture, the Chehalis Collection features slate inlay on the console front, and a brown cherry finish that enhances the oak veneers of this well-appointed entertainment offering. At sixty inches wide, the unit provides a significant platform for your television. Door storage features prominently as does the open media storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/35810-T60.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/35810-T60.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:20"},
  {id: 1577, name: "Marston Collection ", number: "2615DC-96", price: nil, description: "Refined elegance is exemplified in the design of the Marston Collection. With three available table options, there is a perfect match for your home  A double pedestal base rises to support the clipped-corner rectangular tabletop of the 96-inch table, the oval topped pedestal table, and the counter height display base table, each are each flanked by chairs that feature turned front legs and nail head accent, along with a neutral tone fabric that covers the seats and backs. In support of the collection are the functional china and server. Featuring drawer and door storage, each with oval bale pull and knob hardware, you can be assured of plentiful space in which to stow or display your tabletop dcor. The server also features a black melamine laminated top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2615DC_96.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2615DC_96.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:35:29"},
  {id: 1587, name: "Clarice Collection ", number: "2447", price: nil, description: "The ultra contemporary design of the Clarice Collection will be at home in your modern dining room. Channel stitched, white PVC chairs tuck beneath the glossy white table top. Both chairs and table are supported by sleek chrome framing that completes the look of this stylish dining group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2447.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2447.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:36:01"},
  {id: 1768, name: "Barlowe Collection ", number: "1193F3S", price: nil, description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the french note fabric offerings. New fabric options include: blue, grey, dark teal, chain link print, and paisley print.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F3S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1193F3S.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:25"},
  {id: 1548, name: "Jemez Collection ", number: "5470-72", price: nil, description: "Designed for your casual dining space is the Jemez Collection. The substantial V-profile of the table base rises to support the faux marble top in this transitionally styled dining group. Brown fabric upholstered seats feature nail head accent and provide complementing contrast to the weathered wood finish of the chair legs and table base.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72 5470-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72 5466-62_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5470-72.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:36:45"},
  {id: 1554, name: "Angstrom Collection", number: "5429-36RD", price: nil, description: "Following the trend of modern industrial inspired design is the Angstrom Collection. Metal framing provides support to the two distinctly shaped burnished wood table tops  one a rectangular table with built-in wine rack, the other an adjustable round counter-to-pub height table  as well as the accompanying stools. Turning the seats allows for quick adjustment to counter or pub height, while the option for a traditional back stool or a no-back stool allows for your personal preference to reign in designing your space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36RD 5429-24ST a.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36RD 5429-24 a.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5429-36RD 5429-24ST a.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-29 20:38:09"},
  {id: 1846, name: "Suisun Collection ", number: "3605-31", price: nil, description: "Subtle convex dark metal framing provides support to the glass table tops of the Suisun Collection. Matching end tables accompany the cocktail table of this modern 3-piece occasional table group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3605-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3605-31.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:52"},
  {id: 1619, name: "Bethel Collection ", number: "2259GY-1", price: nil, description: "An updated classic addition to your transitional bedroom will be the Bethel Collection. Traditional accents, such as, turned bun feet that support each piece, and a gray, lightly wire-brushed finish on birch veneer and selected hardwoods, blend with framing and lines that compliment your personal style. Hidden drawer storages in the night stand and dresser are a clever way to hide your valuables.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2259GY-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2259GY-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:39:39"},
  {id: 1621, name: "Griffin Collection ", number: "2425-36", price: nil, description: "The transitional design of the five-piece Griffin Collection allows for versatile placement in a number of casual dining settings. The wide ladder back chairs feature black bi-cast vinyl seating that compliments the heavily burnished finish of this 40 fixed-top counter height table.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2425-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2425-36.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:39:46"},
  {id: 1625, name: "Lordsburg Collection ", number: "5473-103", price: nil, description: "Elegantly designed for the traditional dining room is the Lordsburg Collection. Supported by the double pedestal base is the tables top where the magnificent parquet veneer is highlighted by the brown cherry finish that covers the collection. Heavily carved molding provides distinct accent to the tables top while dark brown faux leather covers the seats and backs of the coordinating wood-framed chairs. The accompanying hutch and buffet provide ample storage space for your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5473-103.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5473-103_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5473-103.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:04"},
  {id: 1633, name: "Frederica Collection ", number: "1949-1", price: nil, description: "At home in the most traditional of spaces, the Frederica Collection will provide the classic look you are seeking to add to your bedroom. The low-post bed of the group is complemented by the traditionally accented case goods. Classic bale and knob hardware front each drawer while bun feet support. A dark, burnished cherry finish furthers the traditional look of the Frederica Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1949-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1949-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:40:41"},
  {id: 1640, name: "Lavonia Collection ", number: "1707-1", price: nil, description: "Transitional styling is paired with classic appointments and modern technology to create the Lavonia Collection. The eye-catching dramatic curve of the headboard creates instant appeal when taking in the design of this collection. The framing of the headboard carries over to the design of the low profile footboard and turned-foot supported recessed drawer front case pieces. Modern technology comes into play with the power strip  with USB port  charging station that is mounted to the upper back of the nightstand. A gray wire-brushed finish over oak veneers furthers the classic look of this bedroom collection.\r\n", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1707-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1707-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:41:16"},
  {id: 1597, name: "Cicero Collection ", number: "5235-54", price: nil, description: "In todays modern home, one looks to enhance every room with clean lines and unique design. The Cicero Collection adds those elements to your casual dining space. The square table top is quartered by parquet oak veneers and is supported by a substantial, square pedestal base which has been notched to look like stacked blocks. The modern chair features framed chair backs with baseball stitching designed to mimic the parquet veneer of the table top. The back and seat are generously upholstered in dark brown bi-cast vinyl which perfectly compliments the black finish of this modern casual dining group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5235-54.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5235-54.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:38"},
  {id: 1598, name: "Ohana Collection ", number: "1393BK-36", price: nil, description: "The design of Ohana Collection captures the essence of a casual country home. Its antique white and warm cherry, or antique black and warm cherry finishes give it a striking two-toned apprearance. The solid wood table top and unique chair back supported by turned legs complement Ohana Collection with a touch of elegance. This group is further accented by the curio which features two sliding glass doors. Its a warm look youll love having in your home", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1393BK-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1393BK-36.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:42:40"},
  {id: 1606, name: "Chambord Collection ", number: "1828-92", price: nil, description: "Modern elegance takes form in the Chambord Collection. Immediately catching your eye is the striking champagne gold finish, an opulent mix of silver and gold hues, elegantly accented by the faux silk fabric and gold brushed hardware that is featured on select pieces of the collection. The serpentine-fronted table, china and server are adorned with canted pilasters featuring overlay fretwork, scalloped bases and a delicately splayed cabriole leg. Further lending to the lavish look of the collection is the faux silk back and seat of the coordinating chair. The server features drawer and door storage as well as an elegant quatrefoil hanging mirror. Completing the look of the collection is the graceful china. With mirrored backing, light feature, glass display shelving and drawer storage, your dining room will be the talk of the dinner party.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1828-92.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1828-92.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:43:09"},
  {id: 1667, name: "Townsford Collection ", number: "2124-1", price: nil, description: "The best of traditional style has been carefully assembled to create your ultimate bedroom suite. The Townsford Collection features unique turnings on the headboard and footboard posts with classic scalloped framing rounding out the bed design. Antiqued pewter hardware accents each case piece as does the bun feet that provide support. The rich dark cherry finish on cherry veneer further compliments this elegantly understated offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2124-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2124-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:45:02"},
  {id: 1675, name: "Marceau Collection ", number: "8224DG-3", price: nil, description: "Modern traditional styling makes for a lovely addition to your living room in the Marceau Collection. Flared arms meet the straight back to create a clean profile that is accented with high polish double nailhead. The front base rail features a single accent line of nailhead for an additional decorative touch. Button tufting lends to the tailored look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8224DG.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8224DG.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:46:46"},
  {id: 1685, name: "Chilton Collection ", number: "5531-112", price: nil, description: "Old world European Grandeur is exemplified in the design of the Chilton Collection. Traditional decorative elements come into play throughout the entire collection  egg & dart molding, acanthus leaf carving, floral medallions, bead molding  creating a look that will lend opulent styling to your classic dining room. Shield back dining chairs feature a neutral tone upholstered seat and are supported by intricately carved legs. A double pedestal base supports the 112-inch table top. Lending additional function to the collection is the china, with its impressive stature, featuring behind glass display storages as well as drawer and behind wood door storage. The traditional cherry finish features elegant gold tipping synonymous with the classic styling of this opulent dining collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5531-112.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5531-112.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:23"},
  {id: 1686, name: "Thibodaux Collection ", number: "8233TT-3", price: nil, description: "Classically styled for the most traditional of homes, the Thibodaux Collection will complete the vision you have for your elegant living room. Offered in two coverings  Brown fabric with bi-cast vinyl accent or a neutral toned acanthus print fabric  the collection combines these covers with a dramatic show wood frame that features carvings and scrolled arms. Contrast toss pillows complete the look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8233TT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8233TT.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:29"},
  {id: 1643, name: "Deryn Collection ", number: "8327GY-1S", price: nil, description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Offered as a stand-alone accent to complement your home's dcor or as part of the full Deryn Collection, the chair is featured in a modern grey or teal herringbone pattern. Natural tone finished legs support the frame while tailored stitch tufting lends further accent to this thoroughly modern collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327GY 8327GY-1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8327GY 8327GY-1S.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:47:48"},
  {id: 1646, name: "Amara Collection", number: "6409", price: nil, description: "Fun, funky and functional, the Amara Collection will provide your home with interesting conversation pieces and a look that is as unique as you are. With the turn of a crank, the adjustable table (6414) can be raised or lowered to suit your individual needs. Black iron is complimented by the bold red and white hued design of the -\u0080\u009CAtellier Loft-\u0080\u009D print that appears on the dining tabletop and carries its theme to the caster supported cocktail table (6409) -\u0080\u0093 paired with our tractor seat adjustable iron barstool (6412), you will have created the creative focal point for your dining space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/6412_high.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/6412_high.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:48:47"},
  {id: 1654, name: "Porter Collection ", number: "1852-1", price: nil, description: "With an intricate design lending to the modern look of the Porter Collection, your bedroom will reflect your taste for sophisticated contemporary living. A warm walnut finish and the look of woven detailing highlight the natural wood grain of the veneer on each piece of the collection. Knob hardware blends effortlessly to create an unobtrusive accent to the case goods. The bed features framing on the headboard and low-profile footboard that subtly incorporates the prominent woven design.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1852K-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1852K-1.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:49:31"},
  {id: 1715, name: "Pecos Collection ", number: "8480RED-2LCN", price: nil, description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors  gray, red and dark brown.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480RED_2LCN%2BCR%2BAR%2B2R 3561-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8480RED_2LCN%2BCR%2BAR%2B2R 3561-31.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:51:28"},
  {id: 1726, name: "Keamey Collection ", number: "8336", price: nil, description: "With a configuration options that allow for placement that is perfect for your contemporary home, the Keamey Collection will be a welcome addition to your spacious living room. Ample seating is covered in dark grey fabric, with light grey contrast welt, resulting in a pleasurable seating experience. Bookending this substantially sized seating group are the left or right end units that are offered as reclining chair or push back chaise. Armless chair, console unit, corner seat and armless reclining chair make up the middle part of this sectional offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8336 3292.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8336 3292.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:52:25"},
  {id: 1735, name: "Cassville Collection ", number: "8403-3", price: nil, description: "Uniquely appointed for ultimate relaxation, the Cassville Collection will provide your living room with a comfortable place to spend your downtime. Dark brown bi-cast vinyl covers the plush seating of this motion seating group. The sofa features a unique drop down back center console and dual reclining ends. The accompanying chair completes the arrangement with a reclining mechanism.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8403_all.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8403_all.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-29 20:53:02"},
  {id: 1694, name: "Reid Collection ", number: "5267RF-96", price: nil, description: "A classic look for your traditional home, the Reid Collection offers an updated country style that will be a warm and inviting addition to your dining space. A cherry finish graces the wood veneer of the group. The rectangular table is supported by substantially appointed double turned leg bases while host and hostess chairs feature nailhead accent, neutral tone fabric and turned legs. The tabletop extends to reveal a self-storing table leaf for quick and convenient placement. The accompanying china provides ample space for display, drawer and behind door storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5267RF-96 5267RF-50 5267RF-55 5267RFA.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5267RF-96 5267RF-50 5267RF-55 5267RFS.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5267RF-96 5267RF-50 5267RF-55 5267RFA.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:14:59"},
  {id: 1697, name: "Nicasio Collection ", number: "8223DB-3PW", price: nil, description: "Designed for comfort, the Nicasio Collection will provide a restful place in which to unwind. Low profile arms feature subtle stitch tufting that complements the transitional styling of the seating group. The all leather covering is available in dark brown or black providing a neutral palate from which to extend your personal decorative style. Power reclining mechanisms allow for the smooth transition from seated to prone, with the press of a button.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8223DB.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8223DB.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:16:08"},
  {id: 1705, name: "Amite Collection ", number: "8229-AC", price: nil, description: "Ultra-modern design combined with convenient function makes the Amite Collection a stylish addition to your contemporary home. Beige leather gel match is perfectly complemented by dark brown accenting on the seatbacks, seats and arms, providing contrast and definition to the profile of the collection. With the push of the power reclining mechanism, the end and armless reclining chairs recline to the prone position. The console unit features hidden storage as well as cup holders for convenient functional use. The corner center unit and stationary armless chair do not recline.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8229_LRPW%2BCN%2BAC%2BCR%2BAC%2BCN%2BRRPW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8229_LRPW%2BCN%2BAC%2BCR%2BAC%2BCN%2BRRPW.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:18:29"},
  {id: 1745, name: "Vernon Collection", number: "9603WHT", price: nil, description: "With defined angles that exemplify contemporary design, the Vernon Collection will blend effortlessly into your modern home. Metal legs support the bonded leather seating group while also enhancing the look of the collection. The headrests atop each piece add function to this already unique group. The collection is offered in black or white bonded leather.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9603WHT.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/9603WHT.jpg", created_at: "2018-01-16 05:02:13", updated_at: "2018-01-30 20:22:20"},
  {id: 1756, name: "Lucille Collection ", number: "1192GY", price: nil, description: "Retro lines need not stay in the past with the mid-century inspired lines of the Lucille Collection. With fabric offerings that range from neutral to bold such as beige, gray, blue, and orange further complemented with button-tufted accenting and stylishly appointed legs, this classic accent chair will provide a look that shows your personal style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1192GY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1192GY.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:10"},
  {id: 1758, name: "Moderne Collection ", number: "1200BLK", price: nil, description: "Drawing inspiration from the timeless look of Art Deco lounges, the Moderne Collection will add a hint of masculine aesthetic to your home's dcor. Hugging the contour of your body, the curved seat and back of the low-profile chair sits atop a swivel base allowing for 360-degree movement. The chair is covered in black or brown bi-cast vinyl with nailhead and roll-tucked back accent.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1200BLK.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1200BLK.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:23:19"},
  {id: 1773, name: "Marston Collection ", number: "2615DC-72", price: nil, description: "Refined elegance is exemplified in the design of the Marston Collection. With three available table options, there is a perfect match for your home  A double pedestal base rises to support the clipped-corner rectangular tabletop of the 96-inch table, the oval topped pedestal table, and the counter height display base table, each are each flanked by chairs that feature turned front legs and nail head accent, along with a neutral tone fabric that covers the seats and backs. In support of the collection are the functional china and server. Featuring drawer and door storage, each with oval bale pull and knob hardware, you can be assured of plentiful space in which to stow or display your tabletop dcor. The server also features a black melamine laminated top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2615DC-72 2615DC-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2615DC-72 2615DC-40.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:29:55"},
  {id: 1780, name: "Alida Collection ", number: "8555WHT-1", price: nil, description: "Serving as a perfect accent in your contemporary home is the Alida Collection. The reclining mechanism of the chair combined with the separate ottoman allows for complete extension into a relaxed position. Fitted with a convenient swivel base, the chair faces the action at all times. Cover options include black or white bonded leather match.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8555wht_2014H-94.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8555wht_2014H-94.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:30:51"},
  {id: 2029, name: "Claire Collection ", number: "470PU", price: nil, description: "Functional cocktail ottoman features seating that reverses to reveal 4 individual serving trays and 4 cleverly stored stools.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/470PU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/470PU.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:03"},
  {id: 1809, name: "Adalie Collection ", number: "4971", price: nil, description: "A classic look is offered to meet the sleep and relaxation needs of your household with the Adalie Collection. The profile of the daybed is defined by double nailhead accenting while the interior and exterior panels feature button tufting that lends to the modern traditional styling of the group. The accompanying the under-bed trundle pulls out to accommodate your additional sleep space needs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4971.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4971.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:32:23"},
  {id: 1813, name: "Tulney Collection ", number: "4966", price: nil, description: "The Tulney Collection is designed with the modern traditional home in mind. Designed to use as a bed or a cozy relaxation nook, it features a trundle that provides the extra space that you need for overnight guests. Covered in a neutral toned grey fabric, the black button-tufted back panel, and the nailhead accent along the curved arm panels complete the traditional look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4966.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4966.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:32:53"},
  {id: 1872, name: "Noura Collection", number: "H11760", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant rectangular lamp shade on black base. It offers flexible lighting solution: a floor lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11760.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11760.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:09"},
  {id: 1879, name: "Codie Collection ", number: "5544-72", price: nil, description: "The look of natural weathering is combined with the understated styling of rustic design in the Codie Collection. The look of saw marks on the distressed wood veneer lend perfectly to this trend forward style. Gray undertones play to the weathered look with brown burnishing lending distinct, yet natural contrast. Allowing for perfect placement in your home are the side chairs, with neutral tone fabric seats, and optional 50-inch wood bench. An accompanying server provides drawer and display storage for your tabletop accessories.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5544-72.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5544-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5544-72_table top.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5544-72.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:55"},
  {id: 1791, name: "Lonan Collection ", number: "1955T-1", price: nil, description: "With a hint of weathering so popular in industrial styling, the Lonan Collection will fit into the rustic contemporary aesthetic that you look to achieve in your bedroom. Melamine laminate mimics the look of sun-bleached wood with a darker under-hue providing subtle contrast to the design of the group, with dark finished metal handles providing additional contrast. The collection is offered in twin, full, queen, eastern king and california king for perfect placement in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1955T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1955T-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:39:07"},
  {id: 1824, name: "Chambord Collection ", number: "1828-1", price: nil, description: "Modern elegance takes form in the Chambord Collection. Immediately catching your eye is the striking champagne gold finish, an opulent mix of silver and gold hues, elegantly accented by the faux silk fabric and gold brushed hardware that is featured on select pieces of the collection.  The serpentine-fronted case pieces are adorned with canted pilasters featuring overlay fretwork, scalloped bases and a delicately splayed cabriole leg. Further lending to the lavish look of the collection is the faux silk rolled, button-tufted bed. The low profile footboard allows for an unrestricted view of the magnificent headboard.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1828-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1828-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:00"},
  {id: 1828, name: "Galen Collection ", number: "B2053FFW-1", price: nil, description: "Providing flexible options to fit any size bedroom is the Galen Collection. This transitional bedroom group is featured in a white finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2053FFW-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2053FFW-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:34:13"},
  {id: 1857, name: "Lucille Collection ", number: "1192BL", price: nil, description: "Retro lines need not stay in the past with the mid-century inspired lines of the Lucille Collection. With fabric offerings that range from neutral to bold such as beige, gray, blue, and orange further complemented with button-tufted accenting and stylishly appointed legs, this classic accent chair will provide a look that shows your personal style.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1192BL.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1192BL.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:05"},
  {id: 1861, name: "Qirin Collection ", number: "4502FA", price: nil, description: "Designed with a traditional touch and a nod towards modern classicism, the Qirin Collection accent bench is a gorgeous option for your home. A sturdy metal frame design is supported with subtle distressed white finish covers the turned legs and is elegantly accented by the bluish gray, button-tufted seat.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4502FA.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4502FA.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:36:31"},
  {id: 1878, name: "Clementine Collection ", number: "B1799T-1", price: nil, description: "With a design as sweet as the name implies, the Clementine Collection will be a bright and classic addition for your childrens sanctuary. Scaled for your childs bedroom, the traditional bed and bunk bed offer a customizable sleep spaces to suit your individual needs. Wooden knob hardware stands boldly against the double bow-fronted case goods while the additional decorative accents of framed bead-board paneling and scalloped base carry over to the design of the turned post headboard and footboard  further enhancing the classic look of this lovely bedroom. The bunk bed features an optional full-size extension kit for the lower bunk. Also offered for each bed in the collection is a functional trundle allowing for the option of either storage or twin bed.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B1799T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B1799T-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:37:51"},
  {id: 1835, name: "Ella Martin Collection ", number: "1288-301", price: nil, description: "When adding the personal touches to your living space that reflect the warmth and elegance of your home, the Ella Martin Collection is the perfect traditional table offering. Featuring a warm brown cherry finish, smoked glass, and gold tipped acanthus leaf motif.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1288-301.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1288-301.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:21"},
  {id: 1836, name: "Tioga Collection ", number: "3533-30", price: nil, description: "Designed for the modern home, the Tioga Collection will provide a unique look for your living room. Brushed chrome geometric support legs provide a distinct contrast to the espresso finish of the table tops and display shelves in this occasional grouping. Drawers provide additional storage space while the functionality of the collection is further enhanced by the lift mechanism that allows for the extension of the cocktail table's top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3533-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3533-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:24"},
  {id: 1838, name: "Lovington Collection ", number: "3587-30", price: nil, description: "Turned legs provide support to the tabletops and display shelves of the Lovington Collection. Modern traditional styling is achieved with a blend of classic accents -\u0080\u0093 turned legs, knob hardware, espresso finish, and creative functionality -\u0080\u0093 caster-supported lift-top cocktail table, end table with drawer. Each of these elements combines to create a stylish look for your home's living room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3587-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3587-30.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:26"},
  {id: 1843, name: "Janina Collection ", number: "5516-66", price: nil, description: "At home in a casual country setting, the Janina Collection allows for a customizable look to match the dcor of your dining space. The natural finish of the pine veneer serves to contrast the 4 available colors  teal, black, white, buttermilk  and allowing for an eclectic mix and match combination or singular color configuration.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5516BKS 5516BMS 5516TLS 5516WTS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5561BMS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5516WTS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5516BKS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5561TLS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516BKS 5516BMS 5516TLS 5516WTS.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5516-66 5516BKS 5516BMS 5516TLS 5516WTS.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:44:42"},
  {id: 1907, name: "Catalonia Collection ", number: "1824-1", price: nil, description: "Old-World European styling is captured in the dramatically elegant Catalonia Collection. Traditional design elements reign at every turn  egg and dart molding, acanthus leaf carving, bead molding, gold tipping and extravagant carvings  creating a sophisticated look for your bedroom. Each drawer front features antiqued brass fixed-drop hardware with decorative flourish that furthers the elegant appointments that embellish this collection. A traditional cherry finish is utilized to highlight the cherry veneer of the set and decorative inlay patterns found on the case good tops. Metal scrollwork provides additional visual interest to the headboard, footboard and mirror framing.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1824-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1824-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:50:09"},
  {id: 1892, name: "Radley Collection ", number: "8324-3", price: nil, description: "Refined for placement in the most traditional of homes, yet inviting enough for more casual settings, the Radley Collection will be a statement to your preference for classic style. Tufted seat backs serve as the initial focal point of the collection, turned legs and contoured arms solidifying the modern traditional look. The geometric pattern coordinating contrast toss pillows and ottoman create a delicate balance with the solid beige covering of the seating.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8324.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8324.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:53:34"},
  {id: 1954, name: "Crown Point Collection ", number: "1372-36", price: nil, description: "Adorn your dining area with Crown Point Collection. This grand scale casual dining in warm merlot finish is as strong and durable as they are stunning. Table top is constructed of mango veneer with strong support tapered legs. Attractive X-back dining chair with comfortable leather-look dark brown seat completes the unsophisticated streamlined look.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1372-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1372-36.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:32"},
  {id: 1960, name: "Andover Collection ", number: "2458", price: nil, description: "Your cozy breakfast nook will be complete with the Andover Collection. The transitional pedestal base lends a casual feel to this five-piece offering. The table and spindle-back chairs are featured in an antique oak and black two-tone finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2458.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2458.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:55:49"},
  {id: 1961, name: "St. Claire Collection ", number: "8469-3", price: nil, description: "Graceful curves are elegantly appointed in the St. Claire Collection. Delicate herringbone style fabric presents as the initial look into the traditional style of this seating group with prevalent button-tufted accenting that is hard to overlook. The rolled arms and bowed seatbacks present an air of femininity while lending curvaceous inspiration to the traditional chaise lounge. Cherry finished turn legs provide support and complement the brown tone of the fabric.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8469_a.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8469-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8469_a.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:01"},
  {id: 1967, name: "Moorewood Park Collection ", number: "1704-1", price: nil, description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that feature prominently throughout the collection. The headboard of the bed in combination with the low-profile footboard, create eye-catching drama with their bold design. Each case piece feature canted curved pilasters and legs that enhance the profile of the collection while button and bale, along with knob, hardware featured in an antiqued bronze finish lend subtle contrast.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1704-1.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:33"},
  {id: 1971, name: "Mayville Collection ", number: "2147BK-1", price: nil, description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes  burnished brown cherry, white, black, and the newly offered stained grey  with all of the traditional flare unique to the style  antiqued metal bale hardware and distinct framing  this collection is a perfect addition to your traditional adult or youth bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147BK.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147BK-12.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2147BK.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 20:56:52"},
  {id: 1932, name: "Caffery Collection ", number: "4829LN", price: nil, description: "In creating the perfect recreational room, you need functional pieces that provide comfort to your friends and family. The Caffery Collection, with a quick adjustment to the click mechanism, turns from a casual sofa into a flat platform perfect for sleeping or just hanging out. Offered in a dark brown bi-cast vinyl with white contrast stitching or dark grey fabric, the collection also features cup holders at arms for added convenience.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4829LN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/4829LN.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:21"},
  {id: 1942, name: "Beaugrand Collection ", number: "5177-54", price: nil, description: "Leaning towards the styles of industrial, contemporary and transitional, the Beaugrand Collection will be an appropriate choice for a number of dining room decors. Offered in two table styles  round or rectangular  both options of the dining collection feature decorative stainless steel apron trim banding and modified X-base. The coordinating sling-back chair is upholstered in neutral grey fabric with brown tone, accenting by nailheads.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5177-54.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5177-54.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:06:57"},
  {id: 1912, name: "Sona Collection ", number: "5532-36", price: nil, description: "Ultra-modern styling is executed flawlessly in the design of the Sona Collection. Immediately drawing your attention and providing stylistic drama to the casual dining group is the silver finished metal base and elongated cut-away bi-cast vinyl backs of the flanking dining chairs. Silver finished metal table legs support the dual glass table top -\u0080\u0093 the dining surface features a clear glass with black framing while the lower display shelf features black glass providing contrast and a finish that lends a modest touch to the over-the-top design of this casual dining offering.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5532-36.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5532-36.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:51:04"},
  {id: 1922, name: "Lonan Collection ", number: "1955-1", price: nil, description: "With a hint of weathering so popular in industrial styling, the Lonan Collection will fit into the rustic contemporary aesthetic that you look to achieve in your bedroom. Melamine laminate mimics the look of sun-bleached wood with a darker under-hue providing subtle contrast to the design of the group, with dark finished metal handles providing additional contrast. The collection is offered in twin, full, queen, eastern king and california king for perfect placement in your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1955-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1955-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:52:07"},
  {id: 1905, name: "Odelia Collection ", number: "1708T-1", price: nil, description: "Making a statement to the glamorous nature of your personal design aesthetic is the Odelia Collection. The striking silver finish of the collection serves to highlight the decorative accents that reign the design -\u0080\u0093 crocodile embossed drawer fronts with polished nickel hardware, mirrored top drawer fronts with their faceted knob hardware and crystal-embellished button-tufted pearl bi-cast vinyl inserts on the headboard and foot board. The available twin, full, queen, Eastern King and California King bed options allow for perfect placement in your bedroom space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1708T-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1708T-1.jpg", created_at: "2018-01-16 05:02:14", updated_at: "2018-01-30 20:55:02"},
  {id: 2022, name: "Jalen Collection", number: "H11759", price: nil, description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant rectangular lamp shade on black base. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11759.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/H11759.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:27"},
  {id: 1979, name: "Bastrop Collection ", number: "8230BRW-2L", price: nil, description: "Comfort is the name of the game in the Bastrop Collection. The collection is offered in several configurations  traditional sofa, love seat and chair, and sectional  for versatile placement in your living room maximum relaxation potential in your downtime. The two optional coverings  black or brown leather gel match  feature contrast welting for definition of profile and modern accenting. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion. The sectional configuration features a left side love seat with reclining end and the right side double reclining love seat with center console unit featuring cup holders and storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8230BRW_2L%2BCR%2B2RCN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8230BRW_2L%2BCR%2B2RCN.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:58"},
