  {id: 1986, name: "Adair Collection ", number: "8413GY-3", price: nil, description: "The Adair Collection offers a classic look to your stylish home. Classic lines form the profile of this versatile look. Offered in 4 trend-driven colors -\u0080\u0093 teal, grey, yellow and beige -\u0080\u0093 your choice of fabric will allow for your decorative personality to shine.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8413GY_all_mixing color (2015).jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8413GY_all_mixing color (2015).jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:27"},
  {id: 2052, name: "Savion Collection ", number: "5494-76", price: nil, description: "Sophisticated soft contemporary design is achieved in your dining room with the addition of the Savion Collection. Two table types are offered as versatile options to fit in your space  a rectangular double pedestal table and an oval single pedestal table. Both featuring a distinct birdcage style base. An espresso finish highlights the unique veneer pattern. Dramatic flair is lent to the design by the accompanying chairs. Neutral tone fabric covers the substantially sized roll back arm and side chairs. Reeded fronts on the server along with the serpentine profile further the elegance of this distinctly sophisticated collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5494-76.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5494-76_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5494-76.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:16"},
  {id: 2000, name: "Galen Collection ", number: "B2053PRW-1", price: nil, description: "Providing flexible options to fit any size bedroom is the Galen Collection. This transitional bedroom group is featured in a white finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2053PRW-1_open.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2053PRW-1_open.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:08:34"},
  {id: 2006, name: "Sikeston Collection ", number: "3588-30", price: nil, description: "With a design that is refined in its simplicity, the Sikeston Collection will be an elegant addition to your living room. A warm cherry finish is utilized to highlight the book match veneers that grace each tabletop. Clipped corners provide a decorative touch, the lower display shelves allow for placement of your prized possessions and casters provide functionality with ease of movement of the cocktail table.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3588-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3588-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:20"},
  {id: 2013, name: "Rowe Collection ", number: "B2013PRDC-1", price: nil, description: "Maximizing sleep space is achieved with the stylish Rowe Collection. This transitional bedroom group is featured in a dark cherry finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2013PRDC-1_open.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2013PRDC-1_open.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:09:43"},
  {id: 2019, name: "Sage Collection ", number: "5512-31", price: nil, description: "Burnished wood tabletops sit atop modern-industrial framing in the Sage Collection. Packaged as a three piece occasional table group, the cocktail and two end tables provide a distinct look as well as the tabletop space you need for your living room.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5512-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5512-31.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:10:21"},
  {id: 1997, name: "Bastrop Collection ", number: "8230BRW-3", price: nil, description: "Comfort is the name of the game in the Bastrop Collection. The collection is offered in several configurations  traditional sofa, love seat and chair, and sectional  for versatile placement in your living room maximum relaxation potential in your downtime. The two optional coverings  black or brown leather gel match  feature contrast welting for definition of profile and modern accenting. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion. The sectional configuration features a left side love seat with reclining end and the right side double reclining love seat with center console unit featuring cup holders and storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8230BRW.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8230BRW.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:11:44"},
  {id: 2051, name: "Fairhope Collection ", number: "3580-31", price: nil, description: "Metal scroll-work lends a feminine touch to the side supports of the beautiful Fairhope Collection. The display shelf metal bases of this three-piece occasional collection rise to support faux marble tops creating a timeless look. A matching sofa table, can also be served as TV stand, is featured in this collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3580-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3580-31.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:14:14"},
  {id: 2061, name: "Tempe Collection ", number: "2601-31", price: nil, description: "With a scale appropriate for any number of cozy living rooms, the Tempe Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble table top and the minimalistic design of this three pack occasional group. The tables are constructed of metal with a black finish.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2601-31.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2601-31.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:11"},
  {id: 2071, name: "Angstrom Collection", number: "5429-36", price: nil, description: "Following the trend of modern industrial inspired design is the Angstrom Collection. Metal framing provides support to the two distinctly shaped burnished wood table tops  one a rectangular table with built-in wine rack, the other an adjustable round counter-to-pub height table  as well as the accompanying stools. Turning the seats allows for quick adjustment to counter or pub height, while the option for a traditional back stool or a no-back stool allows for your personal preference to reign in designing your space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36 5429-24ST.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36 5429-24.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5429-36 5429-24ST.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:15:54"},
  {id: 2040, name: "Ballwin Collection ", number: "3256RF-30", price: nil, description: "Designed for placement in a number of living room settings, the Ballwin Collection is a functional and stylish addition to your home. The cocktail-\u0080\u0099s tabletop lifts to extend to your seated position and is supported by casters for ease of movement. Functional drawers are featured on the cocktail and end table. Providing additional tabletop space is the accompanying chairside table. A deep cherry finish over book matched veneers solidifies this versatile occasional grouping.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3256RF-30.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/3256RF-30.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:40"},
  {id: 2043, name: "Corvallis Collection ", number: "8405BJ-3", price: nil, description: "Blending elements of traditional and transitional styling creates the look of the Corvallis Collection. Rolled arms feature traditional nail head accent that lend to the classic look. Plush reversible seating combined with the rustic look of bomber jacket microfiber lends a distinctly masculine appeal to the design. Newly offered with a functional pull-out sleeper system, your living room will now allow for the extra sleep space needed when you have the occasional guest in town, or maybe when you want to get extra comfortable as you watch a movie. Timeless in its look, the Corvallis Collection will be a stylish and functional addition to your home.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8405BJ_all.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8405BJ_all.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:17:57"},
  {id: 2115, name: "Taye Collection ", number: "8210GRY-3", price: nil, description: "With styling that lends to either transitional or contemporary living spaces, the Taye Collection will provide a comfortable platform for your much deserved downtime. Gray leather gel match covers this plush seating group. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8210GRY.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8210GRY.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:28"},
  {id: 2079, name: "Bonaventure Park Collection ", number: "1935-76", price: nil, description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered pilasters frame the serpentine fronted china and server, while egg and dart molding, acanthus leaf motif and bale, and button hardware lend to the traditional look of all pieces. Burl inlay creates beautiful contrast to the gold-highlighted cherry finish of the collection. Two table options provide flexibility for placement in your dining space  the first, a 110-inch double pedestal base rectangular top table, the second, a 76-inch oval top single pedestal base table. Button-tufted traditional tweed fabric features prominently on the accompanying wood-framed chairs.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935-76.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1935-76.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:25"},
  {id: 1434, name: "Luella Collection ", number: "5100-84", price: nil, description: "At home in a number of decorative styles, the Luella Collection will be the perfect match for your living space. Zinc table top is supported by X-frame bases in this casual dining offering. The table is flanked by coordinating chairs, each with a neutral tone fabric and nailhead accent. Completing the look is a cool weathered oak finish that serves as the perfect contrast to the natural grey tone of the zinc table top.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5100-84.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5100-84_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5100-84.jpg", created_at: "2018-01-16 05:02:12", updated_at: "2018-01-30 21:24:46"},
  {id: 2123, name: "Florentina Collection ", number: "1867-102", price: nil, description: "The elaborate designs of Old World Europe are treated with a distinct modern touch in the Florentina Collection. The elegant pedestal base table serves as the focal point of this stunning dining offering. With details such as shell and acanthus leaf scrolling which grace the tables apron to the eye-catching jewel tufting of the accompanying chairs, which reflect with a brilliance intended to accentuate the dusky taupe coloring of the faux silk and the rich silver  with gold undertone  finish of the wood veneer. The acanthus motif is carried over to the display china, that along with carved cabriole feet, delicately designed knob hardware, glass shelving, and drawer storage, complete the traditional look of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1867-102.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1867-40.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1867-102.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:15"},
  {id: 2130, name: "Bastrop Collection ", number: "8230BLK-2L", price: nil, description: "Comfort is the name of the game in the Bastrop Collection. The collection is offered in several configurations  traditional sofa, love seat and chair, and sectional  for versatile placement in your living room maximum relaxation potential in your downtime. The two optional coverings  black or brown leather gel match  feature contrast welting for definition of profile and modern accenting. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion. The sectional configuration features a left side love seat with reclining end and the right side double reclining love seat with center console unit featuring cup holders and storage.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8230BLK_2L%2BCR%2B2RCN.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8230BLK_2L%2BCR%2B2RCN.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:47"},
  {id: 2141, name: "Delavan Collection", number: "5251-108", price: nil, description: "Subtle influence for the design of the Delavan Collection is drawn from the classic look of Art Deco styling. The flared pedestal table base ascends to support the book-matched veneer tabletop. Oval wood-backed chairs feature a complementary radiant veneer pattern and neutral toned padded seats and backs. The rich brown cherry finish serves to highlight the exquisite look of the collections wood veneer. The collection is shown with the china and server of Keegan Collection. The china cabinet, which stands at attention, not only functioning as a storage facility for all of your tabletops finest, but also as the grand centerpiece of this stylish dining offering. For additional storage, or for smaller spaces, the server features wine storage and unique mirror accent that adds a small height to the standard server. Storage features prominently on both pieces.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5251-108.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5251 2546-40 2546-40M.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5251-108.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:40"},
  {id: 2050, name: "Urbana Collection ", number: "5179-90", price: nil, description: "Transitional design combined with the trend forward look of industrial styling creates the look for the Urbana Collection. Turnbuckle accents paired with faux rivets lend to the design of the table and accompanying server. A burnished finish is utilized to highlight the wood grain veneer. The wood-framed metal X-backed chairs feature dark brown bi-cast vinyl seats and backs. In addition to the traditional chairs, an optional bench is also available as a unique seating option. The server features drawer and door fronted storage along with wine rick and stationary leg supports that mimic industrial cart wheels.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5179-90.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5179-90.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:18:12"},
  {id: 2098, name: "Bartly Collection ", number: "B2043FF-1", price: nil, description: "With options that allow for the perfect placement within your bedroom is the Bartly Collection. This transitional bedroom group is featured in a natural pine finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2043FF-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2043FF-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:19:39"},
  {id: 2100, name: "Garcia Collection ", number: "2046T-1", price: nil, description: "Transitionally styled for your bedroom is the Garcia Collection. Created for versatile placement within a number of environments the louvered panel accents, distinct framing along with a cool gray finish over birch veneer combine to provide a clean palate for your personal decorative style. Nickel knob hardware provides subtle, yet distinct, contrast to the fronts of each case piece. The available desk is a functional addition to the collection with keyboard tray and drawer storage. The collection is offered in twin, full, queen, eastern king and california king for the perfect fit within your bedroom.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2046-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2046-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:21"},
  {id: 2104, name: "Onofre Collection ", number: "5517-78", price: nil, description: "With a design that hints at futuristic contemporary styling, the Onofre is a unique offering for your casual dining space. Immediately drawing your eye is the dramatic body hugging curve of the chairs -\u0080\u0093 blending wood framing and bi-cast vinyl seats to create a profile that is out of this world. The supporting table base interlocks to create a substantial, yet open look. The look of the thick table top carries through to the design of the accompanying server. Door and drawer storage allow for the stowage of tabletop accessories, while the horizontal wine rack provides additional function. A brown finish is utilized to highlight the mindy veneer of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5517-78.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5517-78.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:20:32"},
  {id: 2114, name: "Erath Collection ", number: "8244BU-3", price: nil, description: "Mid-Century modern design creates the look of the Erath Collection. High seatbacks and low slung arms lend shape to the profile of the collection while the dramatic tones of blue, orange and sand create visual and decorative interest. Splayed wood legs that are synonymous with mid-century styling support this modern seating group.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8244BU.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8244BU.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:21:23"},
  {id: 2076, name: "Bayshore Collection ", number: "5447-36XL", price: nil, description: "Transitional aesthetic meets modern lines in the casually elegant Bayshore Collection. Offering flexibility in the collection are the options of two dining tables. The 47.5-inch fixed oak veneer square table top. And the rectangular oak veneer tabletop with leaf. Both tables feature quartered book-match walnut inlay veneers with a heavily burnished finish. Supporting the uniquely veneered table top is a storage table base with a display shelf. Both tables are complimented by dark brown bi-cast vinyl chairs that feature wood cap and legs. Coordinating server is also available.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36XL.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36XL 5447-24FAS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36 Top.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5447-36XL.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:22:05"},
  {id: 2087, name: "Talbot Collection ", number: "8524BK", price: nil, description: "Designed with your bold design choices in mind, the contemporary Talbot Collection will provide your family and friends with a comfortable place to spend their quality time. Offered in red or black bonded leather match, the race car inspired bucket seat is fine tuned by contrast double stitching. Features include: adjustable headrests, reclining ends sofa, glider reclining love seat with console and glider mechanism equipped coordinating chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8524bk_mix photo.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8524BK_home.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/8524bk_mix photo.jpg", created_at: "2018-01-16 05:02:15", updated_at: "2018-01-30 21:23:11"},
  {id: 2089, name: "Ashden Collection ", number: "1918-1", price: nil, description: "The Ashden Collection creates visual interest with sophisticated modern traditional accents and elegant lines. The driftwood finish that enhances the beautiful cathedral grain of mindy veneer is utilized to provide contrast with the high polish of the nail heads and hardware that accents the collection. Distinctive scallop shaping graces subtle molding of the case pieces which carries over to the design of the base rail and feet of the bed. Neutral button-tufted fabric headboard is highlighted with subtle shimmer, further lending to the sophisticated yet understated elegance of the collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1918-1.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1918-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:23:24"},
  {id: 2147, name: "Orleans II Collection ", number: "2168WW-1", price: nil, description: "An updated look to the grandeur of Old World Europe is flawlessly executed in the Orleans II Collection. Acanthus leaf carvings feature prominently and blend with elegantly appointed moldings on each piece of this stately bedroom. Wreath accents lend dramatic flair to the bed and mirror as does the sculpted lion-\u0080\u0099s foot base, supporting each of the case pieces. Heavy pilasters rise with and are topped with carved finials on the neutral-toned, linen accented headboard and footboard. The washed white and weathered brown two-tone finish lends to the unique styling of this elegant bedroom collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168KWW-1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168WW-11.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168WW-9.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2168KWW-1.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:24:12"},
  {id: 2129, name: "Bartly Collection ", number: "B2043PR-1", price: nil, description: "With options that allow for the perfect placement within your bedroom is the Bartly Collection. This transitional bedroom group is featured in a natural pine finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2043PR-1_open.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/B2043PR-1_open.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:25:43"},
  {id: 2136, name: "Marston Collection ", number: "2615DC-1", price: nil, description: "Refined elegance is exemplified in the design of the Marston Collection. Blending classic design elements to create a warm and welcoming bedroom. Each piece in the collection features turned feet and high polished oval bale pull and knob hardware. The neutral toned fabric inserts of the headboard and the padded footboard rail feature nailhead accent. Drawer storage features prominently on the footboard, offering that extra functional space that you need. The classic dark cherry finish further lends to the modern traditional look of the Marston Collection.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2615DC.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2615DC.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:02"},
  {id: 2138, name: "Georgia Collection ", number: "1257F1S", price: nil, description: "The elegant fan-like profile of the Georgia Collection is enhanced by traditional accents, that make this two-toned accent chair a beautiful addition to your home. The neutral toned seating features a decorative toss pillow with scroll embroidered design. Dark nail head accent trims the wing back frame and serves as a compliment to the dark brown herringbone style fabric of the back side of chair.", brand: "Homelegance", dimensions: nil, images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1257F1S.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/1257F1S.jpg", created_at: "2018-01-16 05:02:16", updated_at: "2018-01-30 21:26:32"}
